(40, 'مشاهدة فيلم Last Sunrise 2019 مترجم', 'مشاهدة وتحميل فيلم المغامره والدراما Last Sunrise 2019 بجودة HD مترجم اون لاين وتحميل مباشر. في مستقبل يعتمد على الطاقة الشمسية، يغرق العالم في الفوضى بعد إختفاء الشمس ويجوب أحد علماء الفلك المدينة بحثاً عن النور في ظلام العالم الحالك.', 'last-sunrise-2019', 'https://m.media-amazon.com/images/M/MV5BMzQ4Mzk4ZDgtY2JkMS00NGZhLWFiN2UtZThhZTg4NTJjYzA0XkEyXkFqcGdeQXVyMTk5NjcxNjM@._V1_SX300.jpg', 0, 'HD', 0, 1, 40, '2019-04-09 14:06:28', '2019-04-12 10:46:35'),
(41, 'مشاهدة فيلم The Knight of Shadows: Between Yin and Yang 2019 مترجم', 'مشاهدة وتحميل فيلم الاكشن والفانتازيا The Knight of Shadows: Between Yin and Yang 2019 بجودة HD مترجم اون لاين وتحميل مباشر. يروي الفيلم قصة صائد للشياطين يتعقب كافة الوحوش التي تقتحم الحيز البشري، ويعاونه في هذه المهام مجموعة من الوحوش اﻷليفة باﻹضافة إلى أحد المتدربين.', 'the-knight-of-shadows-between-yin-and-yang-2019', 'https://m.media-amazon.com/images/M/MV5BMWQxYmVmZjYtYmZkNi00MDkzLWJmNzMtN2UyYTA5NjlmZmNiXkEyXkFqcGdeQXVyNzI1NzMxNzM@._V1_SX300.jpg', 5.1, 'HD', 0, 1, 41, '2019-04-09 14:06:34', '2019-04-12 10:46:35'),
(42, 'فيلم Red Island 2018 Web-dl مترجم', 'مشاهدة وتحميل فيلم اثارة Red Island 2018 مترجم بجودة Web-dl كامل اون لاين', 'red-island-2018-web-dl', 'https://m.media-amazon.com/images/M/MV5BZDE0ZjYzNGQtZDBjMS00NDBkLThmZTgtMTNjYmUzOGMxYjNkXkEyXkFqcGdeQXVyMzM4NzgzNjk@._V1_SX300.jpg', 3.4, 'Web-dl', 0, 1, 42, '2019-04-09 14:06:38', '2019-04-12 10:46:35'),
(44, 'مشاهدة فيلم No One Would Tell 2018 مترجم', 'مشاهدة وتحميل فيلم الدراما No One Would Tell 2018 مترجم بجودة HDTV كامل اون لاين. مئخوذ من قصة حقيقية. ويترتب على ذلك رواية حياة حقيقية لطالب في المدرسة الثانوية يبلغ من العمر 16 عامًا يدعى جيمي فولر ، والذي قتل صديقته البالغة من العمر 14 عامًا ، أيمي كارنيفال. وكان فولر غيور جدا ومسيئة تجاه ايمي. عندما انفصل كارنيفال معه ، لم يأخذ الأمر جيدًا. جذب فولر كارنيفال لقضاء بعض الوقت معه وأصدقائه في الغابة. عندما كان فولر بمفرده في الغابة مع كارنيفال ، ورد أنه طعنها 10 مرات وكسر حنجرتها. قتل كارنيفال في 23 أغسطس 1991 ، في بيفرلي ، ماساتشوستس.', 'no-one-would-tell-2018', 'https://m.media-amazon.com/images/M/MV5BMjEzMTQ5MDAzNl5BMl5BanBnXkFtZTcwODUxMzgzMQ@@._V1_SX300.jpg', 6.8, 'HDTV', 0, 1, 44, '2019-04-09 14:06:48', '2019-04-12 10:46:35'),
(46, 'مشاهدة فيلم Carga 2018 مترجم', 'مشاهدة وتحميل فيلم الدراما Carga 2018 بجودة WEB-DL مترجم اون لاين وتحميل مباشر. “شاحنة وطريق ومصير لا يُمكن التنبؤ به، وكلها تتقاطع في شبكة الاتجار بالبشر.”', 'carga-2018', 'https://m.media-amazon.com/images/M/MV5BMWQzMzk0ZmYtY2UxZC00NDViLWE4YWMtODExZTM1ZjQ4MzY4XkEyXkFqcGdeQXVyODc0OTEyNDU@._V1_SX300.jpg', 5.9, 'WEB-DL', 0, 1, 46, '2019-04-09 14:06:54', '2019-04-12 10:46:35'),
(48, 'مشاهدة فيلم Paskal 2018 مترجم', 'مشاهدة وتحميل فيلم الاكشن والدراما Paskal 2018 بجودة WEB-DL مترجم اون لاين وتحميل مباشر. تواجه وحدة البحرية الماليزية الخاصة، “باسكال”، موقفًا صعبًا حين يسخّر أحد أفرادها السابقين مهاراته لصالح الخاطفين. فيلم من وحي أحداث حقيقية.', 'paskal-2018', 'https://m.media-amazon.com/images/M/MV5BNzM5MzRjMTEtODk4Yy00ZWE2LWI0MjMtNWQ0MTFhZTkwMWE0XkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg', 7.6, 'WEB-DL', 0, 1, 48, '2019-04-09 14:06:59', '2019-04-12 10:46:35'),
