(303, 'مشاهدة فيلم The Hole in the Ground 2018 مترجم', 'مشاهدة وتحميل فيلم الرعب The Hole in the Ground 2018 مترجم بجودة WEB-DL كامل أون لاين. تحاول (سارة أونيل) الهروب من ماضيها المحطم، وبناء حياة جديدة على أطراف بلدة ريفية مع ابنها الصغير (كريس)، لكنها تضطر لمواجهة مرعبة مع جار غامض يحطم أمنها الضعيف، حيث قام برمي (سارة) في كابوس متصاعد من جنون الارتياب وعدم الثقة، وهي تحاول أن تكشف ما إذا كانت التغييرات المقلقة في طفلها الصغير مرتبطة بمجرى مشؤوم مدفون في أعماق الغابة التي تحيط بمنزلها.', 'the-hole-in-the-ground-2018', 'https://m.media-amazon.com/images/M/MV5BYmY2NjQwZTgtYjQ5Ny00NTlhLTg1NzUtZGYwNTc3NWZhMTg1XkEyXkFqcGdeQXVyMjYwNDA2MDE@._V1_SX300.jpg', 5.8, 'WEB-DL', 0, 1, 303, '2019-04-09 18:54:19', '2019-04-12 10:46:38'),
