(325, 'مشاهدة فيلم Cold Pursuit 2019 مترجم', 'مشاهدة وتحميل فيلم الاكشن والدراما Cold Pursuit 2019 بجودة HDCAM مترجم اون لاين وتحميل مباشر. نيلز (ليام نيسون) سائق كاشطات ثلج خلوق وملتزم، يُمنَح جائزة مواطن العام مِن قِبَل بلدة التزلج (كولورادو). لكن تتغير الأحوال وتنقلب حياته رأسًا على عقب بعد مقتل ابنه على يد رئيس منظمة إجرامية عتيدة الإجرام، فيصبح مسعى نيلز الوحيد هو الانتقام لولده', 'cold-pursuit-2019', 'https://m.media-amazon.com/images/M/MV5BM2YyYWI3NjItMWEwZS00MzhkLWJmZTMtZDAzYjRhODM0OTMzXkEyXkFqcGdeQXVyMjM4NTM5NDY@._V1_SX300.jpg', 6.5, 'HDCAM', 0, 1, 325, '2019-04-09 18:57:44', '2019-04-12 10:46:38'),
(326, 'مشاهدة فيلم Darkness Visible 2019 مترجم', 'مشاهدة فيلم الاثارة Darkness Visible 2019 مترجم بجودة WEB-DL مشاهدة مباشرة اون لاين. يعود روني المولود في لندن إلى منزله في الهند ليكتشف أن والدته قد توفيت في ظروف غامضة. وبينما يكشف عن سلسلة من جرائم القتل المشابهة في الماضي ، يظهر ضوء داكن داخلي لرويني.', 'darkness-visible-2019', 'https://m.media-amazon.com/images/M/MV5BYzBmMGFjMmMtNzI3Mi00NDg3LTlmM2UtMGI0M2IxMjIzMGM0XkEyXkFqcGdeQXVyNzc0MTgzMzU@._V1_SX300.jpg', 5.9, 'WEB-DL', 0, 1, 326, '2019-04-09 18:57:54', '2019-04-12 10:46:38'),
