(373, 'مشاهدة فيلم Climax 2018 مترجم', 'مشاهدة فيلم الدراما والرعب Climax 2018 مترجم بجودة WEB-DL مشاهدة مباشرة اون لاين. يجتمع الراقصون الفرنسيون في مبنى مدرسة فارغ بعيد لتدريباتهم في ليلة شتوية.', 'climax-2018', 'https://m.media-amazon.com/images/M/MV5BMjllYmQ2OGQtN2IxZC00ODJiLWI4NjQtYmNlZjYzNzUzYjkyXkEyXkFqcGdeQXVyNTAzMTY4MDA@._V1_SX300.jpg', 7.3, 'WEB-DL', 0, 1, 373, '2019-04-09 19:45:20', '2019-04-12 10:46:39'),
(374, 'مشاهدة فيلم A Private War 2018 مترجم', 'مشاهدة وتحميل فيلم السيرة الذاتية والدراما A Private War 2018 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب ” حرب خاصه ” حول تدور الأحداث حول واحدة من أشهر مراسلي الحروب وهي (ماري كولفين)، فهي شخصية لا تعرف الخوف كما، أنها متمردة وتدفع بنفسها للخطوط الأمامية للصراعات في جميع أنحاء العالم لإعطاء صوت لمن لا صوت لهم.', 'a-private-war-2018', 'https://m.media-amazon.com/images/M/MV5BODFkMzljMWUtY2NjNS00NjZhLTk4MDItYWNjMjIyODZlNDc1XkEyXkFqcGdeQXVyNzEyMTk0MzM@._V1_SX300.jpg', 6.7, 'BluRay', 0, 1, 374, '2019-04-09 19:45:26', '2019-04-12 10:46:39'),
(375, 'مشاهدة فيلم Animas 2018 مترجم', 'مشاهدة وتحميل فيلم الرعب والاثارة Animas 2018 بجودة WEB-DL مترجم كامل اون لاين مشاهدة مباشرة يوتيوب عقب ارتباط صديق عمرها بحبيبة ومقتل والده المسيء الذي يحوم حوله الغموض، تتكرّر لدى مراهقة رؤًى غامضة مخيفة ومثيرة للرعب… بل وتزداد تواترًا.', 'animas-2018', 'https://m.media-amazon.com/images/M/MV5BMDQ4OWFlYjItYjVkMS00ZWQ2LTk3MTItNzQ0Mjc4YmJiZDdkXkEyXkFqcGdeQXVyNDM1MDAxNzg@._V1_SX300.jpg', 0, 'WEB-DL', 0, 1, 375, '2019-04-09 19:45:33', '2019-04-12 10:46:39'),
(376, 'مشاهدة فيلم Can You Ever Forgive Me? 2018 مترجم', 'مشاهدة فيلم السيرة الذاتية والكوميديا Can You Ever Forgive Me? 2018 مترجم بجودة WEB-DL مشاهدة مباشرة اون لاين. ” أيمكنك أن تسامحني؟ ” حول القصة الحقيقية عن لي اسرائيل (ميليسا مكارثي)، صديقة القطط وأفضل كُتاب السيّر الذاتية المشاهير. حيث عاشت حياتها خلال السبعينات والثمانينات ترصد ملامح النجمات الشهيرات، مثل: (كاثرين هيبورن، تالولا بانكهيد، إستي لاودر، والصحفية دوروثي كيل).. عندما تتوقف لي عن نشر كتاباتها عاجزة عن مجاراة الأذواق الحالية؛ تُحوَِل عملها الفني إلى الخداع والغش، بتحريض ومعاونة صديقها الوفي (جاك).', 'can-you-ever-forgive-me-2018', 'https://m.media-amazon.com/images/M/MV5BMTFkZmFmNzEtM2FjZC00MmQ1LThlMjctODc1M2RmNzE5NjFjXkEyXkFqcGdeQXVyODY1NDk1NjE@._V1_SX300.jpg', 7.2, 'WEB-DL', 0, 1, 376, '2019-04-09 19:45:42', '2019-04-12 10:46:39'),
(377, 'مشاهدة فيلم If Beale Street Could Talk 2018 مترجم', 'مشاهدة فيلم If Beale Street Could Talk 2018 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر ” لو استطاع شارع بيل التحدث ” حول (تيش) وهي امرأة في هارلم تناضل يائسة لإثبات براءة حبيبها من جريمة، بينما هي حامل في طفلها الأول', 'if-beale-street-could-talk-2018', 'https://m.media-amazon.com/images/M/MV5BZWVkMzY5NzgtMTdlNS00NjY5LThjOTktZWFkNDU3NmQzMDIwXkEyXkFqcGdeQXVyODk2NDQ3MTA@._V1_SX300.jpg', 7.4, 'WEB-DL', 0, 1, 377, '2019-04-09 19:45:48', '2019-04-12 10:46:39'),
(379, 'مشاهدة فيلم I Hate Kids 2019 مترجم', 'مشاهدة وتحميل فيلم الكوميديا I Hate Kids 2019 مترجم بجودة WEB-DL كامل اون لاين. أخيرًا يستقر (نيك بيرسون) بعد أن كان أعزب طول الحياة، وعلى مشارف زفافه يندهش من المفاجأة عندما يجد صبي لديه 13 عام، يخبره بأنه ابنه، المشكلة أن (نيك) لا يمكنه أن يبقى مع ابنه، وسوف يقوم بإرساله إلى والدته، باستثناء أن لا يكون أحد على علم بحقيقة الطفل.', 'i-hate-kids-2019', 'https://m.media-amazon.com/images/M/MV5BNTZjODhlYjUtODJkYi00MzY2LTg0ODUtOTM3MGQ3YjQzYzhkXkEyXkFqcGdeQXVyMTk5MzE1MTY@._V1_SX300.jpg', 6.9, 'WEB-DL', 0, 1, 379, '2019-04-09 19:45:59', '2019-04-12 10:46:39'),
(380, 'مشاهدة فيلم Destruction Los Angeles 2017 مترجم', 'مشاهدة وتحميل فيلم الاكشن والمغامره Destruction Los Angeles 2017 مترجم بجودة WEB-DL كامل اون لاين. انفجار مدمر وزلزال مفاجئ في (لوس أنجلوس)، ويستغل المراسل (جون بينسون )فرصة لتغطية الأخبار العاجلة لزيادة النشاط الزلزالي وتوثيقها بفيدوهات.”', 'destruction-los-angeles-2017', 'https://m.media-amazon.com/images/M/MV5BNTBjNTllNmYtOThiZi00NzRiLTgyMmMtMjA5YjA5Y2ZkZTg2L2ltYWdlXkEyXkFqcGdeQXVyMzM1NTgwODQ@._V1_SX300.jpg', 5.4, 'WEB-DL', 0, 1, 380, '2019-04-09 19:46:07', '2019-04-12 10:46:39'),
(381, 'مشاهدة فيلم Wakey Wakey 2012 مترجم', 'مشاهدة فيلم Wakey Wakey 2012 بجودة WEBRip مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر تسعى (جوزي) في سن المراهقة أن تفهم عالمًا مخيفًا يُحوّلها من حالة نوم إلى أحلام يقظة واقعية، وتندرج تحت تأثير أختها (سامانثا)، التي تكشف لها أسرارها الداكنة.”', 'wakey-wakey-2012', 'https://m.media-amazon.com/images/M/MV5BMTYyMzMyNTUxMF5BMl5BanBnXkFtZTgwNTY3OTk2MDE@._V1_SX300.jpg', 5.3, '0', 0, 1, 381, '2019-04-09 19:46:13', '2019-04-12 10:46:39'),
(383, 'مشاهدة فيلم Gosnell 2018 مترجم', 'مشاهدة فيلم Gosnell 2018 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر ” جوسنيل: محاكمة أكبر قاتل متسلسل في أمريكا ” حول فيلم عن الجرائم المروعة ومحاكمة كيرميت غوسنيل ، أكبر قاتل متسلسل في أمريكا', 'gosnell-2018', 'https://m.media-amazon.com/images/M/MV5BNzE1Mjg2MjItNWQ5Yi00Zjk1LThhMDktYWE1YmE3ZDE2YmFmXkEyXkFqcGdeQXVyMTg3MTIzMjk@._V1_SX300.jpg', 6.9, 'WEB-DL', 0, 1, 383, '2019-04-09 19:46:27', '2019-04-12 10:46:39'),
(384, 'مشاهدة فيلم The New Romantic 2018 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والدراما The New Romantic 2018 بجودة WEB-DL مترجم كامل اون لاين مشاهدة مباشرة يوتيوب ” الرومانسية الجديدة ” حول الشعور بالاحباط مع عدم وجود شهم سنها ، يتخلى أحد كبار الطلاب عن المواعدة للحب حتى الآن رجل كبير السن في مقابل الهدايا', 'the-new-romantic-2018', 'https://m.media-amazon.com/images/M/MV5BMjE3MjY1OTc1Nl5BMl5BanBnXkFtZTgwMDk3NjczNjM@._V1_SX300.jpg', 5.8, 'WEB-DL', 0, 1, 384, '2019-04-09 19:46:34', '2019-04-12 10:46:39'),
(385, 'مشاهدة فيلم Robin Hood 2018 مترجم', 'مشاهدة وتحميل فيلم الانيميشن والمغامره Robin Hood 2018 بجودة WEB-DL مترجم اون لاين وتحميل مباشر. يقوم (روبن) وقائده المغاربي (ليتل جون) بتنظيم ثورة جريئة ضد التاج الإنجليزي الفاسد في مغامرة مثيرة مليئة بمنافسات ساحقة في ساحة المعركة.', 'robin-hood-2018', 'https://m.media-amazon.com/images/M/MV5BMTM5NzcwMzEwOF5BMl5BanBnXkFtZTcwNjg5MTgwMw@@._V1_SX300.jpg', 6.7, 'WEB-DL', 0, 1, 385, '2019-04-09 19:46:42', '2019-04-12 10:46:39'),
(386, 'مشاهدة فيلم Fyre 2019 مترجم', 'مشاهدة فيلم Fyre 2019 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر يوصَف مهرجان “فاير” على أنّه تجربة موسيقيّة راقية على جزيرة خاصّة رائعة، لكنّه يفشل فشلًا ذريعًا على يدي متعهّد حفلات مغرور.', 'fyre-2019', 'https://m.media-amazon.com/images/M/MV5BMjQ2NzE1MjYxMV5BMl5BanBnXkFtZTgwMjM3MDQxNzM@._V1_SX300.jpg', 7.3, 'WEB-DL', 0, 1, 386, '2019-04-09 19:46:50', '2019-04-12 10:46:39'),
(387, 'مشاهدة فيلم Thi Mai, rumbo a Vietnam 2017 مترجم', 'مشاهدة وتحميل فيلم الكوميديا Thi Mai, rumbo a Vietnam 2017 مترجم بجودة WEB-DL كامل أون لاين. برفقة صديقتيها، تسافر امرأة يملؤها التصميم إلى فيتنام لتعيد إلى الوطن الطفلة التي خطّطت ابنتها المتوفاة مؤخّرًا لتبنيها.', 'thi-mai-rumbo-a-vietnam-2017', 'https://m.media-amazon.com/images/M/MV5BNzMxNDhkYTYtMmExMy00OTZhLTk2Y2YtMjIyNjA3NmJhNWIzXkEyXkFqcGdeQXVyNTY4MzAyNDA@._V1_SX300.jpg', 6, 'WEB-DL', 0, 1, 387, '2019-04-09 19:46:58', '2019-04-12 10:46:39'),
(388, 'مشاهدة فيلم He Even Has Your Eyes 2016 مترجم', 'مشاهدة فيلم الكوميديا He Even Has Your Eyes 2016 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. عندما يكتشف زوجان فرنسيان أفريقيا الأصل، “بول” و “سالي”، أن الطفل الذي طال انتظاره وسيتبنّيانه أبيض البشرة، تبدأ الفوضى والتحدي الأسري.', 'he-even-has-your-eyes-2016', 'https://m.media-amazon.com/images/M/MV5BZjUwOTc5MGItZjMxYS00YTRlLTgxZWItMmZjYmNjYTA0Y2E2L2ltYWdlXkEyXkFqcGdeQXVyNTYzNDEyMjI@._V1_SX300.jpg', 6.2, 'BluRay', 0, 1, 388, '2019-04-09 19:47:04', '2019-04-12 10:46:39'),
(391, 'مشاهدة فيلم Saving Banksy 2017 مترجم', 'مشاهدة وتحميل فيلم الوثائقي Saving Banksy 2017 مترجم بجودة WEB-DL كامل أون لاين. ترك رسام الكاريكاتير المعروف عالمياً ، بانكسي ، بصماته على سان فرانسيسكو في أبريل / نيسان 2010. ولم يعلم شيئاً عن أن هذا العمل التخريبي من شأنه أن يشعل سلسلة من الأحداث التي تشمل إزالة أحد فئرانه من جدار', 'saving-banksy-2017', 'https://m.media-amazon.com/images/M/MV5BMjQwMDQ3OTE0M15BMl5BanBnXkFtZTgwNjQxMDUwMTI@._V1_SX300.jpg', 6.8, 'WEB-DL', 0, 1, 391, '2019-04-09 19:47:31', '2019-04-12 10:46:39'),
(392, 'مشاهدة فيلم Elephant White 2011 مترجم', 'مشاهدة وتحميل فيلم الاكشن والجريمة Elephant White 2011 بجودة BluRay مترجم اون لاين وتحميل مباشر. في إطار درامي ممزوج ببعض اﻹثارة والتشويق تدور أحداث الفيلم؛ حيث رجل أعمال اختطفت ابنته ذات الأربعة عشر عاما، من قبل تجار الرقيق البيض، للعمل فى مجال الدعارة، ويقرر رجل الأعمال البحث عن الانتقام ممن قاموا بهذا الفعل الدنيء؛ لذا يقرر استئجار قاتل محترف من أجل قتل كل من كان له يد فى اختطافها فى تايلاند.', 'elephant-white-2011', 'https://m.media-amazon.com/images/M/MV5BMTI4NjQ5NDc4NF5BMl5BanBnXkFtZTcwMTUzODc1Mw@@._V1_SX300.jpg', 5.1, 'BluRay', 0, 1, 392, '2019-04-09 19:47:37', '2019-04-12 10:46:39'),
(393, 'مشاهدة فيلم Only Mine 2019 مترجم', 'مشاهدة وتحميل فيلم الاثارة Only Mine 2019 بجودة WEB-DL مترجم كامل اون لاين مشاهدة مباشرة يوتيوب بعد تعذيبها وتركها ميتة من قبل عشيق مزدحم ، تجد المرأة القوة داخل نفسها لاسترداد والانتقام من مسيئها', 'only-mine-2019', 'https://m.media-amazon.com/images/M/MV5BNDEzNzdhOTktNDg2Mi00NjVmLTkwM2QtODMxYmFlMGIyNzc2XkEyXkFqcGdeQXVyNjg2MDM0ODA@._V1_SX300.jpg', 4.7, 'WEB-DL', 0, 1, 393, '2019-04-09 19:47:45', '2019-04-12 10:46:39'),
(394, 'مشاهدة فيلم Project Gutenberg 2018 مترجم', 'مشاهدة وتحميل فيلم الاكشن والجريمة Project Gutenberg 2018 بجودة HD مترجم اون لاين وتحميل مباشر. تبحث شرطة هونج كونج عن عصابة مقلدة يقودها العقل المدبر الذي يدعى “بانتير”. من أجل كسر الهوية الحقيقية له ، تقوم الشرطة بتجنيد عضو عصابة لي مان لكشف الهوية السرية لـ “بانتير”', 'project-gutenberg-2018', 'https://m.media-amazon.com/images/M/MV5BZDc5MDY3ODItNWFhNS00NDU4LWJmZGQtMDJjYmE3MWU3NDFjXkEyXkFqcGdeQXVyMTk4MTEwNTI@._V1_SX300.jpg', 7.1, 'HD', 0, 1, 394, '2019-04-09 19:47:55', '2019-04-12 10:46:39'),
(395, 'مشاهدة فيلم Polar 2019 مترجم', 'مشاهدة وتحميل فيلم الاكشن والجريمة Polar 2019 بجودة HDRIP مترجم اون لاين وتحميل مباشر. يتعيّن على قاتل يوشك أن يعتزل إرجاء خططه لعيش حياة هانئة حين يُرسل زعيمه الجشع مجموعة قتلة من الشباب عديمي الرحمة للقضاء عليه.', 'polar-2019', 'https://m.media-amazon.com/images/M/MV5BMjAzNDkzODU3Ml5BMl5BanBnXkFtZTgwNDI4OTExNzM@._V1_SX300.jpg', 6.3, 'HDRIP', 0, 1, 395, '2019-04-09 19:48:07', '2019-04-12 10:46:39'),
(397, 'مشاهدة فيلم Rockaway 2017 مترجم', 'مشاهدة فيلم Rockaway 2017 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر ” الحنطور ” حول مستوحاة من الأحداث الحقيقية ، رجل يسرد صيف عام 94 ، عندما تآمر هو وأخوه على الانتقام من والدهم المسيء', 'rockaway-2017', 'https://m.media-amazon.com/images/M/MV5BMzQwNmM2NTMtM2E3NS00Y2U1LWIzNjAtMTJiZDJiODVlNDQ2XkEyXkFqcGdeQXVyNTU3MDU5MDg@._V1_SX300.jpg', 6.5, 'WEB-DL', 0, 1, 397, '2019-04-09 19:48:26', '2019-04-12 10:46:39'),
(450, 'مشاهدة فيلم Cook Up a Storm 2017 مترجم', 'مشاهدة وتحميل فيلم الدراما Cook Up a Storm 2017 بجودة HDRip مترجم كامل اون لاين مشاهدة مباشرة يوتيوب ويكتشف الطهاة الكانتونية والطاهي الرئيسي، وهو طاه موسيقي حائز على نجمة ميشلان الفرنسية، أن لديهم الكثير من القواسم المشتركة وهم يستعدون لمسابقة الطهي الشهيرة عالميا. وتصبح المنافسة الدولية في الطهي ساحة قتال بين الطهاة المتنافسين، أحدهم مشهور بأكله في الشارع الكانتوني، والآخر هو طاه حائز على نجمة ميشلان مدرب في فرنسا. ولكن تنافسهم يأخذ منعطفا غير متوقع عندما يكتشفون عدو مشترك ويجمعون مهاراتهم في مزيج من الشرق والغرب.', 'cook-up-a-storm-2017', 'https://m.media-amazon.com/images/M/MV5BY2Y5YzY2ZmMtYTY3MS00M2U4LThkMGMtNDZmMTVmOTM1N2FjL2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyMjI0MDI5Mg@@._V1_SX300.jpg', 6.4, 'HDRip', 0, 1, 450, '2019-04-09 19:48:37', '2019-04-12 10:46:39'),
(452, 'مشاهدة فيلم Benchwarmers 2 2019 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والرياضي Benchwarmers 2 2019 مترجم بجودة DVDRip كامل أون لاين. ” خسارة مقبولة ” حول كان بن ماكغراث (كريس كلين) يملك إمكانات رئيسية في الدوري ، وكان يلعب كرة البيسبول المحترفة ، لكن آماله في لعب الكرة سحقها حرفياً. على حظه ، يحصل بن على تأرجح آخر في الخلاص كمحام جديد لشموود وشركائه', 'benchwarmers-2-2019', 'https://m.media-amazon.com/images/M/MV5BMTcxMzg3NDQwNl5BMl5BanBnXkFtZTcwMjk1ODQzMQ@@._V1_SX300.jpg', 5.6, 'DVDRip', 0, 1, 452, '2019-04-09 19:49:00', '2019-04-12 10:46:39'),
(455, 'مشاهدة فيلم Foreign Exchange 2019 مترجم', 'مشاهدة و تحميل فيلم الغموض والاثارة Foreign Exchange 2019 مترجم اون لاين جودة WEB-DL وتحميل مباشر مشاهدة اون لاين مباشرة عندما تصبح طالبة في مجال النقد الأجنبي ، آنا (هايلي ماكلولين) ، التي تدرس في الخارج في أمريكا ، هدفا لمطارق خطير ، تقبل الدعوة للانضمام إلى أسرة زميلتها في بلدتها المثالية', 'foreign-exchange-2019', 'https://m.media-amazon.com/images/M/MV5BMjA5ODg0MzQ4MF5BMl5BanBnXkFtZTcwMjk3NTk5Mw@@._V1_SX300.jpg', 4.2, 'WEB-DL', 0, 1, 455, '2019-04-09 19:49:15', '2019-04-12 10:46:39'),
(456, 'مشاهدة فيلم An Acceptable Loss 2018 مترجم', 'مشاهدة و تحميل فيلم الدراما والاثارة An Acceptable Loss 2018 مترجم اون لاين جودة WEB-DL وتحميل مباشر مشاهدة اون لاين مباشرة تم تهديد كبير مستشاري الأمن الأمريكي السابق إليزابيث “ليبي” لام (سومبير) من قبل شركاء لها من الماضي المظلم بما في ذلك راشيل بيرك (كيرتس) ، وهو سياسي قوي ، قيادي مع موهبة لا تتزعزع لتحقيق أهدافها', 'an-acceptable-loss-2018', 'https://m.media-amazon.com/images/M/MV5BNTlmODY4MjQtZDUzNC00YWFhLWJjNTktYTMyYjY1OTVjOTc1XkEyXkFqcGdeQXVyODY3Nzc0OTk@._V1_SX300.jpg', 4.9, 'WEB-DL', 0, 1, 456, '2019-04-09 19:49:25', '2019-04-12 10:46:39'),
(458, 'مشاهدة فيلم No Mercy 2010 مترجم', 'مشاهدة وتحميل فيلم الاكشن والجريمة No Mercy 2010 مترجم بجودة DVDRip كامل أون لاين. فتاة شابة وجد مقتولة في نهر ليبدأ المحقق بالبحث عن القاتل لحل هذه الجريمة الغامضة', 'no-mercy-2010', 'https://m.media-amazon.com/images/M/MV5BZTYyYzkwMzUtZTIxNy00N2VjLWFiNGItZDhhMzY3NjhmZjU3XkEyXkFqcGdeQXVyMDUyOTUyNQ@@._V1_SX300.jpg', 5.7, 'DVDRip', 0, 1, 458, '2019-04-09 19:49:37', '2019-04-12 10:46:39'),
(480, 'فيلم Cucuy: The boogeyman 2018 مترجم اون لاين', 'مشاهدة وتحميل فيلم الرعب والاثارة Cucuy: The boogeyman 2018 مترجم بجودة HDTV كامل اون لاين.', 'cucuy-the-boogeyman-2018', 'https://m.media-amazon.com/images/M/MV5BYTY5MTMzM2MtMWNhOS00ZTA2LWJmNTEtYjVhYjE2ODJjODYyXkEyXkFqcGdeQXVyNDUzMzc3NTQ@._V1_SX300.jpg', 4.9, 'HDTV', 0, 1, 480, '2019-04-09 19:55:50', '2019-04-12 10:46:39'),
(501, 'مشاهدة فيلم IO 2019 مترجم', 'مشاهدة فيلم IO 2019 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر عندما يبحث عالم شاب عن طريقة لإنقاذ أرض ميتة ، تجد علاقة مع رجل يتسابق من أجل التقاط آخر المكوك من الكوكب', 'io-2019', 'https://m.media-amazon.com/images/M/MV5BNmU4NTc0ZTgtNjliOC00NTM2LWE3NDktNGJiNzc2YzY3ZjA2XkEyXkFqcGdeQXVyNDg4NjY5OTQ@._V1_SX300.jpg', 4.7, 'WEB-DL', 0, 1, 505, '2019-04-10 06:57:09', '2019-04-12 10:46:39'),
(503, 'مشاهدة فيلم The Nutcracker and the Four Realms 2018 مترجم', 'مشاهدة و تحميل فيلم المغامره والعائلي The Nutcracker and the Four Realms 2018 مترجم اون لاين جودة DVDRip وتحميل مباشر مشاهدة اون لاين مباشرة كل ما ترغبه (كلارا) هو مفتاح؛ مفتاح من نوع خاص لتفتح به صندوقًا يحوي هدية قيّمة من والدتها الراحلة.. تُهدى كلارا ببكرة خيط ذهبية في حفلة أبيها الروحي السنوية، وبمقدور البكرة أن تقودها إلى المفتاح المطلوب، والذي نكتشف أنه قد اختفي في عالم آخر موازي تفعمه الغرابة والغموض. حيث تقابل فيه كلارا جندي يٌدعى (فيليب)، عصابة من الفئران، وحُكام يحكمون ثلاث عوالم مختلفة: أرض الثلوج، أرض الزهور، وأرض الحلوى.', 'the-nutcracker-and-the-four-realms-2018', 'https://m.media-amazon.com/images/M/MV5BOTg1NDI1MjEyMl5BMl5BanBnXkFtZTgwOTA5MTgwNjM@._V1_SX300.jpg', 5.5, 'DVDRip', 0, 1, 507, '2019-04-10 06:57:19', '2019-04-12 10:46:39'),
(505, 'مشاهدة فيلم The Spy Gone North 2018 مترجم', 'مشاهدة فيلم The Spy Gone North 2018 بجودة HDRIP مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر في عام 1992، جندت الاستخبارات الوطنية في كوريا الجنوبيةضابط عسكري سابق ( بارك سوك يونغ) كجاسوس،ومنحتهُ الاسم الحركي “بلاك فينوس”وأوكلت إليه مهمة التسلل إلى مجموعة من كبار المسؤولين في كوريا الشماليةلكسب ثقتهم بهدف جمع المعلومات.خلال مهمته الخطيرة، تتصارع طموحاته وأحلامه العظيمةمع المكائد السياسية والخيانات.هل سينجو مع طموحاته أم ستتلقفه المكائد مع كُل جانب؟!', 'the-spy-gone-north-2018', 'https://m.media-amazon.com/images/M/MV5BMzZkNmJmN2EtODYwNi00MTJhLWIxNzgtZDkxNzgzNDkyNmE3XkEyXkFqcGdeQXVyOTI2NjU2MTE@._V1_SX300.jpg', 7.2, 'HDRIP', 0, 1, 509, '2019-04-10 06:57:30', '2019-04-12 10:46:39'),
(507, 'مشاهدة فيلم King of Thieves 2018 مترجم', 'مشاهدة و تحميل فيلم الجريمة والدراما King of Thieves 2018 مترجم اون لاين جودة WEB-DL وتحميل مباشر مشاهدة اون لاين مباشرة فريق من المحتالين المتقاعدين يقومون بإنجاز سرقة كبيرة بضاحية المجوهرات في (لندن).', 'king-of-thieves-2018', 'https://m.media-amazon.com/images/M/MV5BYTBjMGY2NzktMTc0ZS00ZTViLWJlN2MtNTI4YjhmMjQ5NjhhXkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg', 5.5, 'WEB-DL', 0, 1, 511, '2019-04-10 06:57:42', '2019-04-12 10:46:39'),
(562, 'مشاهدة فيلم 12 Strong 2018 مترجم', 'مشاهدة وتحميل فيلم الاكشن والدراما 12 Strong 2018 بجودة BluRay مترجم اون لاين وتحميل مباشر. قصة أول فريق قوات خاصة في افغانستان بعد 9/11 تحت قياد كابتن جديد يجب ان يتعاون الفريق مع قائد الحرب الافغاني لهزيمة طالبان.', '12-strong-2018', 'uploads/11207270084.jpg', 8.1, 'BluRay', 0, 1, 566, '2019-04-10 06:58:33', '2019-04-12 10:46:39'),
(563, 'مشاهدة فيلم The Outsider 2018 مترجم', 'مشاهدة فيلم الاكشن والجريمة The Outsider 2018 مترجم بجودة WEB مشاهدة مباشرة اون لاين. عن الأحداث الملحمية التي عقبت الحرب العالمية الثانية في (اليابان)، حيث يستعرض الفيلم قصة واحد من جنود الجيش الأمريكي، والذي ينضم للـ(ياكوزا)؛ المنظمة الإجرامية الأكبر في اليابان.', 'the-outsider-2018', 'https://m.media-amazon.com/images/M/MV5BMjIyYjAzOWItNzI5Yy00NGU4LTlhODktYjZmZThmMTY3ZWNhXkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg', 6.3, '0', 0, 1, 567, '2019-04-10 06:58:41', '2019-04-12 10:46:39'),
(564, 'مشاهدة فيلم The Car Road to Revenge 2019 مترجم', 'مشاهدة وتحميل فيلم الاكشن والرعب The Car Road to Revenge 2019 مترجم بجودة WEB-DL كامل أون لاين. في مدينة (سيبروبانك ) المُتهالكة المبتلاة بالجريمة والفساد، يُقتل مُحاميّ المقاطعة عديم الضمير ويُرمى من مبنى فوق سيارته الجديدة، فيِ ظروفٍ غامضةٍ، ثم عاد مُحاميّ المقاطعة وهو وسيارته ككيانٍ واحدٍ مُتعطشًا للإنتقام', 'the-car-road-to-revenge-2019', 'https://m.media-amazon.com/images/M/MV5BMjdjNjFkNGUtOTNhYy00NjM3LThmYTUtYjRhZTI1MWE5YjJkXkEyXkFqcGdeQXVyNzMzMjU5NDY@._V1_SX300.jpg', 4.2, 'WEB-DL', 0, 1, 568, '2019-04-10 06:58:49', '2019-04-12 10:46:39'),
(566, 'مشاهدة فيلم The Doll 2 2017 مترجم', 'مشاهدة وتحميل فيلم الرعب والاثارة The Doll 2 2017 مترجم بجودة WEB-DL كامل أون لاين. تدور احداث قصة فيلم الرعب والاثارة The Doll 2 2017 ” الدمية 2 ” حول تستخدم أمّ دمية ابنتها المتوفاة كوسيط للتواصل معها، لكنّ العواقب مُخيفة بل وتقشعرّ منها الأبدان… الجزء الثاني من أفلام Doll', 'the-doll-2-2017', 'https://m.media-amazon.com/images/M/MV5BMWY3N2RmMTctMWE3Yi00OWVhLTkyMGYtMTYyZWFhZmRmZWI0XkEyXkFqcGdeQXVyMzE0MjY5ODA@._V1_SX300.jpg', 7.3, 'WEB-DL', 0, 1, 570, '2019-04-10 06:58:57', '2019-04-12 10:46:39'),
(567, 'مشاهدة فيلم Tommy Battles the Silver Sea Dragon 2018 مترجم', 'مشاهدة و تحميل فيلم الفانتازيا والموسيقى Tommy Battles the Silver Sea Dragon 2018 مترجم اون لاين جودة WEB-DL وتحميل مباشر مشاهدة اون لاين مباشرة “عندما يجد رجل نفسه في قاعة المحكمة وتُطارده شياطينه، يجب أن يحسب له ذنب موت أمه قبل أن يُدّمر”.', 'tommy-battles-the-silver-sea-dragon-2018', 'https://m.media-amazon.com/images/M/MV5BMTY4MzQ2NDA2OF5BMl5BanBnXkFtZTgwNTQxMzEyNjM@._V1_SX300.jpg', 5.7, 'WEB-DL', 0, 1, 571, '2019-04-10 06:59:06', '2019-04-12 10:46:39'),
(569, 'مشاهدة فيلم Bigger 2018 مترجم', 'مشاهدة و تحميل فيلم الدراما Bigger 2018 مترجم اون لاين جودة WEB-DL وتحميل مباشر مشاهدة اون لاين مباشرة قصة ملهمة من الأجداد من اللياقة البدنية كما نعرفها الآن ، جو وبن ويدر. وفي مواجهة معاداة السامية والفقر المدقع ، تغلب الأخوان على كل الصعاب لبناء إمبراطورية وإلهام أجيال المستقبل', 'bigger-2018', 'https://m.media-amazon.com/images/M/MV5BMTc4Nzk0MzkwNl5BMl5BanBnXkFtZTgwMjgyMjQyNjM@._V1_SX300.jpg', 6.6, 'WEB-DL', 0, 1, 573, '2019-04-10 06:59:15', '2019-04-12 10:46:39'),
(570, 'مشاهدة فيلم Doom Room 2019 مترجم', 'مشاهدة فيلم Doom Room 2019 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر امرأة تستيقظ في غرفة صغيرة دون ذاكرة عن كيفية وصولها إلى هناك. غير قادرة على الهروب ، والمعذبة من قبل سلسلة من خوارق الكيانات ، يجب أن تكشف عن لغز من هي وكيف وصلت إلى هنا', 'doom-room-2019', 'https://m.media-amazon.com/images/M/MV5BMzQ1ODU2MTkxMV5BMl5BanBnXkFtZTcwNTU3NTQ5OQ@@._V1_SX300.jpg', 3, 'WEB-DL', 0, 1, 574, '2019-04-10 06:59:24', '2019-04-12 10:46:39'),
(571, 'مشاهدة فيلم Second Act 2018 مترجم', 'مشاهدة فيلم الكوميديا والرومانسية Second Act 2018 مترجم بجودة WEB-DL مشاهدة مباشرة اون لاين. عاملة في شركة (كوستكو) تعيد بناء حياتها وتشكيل قصة حياتها من جديد، كما يتعرض الفيلم لشارع (ماديسون) كدليل على ما يمكن للحاذقين واﻷذكياء في هذا للشارع تقديمه ومنحه من خدمات', 'second-act-2018', 'https://m.media-amazon.com/images/M/MV5BMjQ2MjI5Njk0MF5BMl5BanBnXkFtZTgwNDQ2NzczNTM@._V1_SX300.jpg', 5.8, 'WEB-DL', 0, 1, 575, '2019-04-10 06:59:27', '2019-04-12 10:46:39'),
(573, 'مشاهدة فيلم Killers Within 2018 مترجم', 'مشاهدة وتحميل فيلم الرعب والاثارة Killers Within 2018 مترجم بجودة HDRip كامل اون لاين. يقوم تشكيل عصابي بخطف إبن الضابطة (اماندا دويل) , ليجبره تلك الضابطة هي و زوجها السابق بالاتحاد مع ثلاثة من المجرمين لمساعدتهم فى عملية أختطاف محاسب مصرفي ثري هو أسرته من أجل الحصول على فديه , ولكن سرعان ما يكتشفوا أنهم وقعوا فى فخ وان هذه أسرة المحاسب المصرفي ليست أسرة طبيعية', 'killers-within-2018', 'https://m.media-amazon.com/images/M/MV5BNTgyNzQzZDMtYjcwOC00YTkwLWI5MGQtMWI4MmUzMjQzNzBhXkEyXkFqcGdeQXVyNDI1NDc2Mjc@._V1_SX300.jpg', 5.3, 'HDRip', 0, 1, 577, '2019-04-10 06:59:37', '2019-04-12 10:46:39'),
(574, 'مشاهدة فيلم Boy Erased 2018 مترجم', 'مشاهدة وتحميل فيلم السيرة الذاتية والدراما Boy Erased 2018 مترجم بجودة BrRip كامل أون لاين. يضطر ابن رجل دين من الطائفة المعمدانية للمشاركة في برنامج تحويل الميول الجنسية المدعوم من قِبَل الكنيسة', 'boy-erased-2018', 'https://m.media-amazon.com/images/M/MV5BNzM2MzU1NTM4NF5BMl5BanBnXkFtZTgwNTMwMzI1NjM@._V1_SX300.jpg', 7, '0', 0, 1, 578, '2019-04-10 06:59:44', '2019-04-12 10:46:39'),
(576, 'مشاهدة فيلم All Good Things 2010 مترجم', 'مشاهدة وتحميل فيلم الجريمة والدراما All Good Things 2010 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب استنادًا على قصة حقيقية، تدور أحداث الفيلم خلال حقبة السبعينيات حول (دافيد ماركز) الذي ينتمي لعائلة ثرية ويتزوج من فتاة كادحة تدعى (كايتي) على الرغم من أنف عائلته التي رفضت هذا الزواج، وتواجه علاقتهما الكثير من الصعوبات خاصة مع التقلبات المزاجية الغامضة التي تنتاب دافيد، وفي ذات يوم، تختفي كايتي فجأة من دون أثر، ولا أحد يعرف من وراء اختفائها على مدار 20 عامًا، حتى تتكشف المزيد من الحقائق بعد مرور كل هذه الفترة.', 'all-good-things-2010', 'https://m.media-amazon.com/images/M/MV5BMTcwMjIyMTc2Nl5BMl5BanBnXkFtZTcwOTQyMzc5Mw@@._V1_SX300.jpg', 6.3, 'BluRay', 0, 1, 580, '2019-04-10 06:59:52', '2019-04-12 10:46:39'),
(577, 'مشاهدة فيلم Root Cause 2019 مترجم', 'مشاهدة فيلم Root Cause 2019 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر فيلم وثائقي طويل يعرض آراء الخبراء من أحدث الأطباء وأطباء الأسنان من جميع أنحاء العالم ، والذي يعرض الآثار الصحية الحقيقية', 'root-cause-2019', 'https://m.media-amazon.com/images/M/MV5BMTM3YzBjOTYtMTQ3OS00ZjY1LWJmNDctMzQyNmI4MWYwZmM5XkEyXkFqcGdeQXVyMzY0NTIxMjE@._V1_SX300.jpg', 4.1, 'WEB-DL', 0, 1, 581, '2019-04-10 07:00:01', '2019-04-12 10:46:39'),
(579, 'مشاهدة فيلم Suspiria 2018 مترجم', 'مشاهدة فيلم الفانتازيا والرعب Suspiria 2018 مترجم بجودة WEB-DL مشاهدة مباشرة اون لاين. ” صاسبيريا ” حول (سوزي بانيون) شابة أمريكية تسافر إلى شركة (ماركوس تانز) المرموقة لرقص الباليه في (برلين) عام 1977. وبمجرد وصولها كواحدة من أعضاء الشركة، تختفي (باتريشيا) في ظروف غامضة. بينما تحقق سوزي تقدمًا غير مسبوق بتوجيه مدام (بلانك)؛ المديرة الفنية الثورية للشركة. ثم تعقد سوزي صداقة مع راقصة أخرى تُدعى (سارة)، والتي تشاركها شكوكها بأن عاملات الشركة، بل والشركة نفسها قد تكون مأوى لسر مظلم رهيب', 'suspiria-2018', 'https://m.media-amazon.com/images/M/MV5BMjRiYTNjODctNGU1Ni00NDg3LTk0NGUtMWU0NjgyZTAyYmNjXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 7.5, 'WEB-DL', 0, 1, 583, '2019-04-10 07:00:08', '2019-04-12 10:46:39'),
(580, 'مشاهدة فيلم A Bundle of Trouble 2017 مترجم', 'مشاهدة فيلم A Bundle of Trouble 2017 بجودة HDTV مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر تستضيف أورورا ابنة أخت مارتين ومولودها الجديد ليلاً ، ولكن بعد ذلك تختفي ابنة أخته ، ويجد الطفل مختبئًا في حوض الاستحمام وتكتشف أورورا شخصًا غريبًا في خزانة ملابسها ، إلى جانب 10 آلاف دولار نقدًا في حقيبة حفاضات', 'a-bundle-of-trouble-2017', 'uploads/241186297304.jpg', 0, 'HDTV', 0, 1, 584, '2019-04-10 07:00:18', '2019-04-12 10:46:39'),
(582, 'مشاهدة فيلم After Darkness 2018 مترجم', 'مشاهدة فيلم الدراما والعائلي After Darkness 2018 مترجم بجودة WEB-DL مشاهدة مباشرة اون لاين. مع اقتراب الحروب ، تتجمع عائلة أميركية في نهاية العالم ، حيث تتدهور آمالهم في الإنقاذ ببطء لأنها تواجه أيضاً انقسامات دائمة بين بعضهم البعض', 'after-darkness-2018', 'https://m.media-amazon.com/images/M/MV5BZWQ1YWY2YzgtYTg2MC00YjFjLTgyMGItZTNmZDY4MmJiNGM0XkEyXkFqcGdeQXVyOTg4MDYyNw@@._V1_SX300.jpg', 3.3, 'WEB-DL', 0, 1, 586, '2019-04-10 07:00:25', '2019-04-12 10:46:39'),
(583, 'مشاهدة فيلم Blood Bound 2019 مترجم', 'مشاهدة وتحميل فيلم الرعب والاثارة Blood Bound 2019 بجودة WEB-DL مترجم اون لاين وتحميل مباشر. ” ملزمة الدم ” حول كل 25 سنة ، تبدأ. من خلال اتفاق قديم ، تنحدر عائلة من قوة غير محدودة على بلدة ريفية صغيرة للتضحية بأرواح 4 أشخاص ، أحدهم عضو في عائلتهم. تبدأ الطقوس عندما تدرك كيري البالغة من العمر 18 عامًا ، وهي تجد نفسها حاملًا ، أن طفلها الذي لم يولد بعد هو هدف مؤامرة شريرة', 'blood-bound-2019', 'https://m.media-amazon.com/images/M/MV5BMTMxZGEyOTUtY2VmMS00ODg5LWFkMzctYTU4OWMxNTkzNWY5XkEyXkFqcGdeQXVyNjU2NDIxOTM@._V1_SX300.jpg', 4.3, 'WEB-DL', 0, 1, 587, '2019-04-10 07:00:35', '2019-04-12 10:46:39'),
