(702, 'مشاهدة فيلم Summer 03 2018 مترجم', 'مشاهدة وتحميل فيلم الكوميديا Summer 03 2018 بجودة WEB-DL مترجم كامل اون لاين مشاهدة مباشرة يوتيوب حول وترقد فتاة تبلغ من العمر 16 عاما وعائلتها الممتدة تتوتر بعد أن تكشف جدتها المحتشدة عن مجموعة من الأسرار على فراش الموت.', 'summer-03-2018', 'https://m.media-amazon.com/images/M/MV5BMDU3NmE3MDEtODY0Ni00NDdhLThhYzMtZTM0YjUzMmY1ZTFiXkEyXkFqcGdeQXVyMjQzMzQzODY@._V1_SX300.jpg', 7.8, 'WEB-DL', 0, 1, 706, '2019-04-10 07:20:54', '2019-04-12 10:46:40'),
(705, 'مشاهدة فيلم Still 2018 مترجم', 'مشاهدة و تحميل فيلم الدراما والفانتازيا Still 2018 مترجم اون لاين جودة WEB-DL وتحميل مباشر مشاهدة اون لاين مباشرة عندما يتعثر شاب مسافر في مزرعة معزولة بعد أن يفقد طريقه على درب الآبالاش ، يتم استدعاؤه من قبل زوجين غريبين وجميلين يائسين لحماية سر عميق في الجبال', 'still-2018', 'https://m.media-amazon.com/images/M/MV5BMTQ5NDM1Nzc4MF5BMl5BanBnXkFtZTgwMTg0OTA1MzE@._V1_SX300.jpg', 5.3, 'WEB-DL', 0, 1, 709, '2019-04-10 07:21:00', '2019-04-12 10:46:40'),
(706, 'مشاهدة فيلم What They Had 2018 مترجم', 'مشاهدة وتحميل فيلم الدراما What They Had 2018 بجودة WEB-DL مترجم كامل اون لاين مشاهدة مباشرة يوتيوب تعود بريدجيت إلى منزلها عندما حث أخيها على التعامل مع والدتها المريضة وإحجام والدها عن التخلي عن حياتهما معاً', 'what-they-had-2018', 'https://m.media-amazon.com/images/M/MV5BMTc4NzIyODE3Nl5BMl5BanBnXkFtZTgwNjg2NTc5NTM@._V1_SX300.jpg', 6.6, 'WEB-DL', 0, 1, 710, '2019-04-10 07:21:08', '2019-04-12 10:46:40'),
(708, 'مشاهدة فيلم The Last Boy 2019 مترجم', 'مشاهدة فيلم The Last Boy 2019 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر حول العالم في نهايته ، الأم المتوفاة ترسل ابنها الصغير في مسعى للعثور على المكان الذي يمنح الأمنيات', 'the-last-boy-2019', 'https://m.media-amazon.com/images/M/MV5BMjZkOGI4YTUtYzQyMC00ZTUyLWE0NDEtM2I0YjMzNDZhZjUyXkEyXkFqcGdeQXVyMzYwNTc4NDA@._V1_SX300.jpg', 6.9, 'WEB-DL', 0, 1, 712, '2019-04-10 07:21:14', '2019-04-12 10:46:40'),
(709, 'مشاهدة فيلم Loophole 2019 مترجم', 'مشاهدة فيلم الخيال العلمي Loophole 2019 مترجم بجودة WEB-DL مشاهدة مباشرة اون لاين. حول إن مستقبل الإنسانية معلقة في الميزان ، حيث يتسابق كلا الطرفين مع الزمن لإيجاد سلالة يهوذا الإسخريوطي. عندما تجد ليكس سميث ، وهي طالبة جامعية بسيطة ، نفسها في وسط حرب روحية شاملة ، تُجبر على الوثوق بغريب كامل. إذا ما تم اختطافها وإنقاذها ثم إخفاؤها ، فإنها تعلم أنها يجب أن تتصرف ، ولكن هل سيكون لديها ما يكفي من الوقت لإنقاذ البشرية؟', 'loophole-2019', 'https://m.media-amazon.com/images/M/MV5BNDQ2YmQ5NjEtYmFlNy00OGE4LTg4Y2MtNWVlOTM4N2MyYWVhXkEyXkFqcGdeQXVyNDYzNTI2ODc@._V1_SX300.jpg', 5.9, 'WEB-DL', 0, 1, 713, '2019-04-10 07:21:23', '2019-04-12 10:46:40'),
(711, 'مشاهدة فيلم Girl on the Bridge 1999 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والدراما Girl on the Bridge 1999 مترجم بجودة DVDRip كامل اون لاين. تدور القصة حول شاب و فتاة غريبان عن بعض يلتقيان مع بعض على جسر . و كل منهما يحاول العثور على الحظ في حياته بعد محاولات فاشلة في ان يكونا ناجحين في حياتهما المهني و العاطفية و بعد ان سئما من حياتهما قررا الانتحار بالقفز من الجسر و يكون كلمهما بنفس الوقت على نفس الجسر و يقوم الرجل (جابور) بايقاف الفتاة (اديل) و يطلب منها السفر معه الى بعض بلدان العالم لممارسة عمله ((رمي السكاكين)).', 'girl-on-the-bridge-1999', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTA4MjI5NzAzOTJeQTJeQWpwZ15BbWU2MDc5NjcwOQ@@._V1_SX300.jpg', 7.6, 'DVDRip', 0, 1, 715, '2019-04-10 07:21:29', '2019-04-12 10:46:40'),
(742, 'مشاهدة فيلم A Separation 2011 مترجم', 'مشاهدة وتحميل فيلم الدراما A Separation 2011 مترجم بجودة BluRay كامل اون لاين. يعاني نادر بعد انفصاله عن زوجته سيمين، لرفضه طلبها بالهجرة والعمل بالخارج، فيعاني هو الوحدة ورعايته لوالده المُسن المصاب بالزهايمر، فيلجأ للاستعانة بخادمة لمساعدته في رعاية والده وتدبير شئون المنزل، لكن يقع خلاف حاد بينهما، فيحدث ما لا يحمد عقباه.', 'a-separation-2011', 'https://m.media-amazon.com/images/M/MV5BMTYzMzU4NDUwOF5BMl5BanBnXkFtZTcwMTM5MjA5Ng@@._V1_SX300.jpg', 8.3, 'BluRay', 0, 1, 746, '2019-04-10 07:25:38', '2019-04-12 10:46:40'),
(744, 'مشاهدة فيلم Beautiful Boy 2018 مترجم', 'مشاهدة وتحميل فيلم السيرة الذاتية والدراما Beautiful Boy 2018 مترجم بجودة WEB-DL كامل أون لاين. يوميات مُلهمة تخطف الأنفاس لمدمن مخدرات الميث الذي يتعافى من إدمانه، حيث تُروى هذه اليوميات من منظور الوالد الذي يبصر ابنه وهو يقاتل إدمانه.', 'beautiful-boy-2018', 'https://m.media-amazon.com/images/M/MV5BNjNhNjVjZDQtMzRhMS00YmI2LTkxZmEtMDdkMWU3OWQ2NjNmXkEyXkFqcGdeQXVyODE1MjMyNzI@._V1_SX300.jpg', 7.3, 'WEB-DL', 0, 1, 748, '2019-04-10 07:25:49', '2019-04-12 10:46:40'),
(746, 'مشاهدة فيلم Monsters and Men 2018 مترجم', 'مشاهدة فيلم الدراما Monsters and Men 2018 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. “قُتل رجل أمريكي مِن أصل أفريقي على يد أحد رجال الشرطة، دون سببٍ واضحٍ، فكان الماره يُصوّرون هذا كدليلٍ واضحٍ، إنما الشرطة لمْ تكتفِ بالدليل، فقامت المظاهرات وبعض أحداث الشغب في المدينة.', 'monsters-and-men-2018', 'https://m.media-amazon.com/images/M/MV5BYWIyMWU1MmMtNjFhOS00MjhhLThjOWUtZTNmM2ZjY2JkZWYzXkEyXkFqcGdeQXVyNTk5NTQzNDI@._V1_SX300.jpg', 5.5, 'BluRay', 0, 1, 750, '2019-04-10 07:25:58', '2019-04-12 10:46:40'),
(747, 'مشاهدة فيلم Lose Control 2018 مترجم', 'مشاهدة وتحميل فيلم ال Lose Control 2018 مترجم بجودة HC HDRip كامل اون لاين. فريق خاصة لمكافحة المخدرات يقرر العمل معاً من أجل تحقيق الثراء السريع عن طريق الإستيلاء على أموال تجار المخدرات.', 'lose-control-2018', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMzlhZGVmZmEtOWNlNS00MGYxLWFiMGQtYmJmYmZmM2VjOWUyXkEyXkFqcGdeQXVyMjI5NzEyMTc@._V1_SX300.jpg', 0, 'HDRip', 0, 1, 751, '2019-04-10 07:26:06', '2019-04-12 10:46:40'),
(749, 'مشاهدة فيلم Once Upon a Time in China 1991 مترجم', 'مشاهدة فيلم الاكشن والمغامره Once Upon a Time in China 1991 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. في أواخر القرن 19 ، يصور فيلم فنون القتال هذا الموقف الذي اتخذه بطل فنون الدفاع عن النفس الأسطوري ، وونغ في-هونغ (1847-1924) ضد نهب القوات الأجنبية (الإنجليزية ، الفرنسية والأمريكية) للصين.', 'once-upon-a-time-in-china-1991', 'https://m.media-amazon.com/images/M/MV5BOWNmMzg1OTMtOGM5NS00ODEwLWIyYjMtZGU3NWM2MmViMmZhXkEyXkFqcGdeQXVyNzM3NDU4Njk@._V1_SX300.jpg', 7.4, 'BluRay', 0, 1, 753, '2019-04-10 07:26:12', '2019-04-12 10:46:40'),
(750, 'مشاهدة فيلم And Breathe Normally 2018 مترجم', 'مشاهدة و تحميل فيلم الدراما And Breathe Normally 2018 مترجم اون لاين جودة WEB-DL وتحميل مباشر مشاهدة اون لاين مباشرة على طرف شبه جزيرة (ركيينز) الأيسلندية، ستتقاطع حياة امرأتين لبرهة قصيرة، وذلك أثناء وقوعهما تحت حصار ظروف غير متوقعة، حيث ستتكون رابطة حميمة بينُ أم أيسلندية عزباء، وبينُ لاجئة سياسية من أفريقيا بينما تحاول كل منهما الإمساك بزمام حياتها من جديد.', 'and-breathe-normally-2018', 'https://m.media-amazon.com/images/M/MV5BNjljNzZmZDgtZGE0MS00OTgzLWE2MDAtODQ5YTMwYWU0MzAwXkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg', 6.9, 'WEB-DL', 0, 1, 754, '2019-04-10 07:26:19', '2019-04-12 10:46:40'),
(751, 'مشاهدة فيلم Nostalgia 1983 مترجم', 'مشاهدة فيلم Nostalgia 1983 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر التقييم : 8.1 حاصل على 3 جوائز ومرشح لجائزة ايضاً.', 'nostalgia-1983', 'https://m.media-amazon.com/images/M/MV5BN2VmZjJkMGUtZGQ4My00NGJiLThjMDMtYTU5ODM1Y2Q0Yzc5XkEyXkFqcGdeQXVyMzIwNDY4NDI@._V1_SX300.jpg', 8.1, 'BluRay', 0, 1, 755, '2019-04-10 07:26:28', '2019-04-12 10:46:40'),
(752, 'مشاهدة فيلم The Vanishing 2018 مترجم', 'مشاهدة وتحميل فيلم الدراما والغموض The Vanishing 2018 بجودة WEB-DL مترجم كامل اون لاين مشاهدة مباشرة يوتيوب قارب إغاثة صغير يدنو من جزيرة صغير معزولة تبعد عشرين ميلًا عن الساحل الوعر، بهدف الاستبدال الروتيني لُحراس المنارة الثلاث بعد قضائهم وحيدين برفقة الضوء لمدة ست أسابيع.. يقترب القارب من الجزيرة أكثر فأكثر دون أي إشارة من الحُراس الثلاث (توماس، جيمس، ودونالد)، أو دليل على وجودهم، فقد اختفوا تمامًا', 'the-vanishing-2018', 'https://m.media-amazon.com/images/M/MV5BNGFhOWJmMDktOWRkNy00OGIxLTk2YjMtNTZkNGE0YzViZTNlXkEyXkFqcGdeQXVyMzg2MzE2OTE@._V1_SX300.jpg', 7.8, 'WEB-DL', 0, 1, 756, '2019-04-10 07:26:35', '2019-04-12 10:46:40'),
(753, 'مشاهدة فيلم Our Evil 2017 مترجم', 'مشاهدة فيلم الدراما والرعب Our Evil 2017 مترجم بجودة BrRip مشاهدة مباشرة اون لاين. رجل من ذوي القوى الروحية يخبره مرشده بأن كيان شيطاني عاد ليدمر روح ابنته ، وأنه يجب أن يتخذ إجراءات جذرية لمنع حدوث ذلك', 'our-evil-2017', 'https://m.media-amazon.com/images/M/MV5BOTVmZjcxYmItOWI2YS00OWY0LWI4MTgtOTQ1MDI5ZDllNjRjXkEyXkFqcGdeQXVyNjg2OTExMTE@._V1_SX300.jpg', 5.5, '0', 0, 1, 757, '2019-04-10 07:26:43', '2019-04-12 10:46:40'),
(754, 'مشاهدة فيلم Rust Creek 2018 مترجم', 'مشاهدة فيلم الدراما والاثارة Rust Creek 2018 مترجم بجودة WEB-DL مشاهدة مباشرة اون لاين. أثناء ذهابها لإجراء مقابلة عمل، تضيع طالبة جامعية طريقها، حينما اتخذت منعطف خاطئ جعلها عالقة في أعماق غابة كنتاكي، وهنا يجب عليها أن تدافع عن نفسها ضد عناصر الغابة القاسية، وأيضًا فرقة من الخارجين عن القانون، والذين لا يرحمون أحد، لكنها أيضًا تجد نفسها مجبرة على التحالف مع شخص غريب وحيد، ولديه نوايا غير معروفة', 'rust-creek-2018', 'https://m.media-amazon.com/images/M/MV5BZjkyZTU5OWQtOTZiMy00NzdmLWE4ODgtNmRkZTE2MTZmYWI3XkEyXkFqcGdeQXVyODY3Nzc0OTk@._V1_SX300.jpg', 5.7, 'WEB-DL', 0, 1, 758, '2019-04-10 07:26:54', '2019-04-12 10:46:40'),
(755, 'مشاهدة فيلم American Hangman 2019 مترجم', 'مشاهدة وتحميل فيلم الاثارة American Hangman 2019 بجودة WEB-DL مترجم كامل اون لاين مشاهدة مباشرة يوتيوب شخص مجهول يقوم بعمل بث مباشر لإثنين من المختطفين لديه ويعرضهم لمحاكمة.', 'american-hangman-2019', 'https://m.media-amazon.com/images/M/MV5BMTE0ODY5OTU1MTReQTJeQWpwZ15BbWU4MDcyNDE1ODYz._V1_SX300.jpg', 5.8, 'WEB-DL', 0, 1, 759, '2019-04-10 07:27:01', '2019-04-12 10:46:40'),
(756, 'مشاهدة فيلم Lionheart 2018 مترجم', 'مشاهدة وتحميل فيلم الكوميديا Lionheart 2018 مترجم بجودة WEB-DL كامل أون لاين. عندما يعتلّ والدها، تُعزّز “أديزي” جهودها في إدارة أعمال شركة العائلة، إلى جانب عمّها، وتثبت جدارتها في عالم يسيطر عليه الرجال.', 'lionheart-2018', 'https://m.media-amazon.com/images/M/MV5BMTU1NDEyMjktODgyOC00NzYzLTk4ZjctYTc4NWQ4NjA2MGM4XkEyXkFqcGdeQXVyNDc2NjEyMw@@._V1_SX300.jpg', 6.2, 'WEB-DL', 0, 1, 760, '2019-04-10 07:27:08', '2019-04-12 10:46:40'),
(757, 'مشاهدة فيلم True Fiction 2018 مترجم', 'مشاهدة و تحميل فيلم الاثارة True Fiction 2018 مترجم اون لاين جودة HD وتحميل مباشر مشاهدة اون لاين مباشرة تدور الأحداث عن ذهاب مرشح قوي لمنصب العمدة في رحلة سرية مع حبيبته لكوخ ريفي فيظهر أمامهم شباب غامضين يحولون الرحلة لكابوس مخيف مَملُوء بالأكاذيب.', 'true-fiction-2018', 'uploads/12811567258.jpg', 2.2, 'HD', 0, 1, 761, '2019-04-10 07:27:17', '2019-04-12 10:46:40'),
(758, 'مشاهدة فيلم The Black Swan 1942 مترجم', 'مشاهدة فيلم The Black Swan 1942 بجودة bluray مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر في عام ١٦٧٤ تمكن القرصان سيئ السمعة (هنري مورجان) من الحصول على منصب حاكم (جامايكا)، وأراد أن ينظف (البحر الكاريبي) من القراصنة ويبعدهم عن طريق الإبحار إلى (إنجلترا)، فاتصل بزملائه السابقين من القراصنة، وطلب منهم اتخاذ طرق أخرى بعيدا عن (البحر الكاريبي)، ولكن رفض بعضهم خصوصا الكابتن (بيللي ليش)، والذي تلقى عرضا من الأرستقراطي الإنجليزي (روجر إنجرام) الذي أمده بالمعلومات والمساعدات اللازمة للإطاحة بالحاكم الجديد.', 'the-black-swan-1942', 'https://m.media-amazon.com/images/M/MV5BMTQ1ODM0NTM2NF5BMl5BanBnXkFtZTgwMTI0MjczMjE@._V1_SX300.jpg', 6.9, 'bluray', 0, 1, 762, '2019-04-10 07:27:23', '2019-04-12 10:46:40'),
(759, 'مشاهدة فيلم Krystal 0 مترجم', 'مشاهدة فيلم Krystal 0 بجودة HD مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر ', 'krystal-0', 'https://m.media-amazon.com/images/M/MV5BNjEwMTk4MDUxOV5BMl5BanBnXkFtZTgwMTI2OTMxNTM@._V1_SX300.jpg', 5.2, 'HD', 0, 1, 763, '2019-04-10 07:27:30', '2019-04-12 10:46:40'),
(760, 'مشاهدة فيلم Curve 2015 مترجم', 'مشاهدة وتحميل فيلم الرعب والاثارة Curve 2015 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب (مالوري رتليدج) عندما كانت تتحدث في الهاتف مع شقيقتها إيلا، حيث تقف سيارتها فجأة عندما كانت في طريقها لمقابلة خطيبها وينقطع اﻻتصال بأختها، فجأة يظهر (كريستيان) ويعرض عليها إصلاح السيارة، و بعد موافقتها يطلب منها أن تقلِّه معها إلي لفندق مهجور، فتكتشف أن هذا الشاب مختل عقليا، فتحاول اﻹنحراف عن الطريق، وتنقلب السيارة فتظل حبيسة مع هذا المجنون بداخل العربة.', 'curve-2015', 'https://m.media-amazon.com/images/M/MV5BNDVkMTk1ZjktYzdiNi00YjcwLWEzNGMtY2NhYjA3MTk3NzJkXkEyXkFqcGdeQXVyNjU0NTI0Nw@@._V1_SX300.jpg', 5.5, 'BluRay', 0, 1, 764, '2019-04-10 07:27:40', '2019-04-12 10:46:40'),
(761, 'مشاهدة فيلم Packing for Mars 2015 مترجم', 'مشاهدة وتحميل فيلم الوثائقي Packing for Mars 2015 بجودة HDTV مترجم اون لاين وتحميل مباشر. رحلة رجل واحد من أجل الحقيقة', 'packing-for-mars-2015', 'https://m.media-amazon.com/images/M/MV5BMTY3NDQ5Mjk2N15BMl5BanBnXkFtZTgwNjg2ODE3NTE@._V1_SX300.jpg', 5.7, 'HDTV', 0, 1, 765, '2019-04-10 07:27:46', '2019-04-12 10:46:40');
