(1465, 'مشاهدة فيلم Cold War 2018 مترجم', 'مشاهدة و تحميل فيلم الدراما والموسيقى Cold War 2018 مترجم اون لاين جودة DVDRip وتحميل مباشر مشاهدة اون لاين مباشرة قصة حب مستعرة بين اثنيْن طبائعهما شديدة التباين وينحدران من خلفيات اجتماعية مختلفة؛ فينعدم التطابق فيما بينهما تمامًا.. تنشأ قصة حبهما وتدور في خلفية الحرب الباردة خلال الخمسينيات، ما بين بولندا، برلين، يوغسلافيا وباريس.', 'cold-war-2018', 'https://m.media-amazon.com/images/M/MV5BNTJmNzExOGItZTQyMi00YzBlLTk0ZTQtNzAxYmUwZDQwZjU4XkEyXkFqcGdeQXVyODE1MjMyNzI@._V1_SX300.jpg', 7.7, 'DVDRip', 0, 1, 1469, '2019-04-10 12:51:20', '2019-04-12 10:46:44'),
(1467, 'مشاهدة فيلم Great Barrier Reef 2018 مترجم', 'مشاهدة وتحميل فيلم ال Great Barrier Reef 2018 بجودة HDTV مترجم اون لاين وتحميل مباشر. ما الذي يتبادر إلى ذهني عندما تفكر في أكبر بنية بنيت من قبل الكائنات الحية؟ سور الصين العظيم مترامي الاطراف؟ أو ربما ناطحات السحاب في نيويورك ودبي؟ والحقيقة هي أنه لا يمكن مقارنة أي إنجاز إنساني للبناء بالحجم الكبير والعظمة للحاجز المرجاني العظيم – الذي يمتد على مسافة أكثر من 1400 ميل من ساحل أستراليا وموطن لأنواع فريدة لا حصر لها من الحياة المائية.', 'great-barrier-reef-2018', 'https://m.media-amazon.com/images/M/MV5BMjk4OTk4NDAwOV5BMl5BanBnXkFtZTcwNTI2NzY1OA@@._V1_SX300.jpg', 8.3, 'HDTV', 0, 1, 1471, '2019-04-10 12:51:29', '2019-04-12 10:46:44'),
