(1578, 'مشاهدة فيلم Death House 2017 مترجم', 'مشاهدة فيلم الرعب Death House 2017 مترجم بجودة WEB-DL مشاهدة مباشرة اون لاين. عميلان فيدراليان يشقان طريقهما من خلال تسعة مستويات من الجحيم داخل أحد السجون السرية المعروفة باسم (منزل الموت)، فتتحول رحلة هروبهما من السجن إلى جولة مرعبة تدفعهما نحو الشر المطلق الكامن في الدرك الأسفل من الأرض.', 'death-house-2017', 'https://m.media-amazon.com/images/M/MV5BMjdkNjc3NWUtZTdlYy00Mjk4LWI2Y2EtZTMxZmIzMTU5Y2E3XkEyXkFqcGdeQXVyMTY1MDI4NA@@._V1_SX300.jpg', 3.4, 'WEB-DL', 0, 1, 1582, '2019-04-10 22:21:48', '2019-04-12 10:46:44'),
(1579, 'مشاهدة فيلم In Echo Park 2018 مترجم', 'مشاهدة وتحميل فيلم الجريمة والدراما In Echo Park 2018 مترجم بجودة WEB-DL كامل اون لاين. رجل فاسق في الشارع ، زوج من الألفية ، ومراهق سلفادوري يجري تجنيده من قبل عصابة محلية تتصادم ، وتشكل قصة متشابكة للطبقة والهوية في إيكو بارك ، لوس أنجلوس.', 'in-echo-park-2018', 'https://m.media-amazon.com/images/M/MV5BYTg5NGRiM2ItOGQ0MC00OTdhLWEwMmMtYzYzNGYwNTI2YWI4XkEyXkFqcGdeQXVyMTQ2OTU2OTQ@._V1_SX300.jpg', 4.6, 'WEB-DL', 0, 1, 1583, '2019-04-10 22:21:54', '2019-04-12 10:46:44'),
(1678, 'مشاهدة فيلم Mademoiselle Paradis 2017 مترجم', 'مشاهدة و تحميل فيلم الدراما والتاريخي Mademoiselle Paradis 2017 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة عازف البيانو أعمى الذين يعيشون في فيينا القرن الثامن عشر يشكل علاقة غير عادية مع الطبيب الذي يحاول استعادة بصرها.', 'mademoiselle-paradis-2017', 'https://m.media-amazon.com/images/M/MV5BZDQ3NDE4YjktZmI2Zi00OWYyLTk4NWQtYWExZjAwMmY0YmIyXkEyXkFqcGdeQXVyNDkzNTM2ODg@._V1_SX300.jpg', 6.5, 'BluRay', 0, 1, 1682, '2019-04-10 22:31:48', '2019-04-12 10:46:45'),
(1680, 'مشاهدة فيلم The Crimes That Bind 2018 مترجم', 'مشاهدة وتحميل فيلم الغموض والاثارة The Crimes That Bind 2018 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب تدور أحداث الفيلم حول جريمة قتل تحدث في شقة بطوكيو، فتبدأ الشرطة بالتحقيقات لتجد أن الضحية قد أتت لزيارة مخرجة ولكن لا يوجد علاقة بينهما بالإضافة إلى ان مالك الشقة اختفى.', 'the-crimes-that-bind-2018', 'https://m.media-amazon.com/images/M/MV5BZjcxNjg2OTgtMzU2Yi00N2FlLThjMmUtMDkzZjY2YmY0N2M0XkEyXkFqcGdeQXVyNjgwNTk4Mg@@._V1_SX300.jpg', 7.1, 'BluRay', 0, 1, 1684, '2019-04-10 22:31:57', '2019-04-12 10:46:45'),
(1681, 'مشاهدة فيلم Three Identical Strangers 2018 مترجم', 'مشاهدة وتحميل فيلم الوثائقي Three Identical Strangers 2018 بجودة BluRay مترجم اون لاين وتحميل مباشر. يصور الفيلم كيف التقى الأشقاء بصدفة لم تكن طرقهم لتتقاطع لولاها، إذ فوجئ شفران في يومه الأول في كلية سوليفان بولاية نيويورك، بترحيب حار، من قبل أشخاص لم يلتق بهم من قبل، من بينهم شاب يدعى مايكل دومنيتز، الذي أدرك بعد لحظات أن الشخص الذي أمامه، لم يكن زميله إدي غالان الذي كان معه في الكلية في العام السابق، وإنما شخص يشبهه بطريقة مخيفة.', 'three-identical-strangers-2018', 'https://m.media-amazon.com/images/M/MV5BMTc0NWM3ZGItMzlmZC00NDRmLWJlZmUtMjkzZjNlYmNhYTc1XkEyXkFqcGdeQXVyNzgxMzYzNjA@._V1_SX300.jpg', 7.7, 'BluRay', 53, 1, 1685, '2019-04-10 22:32:02', '2019-04-14 18:37:56'),
(1684, 'مشاهدة فيلم Pathfinder 1987 مترجم', 'مشاهدة و تحميل فيلم الاكشن والمغامره Pathfinder 1987 مترجم اون لاين جودة BrRip وتحميل مباشر مشاهدة اون لاين مباشرة بينما يقتلون عائلة في منطقة نائية بوحشية ، بما في ذلك الوالدين وابنتهم الصغيرة ، يلاحظ ابن العائلين المراهق ، أيجين ، المذبحة. تمكن من الفرار من هؤلاء القتلة ووصل إلى معسكر آخر مع لابس الذين يشعر سكانهم بالقلق إذا كان قادراً على إخفاء مساره. خوفا من القتلة ، قرروا الفرار إلى الساحل. الصبي يبقى وحده للانتقام من قتل عائلته.', 'pathfinder-1987', 'https://m.media-amazon.com/images/M/MV5BMTk5MDY0NTA1OV5BMl5BanBnXkFtZTcwNjE0MDM0MQ@@._V1_SX300.jpg', 5.4, '0', 0, 1, 1688, '2019-04-10 22:32:17', '2019-04-12 10:46:45'),
(1686, 'مشاهدة فيلم Ulysses: A Dark Odyssey 2018 مترجم', 'مشاهدة وتحميل فيلم الاكشن والجريمة Ulysses: A Dark Odyssey 2018 مترجم بجودة HDRip كامل اون لاين. جندي مخدوع مليء بفقدان الذاكرة ، يعود إلى الوطن من حرب في الشرق الأوسط ، مع العلم فقط أنه يجب أن يمزج المدينة بشدة ليجد زوجته المحبوبة. يملأ القدر هذه الليلة اللانهائية بسلسلة من لقاءات الصدفة. وسواء كان الأثرياء الأكسيدون ، أو العملاقون البائسون بوبوف ، أو أيو غيسبي ، أو سيسي الساحر ، أو الخير أو الشر ، فإن كل لقاء يملأ في جزء مفقود من ذاكرة أولي ، حتى يتمكن في النهاية من مواجهة ماضيه.', 'ulysses-a-dark-odyssey-2018', 'https://m.media-amazon.com/images/M/MV5BZmI2ZDE5NzgtMGQ1OS00MGYzLTkyZTctMDdmZTI2YzgwNzRkXkEyXkFqcGdeQXVyNTYzMjkwNjU@._V1_SX300.jpg', 6.2, 'HDRip', 0, 1, 1690, '2019-04-10 22:32:23', '2019-04-12 10:46:45'),
(1687, 'مشاهدة فيلم Bad Tutor 2018 مترجم', 'مشاهدة وتحميل فيلم الاثارة Bad Tutor 2018 بجودة WEB-DL مترجم كامل اون لاين مشاهدة مباشرة يوتيوب هل يمكن أن يكون الحب مرضا ويكون الأستحواذ وحب السيطرة والتملك بعضا من أعراضه. هل يتفاقم الداء ليسبب الأذي للمحبوب بل أكثر من ذلك. هل يتجانس الدهاء والمثابرة والشر مع الحب في هذه العلة الغريبة. شاهد وتعجب!!!!!', 'bad-tutor-2018', 'https://m.media-amazon.com/images/M/MV5BNTA0Njk4MmUtYTVhNy00ODI5LWE1OTAtMTc1MDk4MDY1MTJhXkEyXkFqcGdeQXVyNjk2Mjc2OTI@._V1_SX300.jpg', 4.7, 'WEB-DL', 0, 1, 1691, '2019-04-10 22:32:29', '2019-04-12 10:46:45'),
(1689, 'مشاهدة فيلم In Harm’s Way 2017 مترجم', 'مشاهدة وتحميل فيلم التاريخي والرومانسية In Harm’s Way 2017 مترجم بجودة WEB-DL كامل أون لاين. دمر الهجوم الياباني على بيرل هاربور معنويات الأمريكيين. قرر رئيس الولايات المتحدة ، فرانكلين دي روزفلت ، المخاطرة بكل شيء بقصف طوكيو ، ورفع آمال الجماهير. قصف الطائرات الجوية بقيادة الولايات المتحدة اللفتنانت كولونيل جيمي دوليتل تقلع من حاملة طائرات ضخمة.', 'in-harms-way-2017', 'uploads/7378356936.jpg', 0, 'WEB-DL', 0, 1, 1693, '2019-04-10 22:32:35', '2019-04-12 10:46:45'),
(1690, 'مشاهدة فيلم Boundaries 2018 مترجم', 'مشاهدة فيلم الكوميديا والدراما Boundaries 2018 مترجم بجودة WEB-DL مشاهدة مباشرة اون لاين. تضطر (لورا) وابنها (هنري) مجبرين على القيادة عبر البلاد بوالدها (جاك) المتعطش للمخاطر، بعد طرده من دار رعاية المسنين التي كان بها.', 'boundaries-2018', 'https://m.media-amazon.com/images/M/MV5BMDYzNWE1ZWUtMTU3Ni00ZWU2LTkxYWUtMTY5NjlkM2Q3YzMyXkEyXkFqcGdeQXVyMjM4NTM5NDY@._V1_SX300.jpg', 4.6, 'WEB-DL', 0, 1, 1694, '2019-04-10 22:32:44', '2019-04-12 10:46:45'),
(1694, 'مشاهدة فيلم Bonehill Road 2017 مترجم', 'مشاهدة فيلم Bonehill Road 2017 بجودة DVDRip مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر إميلي وإيدن ستيفنز هربا من موقف عنيف واحد فقط ليغوص الرأس أولا إلى آخر. مرعوبين وحدهم هم تقطعت بهم السبل في الغابة المظلمة فقط ليتم مطاردة في مشهد مروع في منزل أو أهوال. يجب عليهم العمل معا للخروج من الحياة. لكن ما هو الأسوأ؟ ما هو في الداخل أو الخارج؟', 'bonehill-road-2017', 'https://m.media-amazon.com/images/M/MV5BZThiMGZhNGQtM2JhOS00ZDE1LThkNzUtYWEzYmY5YWM2MGIxXkEyXkFqcGdeQXVyMTg0MTI3Mg@@._V1_SX300.jpg', 4.7, 'DVDRip', 0, 1, 1698, '2019-04-10 22:33:00', '2019-04-12 10:46:45'),
(1696, 'مشاهدة فيلم F.R.E.D.I. 2018 مترجم', 'مشاهدة وتحميل فيلم المغامره والعائلي F.R.E.D.I. 2018 مترجم بجودة WEB-DL كامل أون لاين. مراهق يجعل اكتشاف العمر في الغابة وراء منزله في أركنساس ، وهو رجل آلي ودود.', 'fredi-2018', 'uploads/12616738638.jpg', 0, 'WEB-DL', 0, 1, 1700, '2019-04-10 22:33:08', '2019-04-12 10:46:45'),
(1699, 'مشاهدة فيلم Chicken 2015 مترجم', 'مشاهدة فيلم الدراما Chicken 2015 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. ريتشارد (15 عاما) يعاني من صعوبات في التعلم ، يتوق إلى الجذور ، ولكن شقيقه البولندي المهدئ والمدمر يحتاج إلى مواصلة الحركة. عندما يتم شراء الأرض التي يعيشون عليها من قبل مالك جديد للأرض ، ويتم قطع إمدادات الكهرباء إلى قوافلهم ، فإن ظروفهم المعيشية غير المستقرة بالفعل تزداد سوءًا.', 'chicken-2015', 'https://m.media-amazon.com/images/M/MV5BODY5ZTg2ZTEtZDE5ZS00YWY0LTgwYjYtNDQ2ZTljNjk5MWVlXkEyXkFqcGdeQXVyMTk1MTUyMDA@._V1_SX300.jpg', 6.8, 'BluRay', 0, 1, 1703, '2019-04-10 22:33:22', '2019-04-12 10:46:45'),
(1700, 'مشاهدة فيلم Island of Lost Souls 1932 مترجم', 'مشاهدة و تحميل فيلم الرعب والخيال العلمي Island of Lost Souls 1932 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة يقوم عالم مهووس بإجراء تجارب دنيوية في التطور ، ليثبت نفسه في النهاية على أنه ذاك الديموغود الذي يصف نفسه بأنفسه ، إلى عرق من الفظائع المتطفلة نصف البشرية.', 'island-of-lost-souls-1932', 'https://m.media-amazon.com/images/M/MV5BMTA2NTI3ODM1NDReQTJeQWpwZ15BbWU4MDMwMzIzNTIx._V1_SX300.jpg', 7.5, 'BluRay', 0, 1, 1704, '2019-04-10 22:33:27', '2019-04-12 10:46:45'),
(1704, 'مشاهدة فيلم Misery 1990 مترجم', 'مشاهدة وتحميل فيلم الجريمة والدراما Misery 1990 بجودة BrRip مترجم كامل اون لاين مشاهدة مباشرة يوتيوب هذا الفيلم من تأليف الكاتب ستيفن كينج المعروف بتخصصه فى كتابة قصص الرعب و الاثارة .وهنا يحكى الفيلم عن كاتب ناجح و مشهور يتعرض لحادثة سيارة و لسوء حظه تنقذه ممرضة مهووسة بمؤلفاته فتأخذه معها فى فيلتها بضواحى المدينة و لا تبلغ الشرطة عن اختفائه بل و تقتل الشرطى الذى حاول انقاذه منها .', 'misery-1990', 'https://m.media-amazon.com/images/M/MV5BNzY0ODQ3MTMxN15BMl5BanBnXkFtZTgwMDkwNTg4NjE@._V1_SX300.jpg', 7.8, '0', 0, 1, 1708, '2019-04-10 22:33:40', '2019-04-12 10:46:45'),
(1705, 'مشاهدة فيلم Malevolence 3: Killer 2018 مترجم', 'مشاهدة وتحميل فيلم الرعب Malevolence 3: Killer 2018 بجودة WEB-DL مترجم كامل اون لاين مشاهدة مباشرة يوتيوب يعود مارتن بريستول إلى حيث بدأ كل شيء: المنزل الذي اختطف فيه. لكنه ليس الصبي ذاته الذي اختفى منذ أكثر من 10 سنوات.و تعرض للتعذيب وسوء المعاملة , يحاول العميل الخاص ويليام بيركنز العثور علي مارتن بعد ان بلغت عائلة مارتن ، اختفائه لأكثر من 10 سنوات ، ليس فقط أنه على قيد الحياة ، بل إنه مسؤول عن سلسلة القتل العمد التي تجتاح مدينتهم.', 'malevolence-3-killer-2018', 'uploads/19855617732.jpg', NULL, 'WEB-DL', 1, 1, 1709, '2019-04-10 22:33:46', '2019-04-12 10:46:45'),
(1707, 'مشاهدة فيلم Inside the Boys 2018 مترجم', 'مشاهدة فيلم ال Inside the Boys 2018 مترجم بجودة HDRip مشاهدة مباشرة اون لاين. طالب جامعي يعود مرة أخرى بعد مرور 15 عام من جريمة قتل حيث لم يتقدم به العمر على الإطلاق وهو المتهم الوحيد في الجريمة', 'inside-the-boys-2018', 'https://m.media-amazon.com/images/M/MV5BZTQwYmRjZTYtMzUxOS00NDY0LWE1YjUtOTM2OTZhOGU3MTUyXkEyXkFqcGdeQXVyNjU3NTI3MzQ@._V1_SX300.jpg', 0, 'HDRip', 0, 1, 1711, '2019-04-10 22:33:52', '2019-04-12 10:46:45'),
(1708, 'مشاهدة فيلم 55 Steps 2017 مترجم', 'مشاهدة وتحميل فيلم السيرة الذاتية والدراما 55 Steps 2017 مترجم بجودة WEB-DL كامل أون لاين. عندما تذهب محامية حقوق المرضى كوليت هيوز لمقابلة زبونها الجديد ، إليانور ريس ، وهي مريضة في وحدة الطب النفسي في مستشفى سان فرانسيسكو ، ليس لديها أي فكرة أنه بالإضافة إلى خوض معركة قانونية صعبة لتحسين علاج المرضى العقليين في المستشفيات ، وهي تقابل امرأة ستجعلها مهمتها لتحويل حياة مدمن عمل كوليت', '55-steps-2017', 'uploads/2134880291.jpg', 6.9, 'WEB-DL', 0, 1, 1712, '2019-04-10 22:33:58', '2019-04-12 10:46:45'),
(1710, 'مشاهدة فيلم Bad Times at the El Royale 2018 مترجم', 'مشاهدة وتحميل فيلم الغموض والاثارة Bad Times at the El Royale 2018 مترجم بجودة BluRay كامل أون لاين. سبعة من الغرباء، كلًا منهم يحمل سر دفين، يجتمعون في فندق الرويال وهو فندق ذو ماضِ مظلم، وعلى مدار ليلة مصيرية واحدة سيكون أمام كل شخص فرصة في الخلاص قبل أن يذهب كل شيء إلى الجحيم.', 'bad-times-at-the-el-royale-2018', 'https://m.media-amazon.com/images/M/MV5BOTk1Nzk1MDc1MF5BMl5BanBnXkFtZTgwNjU2NDExNjM@._V1_SX300.jpg', 7.1, 'BluRay', 0, 1, 1714, '2019-04-10 22:34:05', '2019-04-12 10:46:45'),
(1711, 'مشاهدة فيلم First Man 2018 مترجم', 'مشاهدة وتحميل فيلم السيرة الذاتية والدراما First Man 2018 بجودة BluRay مترجم اون لاين وتحميل مباشر. يلقي الفيلم نظرة على قصة حياة نيل أرمسترونج رائد الفضاء اﻷسطوري الذي يعد هو أول رجل في تاريخ البشرية يسير على سطح القمر في العشرين من يوليو من عام 1969.', 'first-man-2018', 'https://m.media-amazon.com/images/M/MV5BMDBhOTMxN2UtYjllYS00NWNiLWE1MzAtZjg3NmExODliMDQ0XkEyXkFqcGdeQXVyMjMxOTE0ODA@._V1_SX300.jpg', 7.4, 'BluRay', 0, 1, 1715, '2019-04-10 22:34:11', '2019-04-12 10:46:45'),
(1712, 'مشاهدة فيلم The Happy Prince 2018 مترجم', 'مشاهدة فيلم The Happy Prince 2018 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر القصة الغير محكية عن الأيام الأخيرة من الأوقات المأسوية للكاتب الإنجليزي الشهير (أوسكار وايلد)، الذي يلاحظ فشله وألاعيب القدر معه فيما يتعلق بالصعوبات التي تكتنف حياته، وما يلازم هذه العقبات من قساوة وسخرية..', 'the-happy-prince-2018', 'https://m.media-amazon.com/images/M/MV5BODVjZThlMzMtZjQwNy00YjRlLWE5ZTMtMWVlMWUwM2U1NjRkXkEyXkFqcGdeQXVyODcyODY1Mzg@._V1_SX300.jpg', 6.3, 'WEB-DL', 0, 1, 1716, '2019-04-10 22:34:17', '2019-04-12 10:46:45'),
(1714, 'مشاهدة فيلم The Kindergarten Teacher 2018 مترجم', 'مشاهدة فيلم الدراما The Kindergarten Teacher 2018 مترجم بجودة WEB-DL مشاهدة مباشرة اون لاين. تدور احداث قصه فيلم الدراما The Kindergarten Teacher 2018 “” حول تصبح مهنة رياض الأطفال في نيويورك مهووسة بأحد تلاميذها الذين تعتقد أنها طفلة معجزة.', 'the-kindergarten-teacher-2018', 'https://m.media-amazon.com/images/M/MV5BZDIxNjIwNjktZTQzNS00ODI1LTkyZGItNDhkYjJlM2FhODcyXkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg', 6.8, 'WEB-DL', 0, 1, 1718, '2019-04-10 22:34:23', '2019-04-12 10:46:45'),
(1715, 'مشاهدة فيلم Feminists What Were They Thinking? 2018 مترجم', 'مشاهدة وتحميل فيلم الوثائقي Feminists What Were They Thinking? 2018 مترجم بجودة WEB-DL كامل أون لاين. بإعادة النظر في صور التُقطت لنساء في حقبة السبعينيّات بهدف رصد الصحوة النسوية، يستكشف هذا الفيلم حياتهنّ ويبحث في حاجتهنّ المستمرّة للتغيير.', 'feminists-what-were-they-thinking-2018', 'https://m.media-amazon.com/images/M/MV5BODljMzYzOTQtZGQyYi00ZjhkLTk5NDktY2RlNTdjOTljYjgwXkEyXkFqcGdeQXVyNjcyMzE1MA@@._V1_SX300.jpg', 6.6, 'WEB-DL', 0, 1, 1719, '2019-04-10 22:34:29', '2019-04-12 10:46:45'),
(1716, 'مشاهدة فيلم Honey 2018 مترجم', 'مشاهدة فيلم الدراما والرومانسية Honey 2018 مترجم بجودة HD مشاهدة مباشرة اون لاين. تدور قصة الفيلم حول أونيسي تايجا (هيرانو شو)، الجانح ذو الشعر الأحمر الذي يطلب من ناو كاجوري (يونا تايرا) الفتاة اللطيفة التي تُلقب بالقطة الخائفة، أن تواعده بنية الزواج منه، ماذا ستفعل ناو ؟', 'honey-2018', 'https://m.media-amazon.com/images/M/MV5BMTIxODE4MTk0MF5BMl5BanBnXkFtZTcwMTg3NTAwMQ@@._V1_SX300.jpg', 5.3, 'HD', 0, 1, 1720, '2019-04-10 22:34:35', '2019-04-12 10:46:45'),
(1718, 'مشاهدة فيلم Kuntilanak 2018 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والرعب Kuntilanak 2018 مترجم بجودة WEB-DL كامل أون لاين. توافق مجموعة من الأطفال على استكشاف منزل مهجور من أجل الفوز في مسابقة عرض للواقع ، مما يتطلب منهم إثبات أن قصص كونتيلاناك الشريرة حقيقية. وسرعان ما يكتشفون أن الشبح حقيقي للغاية عندما يظهر من مرآة قديمة ويبدأ بمطاردتهم.', 'kuntilanak-2018', 'https://m.media-amazon.com/images/M/MV5BMmYxOWI3NGItNzU3My00ZDRiLWJkNTAtMDEwOTkwNzI4OTBlXkEyXkFqcGdeQXVyNjcwNDkxMzg@._V1_SX300.jpg', 4.7, 'WEB-DL', 0, 1, 1722, '2019-04-10 22:34:41', '2019-04-12 10:46:45'),
(1719, 'مشاهدة فيلم Apostle 2018 مترجم', 'مشاهدة فيلم Apostle 2018 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر في العام 1905، يقع رجل هائمٌ، قد أوكلت إليه مهمّة خطيرة لإنقاذ شقيقته المخطوفة، في شباك طائفة دينيّة شرّيرة على جزيرة معزولة.', 'apostle-2018', 'https://m.media-amazon.com/images/M/MV5BMTY1NDk0NjI4MV5BMl5BanBnXkFtZTgwNjUyNzMwNjM@._V1_SX300.jpg', 6.3, 'WEB-DL', 0, 1, 1723, '2019-04-10 22:34:47', '2019-04-12 10:46:45'),
(1721, 'مشاهدة فيلم Errementari 2017 مترجم', 'مشاهدة فيلم الفانتازيا والرعب Errementari 2017 مترجم بجودة WEB-DL مشاهدة مباشرة اون لاين. يلوم حدّاد شرس شيطانًا على معاناته فيُقدم على تعذيبه، غير مُدرك أن يتيمة مُتسلّلة توشك أن تغيّر كلّ شيء… مستوحًى من تراث “الباسك” الشعبي.', 'errementari-2017', 'https://m.media-amazon.com/images/M/MV5BMGEyZWJjZjgtOWEzOS00Njc5LTg2NWUtMGRlYzkzZmFhNzhmXkEyXkFqcGdeQXVyNTYzNDYzNjc@._V1_SX300.jpg', 6.4, 'WEB-DL', 0, 1, 1725, '2019-04-10 22:34:53', '2019-04-12 10:46:45'),
(1723, 'مشاهدة فيلم I Still See You 2018 مترجم', 'مشاهدة فيلم الاثارة I Still See You 2018 مترجم بجودة WEB-DL مشاهدة مباشرة اون لاين. بعد مرور عشر سنوات على وقوع حدث مروع راح ضحيته الملايين من القتلى، تتلقى (روني) رسالة تهديد من خارج القبر، فتنضم إلى زميلها الغامض (كيرك) وينحدران إلى عالم الظل يطمس حدود الحياة والقتلى، ويبدأ سباقًا يائسًا ضد الوقت لإيقاف القاتل المراوغ.', 'i-still-see-you-2018', 'https://m.media-amazon.com/images/M/MV5BMjQ4MjI5MjkxMV5BMl5BanBnXkFtZTgwODU1ODIyNjM@._V1_SX300.jpg', 5.7, 'WEB-DL', 0, 1, 1727, '2019-04-10 22:34:59', '2019-04-12 10:46:45'),
(1783, 'فيلم Planet dinosaur: ultimate killers 2012 مترجم اون لاين', 'مشاهدة فيلم Planet dinosaur: ultimate killers 2012 بجودة bluray مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر', 'planet-dinosaur-ultimate-killers-2012', 'https://m.media-amazon.com/images/M/MV5BYzM5MDYzNDMtNzFiMy00ZGE5LTk4OWYtNTg2YjkwZDIwYmRlXkEyXkFqcGdeQXVyMjc5NzcwNDc@._V1_SX300.jpg', 7.3, 'bluray', 69, 1, 1787, '2019-04-10 22:37:10', '2019-04-14 13:36:42'),
(1787, 'مشاهدة فيلم Extremity 2018 مترجم', 'مشاهدة وتحميل فيلم الرعب Extremity 2018 بجودة WEB-DL مترجم اون لاين وتحميل مباشر. امرأة شغوفة مهووسة بمواضيع رعب نفسها لساعات من العذاب القاسي داخل مأوى شديد في محاولة لمواجهة مخاوفها وقهر الماضي المأساوي الذي يطاردها.', 'extremity-2018', 'https://m.media-amazon.com/images/M/MV5BNTlhZDZkN2QtZGRhYS00OTc1LWFlOGUtYzMxZmEwMWMwMzNlXkEyXkFqcGdeQXVyMTcwMjE4MTQ@._V1_SX300.jpg', 4.3, 'WEB-DL', 0, 1, 1791, '2019-04-10 22:41:18', '2019-04-12 10:46:45'),
(1788, 'مشاهدة فيلم The Legend of Halloween Jack 2018 مترجم', 'مشاهدة وتحميل فيلم الرعب The Legend of Halloween Jack 2018 مترجم بجودة WEB-DL كامل أون لاين. في ليلة عيد الهالوين ، يعود قاتل متسلسل من الموتى للانتقام من الحراس الذين وضعوه حتى الموت قبل عام واحد.', 'the-legend-of-halloween-jack-2018', 'https://m.media-amazon.com/images/M/MV5BYjUxNTY2ODUtZTU0MS00NmQ3LTljYzQtMTdkZjZlMTlhOGQzXkEyXkFqcGdeQXVyMjc4NzY1MTM@._V1_SX300.jpg', 3.2, 'WEB-DL', 0, 1, 1792, '2019-04-10 22:41:19', '2019-04-12 10:46:45'),
(1789, 'مشاهدة فيلم Malevolent 2018 مترجم', 'مشاهدة وتحميل فيلم الرعب Malevolent 2018 مترجم بجودة WEB-DL كامل اون لاين. إن الوسطاء النفسيين المتخصصين في الظواهر الخارقة يجدون أنفسهم ضحايا لفضائحهم عندما تتحول مهمة ما إلى كابوس فجأة.', 'malevolent-2018', 'https://m.media-amazon.com/images/M/MV5BOGJmYWJmYzYtYjIyYS00YzA5LWEwY2ItNTYxMWE3ODcxZGQ3XkEyXkFqcGdeQXVyNTU4MDA0MA@@._V1_SX300.jpg', 4.8, 'WEB-DL', 0, 1, 1793, '2019-04-10 22:41:25', '2019-04-12 10:46:45'),
(1790, 'مشاهدة فيلم Maximum Impact 2017 مترجم', 'مشاهدة وتحميل فيلم الاكشن والكوميديا Maximum Impact 2017 مترجم بجودة WEB-DL كامل اون لاين. يضطر عملاء جهاز الأمن الفيدرالي في روسيا والخدمة السرية الأمريكية للعمل معاً لمنع حدوث أزمة دولية واسعة النطاق.', 'maximum-impact-2017', 'https://m.media-amazon.com/images/M/MV5BNzk3YTljZmItYmVjOC00YThiLTlkYzQtMTRmMGEyMGNlZWFmXkEyXkFqcGdeQXVyMzQwMTY2Nzk@._V1_SX300.jpg', 1.9, 'WEB-DL', 0, 1, 1794, '2019-04-10 22:41:32', '2019-04-12 10:46:45'),
(1791, 'مشاهدة فيلم Private Life 2018 مترجم', 'مشاهدة وتحميل فيلم الدراما Private Life 2018 بجودة WEB-DL مترجم كامل اون لاين مشاهدة مباشرة يوتيوب بينما يكافح زوجان في العقد الخامس من العمر لحدوث حمل، توشك الخيارات أمامهما أن تنفد… حتّى يلوح في الأفق بريق أمل بقدوم زائرة من أقاربهما.', 'private-life-2018', 'https://m.media-amazon.com/images/M/MV5BNjYzMjZiNDItMDk2ZC00MWVkLWFmNjUtZGU1MjM2YmY0Y2MxXkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg', 7.3, 'WEB-DL', 1, 1, 1795, '2019-04-10 22:41:38', '2019-04-12 10:46:45'),
(1792, 'مشاهدة فيلم Bayou Caviar 2018 مترجم', 'مشاهدة وتحميل فيلم الدراما Bayou Caviar 2018 مترجم بجودة WEB-DL كامل أون لاين. تدور الأحداث حول (رودني) وهو بطل ملاكمة سابق، يذهب لزيارة معلمه ومدربه وهو على فراش الموت، وبعد أن كان يريد استعادة النصر في حياة بسيطة كحارس ملهى ليلي.', 'bayou-caviar-2018', 'https://m.media-amazon.com/images/M/MV5BMjM3NTAyMjgzNF5BMl5BanBnXkFtZTgwMTkyMjQyNjM@._V1_SX300.jpg', 6.2, 'WEB-DL', 0, 1, 1796, '2019-04-10 22:41:45', '2019-04-12 10:46:45'),
(1793, 'مشاهدة فيلم Ride 2018 مترجم', 'مشاهدة وتحميل فيلم الاثارة Ride 2018 مترجم بجودة WEB-DL كامل أون لاين. عندما يقوم (جيمس) الذي يعمل سائق لدى (أوبر) بإصطحاب (برونو) تتحول ليلة إعتيادية في لوس أنجلوس إلى حرب نفسية للنجاة.', 'ride-2018', 'https://m.media-amazon.com/images/M/MV5BMTU1Njc1Mzk4NF5BMl5BanBnXkFtZTgwMTU2MzQ3NDE@._V1_SX300.jpg', 5.7, 'WEB-DL', 0, 1, 1797, '2019-04-10 22:41:50', '2019-04-12 10:46:45'),
(1794, 'مشاهدة فيلم Await Further Instructions 2018 مترجم', 'مشاهدة وتحميل فيلم الرعب والغموض Await Further Instructions 2018 بجودة WEB-DL مترجم كامل اون لاين مشاهدة مباشرة يوتيوب تستيقظ للعثور على مادة سوداء غامضة تحيط بمنزلهم. من الواضح أن شيئاً هائلاً يحدث مباشرة خارج أبوابهم ، لكن ما هو بالضبط – حادث صناعي ، هجوم إرهابي ، حرب نووية؟ ينقلبون إلى حجج مذعورة ، يشغلون التلفزيون ، يائسين للحصول على أي معلومات.', 'await-further-instructions-2018', 'https://m.media-amazon.com/images/M/MV5BNWM0MTQzOGQtZTYyNS00MzYyLTg4NzMtZDk5YjY5MGU2YzhjXkEyXkFqcGdeQXVyMzY0MTE3NzU@._V1_SX300.jpg', 4.8, 'WEB-DL', 0, 1, 1798, '2019-04-10 22:41:51', '2019-04-12 10:46:45'),
(1795, 'مشاهدة فيلم Shangri La Near Extinction 2018 مترجم', 'مشاهدة وتحميل فيلم الخيال العلمي Shangri La Near Extinction 2018 بجودة WEB-DL مترجم كامل اون لاين مشاهدة مباشرة يوتيوب انقرضت البشرية تقريبا في هذا الفيلم المخلوق بعد المروع. توفي معظم البشر من الطاعون القاتل والعصر الجليدي الذي صنعوه للقضاء عليه. يقود رجل يدعى فارغاس مجموعة من الناجين في سعيهم للوصول إلى شانغريلا ، الملاذ الآمن الأخير على الأرض. ومع ذلك ، يجب عليهم القتال من خلال البرد ، وعبادة متحولة ومجموعة من المخلوقات القاتلة للوصول إلى هناك.', 'shangri-la-near-extinction-2018', 'https://m.media-amazon.com/images/M/MV5BOTU1MmMzNzUtYTJiNy00MTY3LTg4ODMtYTJhZjM0YjA2MmJiXkEyXkFqcGdeQXVyNzI0MDA2NTM@._V1_SX300.jpg', 2.9, 'WEB-DL', 0, 1, 1799, '2019-04-10 22:41:57', '2019-04-12 10:46:45'),
(1796, 'مشاهدة فيلم Thirst 2018 مترجم', 'مشاهدة وتحميل فيلم الدراما والرعب Thirst 2018 مترجم بجودة DVDRip كامل اون لاين. يتنافس اثنان من أفضل الأصدقاء على بعضهم البعض عندما تأتي فتاة جديدة إلى المدينة ، حيث تزداد الأمور تعقيدًا عندما يتم تجميعهم في الجيش الأمريكي للقتال في حرب الخليج ، والرجال ووحدتهم التي استولت عليها القوات العراقية ويجب أن تعمل معًا أسرى حرب آخرين للهروب من عملية عاصفة الصحراء.', 'thirst-2018', 'https://m.media-amazon.com/images/M/MV5BNDgwODY0MjM3OV5BMl5BanBnXkFtZTcwNzk3MTY2Mg@@._V1_SX300.jpg', 7.2, 'DVDRip', 46, 1, 1800, '2019-04-10 22:42:03', '2019-04-12 12:05:53'),
(1797, 'مشاهدة فيلم Enter the Fire 2018 مترجم', 'مشاهدة وتحميل فيلم الاكشن Enter the Fire 2018 مترجم بجودة WEB-DL كامل اون لاين. في طريقه من الغوغاء ، يزور جيك بولت شقيقه المتبنَّى. وبينما تغلق المافيا ، يجب على الأخوين أن يوحدا معا لصد المافيا – بينما يحاولان عدم قتل بعضهما البعض في هذه العملية.', 'enter-the-fire-2018', 'https://m.media-amazon.com/images/M/MV5BZWZlNjMyYjItYTA0Yi00YjYxLTg5MGItNGY1YWQ0MjViZjY5XkEyXkFqcGdeQXVyMjM5Njk2ODg@._V1_SX300.jpg', 7.6, 'WEB-DL', 0, 1, 1801, '2019-04-10 22:42:09', '2019-04-12 10:46:45'),
(1798, 'مشاهدة فيلم Alterscape 2018 مترجم', 'مشاهدة فيلم الخيال العلمي والاثارة Alterscape 2018 مترجم بجودة HDRip مشاهدة مباشرة اون لاين. بعد محاولة انتحار فاشلة ، يقدم شاب يتعامل مع الخسارة والاكتئاب ، سلسلة من التجارب التي تحسّن المشاعر البشرية ، لكن رد فعله الفريد للاختبارات يرسله في رحلة تتجاوز الواقع المادي والمفترض.', 'alterscape-2018', 'https://m.media-amazon.com/images/M/MV5BYWU2MDE0MWMtYjhkNy00ZGZjLWI1OTQtZjdjNmFlZDlmZTdhXkEyXkFqcGdeQXVyMjI3OTc4ODQ@._V1_SX300.jpg', 6.9, 'HDRip', 0, 1, 1802, '2019-04-10 22:42:16', '2019-04-12 10:46:45'),
(1799, 'مشاهدة فيلم Betrayed 2018 مترجم', 'مشاهدة وتحميل فيلم الاكشن والجريمة Betrayed 2018 مترجم بجودة WEB-DL كامل اون لاين. في محاولة للسيطرة على المدينة يفتح العمدة الأبواب أمام المافيا الروسية. لم يمض وقت طويل حتى يدرك أنهم لن يتبعوا قواعده. لإصلاح المشكلة ، فإنه يقبل عرضًا لإنشاء الروس وفتح الباب أمام كارتل. عندما يكتشف الروس أنهم يأخذون ابنة العمدة ثم تبدأ الألعاب الحقيقية.', 'betrayed-2018', 'https://m.media-amazon.com/images/M/MV5BMTgxOTY5MzA2OV5BMl5BanBnXkFtZTcwNzQ0NjgyNA@@._V1_SX300.jpg', 6.3, 'WEB-DL', 0, 1, 1803, '2019-04-10 22:42:17', '2019-04-12 10:46:45'),
(1800, 'مشاهدة فيلم Operation Finale 2018 مترجم', 'مشاهدة فيلم السيرة الذاتية والدراما Operation Finale 2018 مترجم بجودة WEB-DL مشاهدة مباشرة اون لاين. تأتي هذه القصة الحقيقية المثيرة بعد 15 عام من الحرب العالمية الثانية في أعقاب المهمة السرية لعام 1960 لعميل الموساد الأسطوري (بيتر مالكين) حيث يتسلل إلى الأرجنتين ويتعقب (أدولف أيخمان) الضابط النازي الذي دبر النقل اللوجستي الذي جلب الملايين من الأبرياء اليهود إلى موتهم في معسكرات الاعتقال النازية.', 'operation-finale-2018', 'https://m.media-amazon.com/images/M/MV5BYzE1YjI2MjctZTY2Zi00NDBhLWIzYmMtNzMzMDgwZjE4MzUxXkEyXkFqcGdeQXVyNTI4MzE4MDU@._V1_SX300.jpg', 6.5, 'WEB-DL', 0, 1, 1804, '2019-04-10 22:42:24', '2019-04-12 10:46:45'),
(1801, 'مشاهدة فيلم Terrortory 2 2018 مترجم', 'مشاهدة وتحميل فيلم الرعب Terrortory 2 2018 بجودة WEB-DL مترجم اون لاين وتحميل مباشر. “أربع قصص تقشعر لها الأبدان مرتبطة ببعضها يسردها رجل واحد، يُسافر في انحاء الأراضي المعروفة باسم الـ(تيريورتي)، بها العديد من الوحوش، ولكل منهم نقطة ضعف، أو قاعدة عامة.”', 'terrortory-2-2018', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTQ5NDgxODM2M15BMl5BanBnXkFtZTgwNzk4OTkxMDI@._V1_SX300.jpg', 4.1, 'WEB-DL', 0, 1, 1805, '2019-04-10 22:42:25', '2019-04-12 10:46:45'),
(1802, 'مشاهدة فيلم The Amityville Murders 2018 مترجم', 'مشاهدة وتحميل فيلم الرعب The Amityville Murders 2018 مترجم بجودة WEB-DL كامل اون لاين. في ليلة 13 نوفمبر 1974 ، اتخذ رونالدو ديفو الابن بندقية ذات قوة عالية وقتل جميع أفراد عائلته وهم نيام. في محاكمته ، ادعى أن “أصوات” في المنزل أمرته بالقتل. هذه قصتهم.', 'the-amityville-murders-2018', 'https://m.media-amazon.com/images/M/MV5BYmE1MGFhMjgtNTdmYS00NmZmLTgzOWUtOWEzMWI4ZWIxYTE4XkEyXkFqcGdeQXVyNDc1NDI4MTU@._V1_SX300.jpg', 5, 'WEB-DL', 0, 1, 1806, '2019-04-10 22:42:31', '2019-04-12 10:46:45'),
