(2117, 'مشاهدة فيلم White Boy Rick 2018 مترجم', 'مشاهدة وتحميل فيلم الجريمة والدراما White Boy Rick 2018 بجودة BluRay مترجم اون لاين وتحميل مباشر. قصة المراهق (ريتشارد ويرش الأصغر)، والذي أصبح مخبرًا سريًا لمكتب التحقيقات الفيدرالي خلال الثمانينات، ثم تم اعتقاله في نهاية المطاف، وحُكم عليه بالسجن المؤبد لإتجاره بالمخدرات.', 'white-boy-rick-2018', 'https://m.media-amazon.com/images/M/MV5BNjQ5MzY4NjQ4Nl5BMl5BanBnXkFtZTgwMzc1NjU4NjM@._V1_SX300.jpg', 6.5, 'BluRay', 0, 1, 2121, '2019-04-12 10:22:10', '2019-04-12 10:46:46'),
