(2126, 'مشاهدة فيلم Bleach 2018 مترجم', 'مشاهدة فيلم Bleach 2018 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر بعدما يُمنح طالب الثانوية “إيتشيغو” قدرات حاصدة للأرواح فجأةً، يشعر برغبة شديدة في ردّ هذه القوى… ولكن سيتعيّن عليه حصد بعض الأرواح أولًا.', 'bleach-2018', 'https://m.media-amazon.com/images/M/MV5BZjE0YjVjODQtZGY2NS00MDcyLThhMDAtZGQwMTZiOWNmNjRiXkEyXkFqcGdeQXVyNTA4NzY1MzY@._V1_SX300.jpg', 8.2, 'BluRay', 0, 1, 2130, '2019-04-12 10:23:15', '2019-04-12 10:46:46'),
(2127, 'مشاهدة فيلم Sobibor 2018 مترجم', 'مشاهدة وتحميل فيلم الدراما والتاريخي Sobibor 2018 مترجم بجودة bluray كامل أون لاين. تدور أحداث الفيلم حول معسكر الانتفاضة (سوبيبور) والذي يتم إبادته خلال الحرب العالمية الثانية، حيث كان هناك ضابط روسي أسير حرب.', 'sobibor-2018', 'https://m.media-amazon.com/images/M/MV5BNWUwYTJiZTAtNjcyNS00MjBmLWE4YTgtN2VjNTdmM2ZhM2UzXkEyXkFqcGdeQXVyMTExNDQ2MTI@._V1_SX300.jpg', 6.3, 'bluray', 0, 1, 2131, '2019-04-12 10:23:19', '2019-04-12 10:46:46'),
(2128, 'مشاهدة فيلم Reversing Roe 2018 مترجم', 'مشاهدة و تحميل فيلم الوثائقي Reversing Roe 2018 مترجم اون لاين جودة WEB-DL وتحميل مباشر مشاهدة اون لاين مباشرة نظرة تاريخية عميقة على واحدة من أكثر القضايا إثارة للجدل في عصرنا ، والتي تسلط الضوء على النقاش حول الإجهاض من نقاط مختلفة على طول الطيف الأيديولوجي في قصة متعرجة للإجهاض في أمريكا.', 'reversing-roe-2018', 'https://m.media-amazon.com/images/M/MV5BOTg1NzE4NDcxMl5BMl5BanBnXkFtZTgwNzE2MzEzNjM@._V1_SX300.jpg', 7.4, 'WEB-DL', 0, 1, 2132, '2019-04-12 10:23:27', '2019-04-12 10:46:46'),
(2130, 'مشاهدة فيلم Student A 2018 مترجم', 'مشاهدة فيلم الدراما Student A 2018 مترجم بجودة HD مشاهدة مباشرة اون لاين. تدور قصة الفيلم حول طالبة المدرسة المتوسطة الانطوائية مي راي (كيم هوان هي)، التي تعاني من انعدام في الثقة بالنفس. تحب الألعاب الإكترونية ولديها موهبة الكتابة، لكنها تجد التواصل مع الأخرين أمر صعب. من خلال صداقتها مع جاي هي (سوهو)، بيك هاب (جونغ دا بين) وتاي يانغ (يو جاي سانغ)، تنضج مي راي بينما تتعلم عن الحياة.', 'student-a-2018', 'https://m.media-amazon.com/images/M/MV5BNTQzNGYzYTQtMWU0Mi00NDU2LTgxZmUtYWFhZDdjM2QzYWNmXkEyXkFqcGdeQXVyNDcyMjQ4MzU@._V1_SX300.jpg', 0, 'HD', 0, 1, 2134, '2019-04-12 10:23:41', '2019-04-12 10:46:46'),
(2131, 'مشاهدة فيلم Curse of the Nun 2018 مترجم', 'مشاهدة فيلم Curse of the Nun 2018 بجودة HDRip مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر شابة محطمة نفسيًا تبحث عن منزل جديد، ولكن روح راهبة تحاول تبقيها في مكانها.', 'curse-of-the-nun-2018', 'uploads/272021296040.jpg', NULL, 'HDRip', 1, 1, 2135, '2019-04-12 10:23:48', '2019-04-12 10:46:55'),
