(2201, 'مشاهدة فيلم Hearts Beat Loud 2018 مترجم', 'مشاهدة فيلم Hearts Beat Loud 2018 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر يقوم أب بالمشاركة مع إبنته بتشكيل فرقة غنائية في الأجازة الصيفية قبل إنتقالها للجامعة في حين يتعرض لأزمة مالية وعلى وشك أن يخسر متجره.', 'hearts-beat-loud-2018', 'https://m.media-amazon.com/images/M/MV5BMjA2MTM2MjcxNV5BMl5BanBnXkFtZTgwMzI3ODgyNTM@._V1_SX300.jpg', 6.9, 'WEB-DL', 0, 1, 2205, '2019-04-12 10:51:03', '2019-04-12 10:55:10'),
(2203, 'مشاهدة فيلم Mandy 2018 مترجم', 'مشاهدة فيلم Mandy 2018 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر تقع الأحداث في البرية البدائية عام 1983، حيث (ريد ميلر) رجل مكسور القلب ومُحبَط، يطارد الطائفة التي قامت بخطف حُب حياته (ماندي).. كانت ماندي تقضي أيامها في قراءة أوراقها الخيالية. وذات يوم، أسرت عينْي قائد طائفة مجنونة؛ فقام بتجنيد مجموعة من الدرّاجين الناريين لاختطافها. يتزود ريد بالمنشار وأسلحة أخرى، ثم ينطلق في رحلته مُخلفًا ورائه جثث تغمرها الدماء، ولا ينتوي أن يتوقف قبل استرجاع محبوبته.', 'mandy-2018', 'https://m.media-amazon.com/images/M/MV5BMjk1MjhmZWQtNzU3OC00NDE4LThlODQtNTdhZGM4M2E3MWZkXkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg', 6.6, 'BluRay', 0, 1, 2207, '2019-04-12 10:51:14', '2019-04-12 10:55:06'),
(2204, 'مشاهدة فيلم The Angel 2018 مترجم', 'مشاهدة وتحميل فيلم الدراما والاثارة The Angel 2018 مترجم بجودة WEB-DL كامل اون لاين. بينما تتأهّب بلاده لخوض الحرب، يتواصل المسؤول المصريّ الكبير “أشرف مروان” مع “إسرائيل”، وينخرط في لعبة جاسوسيّة غامضة عالية المخاطر.', 'the-angel-2018', 'https://m.media-amazon.com/images/M/MV5BMTEzOTY5ODA2MDReQTJeQWpwZ15BbWU4MDI5NDkyMTYz._V1_SX300.jpg', 6.7, 'WEB-DL', 0, 1, 2208, '2019-04-12 10:51:23', '2019-04-12 10:55:05'),
(2205, 'مشاهدة فيلم The Predator 2018 مترجم', 'مشاهدة وتحميل فيلم الاكشن والمغامره The Predator 2018 بجودة BluRay مترجم اون لاين وتحميل مباشر. يقع مجموعة من الرجال وجهًا لوجه مع وحش كاسر في غابة موحشة بمفردهم، وواحدًا تلو اﻵخر، يضيعون في الغابة ويصير كل منهم جثة مسلوخة معلقة على الشجر، ولذلك حينما يظهر الناجي الوحيد من مواجهة سابقة مع نفس الوحش، يكتشفون أنهم في مشكلة أكبر مما تخيلوا.', 'the-predator-2018', 'https://m.media-amazon.com/images/M/MV5BMjM5MDk2NDIxMF5BMl5BanBnXkFtZTgwNjU5NDk3NTM@._V1_SX300.jpg', 5.4, 'BluRay', 0, 1, 2209, '2019-04-12 10:51:31', '2019-04-12 10:55:05'),
(2207, 'مشاهدة فيلم Redbad 2018 مترجم', 'مشاهدة وتحميل فيلم المغامره Redbad 2018 بجودة BluRay مترجم اون لاين وتحميل مباشر. في قالب من المغامرات الشيقة، تقع صراعات للقوى بين ريدباد الفريسي من جهة وبين خصمه اللدود بيبين من آل فرانك.', 'redbad-2018', 'https://m.media-amazon.com/images/M/MV5BNTFiODcxNDAtMTJlMS00NWI5LWFlM2EtZTBkNjQ2NWUzOWUyXkEyXkFqcGdeQXVyMTcwMjE4MTQ@._V1_SX300.jpg', 5.5, 'BluRay', 0, 1, 2211, '2019-04-12 10:51:37', '2019-04-12 10:55:02'),
(2208, 'مشاهدة فيلم Sparring 2017 مترجم', 'مشاهدة وتحميل فيلم الدراما والرياضي Sparring 2017 بجودة WEB-DL مترجم كامل اون لاين مشاهدة مباشرة يوتيوب ستيف لاندري ، الملاكم المتقادم الذي يتكبد خسائر أكثر من الانتصارات ، يقبل بأن يصبح شريكاً في المناكسة لبطل صاعد في محاولة أخيرة للبقاء على صلة.', 'sparring-2017', 'https://m.media-amazon.com/images/M/MV5BYzczZDg4MWYtMjVkOS00ODJhLTk0ZGEtN2RiNWQwZTNkYjMxXkEyXkFqcGdeQXVyNDY2NDMxNDY@._V1_SX300.jpg', 6.1, 'WEB-DL', 0, 1, 2212, '2019-04-12 10:51:45', '2019-04-12 10:55:00'),
(2209, 'مشاهدة فيلم The Basement 2018 مترجم', 'مشاهدة وتحميل فيلم الرعب The Basement 2018 بجودة WEB-DL مترجم كامل اون لاين مشاهدة مباشرة يوتيوب يختطف رجل بريء على ما يبدو من قبل قاتل متسلسل ل.أ. سيئ السمعة ، الذي يجبر ضحاياه على تبديل الأدوار معه حتى يتمكن من سن القبض عليه ، والتعذيب والقتل.', 'the-basement-2018', 'https://m.media-amazon.com/images/M/MV5BMTEwNTUwMDItYTI0MC00MDFlLWJlZmQtOTk0ODA1NTMxNWQ1XkEyXkFqcGdeQXVyMTMyMjI0MjQ@._V1_SX300.jpg', 3.7, 'WEB-DL', 0, 1, 2213, '2019-04-12 10:51:52', '2019-04-12 10:54:58'),
(2211, 'مشاهدة فيلم The Mars Generation 2017 مترجم', 'مشاهدة وتحميل فيلم الوثائقي The Mars Generation 2017 مترجم بجودة WEB-DL كامل أون لاين. يسعى المراهقون الذين يعترفون بأنهم “مهووسون بالفضاء” إلى تحقيق “أحلامهم بالسفر إلى المريخ، بينما يتأمل خبراء في تاريخ ومستقبل.', 'the-mars-generation-2017', 'https://m.media-amazon.com/images/M/MV5BMjQxMzE4MTAxMV5BMl5BanBnXkFtZTgwNTYyMjUyMjI@._V1_SX300.jpg', 6.5, 'WEB-DL', 0, 1, 2215, '2019-04-12 10:52:09', '2019-04-12 10:54:57'),
(2213, 'مشاهدة فيلم Confidence 2003 مترجم', 'مشاهدة وتحميل فيلم الجريمة والاثارة Confidence 2003 بجودة WEB-DL مترجم اون لاين وتحميل مباشر. يستعد جيك فيغ على سحب أكبر مجموعة له ،للانتقام لمقتل صديقه. لكن الفضيحة الاخيرة لها نتائج عكسية، وتترك مدين لزعيم عصابة والمنفذ', 'confidence-2003', 'https://m.media-amazon.com/images/M/MV5BNGQ2OTc5OTgtZmU1My00OWRlLWJkMGEtNjMxY2E1NGE3Y2Q3XkEyXkFqcGdeQXVyMTIxMzMzMzE@._V1_SX300.jpg', 6.7, 'WEB-DL', 0, 1, 2217, '2019-04-12 10:52:18', '2019-04-12 10:54:48'),
(2214, 'مشاهدة فيلم The Show Must Go On 2007 مترجم', 'مشاهدة وتحميل فيلم الاكشن والدراما The Show Must Go On 2007 بجودة HDTV مترجم كامل اون لاين مشاهدة مباشرة يوتيوب نكران مفعمة بالضجيج عن رجل عصابات بدوام جزئي يحاول أن يكون أبًا متفرغًا ويريد أن يعيش حياة سلمية مع عائلته على الرغم من وجوده في مشكلة طوال الوقت تقريبًا ، نظرًا لمهنته.', 'the-show-must-go-on-2007', 'https://m.media-amazon.com/images/M/MV5BYWNiZWM2OTAtYjg2Mi00NTc2LWJlN2YtYTkwMzVkOGE4NzgxXkEyXkFqcGdeQXVyNTAyODkwOQ@@._V1_SX300.jpg', 7, 'HDTV', 4, 1, 2218, '2019-04-12 10:52:26', '2019-04-12 11:01:22'),
(2215, 'مشاهدة فيلم Planet dinosaur: ultimate killers 2012 مترجم', 'مشاهدة فيلم الوثائقي Planet dinosaur: ultimate killers 2012 مترجم بجودة bluray مشاهدة مباشرة اون لاين. مشاهدة الفيلم الوثائقي Planet dinosaur: ultimate killers 2012 مترجم بجودة 720p bluray مشاهدة مباشرة اون لاين', 'planet-dinosaur-ultimate-killers-2012', 'https://m.media-amazon.com/images/M/MV5BYzM5MDYzNDMtNzFiMy00ZGE5LTk4OWYtNTg2YjkwZDIwYmRlXkEyXkFqcGdeQXVyMjc5NzcwNDc@._V1_SX300.jpg', 7.3, 'bluray', 0, 1, 2219, '2019-04-12 10:52:36', '2019-04-12 10:54:39'),
(2216, 'مشاهدة فيلم Duel The Final Round 2016 مترجم', 'مشاهدة وتحميل فيلم ال Duel The Final Round 2016 بجودة WEB-DL مترجم اون لاين وتحميل مباشر. تنقلب حياة بونغ هوو (Lee Joo Seung) الهانئة إلى ماسأة بعد حدوث مصيبة لأخيه الذي كان يحقق في جريمة قتل فيسعى للإنتقام ويجد أمامه رئيس تنفيذي كبير مهووس بألعاب الفيديو القتالية وتطبيقها على أرض الواقع.', 'duel-the-final-round-2016', 'uploads/1564598319.jpg', NULL, 'WEB-DL', 1, 1, 2220, '2019-04-12 10:52:44', '2019-04-12 11:27:15'),
(2217, 'مشاهدة فيلم A Reckoning 2018 مترجم', 'مشاهدة فيلم A Reckoning 2018 بجودة HDRip مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر أرملة تسعى إلى الإنتقام من قاتل زوجها وترك كل شيء وراءها لمطاردة.', 'a-reckoning-2018', 'https://m.media-amazon.com/images/M/MV5BYmYyZTIyZTQtNmNmYy00N2Q4LWI0MjMtNmEwM2E2YzRhOTY1XkEyXkFqcGdeQXVyNjI2ODA4MDU@._V1_SX300.jpg', 3.4, 'HDRip', 0, 1, 2221, '2019-04-12 10:52:51', '2019-04-12 10:54:37'),
(2218, 'مشاهدة فيلم My Teacher My Obsession 2018 مترجم', 'مشاهدة وتحميل فيلم الدراما My Teacher My Obsession 2018 بجودة WEBRip مترجم اون لاين وتحميل مباشر. تكافح رايلي لمقابلة الأصدقاء بعد الانتقال إلى مدرسة ثانوية جديدة حيث يعمل والدها مدرسًا للغة الإنجليزية. عندما تقابل كيلا، زميل وحيد، يصبحون أصدقاء مقربين حتى يتعلم رايلي أن كيلا مهووسة بأبيها.', 'my-teacher-my-obsession-2018', 'https://m.media-amazon.com/images/M/MV5BZTI1YTA5ZTMtZjZkYy00ZWVkLTgwMTYtNWM2ZDQ5M2M4MDk5XkEyXkFqcGdeQXVyNTYxMjExMzY@._V1_SX300.jpg', 4.4, '0', 0, 1, 2222, '2019-04-12 10:52:58', '2019-04-12 10:54:36'),
(2219, 'مشاهدة فيلم Affairs of State 2018 مترجم', 'مشاهدة فيلم Affairs of State 2018 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر أحد معاوني حملة الشباب يجلس على رأسه عندما ينام مع زوجته وابنته لمرشح رئاسي فقط لينتهي به الأمر نزولاً على جانب طريق فارغ في الليل.', 'affairs-of-state-2018', 'https://m.media-amazon.com/images/M/MV5BYWFiY2JmYWYtOWMzNy00ZGZjLTgwMjEtNDg4ZDA1YjM0Mzk5XkEyXkFqcGdeQXVyOTg4MDYyNw@@._V1_SX300.jpg', 4.5, 'BluRay', 0, 1, 2223, '2019-04-12 10:52:59', '2019-04-12 10:54:34'),
(2220, 'مشاهدة فيلم Becoming Warren Buffett 2017 مترجم', 'مشاهدة وتحميل فيلم الوثائقي Becoming Warren Buffett 2017 بجودة WEB-DL مترجم اون لاين وتحميل مباشر. بدأ المستثمر الأسطوري كصبي طموح ، مهووس بالأرقام من نبراسكا وانتهى به الأمر إلى أن أصبح واحداً من أغنى الرجال وأكثرهم احتراما في العالم.', 'becoming-warren-buffett-2017', 'https://m.media-amazon.com/images/M/MV5BOTliNWZhYWItMDE1Ni00Y2EzLWFjNjctZmIyMjA5NTU5OGJmL2ltYWdlXkEyXkFqcGdeQXVyNjkxNDM2MjA@._V1_SX300.jpg', 7.6, 'WEB-DL', 0, 1, 2224, '2019-04-12 10:53:00', '2019-04-12 10:54:33'),
(2221, 'مشاهدة فيلم Breaking the Cycle 2017 مترجم', 'مشاهدة فيلم Breaking the Cycle 2017 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر يزور مدير سجن هالدن ، وهو السجن الأكثر إنسانية في النرويج ، السجون الأمريكية التي تحاول تشجيع تغيير طرق إعادة التأهيل في السجن.', 'breaking-the-cycle-2017', 'https://m.media-amazon.com/images/M/MV5BODIyOTUyOTM0OV5BMl5BanBnXkFtZTcwNjMzMDMyMQ@@._V1_SX300.jpg', 4.4, 'WEB-DL', 0, 1, 2225, '2019-04-12 10:53:09', '2019-04-12 10:54:31'),
(2222, 'مشاهدة فيلم Cries from Syria 2017 مترجم', 'مشاهدة وتحميل فيلم الوثائقي والدراما Cries from Syria 2017 مترجم بجودة WEB-DL كامل أون لاين. صرخات من سوريا [مدبلج] / سرد شامل للصراع الوحشي المستمر منذ 5 اعوام يستعرض خلالها مشاهد حقيقية قام بتوثيقها عدد من النشطاء السوريين والصحفيين والمواطنين بالاضافة الى شهادة المتظاهرين الاطفال وقادة الثورة الانسانيين الذين يدافعون عن حقوق الانسان', 'cries-from-syria-2017', 'https://m.media-amazon.com/images/M/MV5BZjY4ZDZiY2EtOWM5OS00ZjZhLTlkNTAtZDYxY2JiMzVmYjBjXkEyXkFqcGdeQXVyNDExMzMxNjE@._V1_SX300.jpg', 7.9, 'WEB-DL', 0, 1, 2226, '2019-04-12 10:53:15', '2019-04-12 10:54:30'),
(2223, 'مشاهدة فيلم Iliza: Elder Millennial 2018 مترجم', 'مشاهدة فيلم الكوميديا Iliza: Elder Millennial 2018 مترجم بجودة WEB-DL مشاهدة مباشرة اون لاين. في فيلم استعراضي كوميدي. تتعمّق الفنّانة الكوميدية المخطوبة حديثًا “إلايزا شليسنغر” في حقائق دامغة عن الحياة في سنّ الـ 35، وجنون الماضي، وما يخبّئه المستقبل.', 'iliza-elder-millennial-2018', 'https://m.media-amazon.com/images/M/MV5BNTE2ZmFmYTctOGQyNy00OGNkLTgxYWMtYTVlYzMyMzAyZGRiXkEyXkFqcGdeQXVyNzE3MDkxODc@._V1_SX300.jpg', 7.2, 'WEB-DL', 0, 1, 2227, '2019-04-12 10:53:24', '2019-04-12 10:54:29'),
(2224, 'مشاهدة فيلم Aprils Daughter 2017 مترجم', 'مشاهدة وتحميل فيلم الدراما Aprils Daughter 2017 بجودة WEB-DL مترجم اون لاين وتحميل مباشر. (فاليريا) حامل في السابعة عشرة من عمرها، تعيش في (برتو فالارتا) مع أختها الغير شقيقة (كلارا). فاليريا لا ترغب في أن تكتشف والدتها (أبريل) – الغائبة منذ وقت طويل – أنها حامل، لكن بسبب الضغط الاقتصادي والمسئولية الكبيرة بعد وجود طفل في المنزل تقرر كلارا الاتصال بوالدتها.. تصل أبريل لابنتيها، وحينها ندرك لماذا أرادتها فاليريا بعيدًا.', 'aprils-daughter-2017', 'uploads/23956340946.jpg', NULL, 'WEB-DL', 0, 1, 2228, '2019-04-12 10:53:34', '2019-04-12 10:54:28'),
(2225, 'مشاهدة فيلم Robin Williams: Come Inside My Mind 2018 مترجم', 'مشاهدة فيلم Robin Williams: Come Inside My Mind 2018 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر يقدم هذا الفيلم الوثائقي الصورة المرحة والمفجعة بآن واحد لقصة الفنان الكوميدي المبدع والمحبوب. يتحدث هذا الوثائقي بكلمات الفنان روبن ويليامز، كما يحتفل بما قدمه هذا الفنان من عطاء للكوميديا من أواخر السبعينيات حتى وفاته في سنة 2014.', 'robin-williams-come-inside-my-mind-2018', 'https://m.media-amazon.com/images/M/MV5BN2IwOGY4MjktNTgzOS00MTM4LTkxMmMtYjY2M2E5ZDA2NGQxXkEyXkFqcGdeQXVyMjg1MjI3MDA@._V1_SX300.jpg', 8, 'WEB-DL', 0, 1, 2229, '2019-04-12 10:53:35', '2019-04-12 10:54:28'),
(2226, 'مشاهدة فيلم Trophy 2017 مترجم', 'مشاهدة وتحميل فيلم الوثائقي Trophy 2017 بجودة WEB-DL مترجم اون لاين وتحميل مباشر. يناقش فكرة الصيد الجائر، حيث يسلط الضوء علي مدى تأثير هذا النشاط على الحياة البرية، وما هو دورنا في حماية الأنواع والفصائل المختلفة الموجودة على الأرض من الانقراض', 'trophy-2017', 'https://m.media-amazon.com/images/M/MV5BNjI5NGNiMjAtYzUzZS00YjMzLTg1ODctODcyNTRiMzU0NTVhXkEyXkFqcGdeQXVyNzI2NjI5MzY@._V1_SX300.jpg', 7.4, 'WEB-DL', 0, 1, 2230, '2019-04-12 10:53:42', '2019-04-12 10:54:28'),
(2227, 'مشاهدة فيلم Godard Mon Amour 2017 مترجم', 'مشاهدة وتحميل فيلم السيرة الذاتية والكوميديا Godard Mon Amour 2017 بجودة BluRay مترجم اون لاين وتحميل مباشر. خلال تصوير أحد أفلامه، يقع المخرج الفرنسي الشهير (جان-لوك جودارد) في غرام الممثلة اليافعة (آن ويازمسكي) صاحبة السبعة عشر ربيعًا وبعد توطد علاقتهما يتزوجان.', 'godard-mon-amour-2017', 'https://m.media-amazon.com/images/M/MV5BYTNkNGQ0MDctNGNjMS00Y2NhLTk4MTItYjMyMDczZWVjMTJkXkEyXkFqcGdeQXVyNjc0MzY3NTA@._V1_SX300.jpg', 6.7, 'BluRay', 2, 1, 2231, '2019-04-12 10:53:52', '2019-04-12 11:05:59'),
(2228, 'مشاهدة فيلم On My Skin 2018 مترجم', 'مشاهدة وتحميل فيلم الدراما On My Skin 2018 مترجم بجودة WEB-DL كامل اون لاين. في روما، يُقبض على “ستيفانو كوكي” في قضيّة مخدّرات، ليمُضي أسبوعًا مروّعًا في الحبس يُغيّر حياة عائلته للأبد. فيلم مستوحًى من أحداث واقعية', 'on-my-skin-2018', 'uploads/27399199059.jpg', 0, 'WEB-DL', 0, 1, 2232, '2019-04-12 10:53:52', '2019-04-12 10:54:24'),
