(2571, 'مشاهدة فيلم Custody 2017 مترجم', 'مشاهدة وتحميل فيلم الدراما Custody 2017 بجودة BluRay مترجم اون لاين وتحميل مباشر. بعيون صبي صغير يُدعى جوليان بيسون (ثوماس غيوريا)، نتعرّف على قصة زواج متهالك يرمي بظلاله على حياة هذا الطفل الذي يجد نفسه طرفاً في معركة لم يخترها.', 'custody-2017', 'https://m.media-amazon.com/images/M/MV5BMGI4M2FlNjQtNDE3ZC00OTY4LThjYWEtZWEwMjhiZDQyMWM0XkEyXkFqcGdeQXVyMjgyNjk3MzE@._V1_SX300.jpg', 7.5, 'BluRay', 0, 1, 2575, '2019-04-12 11:54:25', '2019-04-12 11:57:07'),
(2572, 'مشاهدة فيلم Journeyman 2017 مترجم', 'مشاهدة وتحميل فيلم الدراما والرياضي Journeyman 2017 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب تدور أحداث قصة فيلم الدراما الرياضي ” رحلة رجل ” حول الملاكم ماتي بيرتون يعاني من إصابة خطيرة في الرأس خلال القتال. تدور حول تأثير ذلك على زواجه وحياته وعائلته', 'journeyman-2017', 'https://m.media-amazon.com/images/M/MV5BMjAzOTY1NjE0NF5BMl5BanBnXkFtZTcwMjk0MDA1MQ@@._V1_SX300.jpg', 8.1, 'BluRay', 0, 1, 2576, '2019-04-12 11:54:30', '2019-04-12 11:57:07'),
(2573, 'مشاهدة فيلم Stefan Zweig Farewell to Europe 2016 مترجم', 'مشاهدة وتحميل فيلم السيرة الذاتية والدراما Stefan Zweig Farewell to Europe 2016 مترجم بجودة BluRay كامل أون لاين. قبل الفجر يرسم سنوات المنفى في حياة الكاتب النمساوي الشهير ستيفان زويج ، صراعه الداخلي من أجل “الموقف الصحيح” تجاه الأحداث في أوروبا التي مزقتها الحرب ، وبحثه عن منزل جديد.', 'stefan-zweig-farewell-to-europe-2016', 'https://m.media-amazon.com/images/M/MV5BYzE4MzFhMDQtYmQ2ZS00MGU5LTkzNmItMmEzODc1YWQwNGI2XkEyXkFqcGdeQXVyMjY1OTYyMDA@._V1_SX300.jpg', 6.7, 'BluRay', 0, 1, 2577, '2019-04-12 11:54:33', '2019-04-12 11:57:06'),
(2574, 'مشاهدة فيلم The Guernsey Literary and Potato Peel Pie Society 2018 مترجم', 'مشاهدة فيلم The Guernsey Literary and Potato Peel Pie Society 2018 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر تدور احداث قصه فيلم الدراما والرومانسية التاريخي The Guernsey Literary and Potato Peel Pie Society 2018 ” جمعية غيرنسي ” حول تشكل الكاتبة رابطة غير متوقعة مع سكان جزيرة غيرنسي في أعقاب الحرب العالمية الثانية ، عندما تقرر كتابة كتاب عن تجاربهم خلال الحرب', 'the-guernsey-literary-and-potato-peel-pie-society-2018', 'https://m.media-amazon.com/images/M/MV5BNjIyNzhhMmQtMjNlZS00MGRkLWE0ODgtY2E4MGMzMjk2M2IzXkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg', 7.4, 'WEB-DL', 0, 1, 2578, '2019-04-12 11:54:37', '2019-04-12 11:57:06'),
(2575, 'مشاهدة فيلم Broken Arrow 1996 مترجم', 'مشاهدة وتحميل فيلم الاكشن والمغامره Broken Arrow 1996 بجودة BluRay مترجم اون لاين وتحميل مباشر. يستخدم مصطلح السهم المكسور عند فقد أسلحة نووية. (فيك ديكنز) و(رايلي هال) هما صديقان وشركاء في التدريب والقتال، يتم تكليفهما بإجراء مناورات تدريبية باستخدام صواريخ نووية حقيقية. ينقلب فيك على صديقه رايلي في أثناء التدريبات ويحاول قتله، ويقوم فيك بسرقة اثنين من الرؤوس النووية.', 'broken-arrow-1996', 'https://m.media-amazon.com/images/M/MV5BYzU2NDg3ZTItNzRmNy00NTQzLTljMDUtNjczOTMwZjEzNWVkXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 6, 'BluRay', 0, 1, 2579, '2019-04-12 11:54:40', '2019-04-12 11:57:04'),
(2577, 'مشاهدة فيلم The Second 2018 مترجم', 'مشاهدة وتحميل فيلم الغموض والاثارة The Second 2018 مترجم بجودة WEB-DL كامل أون لاين. مؤلفة شهيرة تشعر بالتهديد عندما يكشف رفيقها وصديقتها سر مُظلم خلف روايتها الأولى كاشفين الأكاذيب والخيانة وجريمة قتل من ورائها.', 'the-second-2018', 'https://m.media-amazon.com/images/M/MV5BNGQxYWJmZjktZWEwMC00MmUzLWE4ZTktOTA3YWQwMGRjZGM2XkEyXkFqcGdeQXVyNDIwNzQ4Mw@@._V1_SX300.jpg', 5, 'WEB-DL', 0, 1, 2581, '2019-04-12 11:54:46', '2019-04-12 11:57:02'),
