(2583, 'مشاهدة فيلم The Incantation 2018 مترجم', 'مشاهدة وتحميل فيلم المغامره والفانتازيا The Incantation 2018 مترجم بجودة WEB-DL كامل أون لاين. فتاة أمريكية شابة فرصة العمر لزيارة قلعة أجدادها في جنوب فرنسا ، لتكتشف أن عائلتها تخفي أسراراً عميقة ومظلمة عن ماضيها الشنيع ، بعيدًا عن أعين المتطفلين.', 'the-incantation-2018', 'https://m.media-amazon.com/images/M/MV5BMjFjZmJlMzItMjlmYy00NGI2LTllODMtOWQzZTc3NTQ5NzY4XkEyXkFqcGdeQXVyMjQ0NzI5NjI@._V1_SX300.jpg', 3.1, 'WEB-DL', 0, 1, 2587, '2019-04-12 11:55:05', '2019-04-12 11:56:54'),
