(2712, 'مشاهدة فيلم Erin Brockovich 2000 مترجم', 'مشاهدة و تحميل فيلم السيرة الذاتية والدراما Erin Brockovich 2000 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة الأم “إيرن” التي تمتلك ثلاثة أطفال من زواجين فاشلين، وتظل تبحث عن عمل لإعالة أطفالها، خاصة بعد فشلها في الحصول على تعويض بقضيتها ضد طبيب تسبب لها في عاهة جسدية إثر حادث سيارة.', 'erin-brockovich-2000', 'https://m.media-amazon.com/images/M/MV5BYTA1NWRkNTktNDMxNS00NjE4LWEzMDAtNzA3YzlhYzRhNDA4L2ltYWdlXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 7.3, 'BluRay', 0, 1, 2716, '2019-04-12 14:27:52', '2019-04-12 14:32:14'),
(2713, 'مشاهدة فيلم The Princess and the Matchmaker 2018 مترجم', 'مشاهدة فيلم The Princess and the Matchmaker 2018 بجودة HD مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر عمّ الجفاف أرض كوريا في عام 1753 ويبدو أن الطريقة الوحيدة لينزل المطر هي بزواج الأميرة “سونجهوا” ابنة الملك من الشخص المناسب، تم إحضار كاهن محلي يُدعى “سو دويون” ليدعم الزواج بواسطة تعاويذ علم التنجيم المعقدة والطاقات الكونية المُتنوعة لكن الأميرة لا تُبالي كثيراً بالإعتماد عليه وحده، فقد عانت من سوء الحظ طيلة حياتها وقررت ألا تسمح بوقوع الكارثة مرة أخرى، هربت من القصر للتجسس على الرجال المرشحين ل…', 'the-princess-and-the-matchmaker-2018', 'https://m.media-amazon.com/images/M/MV5BODExNzIyYjgtYjJjYi00ZjU2LWFmZTItZTlkNDZiMjkxYmFkXkEyXkFqcGdeQXVyNzk0NTA5NQ@@._V1_SX300.jpg', 6.3, 'HD', 0, 1, 2717, '2019-04-12 14:28:07', '2019-04-12 14:32:14'),
(2714, 'مشاهدة فيلم 1/1 2018 مترجم', 'مشاهدة و تحميل فيلم الدراما 1/1 2018 مترجم اون لاين جودة WEB-DL وتحميل مباشر مشاهدة اون لاين مباشرة “(ليزا) جريئة وحماسية، وتحلل كل تفاصيل حياتها، عمرها 20 عام تسكن في منطقة (بنسلفانيا) الريفية)، تُهدر حياتها ما بين الجنس الذي مارسته لأول مرة في عمر الـ13، والمخدرات والفقدان والخسارة. عندما تُصدم بأنَّها تقوم بفحوصات خوفًا من أن تكون حاملًا، تنفض تراب موتها وتنهض لحياة مختلفة”', '11-2018', 'uploads/51605982103.jpg', NULL, 'WEB-DL', 0, 1, 2718, '2019-04-12 14:28:11', '2019-04-12 14:32:13'),
(2716, 'مشاهدة فيلم Hou lai de wo men 2018 مترجم', 'مشاهدة وتحميل فيلم الدراما والرومانسية Hou lai de wo men 2018 مترجم بجودة WEB-DL كامل أون لاين. يلتقي غريبان على متن قطار وتنشأ بينهما علاقة تتطوّر على مرّ السنين. وبعد انفصال عارض، يجتمعان مجدّدًا ويفكّران مليًّا بحبّهما لبعضهما.', 'hou-lai-de-wo-men-2018', 'uploads/71732574383.jpg', NULL, 'WEB-DL', 0, 1, 2720, '2019-04-12 14:28:19', '2019-04-12 14:32:09'),
(2717, 'مشاهدة فيلم To Each His Own 2017 مترجم', 'مشاهدة وتحميل فيلم الكوميديا To Each His Own 2017 مترجم بجودة HD كامل اون لاين. آوياما تاكاشي موظف مكتب مثقل بأعباء عمل جمّة ويضغط نفسه ذهنياً بشدة، يفقد الوعي وينهار في محطة قطارٍ فينقذه يوماموتو الذي يتحدث بلكنة أهل أوساكا. يستعيد آوياما شخصيته المتألقة عقب لقائه مع يوماموتو ويحرز نتائجاً أفضل في العمل. وذات يوم يرى آوياما صدفةً يوماموتو راكباً حافلة متجهة نحو المقبرة وتعلو وجهه تعابير من الجدية..', 'to-each-his-own-2017', 'https://m.media-amazon.com/images/M/MV5BZWMxNTc4N2ItYWIzNi00NWIzLTg4ZTEtODc2NzI2MGRlYTdkXkEyXkFqcGdeQXVyNjc0MzMzNjA@._V1_SX300.jpg', 7.8, 'HD', 0, 1, 2721, '2019-04-12 14:28:23', '2019-04-12 14:32:08'),
(2725, 'مشاهدة فيلم Burning 2018 مترجم', 'مشاهدة وتحميل فيلم الدراما والغموض Burning 2018 بجودة HD مترجم كامل اون لاين مشاهدة مباشرة يوتيوب امرأة تتشابك حياتها مع رجلين، أحدهما غني والآخر رجل توصيل يصارع لجعل أطراف حياته تتلاقى.', 'burning-2018', 'https://m.media-amazon.com/images/M/MV5BNzJiOTA5NGQtOTI2MS00ZDE0LTlmZjQtZmQ1OTA1ZmJiYzgyXkEyXkFqcGdeQXVyMTA2ODMzMDU@._V1_SX300.jpg', 7.6, 'HD', 0, 1, 2729, '2019-04-12 14:29:37', '2019-04-12 14:32:03'),
(2729, 'مشاهدة فيلم Ghost Machine 2009 مترجم', 'مشاهدة فيلم Ghost Machine 2009 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر تدور قصة الفيلم حول مجموعة أشخاص يسرقون جهاز محاكاة قتالي متطور، ويحولون حياة الجميع إلى معارك دامية.', 'ghost-machine-2009', 'https://m.media-amazon.com/images/M/MV5BMTczNzkxMjQ4Ml5BMl5BanBnXkFtZTgwOTk3MjA2MDE@._V1_SX300.jpg', 4.8, 'BluRay', 0, 1, 2733, '2019-04-12 14:29:47', '2019-04-12 14:32:00'),
(2731, 'مشاهدة فيلم Tully 2018 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والدراما Tully 2018 بجودة BluRay مترجم اون لاين وتحميل مباشر. مارلو (تشارليز ثيرون) أم لثلاثة أطفال، أحدهم مولود جديد.. تحظى مارلو بهدية من شقيقها تتمثل في جليسة أطفال ليلية (ماكنزي دافيس)؛ الطالبة الجامعية التي تساعد مارلو على إيجاد الوقت والطاقة وتقلب حياتها رأسًا على عقب بشكل إيجابي وطرق غير متوقعة.', 'tully-2018', 'https://m.media-amazon.com/images/M/MV5BMTU0OTM4NTMyMF5BMl5BanBnXkFtZTgwNDA5MzUwNTM@._V1_SX300.jpg', 7, 'BluRay', 0, 1, 2735, '2019-04-12 14:29:49', '2019-04-12 14:33:34'),
(2733, 'مشاهدة فيلم Keys to the Heart 2018 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والدراما Keys to the Heart 2018 بجودة HD مترجم اون لاين وتحميل مباشر. بطل آسيا السابق في الملاكمة (لي بيونج هون) لا تربطه علاقة وثيقة بأخيه الأصغر (يون يوه جونج) والذي لديه اعاقة ذهنية لكنه يتمتع بموهبة فريدة و هي عزف البيانو و حفظ اللحن من المرة الأولى سيتقرب الشقيقان من بعضهما و والدتهما و التي تخفي الكثير من الأسرار، سنتعرف على تطور العلاقات بينهم مع الاستمتاع بالمعزوفات الفريدة للبيانو.', 'keys-to-the-heart-2018', 'https://m.media-amazon.com/images/M/MV5BZmNhOGZlMmQtZjk5MC00MTBiLWI0MzktOWI1NGRiNmJhYzk5XkEyXkFqcGdeQXVyNDIzMTI4NDE@._V1_SX300.jpg', 7.4, 'HD', 0, 1, 2737, '2019-04-12 14:29:58', '2019-04-12 14:31:38'),
(2736, 'مشاهدة فيلم The Star Next Door 2017 مترجم', 'مشاهدة وتحميل فيلم ال The Star Next Door 2017 مترجم بجودة HD كامل أون لاين. هيو مي نجمة مشهورة وهي محط انتباه الجميع وكل ما تفعله يصبح قضية تتداولها الألسن. إلا أنها في الحقيقة والخفاء أم عازبة لطالبة ثانوية. يربط الاثنتان علاقة سيئة ولكن سرعان ما سيتغير ذلك عندما تواجهان مصور فضائح يسعى لكشف الحقيقة للعامة.', 'the-star-next-door-2017', 'uploads/9507424448.jpg', 0, 'HD', 0, 1, 2740, '2019-04-12 14:30:19', '2019-04-12 14:31:36'),
(2737, 'مشاهدة فيلم The Messenger: The Story of Joan of Arc 1999 مترجم', 'مشاهدة وتحميل فيلم المغامره والسيرة الذاتية The Messenger: The Story of Joan of Arc 1999 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب حول شابة ترى رؤيا تقودها الى تخليص فرنسا من قامعيها.', 'the-messenger-the-story-of-joan-of-arc-1999', 'https://m.media-amazon.com/images/M/MV5BMjAyMDMwMjg4Nl5BMl5BanBnXkFtZTcwMzM2NDU2MQ@@._V1_SX300.jpg', 6.4, 'BluRay', 0, 1, 2741, '2019-04-12 14:30:23', '2019-04-12 14:31:35'),
(2738, 'مشاهدة فيلم Frankenfish 2004 مترجم', 'مشاهدة وتحميل فيلم الاكشن والمغامره Frankenfish 2004 بجودة WEB-DL مترجم اون لاين وتحميل مباشر. القصة / عندما يُعثر على جثة رجل مُدمر تمامًا في مستنقعات (لويزيانا)، يُعيّن المُحقق الطبي (سام ريفرز) للتحقيق في جريمة القتل، يُسافر مع عالم الأحياء (ماري كالاهان) إلى مسكن الضحية ويقابل عائلته وأصدقائه.', 'frankenfish-2004', 'https://m.media-amazon.com/images/M/MV5BYTk0NmRiODktOGZmMC00NTk4LWE3MGYtNDgwNTZiZGQ1OTNjXkEyXkFqcGdeQXVyMjQwMjk0NjI@._V1_SX300.jpg', 4.8, 'WEB-DL', 0, 1, 2742, '2019-04-12 14:30:31', '2019-04-12 14:31:34'),
(2739, 'مشاهدة فيلم Dream Big Engineering Our World 2017 مترجم', 'مشاهدة و تحميل فيلم الوثائقي والقصير Dream Big Engineering Our World 2017 مترجم اون لاين جودة BrRip وتحميل مباشر مشاهدة اون لاين مباشرة أول فيلم وثائقي من نوعه الدي سوف يغير طريقة تفكيرنا في الهندسة من سور الصين العظيم إلى أطول المباني في العالم للروبوتات تحت الماء والسيارات الشمسية والمدن الذكية المستدامة', 'dream-big-engineering-our-world-2017', 'https://m.media-amazon.com/images/M/MV5BMzI1MWJhOGItNTA2Yy00ZWY5LWE5N2QtZjhjZDQxNzYzNGYxXkEyXkFqcGdeQXVyNzIyMDA5MTk@._V1_SX300.jpg', 6.5, '0', 0, 1, 2743, '2019-04-12 14:30:32', '2019-04-12 14:31:33');
INSERT INTO `movies` (`id`, `name`, `description`, `slug`, `image_url`, `ratings`, `quality`, `views`, `category_id`, `server_links`, `created_at`, `updated_at`) VALUES
(2740, 'مشاهدة فيلم Harry and Snowman 2015 مترجم', 'مشاهدة وتحميل فيلم الوثائقي والسيرة الذاتية Harry and Snowman 2015 مترجم بجودة WEB-DL كامل أون لاين. يعتزم عميل سابق للمقاومة الهولندية في الحرب العالمية الثانية لِيصبح بطلًا في قفز الحواجز، مستعينًا فقط بعزيمته القوية وبحصان بخس الثمن.', 'harry-and-snowman-2015', 'uploads/22278647157.jpg', NULL, 'WEB-DL', 0, 1, 2744, '2019-04-12 14:30:39', '2019-04-12 14:31:32'),
(2741, 'مشاهدة فيلم This Is Not What I Expected 2017 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والدراما This Is Not What I Expected 2017 بجودة HD مترجم كامل اون لاين مشاهدة مباشرة يوتيوب تدور احداث الفيلم حول مدير تنفيذي لإحدى الشركات يقابل طاهية عن طريقة الصدفة يتقربان من بعضهما بسبب حبهم للإطعمة الشهية ولكن شخصياتهم تتصادم كثيراً..', 'this-is-not-what-i-expected-2017', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMzQ4ZTU4NzQtMTc1ZC00NjYwLWJlMmEtOGNhNjdjNjM1ZWM4XkEyXkFqcGdeQXVyMjQ3NzUxOTM@._V1_SX300.jpg', 6.6, 'HD', 0, 1, 2745, '2019-04-12 14:30:40', '2019-04-12 14:31:32'),
(2742, 'مشاهدة فيلم Spivak 2018 مترجم', 'مشاهدة وتحميل فيلم الكوميديا Spivak 2018 بجودة WEB-DL مترجم اون لاين وتحميل مباشر. يعلق الكاتب المكافح “وولي سبيفاك” بدوّامة الرّوتين، إلى أن يقابل حبيبين ساحرين ومفعمين بالحيوية، فيبدأ برؤية جانب الحياة المشرق بشكل جديد.', 'spivak-2018', 'https://m.media-amazon.com/images/M/MV5BNjU5YWVjMmMtOTYwZS00YzM5LWFhNTQtOGU3MjkwMWMxOGVhXkEyXkFqcGdeQXVyNTM0MDc1ODE@._V1_SX300.jpg', 5.5, 'WEB-DL', 0, 1, 2746, '2019-04-12 14:30:48', '2019-04-12 14:31:31'),
(2747, 'مشاهدة فيلم To Love or Not to Love 2017 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والرومانسية To Love or Not to Love 2017 مترجم بجودة HD كامل أون لاين. “إلتون” و “كاسي” زملاء مدرسة، يحبان بعضهما البعض ويبدآن المواعدة لكن “إلتون” على علاقة سرية مع “سيا’ وانفصل على “كاسي”. بعد ذلك تُصبح كاسي خبيرة في العلاقات وتقابل زميلا قديما لها ويُعجب بها لكن تتعقد الأمور فور عودة إلتون إلى حياتها.', 'to-love-or-not-to-love-2017', 'https://m.media-amazon.com/images/M/MV5BZWEyMjk1MzItOGJiMi00YmM4LThjNmEtMjczYzQ5NTI3ZmUxXkEyXkFqcGdeQXVyNzQzOTk0MTU@._V1_SX300.jpg', 6.3, 'HD', 0, 1, 2751, '2019-04-12 14:30:57', '2019-04-12 14:31:26'),
(2750, 'مشاهدة فيلم Tai Chi Hero 2012 مترجم', 'مشاهدة فيلم Tai Chi Hero 2012 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر ” بطل تاى تشي ” حول يدور حول الاعوام الاولى ليانغ لوشان سيد التاي تشي. الرجل الذي ابتكر التاي تشي في القرن التاسع عشر والذي اصبح اشهر اسلوب تاي تشي في العالم. الجزء الثاني يتابع رحلة يانغ لوشان الطفل الموهوب الذي ساعد على انقاذ قرية من الجنود.', 'tai-chi-hero-2012', 'https://m.media-amazon.com/images/M/MV5BMTcyNTUwNzEyOV5BMl5BanBnXkFtZTcwNDY1NjY0OQ@@._V1_SX300.jpg', 6.2, 'BluRay', 0, 1, 2754, '2019-04-12 14:31:11', '2019-04-12 14:31:24'),
(2751, 'مشاهدة فيلم My Teacher 2017 مترجم', 'مشاهدة وتحميل فيلم الدراما والرومانسية My Teacher 2017 بجودة HD مترجم اون لاين وتحميل مباشر. كوساكو إيتو معلم تأريخ في مدرسة ثانوية، وتبدو شخصيته غير مرنة لكن في الواقع قلبه طيب هيبيكي شيمادا طالبة معجبة بالمعلم كوساكو ولم تحظى مسبقاً بصديق حميم، ونظراً لكونها يافعة وساذجة، عبرت عن مشاعرها بصدق لكوساكو لكن كوساكو لا يستطيع التعبير عن مشاعره بحرية نظراً لكونه معلماً.', 'my-teacher-2017', 'https://m.media-amazon.com/images/M/MV5BNzk5N2FmNDEtMDc0My00NDY0LWEzMTQtM2FlZWFhYTM1MjJiXkEyXkFqcGdeQXVyNTI4ODg2Mjc@._V1_SX300.jpg', 6.4, 'HD', 0, 1, 2755, '2019-04-12 14:31:14', '2019-04-12 14:31:23'),
(2752, 'مشاهدة فيلم Daddy You, Daughter Me 2017 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والدراما Daddy You, Daughter Me 2017 بجودة HD مترجم كامل اون لاين مشاهدة مباشرة يوتيوب الفيلم مأخوذ من رواية يابانية عام 2006 تدور قصتها عن أب و إبنته يحدث بينهما تبادل للأجساد.', 'daddy-you-daughter-me-2017', 'https://images-na.ssl-images-amazon.com/images/M/MV5BNGI1NTA5N2MtMjBmOS00MjVlLThjOTgtY2I2ZTQ3M2RhNTYxXkEyXkFqcGdeQXVyNzU5NTIxMzg@._V1_SX300.jpg', 7, 'HD', 0, 1, 2756, '2019-04-12 14:31:15', '2019-04-12 14:31:22'),
(2753, 'مشاهدة فيلم Honnouji Hotel 2017 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والفانتازيا Honnouji Hotel 2017 بجودة HD مترجم اون لاين وتحميل مباشر. مايكو على وشك الزواج تذهب الى كيوتو للتحضير لزفافها. في خضم تفكيرها بخطيبها وما ستؤول اليه حياتها بعد الزواج يحصل خطأ وتضطر للمبيت في فندق هونوجي. في الفندق تلتقي بالشخصية التاريخية اودا نوبوناغا الذي كان يسعى لتوحيد اليابان.', 'honnouji-hotel-2017', 'https://m.media-amazon.com/images/M/MV5BZjZjNTIyZjUtNjRjYS00YWI5LWJhYzEtYjJmZTEwMDg3YzllL2ltYWdlXkEyXkFqcGdeQXVyNDA5ODU0NDg@._V1_SX300.jpg', 6.3, 'HD', 0, 1, 2757, '2019-04-12 14:31:16', '2019-04-12 14:31:21'),
(2754, 'مشاهدة فيلم Nine Queens 2000 مترجم', 'مشاهدة وتحميل فيلم الجريمة والدراما Nine Queens 2000 مترجم بجودة DVDRip كامل أون لاين. ” تسع ملكات ” حول محتالان يحاولان خداع جامع طوابع ببيعهما مجموعة من الطوابع النادرة المزيفة له.', 'nine-queens-2000', 'https://m.media-amazon.com/images/M/MV5BMTYxMDdlYjItMDVkYy00MjYzLThhMTYtYjIzZjZiODk1ZWRmXkEyXkFqcGdeQXVyNDk3NzU2MTQ@._V1_SX300.jpg', 7.9, 'DVDRip', 0, 1, 2758, '2019-04-12 14:31:19', '2019-04-12 14:31:20'),
(2757, 'فيلم لا تراجع و لا استسلام 2010 اون لاين', 'مشاهدة فيلم الكوميديا لا تراجع و لا استسلام 2010 بجودة HDTV-1080p بطولة احمد مكي ودنيا سمير غانم مشاهدة مباشرة اون…', 'fylm-la-trajaa-o-la-astslam-2010-aon-layn', 'uploads/01482179384.jpg', NULL, NULL, 0, 2, 2761, '2019-04-12 14:31:32', '2019-04-12 14:54:25'),
(2758, 'مشاهدة فيلم The Anthem of the Heart 2017 مترجم', 'مشاهدة وتحميل فيلم الدراما والعائلي The Anthem of the Heart 2017 بجودة HD مترجم كامل اون لاين مشاهدة مباشرة يوتيوب تاكومي ساكاجامي (ناكاجيما كينتو) طالب في الثانوية، يتم أختياره للمشاركة في حدث التواصل مع المجتمع. جون ناروسي (كيوكو يوشيني) تم أختيارها أيضاً، ولكنها تعاني من مشكلة في الماضي تجعل معدتها تؤلمها عندما تتحدث لذلك هي لا تملك أصدقاء ولا تتواصل مع أحد، تاكومي و جون ترددوا في البداية لكنهم قرروا أن يجهزوا مسرحية موسيقية للحدث.', 'the-anthem-of-the-heart-2017', 'https://m.media-amazon.com/images/M/MV5BZjE3MGYyM2QtMzgzZS00OGQ5LWE2MjAtMWEyMDk5YzhhZWU0XkEyXkFqcGdeQXVyNjU1ODkwMjU@._V1_SX300.jpg', 7.4, 'HD', 0, 1, 2762, '2019-04-12 14:31:33', '2019-04-12 14:33:30'),
(2759, 'فيلم الثلاثة يشتغلونها 2010 اون لاين', 'مشاهدة فيلم الكوميديا الثلاثة يشتغلونها 2010 بجودة HDTV 720p بطولة ياسمين عبد العزيز مشاهدة مباشرة اون لاين', 'fylm-althlath-yshtghlonha-2010-aon-layn', 'uploads/11686996171.jpg', NULL, NULL, 0, 2, 2763, '2019-04-12 14:31:48', '2019-04-12 14:54:25'),
(2761, 'مشاهدة فيلم Stand by Me 2018 مترجم', 'مشاهدة فيلم المغامره والدراما Stand by Me 2018 مترجم بجودة HD مشاهدة مباشرة اون لاين. تدور قصة الفيلم حول جد يقوم بتربية طفلين بمفرده، يُدرك الجد أنه لم يتبقى له الكثير من الوقت للعيش لذا يجهز هدية مميزة لهما.', 'stand-by-me-2018', 'https://m.media-amazon.com/images/M/MV5BODJmY2Y2OGQtMDg2My00N2Q3LWJmZTUtYTc2ODBjZDVlNDlhXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 8.1, 'HD', 0, 1, 2765, '2019-04-12 14:31:49', '2019-04-12 14:33:29'),
