(2767, 'مشاهدة فيلم Loft 2008 مترجم', 'مشاهدة فيلم Loft 2008 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر ” الشقة ” حول 5 اصدقاء مقربين كلهم متزوجون يتشاركون شقة للقاء عشيقاتهم. ذات يوم يجدون جثة شابة في الشقة. بما انه ثمة 5 مفاتيح فقط يبدأ الرجال الخمسة في الشك في بعضهم.', 'loft-2008', 'https://m.media-amazon.com/images/M/MV5BY2I3ODhjOGUtZmIwYy00NjY0LTgyZTctMDkxM2ZjM2Q4ZDYwXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 7.3, 'BluRay', 0, 1, 2771, '2019-04-12 14:32:22', '2019-04-12 14:33:26'),
