(2936, 'مشاهدة فيلم The Bone Collector 1999 مترجم', 'مشاهدة وتحميل فيلم الجريمة والدراما The Bone Collector 1999 بجودة BluRay مترجم اون لاين وتحميل مباشر. (لينكولن رايم) محقق متخصص في تحليل مسرح الجريمة في أثناء تحقيقه في إحدى الجرائم يسقط عليه عمود، يصيب عموده الفقري ويتسبب له في شلل كامل. نتيجة لقدراته العقلية الفائقة تقرر الشرطة الاستمرار في الاستفادة من قدراته، وتتحمل تكاليف علاجه.', 'the-bone-collector-1999', 'https://m.media-amazon.com/images/M/MV5BOWQxN2ZmNDMtMzA2Ny00ZDJhLTlkNTgtMWMyZjljY2QzMzNhXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 6.7, 'BluRay', 0, 1, 2940, '2019-04-13 06:31:22', '2019-04-13 06:34:20'),
(2937, 'مشاهدة فيلم The Craft 1996 مترجم', 'مشاهدة و تحميل فيلم الدراما والفانتازيا The Craft 1996 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة تنتقل (سارة بيلي) مع أسرتها إلى مدينة جديدة لبدء حياة جديدة، تلتحق (سارة) بإحدى المدارس الثانوية الكاثوليكية المحافظة، تتعرف إلى ثلاثة من الفتيات اللاتي يقضين أغلب الوقت معا، تنضم إليهن، وتفاجأ بأنهن يمارسن السحر، ولديهن قوى سحرية خفية، يلقين بها اللعنات على كل من يغضبهن، ويتسبب في إيذائهن، ولو بقدر ضئيل.', 'the-craft-1996', 'https://m.media-amazon.com/images/M/MV5BMTY4MjQ2MzU1OV5BMl5BanBnXkFtZTgwNTM2Mjc3ODE@._V1_SX300.jpg', 6.3, 'BluRay', 0, 1, 2941, '2019-04-13 06:31:27', '2019-04-13 06:34:20'),
(2938, 'مشاهدة فيلم The Edge 1997 مترجم', 'مشاهدة و تحميل فيلم الاكشن والمغامره The Edge 1997 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة الملياردير “تشارلز مورس” يرافق زوجته عارضة ميكي إلى جلسة تصوير دعائية في ولاية ألاسكا، جلسة التصوير سيقوم بأدائها مصور الأزياء روبرت جرين، ليبحثوا عن المكان الأكثر مناسبة للتصوير، فيطيرون إلى مكان بعيد، وهناك تتحطم طائرتهم الصغيرة عند إحدى البحيرات، للنجاة من الغابة يحتاج الجميع أن يبقوا بجوار بعضهم البعض، لكن تشارلز يبدأ في الشك إذا ما كان روبرت على علاقة بميكى من وراء ظهره.', 'the-edge-1997', 'https://m.media-amazon.com/images/M/MV5BOTU3MGE1OTgtM2YwNC00ODAyLTg3Y2YtYTM0NTc2ZTc3ZDFkL2ltYWdlXkEyXkFqcGdeQXVyNTAyODkwOQ@@._V1_SX300.jpg', 6.9, 'BluRay', 0, 1, 2942, '2019-04-13 06:31:38', '2019-04-13 06:34:19'),
(2939, 'فيلم 2 Days in Paris 2007 مترجم اون لاين', 'مشاهدة وتحميل فيلم الكوميديا والدراما 2 Days in Paris 2007 مترجم بجودة BluRay كامل أون لاين.', '2-days-in-paris-2007', 'https://m.media-amazon.com/images/M/MV5BMjAyNTY3NTcyOF5BMl5BanBnXkFtZTcwMTcyMjM1MQ@@._V1_SX300.jpg', 6.8, 'BluRay', 0, 1, 2943, '2019-04-13 06:31:39', '2019-04-13 06:34:18'),
(2940, 'مشاهدة فيلم The Faculty 1998 مترجم', 'مشاهدة فيلم The Faculty 1998 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر تدور أحداث الفلم في إطار من الرعب والغموض والخيال العلمي . تجري وقائع الفلم في مدرسة ثانوية ببلدة صغيرة في (أوهايو) ، بدون سابق إنذار يبدأ الأساتذة في التصرف بغرابة شديدة ، يظن مجموعة من الطلبة أن مدرسيهم وزملاءهم في المدرسة قد تم الاستحواذ عليهم بواسطة الكائنات الفضائية ، ومن أجل إثبات صحة تلك المزاعم ، يكون عليهم أن يخوضوا مغامرة مميتة ومرعبة .', 'the-faculty-1998', 'https://m.media-amazon.com/images/M/MV5BZTcwZGNiMWYtMTYwNC00MGVjLWI5OTQtODhkZTU4ZDZjOGNkXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 6.5, 'BluRay', 0, 1, 2944, '2019-04-13 06:31:42', '2019-04-13 06:34:17'),
(2941, 'مشاهدة فيلم The Flintstones 1994 مترجم', 'مشاهدة فيلم الكوميديا والعائلي The Flintstones 1994 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. “الفلينستون” و”الرابرز” عائلتان تعيشان في العصر الحجري الحديث.(فريد) و(بارني) يعملان في شركة التعدين الحجرية، فريد يقرض بارني بعض الأموال من أجل أن يستطيع بناء منزل، وأن يقوم هو وزوجته بتحقيق حلمهما بتبني أحد الأطفال. حينما يتم الترشح لمنصب نائب رئيس الشركة، يتقدم فريد وبارني للوظيفة ويساعد بارني فريد في الحصول على الوظيفة؛ التي يكتشف بعد ذلك أنها مؤامرة من (كليف) من أجل توريطه في قضية اختلاس.', 'the-flintstones-1994', 'https://m.media-amazon.com/images/M/MV5BYzY0ZTk4YzctNzYzNy00ZDQ0LTg2Y2ItZTQyYzQxMjQwMDc2XkEyXkFqcGdeQXVyNTAyODkwOQ@@._V1_SX300.jpg', 4.9, 'BluRay', 0, 1, 2945, '2019-04-13 06:31:48', '2019-04-13 06:34:16'),
(2942, 'مشاهدة فيلم The Hard Way 1991 مترجم', 'مشاهدة وتحميل فيلم الاكشن والكوميديا The Hard Way 1991 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب تدور أحداث الفيلم حول الممثل الشهير “نيك لانج” الذي على وشك تمثيل دور شرطي بأحد الأفلام، ولم يجد أمامه سبيلا سوى اللجوء إلى أحد ضباط الشرطة، من أجل زيادة خبراته ومساعدته على أداء دوره بحنكة أوسع، وأثناء ذلك تتوالى المواقف الهزلية بشكل مثير.', 'the-hard-way-1991', 'https://m.media-amazon.com/images/M/MV5BMzkyZWRiMTEtNmZhNy00NjI3LWE2ZDktM2UzYjkyNDBiMmE4XkEyXkFqcGdeQXVyNDk3NzU2MTQ@._V1_SX300.jpg', 6.4, 'BluRay', 0, 1, 2946, '2019-04-13 06:31:52', '2019-04-13 06:34:16'),
