(3019, 'مشاهدة فيلم Hackers 1995 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والجريمة Hackers 1995 مترجم بجودة BluRay كامل اون لاين. تدور أحداث الفيلم حول صبي عبقري في مجال الكمبيوتر يصمم فيروس مدمر يحتجز إثره من قبل جهاز الخدمة السرية الامريكية ويُمنع من استخدام الكمبيوتر إلى أن يبلغ سن الثامنة عشر من عمره.', 'hackers-1995', 'https://m.media-amazon.com/images/M/MV5BNmExMTkyYjItZTg0YS00NWYzLTkwMjItZWJiOWQ2M2ZkYjE4XkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 6.2, 'BluRay', 0, 1, 3023, '2019-04-13 06:45:41', '2019-04-13 06:47:14'),
(3021, 'مشاهدة فيلم The Young Master 1980 مترجم', 'مشاهدة فيلم الاكشن والمغامره The Young Master 1980 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. تدور احداث فيلم The Young Master فى اطار من الكوميديا والاكشن والمغامرة حول جاكى شان بعد ان فشل زملائة فى مسابقة رقصة الاسد تم ارسال التنين جاكى شان بعيدا عن مدرستة فى عار وعلى شرط ان يجب ان يجد اشقائة المخطئين.', 'the-young-master-1980', 'https://m.media-amazon.com/images/M/MV5BODc1ZGQyYTEtMjM1ZS00MDFiLTk3MDYtZmNiZDJhNzcyNTVhXkEyXkFqcGdeQXVyNzc5MjA3OA@@._V1_SX300.jpg', 7.2, 'BluRay', 0, 1, 3025, '2019-04-13 06:45:49', '2019-04-13 06:47:13'),
(3022, 'مشاهدة فيلم They Live 1988 مترجم', 'مشاهدة فيلم They Live 1988 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر في إطار من الرعب والخيال العلمي والحركة، يكتشف أحد المشردين نظارة شمسية خاصة، والتي تساعده تلك النظارة لما لها من القدرة على كشف حقيقة أي شخص أمامه، وإذا به يكتشف أن الفضائيين في الواقع قد قاموا باحتلال الأرض، وحلوا محل البشر من وقت ما، وعليه التعامل مع تلك الحقيقة، وذلك الأمر الواقع.', 'they-live-1988', 'https://m.media-amazon.com/images/M/MV5BMTQ3MjM3ODU1NV5BMl5BanBnXkFtZTgwMjU3NDU2MTE@._V1_SX300.jpg', 7.3, 'BluRay', 0, 1, 3026, '2019-04-13 06:45:54', '2019-04-13 06:47:12'),
(3026, 'مشاهدة فيلم It Could Happen to You 1994 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والدراما It Could Happen to You 1994 مترجم بجودة BluRay كامل اون لاين. يعيش الزوجان (تشارلي) و(موريل) حياة بسيطة وهادئة سويًا، ولكن حياتهما تنقلب رأسًا على عقب عندما يربحان جائزة تقدر بأربعة ملايين دولار في مسابقة لليانصيب. تنتابهما فرحة عارمة بالفوز، ولكن هناك مشكلة واحدة؛ فتشارلي، الذي كان يأكل قبلها في مطعم ولم يستطع أن يدفع إكرامية للنادلة، أخبرها على سبيل الدعابة، أنه سيقتسم معها الجائزة لو فاز باليانصيب. يقرر (تشارلي) أن يقتسم معها الجائزة بالفعل، مما يصيب زوجته بالجنون، وتقرر أن تنفصل عنه.', 'it-could-happen-to-you-1994', 'https://m.media-amazon.com/images/M/MV5BYzMxOGUzOWEtMGUxMi00ZWM1LWE3ODgtNzc4OGVjZmJhMmFmXkEyXkFqcGdeQXVyODY0NzcxNw@@._V1_SX300.jpg', 6.3, 'BluRay', 0, 1, 3030, '2019-04-13 06:46:10', '2019-04-13 06:47:09'),
(3028, 'مشاهدة فيلم Jakob the Liar 1999 مترجم', 'مشاهدة وتحميل فيلم الدراما والحرب Jakob the Liar 1999 بجودة HDTV مترجم اون لاين وتحميل مباشر. في بولندا عام 1944 وفي الحقبة النازية، يتم استدعاء (جاكوب) لمقر الأمن الألماني، ويستمع هناك إلي أخبار عبر الإذاعة الألمانية تشير لتقدم السوفييت على الألمان، ينشر تلك الأخبار عند عودته للجيتو اليهودي، لكي يرفع الروح المعنوية لبنى قومه، كذلك ينشر أخبارا أخرى من أجل زيادة الأمل لدى قاطني الحي لديه، الأمر الذي يساهم في رفع معنوياتهم بشدة.', 'jakob-the-liar-1999', 'https://m.media-amazon.com/images/M/MV5BMDI1ZDVmZTAtMmE3YS00MTY4LTlmMWYtODJmYzk2ODcwMTdkXkEyXkFqcGdeQXVyNTM0NTU5Mg@@._V1_SX300.jpg', 6.5, 'HDTV', 0, 1, 3032, '2019-04-13 06:46:20', '2019-04-13 06:47:08'),
(3031, 'مشاهدة فيلم Jumanji 1995 مترجم', 'مشاهدة فيلم Jumanji 1995 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر تدور القصة في إطار خيالي حول الطفلان جودي وبيتر اللذان يعثران على لعبة جومانجي التي من خلالها تفتح بوابة سحرية على عالم من الغابات الأسطورية. وإذا بفضلهما يقودهما إلى مغامرات ومواقف خطيرة يقابلان فيها الآن باريش الذي يحاول جاهدا مساعدتهما لإنهاء اللعبة خاصة أنه قضى معظم حياته محتجزا داخل اللعبة منذ أن لعبها وهو في الثانية عشرة.', 'jumanji-1995', 'https://m.media-amazon.com/images/M/MV5BZTk2ZmUwYmEtNTcwZS00YmMyLWFkYjMtNTRmZDA3YWExMjc2XkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 7, 'BluRay', 0, 1, 3035, '2019-04-13 06:46:36', '2019-04-13 06:47:06'),
(3032, 'مشاهدة فيلم Junior 1994 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والرومانسية Junior 1994 مترجم بجودة BluRay كامل اون لاين. يعمل عالما الأجنة (أليكس) و(لاري) على دواء جديد يعمل على تقليل نسبة رفض رحم الأم الحامل للجنين؛ مما يقلل من نسبة الإجهاض، لكن فجأة توقف الشركات الداعمة للمشروع الأموال اللازمة لاستكمال التجارب، بجانب سحب السلطات الموافقة على إجراء التجارب على المتطوعين، فيلجأ (لاري) إلى إجراء التجارب على (أليكس) الذي يصبح حاملاً لطفل، يرتبط به أشد الارتباط.', 'junior-1994', 'https://m.media-amazon.com/images/M/MV5BMDUwN2E1ODMtMjRiMS00Yzk0LTk1MWYtZjE4M2I5NzcyMmI4XkEyXkFqcGdeQXVyNTIzOTk5ODM@._V1_SX300.jpg', 4.6, 'BluRay', 0, 1, 3036, '2019-04-13 06:46:40', '2019-04-13 06:47:05'),
(3034, 'مشاهدة فيلم The Perfect Storm 2000 مترجم', 'مشاهدة و تحميل فيلم الاكشن والمغامره The Perfect Storm 2000 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة عن واقعة حقيقية حدثت في بداية التسعينيات تعود السفينة (أندريا جيل) إلى الميناء قبل نهاية موسم الصيد بحصيلة مخيبة للآمال، فيحاول كابتن السفينة (بيلي تاين) إقناع طاقم السفينة بالذهاب إلى منطقة صيد لم يعتادوا عليها، يقررون الذهاب وتكون حصيلة الصيد كبيرة، لكن تعطل ماكينة الثلج التي تحفظ الأسماك تدفعهم للعودة قبل فساد الأسماك، وإذا بعاصفة مدمرة فيجدون أنفسهم مسجونين داخلها ومعرضين للموت المحقق خاصةً مع تحطم جهاز الإرسال.', 'the-perfect-storm-2000', 'https://m.media-amazon.com/images/M/MV5BOGU2MWRiYmQtMDY1MS00OTUzLTkzYTktYjE5YTE4MTI0NzRkL2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 6.4, 'BluRay', 0, 1, 3038, '2019-04-13 06:46:47', '2019-04-13 06:47:03'),
(3035, 'مشاهدة فيلم Dogma 1999 مترجم', 'مشاهدة فيلم Dogma 1999 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر تدور قصة الفيلم حول ملاكين تم عقابهما بالبقاء للأبد في الأرض تحديدا في ولاية (وسكونسن) ومنعهما من الصعود للسماء ثانيا، ومدى محاولاتهما والمساعدات التي قد يتلقاها كلا منهما من أجل العودة إلى الجنة من جديد.', 'dogma-1999', 'https://m.media-amazon.com/images/M/MV5BYzAyOWUyZjQtNDBiMy00ZDExLTgwNmMtZDdmY2ViNzkyN2Y0XkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 7.3, 'BluRay', 0, 1, 3039, '2019-04-13 06:46:52', '2019-04-13 06:47:02'),
(3036, 'مشاهدة فيلم The Princess Bride 1987 مترجم', 'مشاهدة وتحميل فيلم المغامره والعائلي The Princess Bride 1987 مترجم بجودة BluRay كامل اون لاين. يقوم الجد بحكاية إحدى القصص التي توارثتها عائلته لحفيده الصغير، وسرعان ما تتحول الحكاية الكلاسيكية إلى حقيقة، تحكي الأسطورة عن الأميرة الجميلة المخطوبة للأمير الفارس (هامبردينك)، لكنها تخطف، وتحتجز على غير إرادتها، لكي يتسبب هذا الاختطاف في حرب مستعرة، ويسعى القرصان (ويستلي) صديق طفولتها إلى إنقاذها من خاطفيها.', 'the-princess-bride-1987', 'https://m.media-amazon.com/images/M/MV5BMGM4M2Q5N2MtNThkZS00NTc1LTk1NTItNWEyZjJjNDRmNDk5XkEyXkFqcGdeQXVyMjA0MDQ0Mjc@._V1_SX300.jpg', 8.1, 'BluRay', 0, 1, 3040, '2019-04-13 06:46:56', '2019-04-13 06:47:01'),
