(3192, 'مشاهدة فيلم Lifted 2010 مترجم', 'مشاهدة وتحميل فيلم الدراما Lifted 2010 مترجم بجودة BluRay كامل اون لاين. يكافح الصبي (هنري ماثيوز) ابن الثلاثة عشر عاماً في الحياة بعد أن تم إرسال والده الجندي في الاحتياط إلى أفغانستان، وبمساعدة كاهن محلي يقرر الصبي أن يشترك في مسابقة غناء محلية', 'lifted-2010', 'https://m.media-amazon.com/images/M/MV5BMjE0MTcyNDQ3M15BMl5BanBnXkFtZTcwMzI0MjA1MQ@@._V1_SX300.jpg', 7.9, 'BluRay', 0, 1, 3196, '2019-04-13 07:24:30', '2019-04-13 07:27:36'),
(3194, 'مشاهدة فيلم Minutes to Midnight 2018 مترجم', 'مشاهدة وتحميل فيلم الاكشن والرعب Minutes to Midnight 2018 مترجم بجودة HDRip كامل أون لاين. ” دقائق إلى منتصف الليل ” حول على أعتاب عشية رأس السنة الجديدة ، يجتمع سبعة أصدقاء وظهراء غامض في نزل تزلج مقفر في الجبال عندما يطاردونهم بشكل منهجي من قبل رجال ملثمين عديمي الرحمة بأجندات غامضة', 'minutes-to-midnight-2018', 'https://m.media-amazon.com/images/M/MV5BMTY3NTUzNTgzNV5BMl5BanBnXkFtZTgwOTk2MDUxNzE@._V1_SX300.jpg', 3.5, 'HDRip', 0, 1, 3198, '2019-04-13 07:24:40', '2019-04-13 07:27:35'),
(3201, 'مشاهدة فيلم Affliction 1997 مترجم', 'مشاهدة فيلم Affliction 1997 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر “واد وايت هوس” يعمل كشريف في إحدى البلدات الصغيرة فى نيوهامبشير. “ليليان” زوجته السابقة وابنته الصغيرة “جيل” تريان أنه فاشل لم يحقق شيئًا في حياته، بالإضافة إلى أنه سكير، بينما صديقته “ماجي” تقبله كما هو. في أول أيام موسم الصيد، “جاك”؛ صديق وايد، يأخذ أحد الأثرياء إلى رحلة صيد، لكن جاك فقط من يعود حيا؛ لذا يقرر وايد التحقيق في القضية، على الرغم من تأكيد جاك أنها حادثة نتيجة إطلاق الرجل الرصاص على نفسه بطريق الخطأ.', 'affliction-1997', 'https://m.media-amazon.com/images/M/MV5BMTY0NDc0NDMzN15BMl5BanBnXkFtZTcwOTU0NjcyMQ@@._V1_SX300.jpg', 7, 'WEB-DL', 0, 1, 3205, '2019-04-13 07:24:55', '2019-04-13 07:27:32'),
