(3214, 'مشاهدة فيلم A Quiet Life 2010 مترجم', 'مشاهدة وتحميل فيلم الجريمة والدراما A Quiet Life 2010 بجودة BluRay مترجم اون لاين وتحميل مباشر. رجل قتل اثنين وثلاثين شخصًا فإكتسب القوة والسلطة، بعدها خاف لأن الكثيرون أرادوا قتله، فإختفى لمدة 15 عامًا والجميع ظنّ في أنه مات، لكنّه كان يعيش في فندق صغير بالقرب من (فرانكفورت )، مع زوجته الألمانية وابنه”.', 'a-quiet-life-2010', 'https://m.media-amazon.com/images/M/MV5BOGY3OWZmMDktZWI1Ny00ZjU3LTk3MWQtZmFlMTczNDBmYzA1L2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyMjIyMDk1Nzg@._V1_SX300.jpg', 6.8, 'BluRay', 0, 1, 3218, '2019-04-13 07:25:36', '2019-04-13 07:27:25'),
(3216, 'مشاهدة فيلم ¡Three Amigos! 1986 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والغربي ¡Three Amigos! 1986 مترجم بجودة BluRay كامل اون لاين. حول ثلاثة أصدقاء (لاكي) ، و(داستي) ، و(نيد) يعملون كممثلين في أعمال فنية صامتة ، لكنهم عاطلون عن العمل ، يسافرون في رحلة إلى قرية مكسيكية بعد أن تتم دعوتهم ليقوموا بتمثيل إحدى مسرحياتهم هناك ، تواجه هذه القرية مضايقات من عصابة من الخارجين على القانون ، فيحاول الأصدقاء الثلاثة مساعدتهم .', 'three-amigos-1986', 'https://m.media-amazon.com/images/M/MV5BNTE5NDQ1NTMyNl5BMl5BanBnXkFtZTcwNjY5MDQ3NA@@._V1_SX300.jpg', 6.5, 'BluRay', 0, 1, 3220, '2019-04-13 07:25:43', '2019-04-13 07:27:24'),
