(3287, 'مشاهدة فيلم Jackie Brown 1997 مترجم', 'مشاهدة وتحميل فيلم الجريمة والدراما Jackie Brown 1997 مترجم بجودة BluRay كامل أون لاين. تدور اﻷحداث الدرامية حول قيام (جاكي براون) المضيفة بتهريب الأموال من المكسيك إلى لوس أنجلوس، لحساب تاجر الأسلحة (روبي أورديل)، يتم القبض عليها، وبحوذتها 10000 دولار، وكوكايين، بواسطة العميل (راي نيكوليت)، يعرضون عليها صفقة بإطلاق سراحها في مقابل أن تساعدهم في الإيقاع بـ(أورديل)، الذي يفكر في الوقت ذاته بالتخلص منها، تقرر (جاكي براون) خوض اللعبة إلى نهايتها، وخداع الجميع.', 'jackie-brown-1997', 'https://m.media-amazon.com/images/M/MV5BNmY5ODRmYTItNWU0Ni00MWE3LTgyYzUtYjZlN2Q5YTcyM2NmXkEyXkFqcGdeQXVyNjU0OTQ0OTY@._V1_SX300.jpg', 7.5, 'BluRay', 0, 1, 3291, '2019-04-13 07:47:23', '2019-04-13 07:47:30'),
(3289, 'مشاهدة فيلم 10 Things I Hate About You 1999 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والدراما 10 Things I Hate About You 1999 مترجم بجودة BrRip كامل اون لاين. طالب جديد يجب عليه أن يجد شخص ليواعد أكثر الفتيات كآبة في المدرسة، وذلك من أجل أن يأخذ أختها الصغير المعجب بها في موعد، والتي لا تواعد حتى تخرج أختها الأكبر أولاً. .', '10-things-i-hate-about-you-1999', 'uploads/31938909225.jpg', 6, '0', 0, 1, 3293, '2019-04-13 07:47:28', '2019-04-13 08:27:53'),
