(3317, 'مشاهدة فيلم A Time to Kill 1996 مترجم', 'مشاهدة فيلم الجريمة والدراما A Time to Kill 1996 مترجم بجودة BrRip مشاهدة مباشرة اون لاين. تدور أحداث هذا الفيلم الدرامي في ولاية ميسيسيبي الجنوبية. يقرر الأب الأسود كارل لي هايلي (صامويل ل. جاكسون) أن ينتصر للعدالة بطريقته الخاصة، وذلك بعد أن فشل النظام القضائي في إدانة الرجلين اللذين قاما باغتصاب ابنته وتركاها على حافة الموت.', 'a-time-to-kill-1996', 'https://m.media-amazon.com/images/M/MV5BOWExZTg4ZWYtOTQxMi00YWZkLTkxYzgtOTg1MTUxNzNiNDcxL2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 7.4, '0', 0, 1, 3321, '2019-04-13 07:53:42', '2019-04-13 07:55:10'),
(3319, 'مشاهدة فيلم Kindergarten Cop 1990 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والجريمة Kindergarten Cop 1990 مترجم بجودة BluRay كامل أون لاين. (جون كيمبل) هو رجل شرطة صارم، ماهر في عمله، يتتبع تجار المخدرات، ويحاول القبض على أحد كبار التجار (كولن كريسب)، ولكنه لايستطيع لمهارته في التخفي، أن يصل إلى حقيقة أن الشخص الوحيد الذي يستطيع معاونته هو الزوجة السابقة، لكنها تختفي فجأة، ولاتوجد معلومات عنها سوى نقل ابنها لمدرسة في ولاية أوريجون، تضعه الظروف في واحدة من أصعب المهام، وهى التدريس للأطفال حتى يستطيع الوصول إليها.', 'kindergarten-cop-1990', 'https://m.media-amazon.com/images/M/MV5BMjMyMTIyOTc0N15BMl5BanBnXkFtZTgwODY1NTk4NjE@._V1_SX300.jpg', 6.1, 'BluRay', 0, 1, 3323, '2019-04-13 07:53:46', '2019-04-13 07:55:09'),
