(3575, 'مشاهدة فيلم The Nanny 2017 مترجم', 'مشاهدة فيلم الرعب والخيال العلمي The Nanny 2017 مترجم بجودة WEB-DL مشاهدة مباشرة اون لاين. ” المربية ” حول حكاية خيالية مظلمة تتبع مربية غامضة وضعت مسؤولة عن فتاة شابة فضوليّة ، نوا (جادين هاريس) ، وأخوها الصغير مايكل (كريستيان غانيير). عندما تصبح نوا مريبة من أن مربية أطفالها الجديدة (خايمي موراي) يمكن أن تكون شريرة شريرة من عالم مظلم مظلم ، فإنها تتوسل قضيتها إلى أي شخص سوف يستمع إليها', 'the-nanny-2017', 'https://m.media-amazon.com/images/M/MV5BOWMyMzgzZjMtZmRlNy00NDc3LTkyNjYtZmYxNGE3ZjUzNzVlXkEyXkFqcGdeQXVyMTkzODUwNzk@._V1_SX300.jpg', 6.9, 'WEB-DL', 0, 1, 3579, '2019-04-14 09:25:56', '2019-04-14 09:30:27'),
(3576, 'مشاهدة فيلم Claw 2017 مترجم', 'مشاهدة فيلم ال Claw 2017 مترجم بجودة WEB-DL مشاهدة مباشرة اون لاين. ” مخلب ” حول قرر ثلاثة من أصدقائه الخروج من نيويورك لقضاء عطلة نهاية الأسبوع ، ليكتشفوا أن بلدة سوامب هولو النائمة في الولاية هي أرض الصيد للقتلة', 'claw-2017', 'https://m.media-amazon.com/images/M/MV5BMmM0ZTI1OTEtODRkZS00MTcyLWFjMGItZTBlZjJkYWZiNDljXkEyXkFqcGdeQXVyNTM3MDMyMDQ@._V1_SX300.jpg', 3.2, 'WEB-DL', 0, 1, 3580, '2019-04-14 09:26:07', '2019-04-14 09:30:27'),
(3577, 'مشاهدة فيلم A Violent Man 2017 مترجم', 'مشاهدة فيلم A Violent Man 2017 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر ” رجل عنيف ” حول مقاتل في فنون القتال المختلطة مكافح يجد نفسه في قتال على حياته بعد أن وجدت فتاة أقام معها علاقة لليلة واحدة مقتولة في منزله.', 'a-violent-man-2017', 'https://m.media-amazon.com/images/M/MV5BYjEwMDgwNjYtYjNmOS00NmViLWEwMGMtNWQ0MDc4Yzk2YWViXkEyXkFqcGdeQXVyMTk4MTg0MjE@._V1_SX300.jpg', 6.4, 'WEB-DL', 0, 1, 3581, '2019-04-14 09:26:18', '2019-04-14 09:30:27'),
(3578, 'مشاهدة فيلم Ali Wong: Hard Knock Wife 2018 مترجم', 'مشاهدة وتحميل فيلم الكوميديا Ali Wong: Hard Knock Wife 2018 مترجم بجودة WEB-DL كامل أون لاين. ” آلي وونغ: الزوجة العنيدة ” حول الكوميدية آلي وونغ تؤدي عرضها الكوميدي الاكبر في مسرح حديقة الشتاء في تورنتو.', 'ali-wong-hard-knock-wife-2018', 'https://m.media-amazon.com/images/M/MV5BMWVkZDNjZTMtMTY0Yi00OGQ0LTliMDEtMWMxYzljYzZlYTY3XkEyXkFqcGdeQXVyMTEzNjA2NzM@._V1_SX300.jpg', 7.3, 'WEB-DL', 0, 1, 3582, '2019-04-14 09:26:28', '2019-04-14 09:30:26'),
(3579, 'مشاهدة فيلم Class Rank 2017 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والعائلي Class Rank 2017 مترجم بجودة WEB-DL كامل اون لاين. ” رتبة في الصف ” حول غريبان في الثانوية ينضمان الى القوات في محاولة للاستيلاء على بورد مدرسة محلية. بارشاد من عائلتهما يدخلان عالم السياسة الواسع واثناء هذا يتعلمان شيئا او اثنين عن الحب.', 'class-rank-2017', 'https://m.media-amazon.com/images/M/MV5BYjg2ODhjMmEtMzgxNy00NTAwLWE4ZjItYWE2YzgzMTA5YWU2XkEyXkFqcGdeQXVyODY4ODQ0ODI@._V1_SX300.jpg', 6.5, 'WEB-DL', 0, 1, 3583, '2019-04-14 09:26:36', '2019-04-14 09:30:26'),
(3580, 'مشاهدة فيلم Mommy Be Mine 2018 مترجم', 'مشاهدة وتحميل فيلم الاثارة Mommy Be Mine 2018 مترجم بجودة HDTV كامل اون لاين. ” كوني لي يا أمي ” حول تكتشف (سمر) أن صديقتها الجديدة وغريبة الأطوار لها ماضي مظلم كفتاة تفتقد حب الأم وتميل لإستخدام العنف ومستعدة لفعل أي شيء للحصول على أم محبة لها.', 'mommy-be-mine-2018', 'https://ia.media-imdb.com/images/M/MV5BMWNiMmNlNjAtNjNhNy00OWYyLWIyMGMtNGFhYzRkNDEwZDVjXkEyXkFqcGdeQXVyMDc1MjE0MA@@._V1_SX300.jpg', 5.4, 'HDTV', 0, 1, 3584, '2019-04-14 09:26:39', '2019-04-14 09:30:26'),
(3581, 'مشاهدة فيلم The Cured 2017 مترجم', 'مشاهدة فيلم الدراما والرعب The Cured 2017 مترجم بجودة WEB-DL مشاهدة مباشرة اون لاين. ” الشفاء ” حول تم علاج المرض الذي يحول الناس إلى الكسالى. يتعرض الزومبي المصاب مرة واحدة للتمييز ضد المجتمع وعائلاتهم ، مما يؤدي إلى ظهور قضايا اجتماعية. هذا يؤدي إلى تدخل الحكومة المتشددة', 'the-cured-2017', 'https://m.media-amazon.com/images/M/MV5BMzA2ZDIwM2ItYzYyOS00NGFkLWFhZmEtYTFiOTZmZWEzYWZkXkEyXkFqcGdeQXVyNjI0NTQ2Nw@@._V1_SX300.jpg', 5.5, 'WEB-DL', 0, 1, 3585, '2019-04-14 09:26:48', '2019-04-14 09:30:25'),
(3582, 'مشاهدة فيلم All About Ah-Long 1989 مترجم', 'مشاهدة وتحميل فيلم الدراما All About Ah-Long 1989 بجودة bluray مترجم اون لاين وتحميل مباشر. “تلتقي زوجها السابق بعد غياب دام 10 سنوات، فـتعلم عن طريق الصدفة أن لها أبنًا نشأ معه، لكن عندما غادرت منذ سنين كانت أخبرتها والدتها بأن أبنها الرضيع قد مات، لكنها أكتشفت أنه حي يرزق، فتطلب من والده أن تأخذه معها لكي تربيّه في بيئة أفضل وتضمن له مستقبل أفضل بثروتها الهائلة”.', 'all-about-ah-long-1989', 'https://m.media-amazon.com/images/M/MV5BMzMxMDM1NzYtNzI2NS00OWZhLThmZWQtYTA2NDhmM2E0MWUwXkEyXkFqcGdeQXVyMTMxMTY0OTQ@._V1_SX300.jpg', 7.3, 'bluray', 0, 1, 3586, '2019-04-14 09:26:51', '2019-04-14 09:30:25'),
(3583, 'مشاهدة فيلم Dogville 2003 مترجم', 'مشاهدة وتحميل فيلم الجريمة والدراما Dogville 2003 بجودة WEB-DL مترجم اون لاين وتحميل مباشر. ” دوجفيل ” حول (جريس) امرأة جميلة ، تأتي هاربة إلى إحدى المدن الصغيرة التي تعمل في التعدين ، وهي مدينة (دوجفيل) ، يتبعها صوت طلقات رصاص ، تقنع (توم) واعظ المدينة بأن يجعل أهل البلدة يقومون بمساعدتها ، وإيوائها ، وتقنعهم نظرات البراءة في عينيها ، لكن يصل ملصق من عمدة البلدة المجاورة يفيد بأنها مطلوبة مقابل مكافأة مادية مغرية ، وتأتي إحدى فرق البحث إلى (دوجفيل) . فهل سيساعدونها ؟ وهل ستحتفظ بالسر الخطير الذي تكتمه ؟', 'dogville-2003', 'https://m.media-amazon.com/images/M/MV5BMTkwNTg2MTI1NF5BMl5BanBnXkFtZTcwMDM1MzUyMQ@@._V1_SX300.jpg', 8, 'WEB-DL', 0, 1, 3587, '2019-04-14 09:27:02', '2019-04-14 09:30:25'),
(3584, 'مشاهدة فيلم Journey to the West 2013 مترجم', 'مشاهدة و تحميل فيلم الاكشن والمغامره Journey to the West 2013 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة ” رحلة إلى الغرب ” حول تدور أحداث القصة حول الحرب بين الخير والشر، حيث يحاول البطل البوذي (تانج سانانج) حماية إحدى القرى من ثلاثة أشرار يسعون لتدميرها، يقع تانج في غرام السيدة (دوان) التي دائمًا ما تقف إلى جواره في محاربة الأشرار، يقرر تانج مقابلة الملك القرد بهدف مساعدته في التخلص من الأشرار.', 'journey-to-the-west-2013', 'https://m.media-amazon.com/images/M/MV5BMTQzMzUxNzk0NV5BMl5BanBnXkFtZTgwMTEwOTE4MDE@._V1_SX300.jpg', 6.8, 'BluRay', 0, 1, 3588, '2019-04-14 09:27:13', '2019-04-14 09:30:25'),
(3585, 'مشاهدة فيلم Panic Room 2002 مترجم', 'مشاهدة فيلم الجريمة والدراما Panic Room 2002 مترجم بجودة WEB-DL مشاهدة مباشرة اون لاين. ” غرفة الفزع ” حول تدور قصة الفيلم حول الأم (ميج ألتمان)، التي تنتقل مع ابنتها الصغيرة إلى منزل آخر بعد طلاقها من زوجها، ثم تفاجأ بمجموعة لصوص يقتحمون المنزل؛ فتتوجه هي وابنتها المريضة إلى غرفة بالمنزل معدة خصيصا للاختباء بها في مثل تلك الظروف، إلا أن الغرفة ليس بها أي أدوية تٌسعف الابنة المغشي عليها، ترى ماذا تفعل الأم لإنقاذ ابنتها في ظل تواجد اللصوص بالمنزل؟', 'panic-room-2002', 'https://m.media-amazon.com/images/M/MV5BNmY4ZGFjYTYtMDNmYi00ZDM4LWFjYTgtNmNlZjBmMzg0MzQ3XkEyXkFqcGdeQXVyNDk3NzU2MTQ@._V1_SX300.jpg', 6.8, 'WEB-DL', 0, 1, 3589, '2019-04-14 09:27:21', '2019-04-14 09:30:24'),
