(3592, 'مشاهدة فيلم The Summer of Sangailė 2015 مترجم', 'مشاهدة فيلم The Summer of Sangailė 2015 بجودة DVDRip مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر يحكي هذا الفيلم عن “سانغايل” التي تبلغ من العمر 17 سنة، حيث أنها مغرمة بالطائرات البهلوانية المثيرة، وتقابل فتاة من نفس عمرها في عرض جوي بالقرب من دار صغيرة يملكها والديها على البحيرة، بعد ذلك، تسمح “سانغايل” لـ”أوستا” باكتشاف سرها الأكثر حميمية وفي أثناء ذلك، تعثُر على حب المراهقة، الشخص الوحيد الذي شجعها بحق على الطيران.', 'the-summer-of-sangail-2015', 'uploads/181618093527.jpg', NULL, 'DVDRip', 0, 1, 3596, '2019-04-14 09:28:11', '2019-04-14 09:30:22'),
