(3603, 'مشاهدة فيلم Higher Power 2018 مترجم', 'مشاهدة وتحميل فيلم الاكشن والخيال العلمي Higher Power 2018 بجودة WEB-DL مترجم كامل اون لاين مشاهدة مباشرة يوتيوب ” سلطة عليا ” حول عندما يقرر الكون ما يريده ، فمن غير المجدي أن يقاوم. مع حياة عائلته على المحك ، يجد جوزيف ستيدمان نفسه موضوع اختبار غير راغب في عالم مهووس في معركة يمكن أن تنقذ العالم ، أو تدمره', 'higher-power-2018', 'https://m.media-amazon.com/images/M/MV5BMmUzNTE4N2EtMmU3NS00OWFiLWJiMDEtM2UwNjczNTQ1ZGQyXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 5.3, 'WEB-DL', 0, 1, 3607, '2019-04-14 09:29:53', '2019-04-14 09:30:18'),
(3604, 'مشاهدة فيلم Life And 1Day 2016 مترجم', 'مشاهدة فيلم Life And 1Day 2016 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر ” الحياة ويوم إضافي ” حول سومايه الابنة الأصغر لعائلة فقيرة ستتزوج والخوف يتملك كل فرد من العائلة فيما يخص كيفية التغلب على صوباتهم بعد رحيلها', 'life-and-1day-2016', 'uploads/301509268140.jpg', NULL, 'WEB-DL', 0, 1, 3608, '2019-04-14 09:30:07', '2019-04-14 09:30:17'),
(3605, 'مشاهدة فيلم Anaconda 1997 مترجم', 'مشاهدة و تحميل فيلم الاكشن والمغامره Anaconda 1997 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة ” أناكوندا ” حول يذهب فريق تصوير تابع لإحدى القنوات المهتمة بالطبيعة إلى غابات الأمازون، يبحث الفريق عن قبيلة هندية قديمة تتواجد هناك لتصويرها في فيلم وثائقي. خلال رحلتهم يقومون بإنقاذ رجل يدعى (بول سيرون) بعدما عثروا عليه متعلقًا ببقايا قارب غارق، فيضمونه إلى ركبهم حتى يتمكن من الوصول إلى بر الأمان. ولكن ما لا يعرفه أعضاء الفريق هو أن بول صياد مجنون، يستحوذ عليه حلم واحد هو التمكن من صيد ثعبان الأناكوندا العملاق، ويقرر أن يورط الجميع معه في رحلة بحثه عن الثعبان المخيف.', 'anaconda-1997', 'https://m.media-amazon.com/images/M/MV5BMTMzMTU5NjcxNl5BMl5BanBnXkFtZTcwMzE2NDU2MQ@@._V1_SX300.jpg', 4.7, 'BluRay', 0, 1, 3609, '2019-04-14 09:30:17', '2019-04-14 09:30:17'),
(3658, 'مشاهدة فيلم Dating My Mother 2017 مترجم', 'مشاهدة وتحميل فيلم الكوميديا Dating My Mother 2017 بجودة WEB-DL مترجم اون لاين وتحميل مباشر. تدور احداث قصه فيلم الكوميديا Dating My Mother 2017 ” مواعدة امي ” حول يستكشف الفيلم العلاقة الحميمة واحيانا الشديدة بين ام عزباء وابنها الشاذ بينما يستكشفان عالم المواعدة الالكترونية المثير للدوار.', 'dating-my-mother-2017', 'https://m.media-amazon.com/images/M/MV5BN2VlYzU3ZGMtMGE1Ni00OWQxLThiM2MtNDBkNTg2ZmMzZDcxXkEyXkFqcGdeQXVyNTU4MDgzMzc@._V1_SX300.jpg', 4.9, 'WEB-DL', 0, 1, 3662, '2019-04-14 09:33:33', '2019-04-14 09:38:29'),
(3660, 'مشاهدة فيلم The Kissing Booth 2018 مترجم', 'مشاهدة و تحميل فيلم الكوميديا والرومانسية The Kissing Booth 2018 مترجم اون لاين جودة WEB-DL وتحميل مباشر مشاهدة اون لاين مباشرة ” التقبيل ” حول حين تؤدّي القبلة الأولى للمراهقة “إيل” إلى علاقة رومانسيّة محرّمة مع أكثر شباب المدرسة الثانويّة جاذبيّة، تُخاطر بعلاقتها مع أعزّ صديقة', 'the-kissing-booth-2018', 'https://m.media-amazon.com/images/M/MV5BNjQ0Mzk0OTE5MF5BMl5BanBnXkFtZTgwNDkyOTI0NTM@._V1_SX300.jpg', 6.2, 'WEB-DL', 0, 1, 3664, '2019-04-14 09:33:42', '2019-04-14 09:38:28'),
(3661, 'مشاهدة فيلم Terminal 2018 مترجم', 'مشاهدة فيلم Terminal 2018 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر ” نهائي ” حول في مركز مدينة مجهولة مترامية الأطراف، حيث نشهد قصص قتلى مأجوريْن مليئة بالمنعطفات خلال تنفيذهما مهمة شريرة؛ أحدهم مُعلم يُصارع مرضًا مميتًا، والآخر حارس غامض، بينما الأخيرة نادلة تعيش حياة مزدوجة.. تنتج عن مهمتهم عواقب وخيمة؛ فتتشابك حيواتهم على يد مُدبرهّم الجنائي الغامض', 'terminal-2018', 'https://m.media-amazon.com/images/M/MV5BYmEzOGVmNWQtZDBiMC00OTk4LTg3OWQtMzc2MzgxNjlkY2JjXkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg', 5.3, 'WEB-DL', 0, 1, 3665, '2019-04-14 09:33:52', '2019-04-14 09:38:28'),
(3662, 'مشاهدة فيلم Revenge 2017 مترجم', 'مشاهدة وتحميل فيلم الاكشن والاثارة Revenge 2017 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب ” انتقام ” حول لا تأخذي عشيقتك في عطلات الشباب السنوية ، خاصة تلك المخصصة للصيد – درس عنيف لثلاثة رجال أثرياء متزوجين', 'revenge-2017', 'https://m.media-amazon.com/images/M/MV5BMTY2NjA5MDc0OF5BMl5BanBnXkFtZTgwNTE4OTA5MjE@._V1_SX300.jpg', 7.9, 'BluRay', 0, 1, 3666, '2019-04-14 09:33:52', '2019-04-14 09:38:27'),
(3663, 'مشاهدة فيلم The Magnificent Seven 2016 مترجم', 'مشاهدة وتحميل فيلم الاكشن والمغامره The Magnificent Seven 2016 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب في معالجة جديدة لفيلم (The Magnificent Seven) الذي قُدم في الستينات، يفد سبعة رجال خارجين عن القانون وهم مدججين بالسلاح من الغرب القديم إلى قرية بعيدة بهدف مساعدة أهلها في مقابل المال على مواجهة عصابة تحاول استغلالهم وإخضاعهم، ومع الوقت يكتشف الرجال السبعة أن هناك ما هو أهم وأكثر قيمة من المال.', 'the-magnificent-seven-2016', 'https://m.media-amazon.com/images/M/MV5BMTUzNTc0NTAyM15BMl5BanBnXkFtZTgwMTk1ODA5OTE@._V1_SX300.jpg', 6.9, 'BluRay', 0, 1, 3667, '2019-04-14 09:34:02', '2019-04-14 09:38:27'),
(3664, 'مشاهدة فيلم The Eagle Huntress 2016 مترجم', 'مشاهدة وتحميل فيلم الوثائقي والمغامره The Eagle Huntress 2016 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب يدور الفيلم حول فتاة منغولية صغيرة تحارب التقاليد، مستعرضًا لنا مجتمع البدو المنغوليين الكازخيين، مُفتشًا بعناية في تقاليد العمل بصيد النسور الذهبية.', 'the-eagle-huntress-2016', 'https://m.media-amazon.com/images/M/MV5BMjAxNDgwNDYzMl5BMl5BanBnXkFtZTgwNTQ3NDc3OTE@._V1_SX300.jpg', 7.5, 'BluRay', 0, 1, 3668, '2019-04-14 09:34:14', '2019-04-14 09:38:27'),
(3665, 'مشاهدة فيلم The Great Wall 2016 مترجم', 'مشاهدة و تحميل فيلم الاكشن والمغامره The Great Wall 2016 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة خلال الفترة التي حكمت فيها سلالة سونج اﻷراضي الصينية، تتكشف العديد من اﻷسرار التي تحيط بناء سور الصين العظيم، خاصة بعد أن يصير ويليام جارين وبيرو توفار في قبضة مجموعة من العسكريين الصينيين الذين يقومون بالتحضير ضد عملية غزو عارمة ضد السور تقع مرة واحدة كل ستين عامًا.', 'the-great-wall-2016', 'https://m.media-amazon.com/images/M/MV5BMjA3MjAzOTQxNF5BMl5BanBnXkFtZTgwOTc5OTY1OTE@._V1_SX300.jpg', 6, 'BluRay', 0, 1, 3669, '2019-04-14 09:34:20', '2019-04-14 09:38:26'),
(3666, 'مشاهدة فيلم The Man with Thousand Faces 2016 مترجم', 'مشاهدة وتحميل فيلم السيرة الذاتية والاثارة The Man with Thousand Faces 2016 بجودة BluRay مترجم اون لاين وتحميل مباشر. يحكي الفيلمقصة الرجل الذي خدع بلد بأكمله. حكاية من عمليات الاحتيال والمحتالين، الذي أخذ الإلهام من الوقائع الحقيقية ومن واحدة من الشخصيات الأكثر إثارة للاهتمام في العقود الأخيرة: انه الجاسوس فرانسيسكو .', 'the-man-with-thousand-faces-2016', 'https://m.media-amazon.com/images/M/MV5BODk1MmE4OTQtMTQ5OS00MGFhLWJmMGYtNzFiYjM0M2U5NjMwXkEyXkFqcGdeQXVyMTA0MjU0Ng@@._V1_SX300.jpg', 7, 'BluRay', 0, 1, 3670, '2019-04-14 09:34:26', '2019-04-14 09:38:26'),
(3667, 'مشاهدة فيلم Things to Come 2016 مترجم', 'مشاهدة فيلم الدراما Things to Come 2016 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. (ناتالي) تُدرِّس الفلسفة بمدرسة في (باريس)، وهي شخصية شغوفة بعملها مُحِبة للتأمل والتفكير، متزوجة ولديها طفليّن، تقسِّم وقتها بين أسرتها، طلابها، ووالدتها المتسلطة للغاية.. تستمر الامور على هذا المنوال إلى أن يعلن زوجها ذات يوم، أنه على وشك تركها من اجل امرأة اخرى، ليكون على (ناتالي) أن تتعامل مع هذا القرار.', 'things-to-come-2016', 'https://m.media-amazon.com/images/M/MV5BYjdlZGM0YjAtYWU0YS00MTIzLWE1ZmMtNWViOWFlYmFkNjg0L2ltYWdlXkEyXkFqcGdeQXVyNDkzNTM2ODg@._V1_SX300.jpg', 7, 'BluRay', 0, 1, 3671, '2019-04-14 09:34:37', '2019-04-14 09:38:26'),
(3668, 'مشاهدة فيلم To Walk Invisible 2016 مترجم', 'مشاهدة وتحميل فيلم السيرة الذاتية والدراما To Walk Invisible 2016 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب يحكي الفلم قصة الأخوات برونتي، مع التركيز على فترة كتابة ونشر الأعمال الروائية .', 'to-walk-invisible-2016', 'uploads/10920134957.jpg', NULL, 'BluRay', 0, 1, 3672, '2019-04-14 09:34:44', '2019-04-14 09:38:25'),
(3669, 'مشاهدة فيلم When the Bough Breaks 2016 مترجم', 'مشاهدة وتحميل فيلم الجريمة والدراما When the Bough Breaks 2016 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب تدور أحداث القصة حول الحياة العائلية ومعاناة البعض داخل العائلة وتربية الأولاد، حيث تهتم أم بتربية أولادها والقيام بواجباتها تجاههم كأم، ولكن تزداد حياتهم الأسرية تعقيدًا مع احتمالية قيام الأم بدور الأب إلى جانب دورها الأساسي.', 'when-the-bough-breaks-2016', 'https://m.media-amazon.com/images/M/MV5BMTc4MTk3Mzk4NV5BMl5BanBnXkFtZTgwMDgzNDUyOTE@._V1_SX300.jpg', 5, 'BluRay', 0, 1, 3673, '2019-04-14 09:34:56', '2019-04-14 09:38:25'),
(3670, 'مشاهدة فيلم Queen of Katwe 2016 مترجم', 'مشاهدة و تحميل فيلم السيرة الذاتية والدراما Queen of Katwe 2016 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة فتاة اوغاندية تدعى “فيونا موتوسي” و هي فتاة مثلها مثل باقي الشعب الاوغندي يعيش في فقر عظيم و لا يرون اي مخرج من ذلك الفقر . و لكن اثناء تنزهها في قريتها الصغيرة ما بين الخيم , ترى “فيونا” اثنان يلعبان لعبة الشطرنج , و تعجبها تلك اللعبة و تبدأ في تعلمها .', 'queen-of-katwe-2016', 'https://m.media-amazon.com/images/M/MV5BNzQ0MDg2NTY4N15BMl5BanBnXkFtZTgwOTk2NzU3OTE@._V1_SX300.jpg', 7.4, 'BluRay', 0, 1, 3674, '2019-04-14 09:35:05', '2019-04-14 09:38:25'),
(3671, 'مشاهدة فيلم Project 12: The Bunker 2016 مترجم', 'مشاهدة وتحميل فيلم الاكشن والمغامره Project 12: The Bunker 2016 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب تدور ملخص قصة الفيلم حول أثناء الحرب الباردة.', 'project-12-the-bunker-2016', 'uploads/13464227859.jpg', NULL, 'BluRay', 0, 1, 3675, '2019-04-14 09:35:31', '2019-04-14 09:38:25'),
(3672, 'مشاهدة فيلم Petes Dragon 2016 مترجم', 'مشاهدة و تحميل فيلم الاكشن والمغامره Petes Dragon 2016 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة يحاول فتى يتيم يعيش وسط عائلة قامت بتبنيه من قبل أن يهرب منهم، وذلك نتيجة للمعاملة السيئة التي يلقاها منهم، وفي مغامرته تلك يستعين بتنين أليف لتنفيذ مخطط هروبه من المنزل إلى عالم الحرية والاستقلالية والابتعاد عن والديه بالتبني.', 'petes-dragon-2016', 'uploads/142027940397.jpg', NULL, 'BluRay', 0, 1, 3676, '2019-04-14 09:35:34', '2019-04-14 09:38:24'),
(3673, 'مشاهدة فيلم Nocturnal Animals 2016 مترجم', 'مشاهدة وتحميل فيلم الجريمة والدراما Nocturnal Animals 2016 بجودة BluRay مترجم اون لاين وتحميل مباشر. قصة داخل قصة، حيث يتتبع الجزء الأول من الفيلم امرأة تُدعى (سوزان)، تتلقى مخطوطة كتابية من زوجها السابق – الذي تركها منذ عشرين سنة – يطلب فيها رأيها.. بينما يتتبع الجزء الثاني المخطوطة الفعلية بعنوان (Nocturnal Animals)، والتي تدور حول رجل في عطلته العائلية بهدف الاستجمام، لكنها تصير عُطلة عنيفة ومميتة! ثم يعود الفيلم مرة أخرى إلى سوزان التي تعيد اتصالها بزوجها الأول مُواجهة بعض الحقائق المظلمة عن نفسها.', 'nocturnal-animals-2016', 'https://m.media-amazon.com/images/M/MV5BMTYwMzMwMzgxNl5BMl5BanBnXkFtZTgwMTA0MTUzMDI@._V1_SX300.jpg', 7.5, 'BluRay', 0, 1, 3677, '2019-04-14 09:35:59', '2019-04-14 09:38:24'),
(3674, 'مشاهدة فيلم Morgan 2016 مترجم', 'مشاهدة و تحميل فيلم الاكشن والرعب Morgan 2016 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة مورجان (آنيا تايلور-جوي) انسانة آلية تم تخليقها في إحدى المعامل بواسطة مجموعة من العلماء، وتمتلك قدرات خارقة للتعلم السريع حتى أنها تتعلم السير والحديث خلال شهر واحد فقط، وتتجاوز توقعات صناعها أنفسهم، وعندما تدخل في نوبة غضب وتقوم بالهجوم على أحد العلماء، يفكر الفريق في تدميرها قبل أن تتسبب في المزيد من المشاكل.', 'morgan-2016', 'https://m.media-amazon.com/images/M/MV5BMjA1MjYyNDkxN15BMl5BanBnXkFtZTgwMTgxODAwOTE@._V1_SX300.jpg', 5.8, 'BluRay', 0, 1, 3678, '2019-04-14 09:36:34', '2019-04-14 09:38:24'),
(3675, 'مشاهدة فيلم Monster Trucks 2016 مترجم', 'مشاهدة وتحميل فيلم الاكشن والمغامره Monster Trucks 2016 مترجم بجودة BluRay كامل أون لاين. بحثًا عن أي سبيل يخلصه من الحياة في مدينته، يُشيّد تريب (لوكاس تيل)، المُعلم بإحدى المدارس الثانوية شاحنة عملاقة من حُطام وقطع السيارات الخَربة. وبعد وقوع حادث في موقع للتنقيب عن النفط، يظهر مخلوق غريب استثنائي وله موهبة كبيرة في السرعة، فيدرك تريب أنه قد وجد مفتاح الخلاص لهروبه من المدينة برفقة صديق غير متوقع.', 'monster-trucks-2016', 'https://m.media-amazon.com/images/M/MV5BMTEyMjAzMDk4ODZeQTJeQWpwZ15BbWU4MDUxNzMzMDEy._V1_SX300.jpg', 5.7, 'BluRay', 0, 1, 3679, '2019-04-14 09:36:51', '2019-04-14 09:38:24'),
(3677, 'مشاهدة فيلم Missing Woman 2016 مترجم', 'مشاهدة فيلم الدراما والغموض Missing Woman 2016 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. جي سون أم مُتطلقة تعمل في شركة إعلان و تُربي طفلتها لوحدها. تستعين بـ جليسة أطفال لمساعدتها برعاية طفلتها أثناء عملها. ذات يوم تختفي الجليسة مع الطفلة، لتبدأ الأم برحلة البحث عنهم لمدة أربعة أيام.', 'missing-woman-2016', 'https://images-na.ssl-images-amazon.com/images/M/MV5BOTRjODFiMzQtZjgyNi00MGU2LWIzMjMtMWVkYzdlZTU3NzQ1L2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyNDcyMjQ4MzU@._V1_SX300.jpg', 6.4, 'BluRay', 0, 1, 3681, '2019-04-14 09:37:00', '2019-04-14 09:38:23'),
(3678, 'مشاهدة فيلم The Queen of Sin 2018 مترجم', 'مشاهدة وتحميل فيلم الاثارة The Queen of Sin 2018 مترجم بجودة HDTV كامل اون لاين. ” ملكة الذنب ” حول امراة لديها رغبة اخيرة قبل الاستقرار مع خطيبها وهذا يجبرها على خلق كيان بديل. لكن ربما تعقد صفقة مع الشيطان.', 'the-queen-of-sin-2018', 'https://m.media-amazon.com/images/M/MV5BOTI1OTk4YzktNDk2ZC00MTk2LWEyYmUtMTQwY2NkMjVjNTI2XkEyXkFqcGdeQXVyMTk1NzUwMA@@._V1_SX300.jpg', 4.2, 'HDTV', 0, 1, 3682, '2019-04-14 09:37:06', '2019-04-14 09:38:23'),
(3679, 'مشاهدة فيلم Late Summer 2016 مترجم', 'مشاهدة وتحميل فيلم الدراما والغموض Late Summer 2016 مترجم بجودة BluRay كامل اون لاين. سيدة فرنسية تعيش بمفردها في قرية تعاني من ازدواجية في التفكير تتغير حياتها بوصول زوجين زائرين من بلد بعيدة في أوروبا.', 'late-summer-2016', 'https://ia.media-imdb.com/images/M/MV5BOTEyZjU2ZTctZTFiMi00Zjc5LTk0YWMtYTc2YzE5OTE0Y2Y4XkEyXkFqcGdeQXVyNDc4MDgzMzY@._V1_SX300.jpg', 7.5, 'BluRay', 0, 1, 3683, '2019-04-14 09:37:12', '2019-04-14 09:38:22'),
(3680, 'مشاهدة فيلم Live Cargo 2016 مترجم', 'مشاهدة وتحميل فيلم الدراما والاثارة Live Cargo 2016 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب زوجان يغلبهما الحزن والكمد، يختليان بأنفسهما في جزيرة نائية بـ(البهاما)، حيث يتورطان هناك في حرب عصابات بين عمدة الجزيرة ومُهرب جشع يتحلى بالخطورة.', 'live-cargo-2016', 'https://m.media-amazon.com/images/M/MV5BMTMwODZjYTgtNGU3NS00MTM5LThjOGEtMzJiY2JhZDIyY2I3XkEyXkFqcGdeQXVyMjgzMTIwNjA@._V1_SX300.jpg', 4.6, 'BluRay', 0, 1, 3684, '2019-04-14 09:37:14', '2019-04-14 09:38:22'),
(3681, 'مشاهدة فيلم Lo and Behold 2016 مترجم', 'مشاهدة وتحميل فيلم الوثائقي Lo and Behold 2016 بجودة HD مترجم اون لاين وتحميل مباشر. تدور أحداث الفيلم الوثائقي حول استكشاف المخرج (فيرنر هيرتسوغ) للإنترنت والاتصال بالعالم.', 'lo-and-behold-2016', 'uploads/23272392448.jpg', 0, 'HD', 0, 1, 3685, '2019-04-14 09:37:20', '2019-04-14 09:38:22'),
(3682, 'مشاهدة فيلم Loving 2016 مترجم', 'مشاهدة وتحميل فيلم السيرة الذاتية والدراما Loving 2016 مترجم بجودة HD كامل اون لاين. تدور اﻷحداث حول قصة حدثت بالفعل عن الزوجين ريتشارد وميلدريد ﻻفنج، واللذان تم إرسالهما إلى سجن وﻻية فيرجينيا عام 1958 لخرقهما قوانين الزواج في ذلك الوقت بسبب اختلافهما عرقيًا التي تفصل على نحو عنصري بين البيض والسود.', 'loving-2016', 'https://m.media-amazon.com/images/M/MV5BMjE4NTI3NjIzOF5BMl5BanBnXkFtZTgwNjI0NTI5ODE@._V1_SX300.jpg', 7, 'HD', 0, 1, 3686, '2019-04-14 09:37:26', '2019-04-14 09:38:21'),
(3683, 'مشاهدة فيلم Magnus 2016 مترجم', 'مشاهدة و تحميل فيلم الوثائقي Magnus 2016 مترجم اون لاين جودة DVDRip وتحميل مباشر مشاهدة اون لاين مباشرة من معجزة الطفل إلى عبقرية الشطرنج.', 'magnus-2016', 'https://m.media-amazon.com/images/M/MV5BMjM4MTY2Mjg2N15BMl5BanBnXkFtZTgwMDYwNDQ0MDI@._V1_SX300.jpg', 7.1, 'DVDRip', 0, 1, 3687, '2019-04-14 09:37:32', '2019-04-14 09:38:21'),
(3684, 'مشاهدة فيلم Sing 2016 مترجم', 'مشاهدة و تحميل فيلم القصير والدراما Sing 2016 مترجم اون لاين جودة HDTV وتحميل مباشر مشاهدة اون لاين مباشرة تدور أحداث الفيلم المبنية على قصة حقيقية داخل ملجىء للأطفال وتكوينهم فريق غنائي مميز , جدير بالذكر فوز الفيلم بجائزة الأوسكار عن أفضل فيلم قصير.', 'sing-2016', 'https://m.media-amazon.com/images/M/MV5BMTYzODYzODU2Ml5BMl5BanBnXkFtZTgwNTc1MTA2NzE@._V1_SX300.jpg', 7.1, 'HDTV', 0, 1, 3688, '2019-04-14 09:37:39', '2019-04-14 09:38:21'),
(3685, 'مشاهدة فيلم Ride Along 2 2016 مترجم', 'مشاهدة وتحميل فيلم الاكشن والكوميديا Ride Along 2 2016 مترجم بجودة BluRay كامل أون لاين. تدور أحداث الفيلم حول عناصر الشرطة ومواجهتها لعمليات تهريب المخدرات، حيث يقترب موعد زفاف (بن)، فيتوجه إلى ميامي مع (جايمس) والذي يعتبره أخوه في القانون، يستهدفان من زيارتهما إلى المدينة متابعة أحد أبرز تجار المخدرات بهدف القبض عليه ومنعه من تزويد التجار الصغار بهذه المخدرات وترويجها في مدينة أتلانتا.', 'ride-along-2-2016', 'https://m.media-amazon.com/images/M/MV5BNjU4NzYzOTY1MF5BMl5BanBnXkFtZTgwMTAyNTc1MDE@._V1_SX300.jpg', 6.2, 'BluRay', 0, 1, 3689, '2019-04-14 09:37:42', '2019-04-14 09:38:20'),
(3686, 'مشاهدة فيلم Restoration 2016 مترجم', 'مشاهدة وتحميل فيلم الرعب Restoration 2016 مترجم بجودة BluRay كامل اون لاين. تدور أحداث فيلم الرعب أثناء تجديدات في المنزل ثنائي شاب يطلقان روحا نارية تبحث عن الانتقام. لينقذا نفسيهما ويحررا الروح يجب أن يكشفا الغطاء عن الحقيقة المؤلمة. ولكن لا شيء سهل كما يبدو.', 'restoration-2016', 'https://m.media-amazon.com/images/M/MV5BZmQwODk5ZGItMDk5OS00MjU4LTgyYmUtYTBiMTFhYWM5MDY4XkEyXkFqcGdeQXVyMTMxMTY0OTQ@._V1_SX300.jpg', 6.7, 'BluRay', 0, 1, 3690, '2019-04-14 09:37:47', '2019-04-14 09:38:20'),
(3687, 'مشاهدة فيلم Mike and Dave Need Wedding Dates 2016 مترجم', 'مشاهدة وتحميل فيلم المغامره والكوميديا Mike and Dave Need Wedding Dates 2016 مترجم بجودة BluRay كامل أون لاين. تدور أحداث القصة حول شقيقين يقومان بوضع إعلان على الإنترنت من أجل الحصول على فتاة لكل منهما كرفيقة زفاف معه لحضور زفاف أخته في هاواي، ولكن مع انتشار الإعلان بشكل كبير على الإنترنت تخرج الأمور عن السيطرة بتدافع العديد من الفتيات لحضور المناسبة معهما.', 'mike-and-dave-need-wedding-dates-2016', 'https://m.media-amazon.com/images/M/MV5BMjM4NDIxNzI5Nl5BMl5BanBnXkFtZTgwMTg4NTY5NzE@._V1_SX300.jpg', 6, 'BluRay', 0, 1, 3691, '2019-04-14 09:38:03', '2019-04-14 09:38:20'),
(3688, 'مشاهدة فيلم Midnight Special 2016 مترجم', 'مشاهدة وتحميل فيلم الاكشن والدراما Midnight Special 2016 مترجم بجودة BluRay كامل أون لاين. تدور أحداث الفيلم حول والد يكتشف أن ابنه الصغير صاحب الأعوام الثمانية يمتلك قدرات خارقة، يبدأ الوالد مع ابنه في رحلة هروب من رجال دين متشددين وملاحقتهم لهم بهدف القبض على هذا الابن غير العادي، كما تطاردهم قوة خاصة من قوات الشرطة.', 'midnight-special-2016', 'https://m.media-amazon.com/images/M/MV5BMTcwYjMxNTAtMjZkNC00YjJlLTg2ZGItNTM0NWVhYzEzYTZkXkEyXkFqcGdeQXVyNTY0MTkxMTg@._V1_SX300.jpg', 6.6, 'BluRay', 0, 1, 3692, '2019-04-14 09:38:12', '2019-04-14 09:38:19'),
(3689, 'مشاهدة فيلم Michael Jacksons Journey from Motown to Off the Wall 2016 مترجم', 'مشاهدة وتحميل فيلم الوثائقي والموسيقى Michael Jacksons Journey from Motown to Off the Wall 2016 مترجم بجودة BluRay كامل اون لاين. فيلم يحكي قصة صعود “جاكسون” إلى عالم الشهرة والنجومية. هذا الفيلم يأخذ المشاهدين من بدايات “مايكل جاكسون” في “موتاون” إلى تعاونه مع شركة “سي بي اس” للتسجيلات وعلاقته مع المنتج الأسطوري “كوينسي جونز” في نظرة عميقة لشخصية “جاكسون” وأعماله التي حققت نجاحا هائلا وقلما تم تناولها.', 'michael-jacksons-journey-from-motown-to-off-the-wall-2016', 'uploads/311824590759.jpg', NULL, 'BluRay', 0, 1, 3693, '2019-04-14 09:38:19', '2019-04-14 09:38:19'),
(3740, 'مشاهدة فيلم Manhattan Night 2016 مترجم', 'مشاهدة وتحميل فيلم الجريمة والدراما Manhattan Night 2016 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب تدور أحداث الفيلم حول بورتر ورن (أدريان برودي)، كاتب لصحيفة شعبية لديه شهية كبيرة لأخبار التشهير، إن كانت أخبار تتعلق بجرائم القتل، أو أحداث درامية، أو أي شيء يصادفه ويعبر عن الحقيقة، بينما في منزله هو رجل عائلة نموذجي، يُكرِّس حبه لزوجته (جينيفر بيلز)، إلى أن يلتقي بالغريبة المثيرة (إيفون ستروفسكي) والتي تطلب منه أن يحل لغز مقتل زوجها صانع الأفلام والمخرج سيمون (كامبل سكوت)، فلا يستطيع مقاومة سحرها ويقع بغرامها.', 'manhattan-night-2016', 'https://m.media-amazon.com/images/M/MV5BMjQwMDE4NzQ5N15BMl5BanBnXkFtZTgwNzM0NDA3ODE@._V1_SX300.jpg', 6.2, 'BluRay', 0, 1, 3744, '2019-04-14 09:42:19', '2019-04-14 09:47:44'),
(3741, 'مشاهدة فيلم Kill Kane 2016 مترجم', 'مشاهدة وتحميل فيلم الجريمة والاثارة Kill Kane 2016 مترجم بجودة BluRay كامل أون لاين. رجل تتعرض اسرته لعملية قتل وحشية اثناء سرقة احدى العصابات المغمورة لمنزله تاركين اياه ينزف حتى الموت دون اى احد ليعتمد عليه . لكنه ينجح فى البقاء على قيد الحياة . ومع عدم وجود اى شىء ليخسره يبدأ يهيم فى الشوارع لتحقيق العدالة الغائبة و الانتقام اشد الانتقام ممن تسبب بقتل اسرته .', 'kill-kane-2016', 'https://m.media-amazon.com/images/M/MV5BNjE4NTQ2ODkwNV5BMl5BanBnXkFtZTgwNDEzODA3NzE@._V1_SX300.jpg', 3.9, 'BluRay', 0, 1, 3745, '2019-04-14 09:42:30', '2019-04-14 09:47:44'),
(3742, 'مشاهدة فيلم Keanu 2016 مترجم', 'مشاهدة فيلم Keanu 2016 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر تدور أحداث القصة حول فقدان (ريل) لحيوانه الأليف (كيانو) من المنزل، يقوم ريل وصديقه بالتنكر في شخصيات تجار مخدرات والنزول للشارع من أجل استرداد قطه الضائع من أيدي عصابة عنيفة.', 'keanu-2016', 'https://m.media-amazon.com/images/M/MV5BMTUwODA0NzQxMl5BMl5BanBnXkFtZTgwNzUyMjY3ODE@._V1_SX300.jpg', 6.3, 'BluRay', 0, 1, 3746, '2019-04-14 09:42:48', '2019-04-14 09:47:43'),
(3743, 'مشاهدة فيلم How to be Single 2016 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والرومانسية How to be Single 2016 مترجم بجودة BluRay كامل أون لاين. يعتقد البعض بوجود طريقة صحيحة لتكون عازبًا وطريقة أخرى خاطئة لتكون عازبًا في مدينة (نيويورك) المليئة بوحيدي القلوب الذين يسعون للوصول إلى شريك ملائم لهم، سواء كانت علاقة تقوم على الحب، أو مجرد لقاءات ودية، أو شيء في المنتصف.', 'how-to-be-single-2016', 'https://m.media-amazon.com/images/M/MV5BNzI4MDMwMzUwNF5BMl5BanBnXkFtZTgwMDgyNzkyNzE@._V1_SX300.jpg', 6.1, 'BluRay', 0, 1, 3747, '2019-04-14 09:43:01', '2019-04-14 09:47:43'),
(3744, 'مشاهدة فيلم Home Invasion 2016 مترجم', 'مشاهدة فيلم الاثارة Home Invasion 2016 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. تدور الأحداث عندما يتم إستهداف إمرأة ثرية وإبن زوجها من قبل ثلاثة لصوص وتحول بإستماته التخلص والهرب منهم بسبب تحولهم إلى أشخاص أكثر عدوانية .', 'home-invasion-2016', 'https://m.media-amazon.com/images/M/MV5BNzY3NzE4NTMxM15BMl5BanBnXkFtZTgwNzMwNjk4NzE@._V1_SX300.jpg', 5.1, 'BluRay', 0, 1, 3748, '2019-04-14 09:43:14', '2019-04-14 09:47:43'),
(3745, 'مشاهدة فيلم Eddie the Eagle 2016 مترجم', 'مشاهدة وتحميل فيلم السيرة الذاتية والكوميديا Eddie the Eagle 2016 بجودة HD مترجم اون لاين وتحميل مباشر. تدور أحداث الفيلم حول إدي إدواردز الملقب ب(إدي النسر) وهو أشهر المتزلجين الإنجليز، في تناول لأهم التحديات والمواجهات الصعبة التي مر بها خلال تاريخه الرياضي، حيث يركز العمل على أخلاقياته وروحه الرياضية وتصميمه على خوض كافة التحديات دون يأس، وتزداد ثقة إدي بنفسه مع وجود مدرب وجمهور كبير من المشجعين الداعمين والمحبين له خلال مشاركته في بطولة الألعاب الأوليمبية عام 1988.', 'eddie-the-eagle-2016', 'https://m.media-amazon.com/images/M/MV5BMTUxOTc5MTU1NF5BMl5BanBnXkFtZTgwODYyNTA1NzE@._V1_SX300.jpg', 7.4, 'HD', 0, 1, 3749, '2019-04-14 09:43:21', '2019-04-14 09:47:42'),
(3746, 'مشاهدة فيلم Deadpool 2016 مترجم', 'مشاهدة فيلم Deadpool 2016 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر كان وايد ويلسون (ريان رينولدز) يعمل في السابق في القوات الخاصة، لكنه سرعان ما تحول إلى مرتزق ومنح لنفسه اسم (ديدبول) بعد أن تعرض إلى تجربة قاسية تركته بمهارات عالية مثل القدرة على إعادة شفاء نفسه، يخرج (ديدبول) بمهاراته إلى الشارع لينتقم من الرجل الذي دمر حياته.', 'deadpool-2016', 'https://m.media-amazon.com/images/M/MV5BYzE5MjY1ZDgtMTkyNC00MTMyLThhMjAtZGI5OTE1NzFlZGJjXkEyXkFqcGdeQXVyNjU0OTQ0OTY@._V1_SX300.jpg', 8, 'BluRay', 0, 1, 3750, '2019-04-14 09:43:29', '2019-04-14 09:47:42'),
(3747, 'مشاهدة فيلم Barbershop: The Next Cut 2016 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والدراما Barbershop: The Next Cut 2016 بجودة BluRay مترجم اون لاين وتحميل مباشر. تدور أحداث الفيلم بعد مرور عشر سنوات من افتتاح (كالفن) لمحل الكوافير الخاص به، حيث يستمر العمل في الكوافير على يد كالفن وطاقمه المعتاد، ولكن مع مرور السنوات تتغير الأمور ولا يقتصر العمل على الرجال فقط، إنما يتحول المحل لكوافير مختلط يمتليء بالذكور والإناث.', 'barbershop-the-next-cut-2016', 'https://m.media-amazon.com/images/M/MV5BMzUxMzM5MjIxNF5BMl5BanBnXkFtZTgwMDk1NzMzNzE@._V1_SX300.jpg', 5.9, 'BluRay', 0, 1, 3751, '2019-04-14 09:43:34', '2019-04-14 09:47:42'),
(3748, 'مشاهدة فيلم 10 Cloverfield Lane 2016 مترجم', 'مشاهدة فيلم 10 Cloverfield Lane 2016 بجودة HD مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر تتعرض شابة لحادث سيارة تستيقظ منه لتجد نفسها داخل قبو منزل مع شخص غريب عنها، ويخبرها هذا الشخص بحدوث هجمات كيماوية وأنه قد أنقذ حياتها من موت محتوم بعد أن دمّر هذا الهجوم الحياة المعتادة التي تألفها وأصبحت المنازل غير قابلة للإقامة بداخلها، تشك الفتاة في كلامه وتقرر الهروب من القبو والتأكد من صحة كلامه بنفسها.', '10-cloverfield-lane-2016', 'https://m.media-amazon.com/images/M/MV5BMjEzMjczOTIxMV5BMl5BanBnXkFtZTgwOTUwMjI3NzE@._V1_SX300.jpg', 7.2, 'HD', 0, 1, 3752, '2019-04-14 09:43:38', '2019-04-14 09:47:41'),
(3749, 'مشاهدة فيلم The Death of Louis XIV 2016 مترجم', 'مشاهدة و تحميل فيلم السيرة الذاتية والدراما The Death of Louis XIV 2016 مترجم اون لاين جودة HDRip وتحميل مباشر مشاهدة اون لاين مباشرة بعد العودة من رحلة صيد، الملك لويس السادس عشر شعر بألم في قدمه، وبدأ في الإحتضار، مُحاطًا ب أتباعه الأولياء في القصر الملكي.', 'the-death-of-louis-xiv-2016', 'https://m.media-amazon.com/images/M/MV5BNDE3ZjA5OWEtNWEyMi00NDM0LTkwNzctODc3MmI2ZjY4NGZkXkEyXkFqcGdeQXVyMTg5MDEyNw@@._V1_SX300.jpg', 6.8, 'HDRip', 0, 1, 3753, '2019-04-14 09:43:42', '2019-04-14 09:47:41'),
(3750, 'مشاهدة فيلم Mascots 2016 مترجم', 'مشاهدة وتحميل فيلم الكوميديا Mascots 2016 مترجم بجودة WEBRip كامل اون لاين. يلقي الفيلم نظرة كوميدية على تمائم الحظ التي تشكل جزء لا يتجزأ من كافة البطولات الرياضية.', 'mascots-2016', 'https://m.media-amazon.com/images/M/MV5BMjQxNjAxMzI5Ml5BMl5BanBnXkFtZTgwMzE2NjA5OTE@._V1_SX300.jpg', 5.7, '0', 0, 1, 3754, '2019-04-14 09:43:48', '2019-04-14 09:47:41'),
(3751, 'مشاهدة فيلم Snowbound 0 مترجم', 'مشاهدة وتحميل فيلم الاثارة Snowbound 0 مترجم بجودة WEB-DL كامل أون لاين. ” مقيد بالثلج ” حول تستيقظ مجموعة من الحاضرين من حفلات الجنس عارية في الثلج. في الكابينة القريبة تجد فتاة ميتة ورسالة: من أجل البقاء على قيد الحياة ، يجب أن يقرروا من المسؤول عن وفاة الفتاة وقتلها ذلك الشخص وفقًا لذلك', 'snowbound-0', 'uploads/111154258329.jpg', 5.2, 'WEB-DL', 0, 1, 3755, '2019-04-14 09:44:05', '2019-04-14 09:47:40'),
(3752, 'مشاهدة فيلم Dead List 2018 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والرعب Dead List 2018 مترجم بجودة HDRip كامل أون لاين. ” قائمة الميت ” حول يستحضر الممثل المناضل قوة مظلمة من أجل الفوز بدور فيلم', 'dead-list-2018', 'https://m.media-amazon.com/images/M/MV5BYjRlZGNmMTAtMTkyYy00NTVhLWExNjMtYmQyZjkxMTgyMGViXkEyXkFqcGdeQXVyMjM5MTYyOTA@._V1_SX300.jpg', 3.5, 'HDRip', 0, 1, 3756, '2019-04-14 09:44:14', '2019-04-14 09:47:40'),
(3753, 'مشاهدة فيلم Blind Fury 1989 مترجم', 'مشاهدة وتحميل فيلم الاكشن والكوميديا Blind Fury 1989 مترجم بجودة BluRay كامل أون لاين. نيك باركر (راتغر هاور)، وهو جندي أمريكي خدم في حرب فيتنام، يصاب بالعمى نتيجة انفجار قذائف هاون في هجوم على الجيش الأمريكي، بعد أن يضيع في الغابات بوقت قصير، يتم انقاذه من قبل السكان القرويين المحليين الذين يقومون بمساعدته على استعادة صحته. وعلى الرغم من فقدانه لبصره، إلا انه يتم تدريب من قبل سيد محلي على القتال والمبارزة بالسيف بواسطة حواسه الأخرى.', 'blind-fury-1989', 'https://m.media-amazon.com/images/M/MV5BM2NjZWRmZDEtZDA3ZS00Y2EzLTk2YTktMWFjMjczZGI2MmVlXkEyXkFqcGdeQXVyMjUyNDk2ODc@._V1_SX300.jpg', 6.3, 'BluRay', 0, 1, 3757, '2019-04-14 09:44:18', '2019-04-14 09:47:39'),
(3754, 'مشاهدة فيلم Lean on Pete 2017 مترجم', 'مشاهدة وتحميل فيلم المغامره والدراما Lean on Pete 2017 مترجم بجودة WEB-DL كامل أون لاين. ” الاستناد على بيت ” حول يتتبع الفيلم صبي في الخامسة عشر من عمره يُدعى (تشارلي تومبسون)؛ يرغب في منزل، طعام على مائدته، ومدرسة ثانوية يمكنه الالتحاق بها على مدار العام. لكن باعتباره ابنًا لأب يعمل في مستودعات شمال غرب المحيط الهادئ، فمن الصعب أن يحصل على الاستقرار', 'lean-on-pete-2017', 'https://m.media-amazon.com/images/M/MV5BNWRiYzYxNTEtYmU5My00M2Q5LTk5Y2ItZjhkMTZmNjVhYmFhXkEyXkFqcGdeQXVyNTAzMTY4MDA@._V1_SX300.jpg', 7.2, 'WEB-DL', 0, 1, 3758, '2019-04-14 09:44:27', '2019-04-14 09:47:39'),
(3755, 'مشاهدة فيلم Darrow Darrow 2017 مترجم', 'مشاهدة وتحميل فيلم الكوميديا Darrow Darrow 2017 مترجم بجودة WEB-DL كامل أون لاين. ” دارو و درو ” حول كلير دارو هي أم وحيدة ومحامية ، تريد دائمًا أن تفعل الصواب. عندما يُدان صديق مقرب بسرقة متجر مجوهرات باهظة الثمن ، يعود الأمر إلى كلير لتحقيق العدالة', 'darrow-darrow-2017', 'https://m.media-amazon.com/images/M/MV5BZGVmNWE0YmYtZjA4Mi00Nzk0LWJhYzQtODZmMmRkZGY5MzU0XkEyXkFqcGdeQXVyNTU2MDQyOTk@._V1_SX300.jpg', 7, 'WEB-DL', 0, 1, 3759, '2019-04-14 09:44:36', '2019-04-14 09:47:38'),
(3756, 'مشاهدة فيلم Captain America: Civil War 2016 مترجم', 'مشاهدة وتحميل فيلم الاكشن والمغامره Captain America: Civil War 2016 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب تتناول قصة الفيلم محاولة المنظمات الحكومية للتحكم في أنشطة الأبطال الخارقين والوقوف وجهًا لوجه ضد فريق المنتقمين، فيجد (كابتن أمريكا) نفسه في صراع مع حلفائه السابقين وعلى رأسهم (الرجل الحديدي) بهدف تقسيمهم وإضعافهم للسيطرة عليهم.', 'captain-america-civil-war-2016', 'https://m.media-amazon.com/images/M/MV5BMjQ0MTgyNjAxMV5BMl5BanBnXkFtZTgwNjUzMDkyODE@._V1_SX300.jpg', 7.8, 'BluRay', 0, 1, 3760, '2019-04-14 09:44:49', '2019-04-14 09:47:38'),
(3757, 'مشاهدة فيلم Warcraft 2016 مترجم', 'مشاهدة وتحميل فيلم الاكشن والمغامره Warcraft 2016 بجودة BluRay مترجم اون لاين وتحميل مباشر. في إطار من الفانتازيا والمغامرات الخيالية يقدم الفيلم الملحمة الأسطورية التي قيلت عن الصراع المرير بين البشر والأورك في عالم آزيروث، متناولًا من خلال الأحداث كل جوانب الصراع الذي شهد اتحادهم لمواجهة الخطر القادم الذي يهدد بقاؤهم على سطح الأرض.', 'warcraft-2016', 'https://m.media-amazon.com/images/M/MV5BMjIwNTM0Mzc5MV5BMl5BanBnXkFtZTgwMDk5NDU1ODE@._V1_SX300.jpg', 6.9, 'BluRay', 0, 1, 3761, '2019-04-14 09:44:57', '2019-04-14 09:47:38'),
(3758, 'مشاهدة فيلم Miracles from Heaven 2016 مترجم', 'مشاهدة وتحميل فيلم السيرة الذاتية والدراما Miracles from Heaven 2016 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب تكتشف كريستي (جينيفر جارنر) أن ابنتها الصغيرة آنا البالغة من العمر 10 سنوات تعاني من اضطراب هضمي نادر، وبعد تعرضها لحادث غريب من نوعه، تنقلب الأمور رأسًا على عقب بعد الحادث وتشاهد الفتاة أمور من العالم الآخر مع اقترابها من الموت.', 'miracles-from-heaven-2016', 'https://m.media-amazon.com/images/M/MV5BMjkyOTI5NzgxMl5BMl5BanBnXkFtZTgwNjg4MzQzNzE@._V1_SX300.jpg', 7.1, 'BluRay', 0, 1, 3762, '2019-04-14 09:45:21', '2019-04-14 09:47:38'),
(3759, 'مشاهدة فيلم Me Before You 2016 مترجم', 'مشاهدة وتحميل فيلم الدراما والرومانسية Me Before You 2016 بجودة BluRay مترجم اون لاين وتحميل مباشر. (لو كلارك) شابة تعمل في أحد المتاجر، وتعيش حياتها التي تعرفها من عدد خطواتها إلى محطة الأتوبيس وصولًا إلى صعوبة قبولها حب صديقها (باتريك)، ولكنها لم تكن تتوقع طردها من العمل، وعلى الجانب الآخر تقع حادثة دراجة نارية للشاب (ويل تراينور) تمنعه عن القيام بكل ما اعتاد عليه في السابق، يقترب عالميهما معًا لتزيد حياة كل واحد منهما بهجة وسعادة على غير المنتظر.', 'me-before-you-2016', 'https://m.media-amazon.com/images/M/MV5BMTQ2NjE4NDE2NV5BMl5BanBnXkFtZTgwOTcwNDE5NzE@._V1_SX300.jpg', 7.4, 'BluRay', 0, 1, 3763, '2019-04-14 09:45:34', '2019-04-14 09:47:37'),
(3760, 'مشاهدة فيلم Zoolander 2 2016 مترجم', 'مشاهدة وتحميل فيلم الكوميديا Zoolander 2 2016 بجودة BluRay مترجم اون لاين وتحميل مباشر. بعد 10 سنوات من أحداث الجزء الأول، يعود كل من (زولاندر) و(هانسل) للعمل مجددًا في مجال عروض الأزياء، لكن الأمر يصير أكثر صعوبة في ظل وجود شركة تتعارض مصالحها مع مصالحهما، وتحاول عرقلة عملهما وإخراجهما خارج المجال تمامًا.', 'zoolander-2-2016', 'https://m.media-amazon.com/images/M/MV5BODI4NDY2NDM5M15BMl5BanBnXkFtZTgwNzEwOTMxMDE@._V1_SX300.jpg', 6.6, 'BluRay', 0, 1, 3764, '2019-04-14 09:45:49', '2019-04-14 09:47:37'),
(3761, 'مشاهدة فيلم XOXO 2016 مترجم', 'مشاهدة و تحميل فيلم الدراما والموسيقى XOXO 2016 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة تدور ملخص قصة الفيلم حول ستة اشخاص غرباء يعيشون فى تصادم ليلة واحدة رومنسية مليئة بالمشاكل والجنون وملاحقة الاحلام.', 'xoxo-2016', 'https://m.media-amazon.com/images/M/MV5BNjkzNzI4MjQ5NV5BMl5BanBnXkFtZTgwNjc3MzM2OTE@._V1_SX300.jpg', 5.3, 'BluRay', 0, 1, 3765, '2019-04-14 09:46:00', '2019-04-14 09:47:37'),
(3762, 'مشاهدة فيلم Triple 9 2016 مترجم', 'مشاهدة وتحميل فيلم الاكشن والجريمة Triple 9 2016 مترجم بجودة BluRay كامل أون لاين. تخطط عصابة بالتعاون مع بعض العناصر الفاسدة من قوات الشرطة لاغتيال أحد ضباط الشرطة الصالحين بهدف إخلاء الطريق أمامهم لتنفيذ عملية سطو كبيرة، ويضعون فيما بينهم رمزًا هو (999) للتعبير عن إصابة شرطي بهدف استدراج الشرطي الصالح، ولكن تتدهور خطتهم مع حدوث أمور غير متوقعة بمقاومة أحد الأعضاء الغير مشكوك في أمره لذلك الهجوم.', 'triple-9-2016', 'uploads/22594757044.jpg', 7.1, 'BluRay', 0, 1, 3766, '2019-04-14 09:46:10', '2019-04-14 09:47:36'),
(3763, 'مشاهدة فيلم The Division: Agent Origins 2016 مترجم', 'مشاهدة وتحميل فيلم القصير والاكشن The Division: Agent Origins 2016 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب تدور أحداث فيلم القصير حيث مجموعه من الإحتلالات المدمرة من خلال مدينة نيويورك يوم الجمعة الأسود وينهار المجتمع فى حاله من الفوضي حيث تظهر وحدة سرية من وكلاء الدعم الذاتي يعيشون حياة طبيعية وهم مدربون على العمل بشكل مستقل وتتوالى أحداث الفيلم فى إطار من الأكشن', 'the-division-agent-origins-2016', 'https://m.media-amazon.com/images/M/MV5BNjk3MzE1NzIyOF5BMl5BanBnXkFtZTgwNTEwMDc3NzE@._V1_SX300.jpg', 6.2, 'BluRay', 0, 1, 3767, '2019-04-14 09:46:19', '2019-04-14 09:47:36'),
(3764, 'مشاهدة فيلم The Shallows 2016 مترجم', 'مشاهدة وتحميل فيلم الدراما والرعب The Shallows 2016 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب عندما تُهاجَم نانسي (بلايك ليفلي) مِن قِبَل سمكة قرش بيضاء عملاقة أثناء ممارستها ركوب الأمواج بمفردها، تتقطع بها السبل على مقربة من الشاطئ، فتصبح على بعد مائتي ياردة فقط من نجاتها وبقائها على قيد الحياة، ثم تدرك أن الوصول لهناك وبلوغ النجاة هو أمر يحتاج إلى إرادة فولاذية.', 'the-shallows-2016', 'https://m.media-amazon.com/images/M/MV5BMjA1MTA4MzU4Ml5BMl5BanBnXkFtZTgwNjUxNjczODE@._V1_SX300.jpg', 6.3, 'BluRay', 0, 1, 3768, '2019-04-14 09:46:29', '2019-04-14 09:47:36'),
(3765, 'مشاهدة فيلم The Darkness 2016 مترجم', 'مشاهدة وتحميل فيلم الرعب والاثارة The Darkness 2016 مترجم بجودة BluRay كامل اون لاين. تدور أحداث القصة حول عودة عائلة من عطلة عائلية ممتعة، ولكن العائلة لم تعُد كما ذهبت بل عادت ومعها قوة خارقة للطبيعة.', 'the-darkness-2016', 'https://m.media-amazon.com/images/M/MV5BMjIxMTg2NjAyMV5BMl5BanBnXkFtZTgwNDE5ODIxODE@._V1_SX300.jpg', 4.4, 'BluRay', 0, 1, 3769, '2019-04-14 09:46:37', '2019-04-14 09:47:35'),
(3766, 'مشاهدة فيلم Looking: The Movie 2016 مترجم', 'مشاهدة فيلم Looking: The Movie 2016 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر تدور أحداث قصة حول يعود باتريك الي سان فرانسيسكو لمحاولة تجديد علاقاتة مع اصدقائة ريتشي و كيفين.', 'looking-the-movie-2016', 'uploads/261680772977.jpg', NULL, 'BluRay', 0, 1, 3770, '2019-04-14 09:46:46', '2019-04-14 09:47:35'),
(3767, 'مشاهدة فيلم Approaching the Unknown 2016 مترجم', 'مشاهدة وتحميل فيلم الدراما والخيال العلمي Approaching the Unknown 2016 بجودة BluRay مترجم اون لاين وتحميل مباشر. تدور أحداث الفيلم حول كابتن (ويليام ستانفورث)، رائد الفضاء الذي ينطلق بمفرده في مهمة أحادية الإتجاه لقطع أولى خطوات استعمار المريخ، ومثل سائر الرواد على مر التاريخ، يواجه ستانفورد ظروف لا يمكن التغلب عليها، وقرارات مصيرية بين الحياة والموت خلال خوضه في محيط الفضاء.', 'approaching-the-unknown-2016', 'https://m.media-amazon.com/images/M/MV5BMTEzMDU3NjQyNTReQTJeQWpwZ15BbWU4MDY2MTk1Nzgx._V1_SX300.jpg', 4.8, 'BluRay', 0, 1, 3771, '2019-04-14 09:46:55', '2019-04-14 09:47:35');
INSERT INTO `movies` (`id`, `name`, `description`, `slug`, `image_url`, `ratings`, `quality`, `views`, `category_id`, `server_links`, `created_at`, `updated_at`) VALUES
(3768, 'مشاهدة فيلم The Young Messiah 2016 مترجم', 'مشاهدة وتحميل فيلم الدراما والفانتازيا The Young Messiah 2016 مترجم بجودة BluRay كامل اون لاين. تدور أحداث الفيلم بعد بلوغ السيد المسيح سن السابعة، حيث ينتقل مع والديه إلى (الإسكندرية) في (مصر) هروبًا من مجزرة الأطفال التي ارتكبها ملك إسرائيل، ثم يشك المسيح بوجود أسرار عن مولده وسر اختلافه عن باقي الأطفال في عمره ولكن يخفيها والداه عنه، واللذان آمنا بضرورة عدم إخباره بحقيقة مولده لصغر سنه، يعود المسيح مع والديه إلى (الناصرة) مرة أخرى بعد وفاة الملك الإسرائيلي.', 'the-young-messiah-2016', 'https://m.media-amazon.com/images/M/MV5BMTU4NzM3NzczMF5BMl5BanBnXkFtZTgwMzM0NjkwNzE@._V1_SX300.jpg', 5.6, 'BluRay', 0, 1, 3772, '2019-04-14 09:47:03', '2019-04-14 09:47:34'),
(3769, 'مشاهدة فيلم The Last Heist 2016 مترجم', 'مشاهدة وتحميل فيلم الاكشن والرعب The Last Heist 2016 مترجم بجودة BluRay كامل أون لاين. تدور احداث قصة فيلم فى اطار من الجريمة والتشويق حول سرقة بنك وتتسبب فوضى عنيفة عند احد الرهائن تبين أن يكون سفاحا مما أدى إلى محاصرة فريق منظم بشكل جيد من لصوص البنوك في المبنى الآن ويتم قتلهم واحدا تلو الآخر', 'the-last-heist-2016', 'https://m.media-amazon.com/images/M/MV5BMjAzMjk2MzI2Ml5BMl5BanBnXkFtZTgwMjM0OTM3ODE@._V1_SX300.jpg', 3.6, 'BluRay', 0, 1, 3773, '2019-04-14 09:47:12', '2019-04-14 09:47:34'),
(3770, 'مشاهدة فيلم The Boss 2016 مترجم', 'مشاهدة وتحميل فيلم الكوميديا The Boss 2016 مترجم بجودة BluRay كامل اون لاين. تدور أحداث الفيلم حول ميشيل دارنيل سيدة الأعمال والرائدة الصناعية الكبيرة التي يتم اتهامها بتعاملات غير قانونية لتدخل على إثره السجن، وبعد الإفراج عنها تحاول العودة مرة أخرى إلى المجتمع في صورة جديدة آملة في استعادة ثقة الجمهور مرة أخرى، لكنها تواجه صعوبات في تقبل الناس لها بعد تلك القضية.', 'the-boss-2016', 'https://m.media-amazon.com/images/M/MV5BMjQzNTUwNDU0OV5BMl5BanBnXkFtZTgwNzU5NTAwODE@._V1_SX300.jpg', 5.4, 'BluRay', 0, 1, 3774, '2019-04-14 09:47:24', '2019-04-14 09:47:34'),
(3771, 'مشاهدة فيلم Suicide Squad 2016 مترجم', 'مشاهدة فيلم Suicide Squad 2016 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر تدور أحداث قصة فيلم ” الفرقة الانتحارية ” حول مجموعة من الأشخاص المسجونين الأكثر شرًا على الأرض ويعرفهم الجميع باسم (الفرقة الانتحارية)، والذين ينجحوا في عقد معاهدات مع وكالة حكومية فاسدة من أجل تنفيذ مهام شديدة الخطورة ومقابل ذلك سيحصل جميع أفراد (الفرقة الانتحارية) على الأمان والحماية بالسجن، فضلًا عن بعض المزايا الأخرى.', 'suicide-squad-2016', 'https://m.media-amazon.com/images/M/MV5BMjM1OTMxNzUyM15BMl5BanBnXkFtZTgwNjYzMTIzOTE@._V1_SX300.jpg', 6.1, 'BluRay', 0, 1, 3775, '2019-04-14 09:47:33', '2019-04-14 09:47:33'),
(3824, 'مشاهدة فيلم Sniper: Special Ops 2016 مترجم', 'مشاهدة فيلم Sniper: Special Ops 2016 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر حول فرقة عملبات خاصة في الجيش يقودهم قناص خبير هو الرقيب “جايك تشاندلر” يت ارسالهم الى قرية في افغانستان لينقذوا عضو كونغرس تم احتجازه من قبل طالبان. نجحت مهمة الانقاذ ولكن “جايك” انفصل بعد معركة مع العدو وبقي ليساعد جنديا مصابا.', 'sniper-special-ops-2016', 'https://m.media-amazon.com/images/M/MV5BMTgyNTI3MDE0MF5BMl5BanBnXkFtZTgwMTkwNTc3NzE@._V1_SX300.jpg', 3.3, 'BluRay', 0, 1, 3828, '2019-04-14 09:51:09', '2019-04-14 09:57:23'),
(3825, 'مشاهدة فيلم Sing Street 2016 مترجم', 'مشاهدة فيلم الكوميديا والدراما Sing Street 2016 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. تدور أحداث القصة حول هروب أحد الشباب من حياته العائلية المتوترة ومشكلات منزله إلى الموسيقى والغناء، حيث يقوم بتكوين فرقة موسيقية غنائية مع بعض أصدقائه وينتقل من مدينة دبلن الأيرلندية إلى لندن بالمملكة المتحدة لينطلق منها ويحقق أحلام حياته.', 'sing-street-2016', 'https://m.media-amazon.com/images/M/MV5BMjEzODA3MDcxMl5BMl5BanBnXkFtZTgwODgxNDk3NzE@._V1_SX300.jpg', 8, 'BluRay', 0, 1, 3829, '2019-04-14 09:51:21', '2019-04-14 09:57:22'),
(3826, 'مشاهدة فيلم Grandpas Great Escape 2018 مترجم', 'مشاهدة وتحميل فيلم العائلي Grandpas Great Escape 2018 بجودة HDTV مترجم كامل اون لاين مشاهدة مباشرة يوتيوب يقرر صبي مساعدة جده ، وهو طيار يعمل في الحرب العالمية الثانية ويخضع الآن لمرض الزهايمر ، هربًا من منزل عتيق تديره امرأة ذات دوافع خفية.', 'grandpas-great-escape-2018', 'uploads/2924588603.jpg', NULL, 'HDTV', 0, 1, 3830, '2019-04-14 09:51:27', '2019-04-14 09:57:22'),
(3827, 'مشاهدة فيلم Drones 2013 مترجم', 'مشاهدة وتحميل فيلم الاثارة Drones 2013 مترجم بجودة BluRay كامل أون لاين. “طائرات بدون طيار” فى اطار من الاثارة حيث تدور ملخص قصة الفيلم حول جنديان يقرران مصير ارهابي بضغطه واحدة على الزر واستخدام الطائرات العسكرية بدون طيار ومع مرور الوقت يبدا الجنود بالسؤال ما هى الدوافع الحقيقية وراء الهجوم المميت.', 'drones-2013', 'https://m.media-amazon.com/images/M/MV5BNzM3MjQzNzU1NV5BMl5BanBnXkFtZTgwOTc1NDg4MTE@._V1_SX300.jpg', 4.5, 'BluRay', 0, 1, 3831, '2019-04-14 09:51:32', '2019-04-14 09:57:22'),
(3828, 'مشاهدة فيلم Arabesque 1966 مترجم', 'مشاهدة وتحميل فيلم الاكشن والمغامره Arabesque 1966 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب طبيب عيون يقتل الاستاذ راغب(George Coulouris)ويستولى على المدونة الهيروغليفية المخبأة فى نظارته،ثم يسعى الى البروفيسير الأمريكى ديفيد بولوك (Gregory Peck)ليقدم له نفسه على انه الرائد سيلفستر بنينجتون سلون (John Merivale)وإنه يريد منه السفر الى لندن لمقابلة الثرى نجم بيشرافى (Alan Badel)ليترجم له مدونة هيروغليفية،حيث كان ديفيد بولوك أستاذا فى اللغة الهيروغليفية المصرية القديمة بجامعة إكسفورد،ولكن بولوك رفض السفر.', 'arabesque-1966', 'https://m.media-amazon.com/images/M/MV5BZDU3ODBjYWItMDNiNC00YmNlLTg4N2YtYThjNjZjYmM4YWNkXkEyXkFqcGdeQXVyMDI2NDg0NQ@@._V1_SX300.jpg', 6.5, 'BluRay', 0, 1, 3832, '2019-04-14 09:51:39', '2019-04-14 09:57:22'),
(3829, 'مشاهدة فيلم To Sir, with Love 1967 مترجم', 'مشاهدة وتحميل فيلم الدراما To Sir, with Love 1967 مترجم بجودة BluRay كامل اون لاين. في انتظار الحصول على وظيفة ضمن تخصصه الهندسي، يوافق مارك تاكيراي شاب أسود البشرة على التدريس في مدرسة ثانوية في لندن، تضم مجموعة من المراهقين بيض البشرة الفقراء المتمردين والرافضين لجل أشكال الحوار. ليتعرض للعديد من المشاكل والتصادمات معهم، خاصة في ظل فترة الستينيات حيث العنصرية والعنف ضد السود، لكن بعد علمه باستقالة مجموعة من زملائه المدرسين يقرر مارك استخدام أساليبه الخاصة، بعيدا عن أي نظرية تعليمية …', 'to-sir-with-love-1967', 'https://m.media-amazon.com/images/M/MV5BMTQxMzgwNDIyNF5BMl5BanBnXkFtZTgwNjQ4OTI1MDE@._V1_SX300.jpg', 7.7, 'BluRay', 0, 1, 3833, '2019-04-14 09:51:41', '2019-04-14 09:57:21'),
(3831, 'مشاهدة فيلم Incoming 2018 مترجم', 'مشاهدة وتحميل فيلم الاكشن والخيال العلمي Incoming 2018 بجودة WEB-DL مترجم كامل اون لاين مشاهدة مباشرة يوتيوب ” قادم ” حول محطة فضاء دولية تتحول إلى سجن وتُلقَب بالموقع الأسود؛ حيث لا أحد يخرج من هناك، ولا أحد يدرك مكانه. ولكن عندما يستولى الإرهابيون المسجونون على المحطة ويحولونها لصاروخ مُوجه إلى (موسكو)، لا يقدر على ردعهم سوى قائد مركبات فضائية وطبيب صاعد يعاونه', 'incoming-2018', 'https://m.media-amazon.com/images/M/MV5BN2MyYTlhZTctMzNlOC00ODQ4LWE1ZmQtYTkxODkzMjAxZTMyXkEyXkFqcGdeQXVyNDA1NDA2NTk@._V1_SX300.jpg', 3.3, 'WEB-DL', 0, 1, 3835, '2019-04-14 09:52:06', '2019-04-14 09:57:21'),
(3832, 'مشاهدة فيلم The crucible 1996 مترجم', 'مشاهدة وتحميل فيلم الدراما والتاريخي The crucible 1996 بجودة HDTV مترجم اون لاين وتحميل مباشر. عن مسرحية بذات الاسم للكاتب (آرثر ميللر)، وتقع أحداثها خلال القرن السابع عشر في مدينة سالم بولاية ماساشوستس. حيث يعيش (جون بروكتور) الذي يقاوم سيطرة الأغنياء على المدينة ويناهض استغلالهم الجَشِع لعمل الفقراء. كما يُقيم جون علاقة مع الشابة الجميلة (أبيجيل)، نظراً لأن زوجته البيوريتانية المحافظة مريضة طيلة شهور..', 'the-crucible-1996', 'https://m.media-amazon.com/images/M/MV5BN2ZhOTQ5NGUtNDJiYy00ZTM5LWI5MDItNDI3OGZhYzlhZDRhXkEyXkFqcGdeQXVyNjUwNzk3NDc@._V1_SX300.jpg', 6.8, 'HDTV', 0, 1, 3836, '2019-04-14 09:52:14', '2019-04-14 09:57:20'),
(3833, 'مشاهدة فيلم Wraith 2017 مترجم', 'مشاهدة وتحميل فيلم الرعب والغموض Wraith 2017 مترجم بجودة HDRip كامل أون لاين. ” خيال ” حول بعد العيش في قصر قديم منذ ما يقرب من 10 سنوات ، تكتشف العائلة فجأة وجودًا يشبه الشبح يحاول التواصل معه. فيلم مثير للغاية', 'wraith-2017', 'https://m.media-amazon.com/images/M/MV5BZTFmMTQxNzMtYzM1Mi00ZWMyLTgzMTctNTljZjM0MWFkNTk0XkEyXkFqcGdeQXVyMjgwOTAxOTc@._V1_SX300.jpg', 3.6, 'HDRip', 0, 1, 3837, '2019-04-14 09:52:23', '2019-04-14 09:57:20'),
(3834, 'مشاهدة فيلم Wetlands 2017 مترجم', 'مشاهدة فيلم Wetlands 2017 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر ” الأراضي الرطبة ” حول يحاول رجل القيام ببداية جديدة في أتلانتيك سيتي بمساعدة ابنته وشريك تجاري جديد', 'wetlands-2017', 'https://m.media-amazon.com/images/M/MV5BNjMwMWMwYjctNzczMC00YjljLWIyMjctMjg3ZDg3NjEyMGEwXkEyXkFqcGdeQXVyNDYxOTY1Njg@._V1_SX300.jpg', 5.8, 'WEB-DL', 0, 1, 3838, '2019-04-14 09:52:29', '2019-04-14 09:57:19'),
(3835, 'مشاهدة فيلم Lost in Paris 2016 مترجم', 'مشاهدة وتحميل فيلم الكوميديا Lost in Paris 2016 مترجم بجودة BDRip كامل اون لاين. تزور فيونا باريس لأول مرة لمساعدة عمتها مارتي. وينتج عنها كوارث ، تشمل في الأساس دوم ، وهو رجل بلا مأوى لم يكن لديه عاطفة أو يعتقد أنه يخاف من التعبير.', 'lost-in-paris-2016', 'https://m.media-amazon.com/images/M/MV5BMTUzNjQ0NDc0NV5BMl5BanBnXkFtZTgwOTY0NDAzMjI@._V1_SX300.jpg', 6.3, '0', 0, 1, 3839, '2019-04-14 09:52:35', '2019-04-14 09:57:19'),
(3836, 'مشاهدة فيلم Dantes Peak 1997 مترجم', 'مشاهدة فيلم Dantes Peak 1997 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر يسافر (هاري دالتون) خبير البراكين إلى بلدة دانتي، التي تم تسميتها منذ فترة قصيرة كثاني أكثر مكان مُفضل العيش به بأمريكا؛ حيث يتواجد بركان دانتي الخامد منذ فترة طويلة، ليكتشف أن هناك نشاطات بركانية غريبة في البركان، وأنه قد يثور مجددا في أية لحظة، ليحاول إنقاذ البلدة.', 'dantes-peak-1997', 'uploads/12545682048.jpg', NULL, 'BluRay', 0, 1, 3840, '2019-04-14 09:52:51', '2019-04-14 09:57:19'),
(3837, 'مشاهدة فيلم Notes On Blindness 2016 مترجم', 'مشاهدة وتحميل فيلم الوثائقي والدراما Notes On Blindness 2016 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب واحد من أفضل الافلام الوثائقية وتدور قصته حول الكاتب والمفكر “جون هال” والذي أصبح أعمى في صيف عام 1983 قبل أيام قليلة من مولد ابنه الأول. لكي يقوم بثورة في حياته، قرر “هال” الاحتفاظ بيومياته على شرائط كاسيت. عند نشر هذه اليوميات في عام 1990، وصفها “أوليفر ساكس” بأنها أفضل وأجمل تجربة عمى قرأها في حياته” واصف إياها بالتحفة الفنية.', 'notes-on-blindness-2016', 'https://m.media-amazon.com/images/M/MV5BYWQ2ZGYyNGQtNDViMC00MGViLTlmNmUtYzA0NDhiZDAyYWJkL2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyMjQ3NzUxOTM@._V1_SX300.jpg', 7.1, 'BluRay', 0, 1, 3841, '2019-04-14 09:53:01', '2019-04-14 09:57:18'),
(3838, 'مشاهدة فيلم Daylight 1996 مترجم', 'مشاهدة وتحميل فيلم الاكشن والمغامره Daylight 1996 مترجم بجودة BluRay كامل اون لاين. تصطدم إحدى السيارات المحملة بموادٍ سامة، بسيارة أخرى مما يتسبب في تسرب الغاز السام، وتصطدم بنفق نيويورك الشهير، فيُحتَجَز عددٌ كبيرٌ من الأشخاص ويصبحون مُعرضين للموت في أية لحظة، تعجز السلطات المحلية عن حل الكارثة بالطرق التقليدية، فيتطوع مدير خدمات الطواريء السابق، والذي تم فصله سابقًا (كيت لاتورا) لإنقاذ المحتجزين، وإعادة الثقة في سمعته كمدير طواريء.', 'daylight-1996', 'https://m.media-amazon.com/images/M/MV5BOGE5MDkxYzktODU4OS00Yjc4LTk5MjktYzlkY2RjMGVlNjU0XkEyXkFqcGdeQXVyNDc2NjEyMw@@._V1_SX300.jpg', 5.9, 'BluRay', 0, 1, 3842, '2019-04-14 09:53:10', '2019-04-14 09:57:18'),
(3839, 'مشاهدة فيلم Days Of Thunder 1990 مترجم', 'مشاهدة و تحميل فيلم الاكشن والدراما Days Of Thunder 1990 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة يدخل كول عالم الضغط العالي لسباق ناسكر للسيارات ، المعروف عنه بأنه سائق ماهر وذو مزاج حاد ، وذلك يعرضه لمتاعب كثيرة ليس فقط مع السائقين اﻷخرين وإنما أيضا مع أعضاء فريقة .', 'days-of-thunder-1990', 'https://m.media-amazon.com/images/M/MV5BNjc5NjQ1ODIzN15BMl5BanBnXkFtZTgwMjkwNTg4NjE@._V1_SX300.jpg', 6, 'BluRay', 0, 1, 3843, '2019-04-14 09:53:15', '2019-04-14 09:57:17'),
(3840, 'مشاهدة فيلم Se7en 1995 مترجم', 'مشاهدة وتحميل فيلم الجريمة والدراما Se7en 1995 مترجم بجودة BluRay كامل اون لاين. تدور قصة الفيلم حول محققان أحدهما عجوز والآخر شاب يتحدان معا لتولي قضية هي الأخيرة للعجوز والأولى للشاب وتكون مهمتهما فيها القبض على قاتل مجنون يختار ضحاياه من بين مرتكبي الخطايا السبعة المهلكة، كالبدين الذي يأكل بنهم والمحامي الثري نتيجة الجشع وهكذا. ترى هل سينجحان معا في قضيتهما؟', 'se7en-1995', 'https://m.media-amazon.com/images/M/MV5BMmNiODk3OTktOTRmOS00NmM1LTkwNjAtZDQyMmM3Mjk0ZDgxXkEyXkFqcGdeQXVyODUxODg2NDQ@._V1_SX300.jpg', 8.6, 'BluRay', 0, 1, 3844, '2019-04-14 09:53:27', '2019-04-14 09:57:16'),
(3841, 'مشاهدة فيلم Entrapment 1999 مترجم', 'مشاهدة وتحميل فيلم الاكشن والجريمة Entrapment 1999 بجودة BluRay مترجم اون لاين وتحميل مباشر. تدور أحداث الفيلم حول ماك (شين كونري)؛ السارق المحترف الذي يعشق التحديات، الذي يقوم بسرقة قطعة فنية على الرغم من إجراءات الحماية المشددة، وتؤمن جين (كاثرين زيتا جونز)؛ التي تعمل في شركة التأمين، بأن ماك هو الذى قام بالسرقة.', 'entrapment-1999', 'https://m.media-amazon.com/images/M/MV5BODgyMmE3YWQtNDE4Yy00ODExLThmNDUtYmM4ZTk2ZTVjNDEzL2ltYWdlXkEyXkFqcGdeQXVyNjQzNDI3NzY@._V1_SX300.jpg', 6.3, 'BluRay', 0, 1, 3845, '2019-04-14 09:53:53', '2019-04-14 09:57:16'),
(3842, 'مشاهدة فيلم Showdown in Little Tokyo 1991 مترجم', 'مشاهدة وتحميل فيلم الاكشن والكوميديا Showdown in Little Tokyo 1991 مترجم بجودة BluRay كامل أون لاين. (كريس) أحد أفراد الشرطة المهرة، على الرغم من أنه تربى كطفل يتيم في (اليابان) بعد مقتل والده الذي كان يعمل ضمن قوة البوليس، يبدأ في مطاردة زعيم عصابة لا يعرف الرحمة يدعى (يوشيدو)، وكان قد ساعد في إقامة منطقة يابانية صغيرة، ويقوم حاليا بإدارة عصابة لتهريب المخدرات.', 'showdown-in-little-tokyo-1991', 'https://m.media-amazon.com/images/M/MV5BMDI5NzM2YzEtNjBkNC00Njk0LTgxZDItY2RhMWM2ODE1ODNjXkEyXkFqcGdeQXVyMDI4NjM1MQ@@._V1_SX300.jpg', 6.1, 'BluRay', 0, 1, 3846, '2019-04-14 09:54:09', '2019-04-14 09:57:15'),
(3843, 'مشاهدة فيلم Balto 1995 مترجم', 'مشاهدة وتحميل فيلم الانيميشن والمغامره Balto 1995 مترجم بجودة BluRay كامل أون لاين. يروي الفيلم القصة الحقيقية للكلب الضال (بالتو) المنبوذ من البشر وحتى من أبناء جنسه ؛ لأنه كلب مذءوب ، إلا أنه يتمكن من تكوين صداقة غريبة مع الأوزة (بوريس) ، والدبين القطبيين (موك) ، و(لوك) ، ورغم انعزاله عن بقية الكلاب في المنطقة التي يعيش فيها إلا أنه لا يسلم من إيذاء الكلب (ستيل) ، الذي يقود مجموعة كبيرة من الكلاب بسبب تنافسها للفوز بقلب الكلبة (جينا) .', 'balto-1995', 'https://m.media-amazon.com/images/M/MV5BMjBhNmFlZjMtMzhlYy00NDBlLWFiMjctMmE0ZjgwOGM2MTNmXkEyXkFqcGdeQXVyNjExODE1MDc@._V1_SX300.jpg', 7.1, 'BluRay', 0, 1, 3847, '2019-04-14 09:54:18', '2019-04-14 09:57:15'),
(3844, 'مشاهدة فيلم Everyone Says I Love You 1996 مترجم', 'مشاهدة و تحميل فيلم الكوميديا والموسيقى Everyone Says I Love You 1996 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة تدور أحداث الفيلم في قالب كوميدي رومانسي غنائي. يعيش (هولدن) و(سكايلر) قصة حب جميلة وهما على وشك الزواج، تعيش سكايلر بصحبة عائلتها الكبيرة في مانهاتن.', 'everyone-says-i-love-you-1996', 'https://m.media-amazon.com/images/M/MV5BYWNlODY4MjctNmE0MS00YmJmLTk3MWEtNjE4ZjIzMTFkY2EwXkEyXkFqcGdeQXVyNTE1NjY5Mg@@._V1_SX300.jpg', 6.8, 'BluRay', 0, 1, 3848, '2019-04-14 09:54:24', '2019-04-14 09:57:14'),
(3845, 'مشاهدة فيلم Eyes Wide Shut 1999 مترجم', 'مشاهدة فيلم الدراما والغموض Eyes Wide Shut 1999 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. طبيب محترم و حياته كانت تسير بشكل جيد جدا,لديه زوجة جميلة و ابنة و عمل يحبه و لكن في احدى الليالي و بعد حضور حفلة ,زوجته (اليس) بدات تحكي له عن تخيلات جنسية و كيف انا كانت على وشك ان تهجره من اجل رجل اخر لم تعرفه حتى,و من شدة وطاة الخبر عليه خرج الزوج متجولا في الشوارع.', 'eyes-wide-shut-1999', 'https://m.media-amazon.com/images/M/MV5BMjA5NTUwNjI1N15BMl5BanBnXkFtZTYwOTE1ODc5._V1_SX300.jpg', 7.4, 'BluRay', 0, 1, 3849, '2019-04-14 09:54:48', '2019-04-14 09:57:14'),
(3846, 'مشاهدة فيلم Snake Eyes 1998 مترجم', 'مشاهدة فيلم Snake Eyes 1998 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر شرطي المباحث يجد نفسه في وسط مؤامرة القتل في مباراة الملاكمة الهامة في كازينو أتلانتيك سيتي.', 'snake-eyes-1998', 'https://m.media-amazon.com/images/M/MV5BNmZiODkzNWEtNDkxZC00NDg2LWFiYzktZjY2ZmUwMmM2ZmJlXkEyXkFqcGdeQXVyNTAyODkwOQ@@._V1_SX300.jpg', 6, 'BluRay', 0, 1, 3850, '2019-04-14 09:55:02', '2019-04-14 09:57:13'),
(3847, 'مشاهدة فيلم Face Off 1997 مترجم', 'مشاهدة فيلم الاكشن والجريمة Face Off 1997 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. تدور احداث الفيلم حول مطاردة ضخمة وطويلة من الإف بي آي بقيادة شون آرتشر للقبض على كاستور تروي قائد عصابة خطير ، المطاردة تنتهي بإصابة زعيم العصابة إصابة قوية تتسبب في غيبوبته ، بعدها علم الإف بي آي أن زعيم العصابة قد زرع قنبلة في المدينة وستنفجر في يوم محدد .', 'face-off-1997', 'https://m.media-amazon.com/images/M/MV5BNTUzMTk4NDU2MV5BMl5BanBnXkFtZTcwMjk4ODgzNA@@._V1_SX300.jpg', 8.2, 'BluRay', 0, 1, 3851, '2019-04-14 09:55:12', '2019-04-14 09:57:13'),
(3848, 'مشاهدة فيلم The Siege 1998 مترجم', 'مشاهدة فيلم The Siege 1998 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر عندما قام الإرهابيون بعملية تفجير إرهابية ، وفجروا حافلة في (نيويورك)، طاردهم العملاء الفيدراليون ، وحاولوا القبض عليهم ، واحتجازهم ، ولكن بعد فترة وجيزة كرر الإرهابيون عملية إرهابية تفجيرية أخرى ، الأمر الذي دعا الجيش الأمريكي لفرض حصار شامل على مدينة (نيويورك) لحين القبض عليهم ، والتخلص منهم .', 'the-siege-1998', 'https://m.media-amazon.com/images/M/MV5BZWFiOTFkNTYtMmUyNy00OTVjLTlhMjItN2QyZGMzNzY1NTZiXkEyXkFqcGdeQXVyNDk3NzU2MTQ@._V1_SX300.jpg', 6.3, 'BluRay', 0, 1, 3852, '2019-04-14 09:55:25', '2019-04-14 09:57:13'),
(3849, 'مشاهدة فيلم Flubber 1997 مترجم', 'مشاهدة فيلم Flubber 1997 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر إعاده لأحد أفلام ديزني الكلاسيكية في عام 1961، وهو “البروفيسير ذو العقل الشارد”، ويدور حول البروفيسير شارد الذهن (فيليب برينارد) الذي يعمل مع مساعدته (ويبو) على اكتشاف جديد، ينقذ به موقع (سارة) حبيبته في رئاسة معهد البحوث، تتطور الأحداث؛ حيث يبلغ شرود ذهنه بأنه نسي موعد زفافه مرتين، في الوقت ذاته يتمكن من اكتشاف مادة تشبه المطاط تستطيع حمل الأشياء والطيران، يدعوها (فلابر)، وإذا بأشياء غريبة تحدث لم تكن في الحسبان.', 'flubber-1997', 'https://m.media-amazon.com/images/M/MV5BZDlkOTA0OTUtOThmMi00NTMyLTg0NDgtZWZiYmRjZWI4MDY4XkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 5.2, 'BluRay', 0, 1, 3853, '2019-04-14 09:55:58', '2019-04-14 09:57:12'),
(3850, 'مشاهدة فيلم Gang Related 1997 مترجم', 'مشاهدة وتحميل فيلم الاكشن والجريمة Gang Related 1997 مترجم بجودة BluRay كامل اون لاين. في إطار من الجريمة والدراما، وفي عالم الشرطة الفاسدة، اثنان من رجال الشرطة الفاسدين، يقومان بقتل عميل عن طريق الخطأ، وعن طريق العديد من الطرق الغير منتظمة، والمحاولات العشوائية، يحاولان تغطية فعلتهما، وتدريب شهود على الشهادة الكاذبة، والارتجال بلا خطة محكمة منعا لمخططهما من التدمير.', 'gang-related-1997', 'https://m.media-amazon.com/images/M/MV5BMWFhYTNlMGEtNDRiZS00YzM0LWIxOTctZjc3MGNjYzZhNWNkXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 6.5, 'BluRay', 0, 1, 3854, '2019-04-14 09:56:17', '2019-04-14 09:57:11'),
(3851, 'مشاهدة فيلم The Sixth Sense 1999 مترجم', 'مشاهدة وتحميل فيلم الدراما والغموض The Sixth Sense 1999 بجودة BluRay مترجم اون لاين وتحميل مباشر. في قالب من الدراما، تدور أحداث الفيلم حول طفل صغير يبلغ من العمر ثمانية اعوام، لديه القدرة على التخاطب مع الموتى، ومن ناحية اخرى يوجد طبيب متخصص في علم نفس الأطفال يقوم بمساعدة الطفل.', 'the-sixth-sense-1999', 'https://m.media-amazon.com/images/M/MV5BMWM4NTFhYjctNzUyNi00NGMwLTk3NTYtMDIyNTZmMzRlYmQyXkEyXkFqcGdeQXVyMTAwMzUyOTc@._V1_SX300.jpg', 8.1, 'BluRay', 0, 1, 3855, '2019-04-14 09:56:30', '2019-04-14 09:57:11'),
(3852, 'مشاهدة فيلم Ghost 1990 مترجم', 'مشاهدة فيلم Ghost 1990 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر تدور الأحداث في إطار من الخيال حول شابة يٌقتل حبيبها أثناء عملية سطو فاشلة، بينما يستمر شبحه في ملاحقتها من خلال البقاء حولها، ومحاولة حمايتها من الأخطار، وإبعاد كل من يقترب منها، وذلك بمساعدة من صديقه المختل نفسيا، وتتوالى الأحداث.', 'ghost-1990', 'https://m.media-amazon.com/images/M/MV5BMTU0NzQzODUzNl5BMl5BanBnXkFtZTgwMjc5NTYxMTE@._V1_SX300.jpg', 7, 'BluRay', 0, 1, 3856, '2019-04-14 09:56:43', '2019-04-14 09:57:10'),
(3853, 'مشاهدة فيلم The Bridges of Madison County 1995 مترجم', 'مشاهدة وتحميل فيلم الدراما والرومانسية The Bridges of Madison County 1995 بجودة BluRay مترجم اون لاين وتحميل مباشر. تجد فرانشيسكا جونسون (ميريل ستريب) نفسها في مفترق الطرق ،فتبدأ بالتشكك في طريقة حياتها المُعدة مسبقًا. فحينما يسافر زوجها وابنها إلى إلينوي تجد نفسها وحيدةً. تقابل بالصدفة رجلًا ضل سبيله روبرت كينكايد (كلينت إستود)، فيطلب منها أن تدله إلى جسر روزمان من أجل تصويره لمجلة (ناشيونال جيوجرافيك) فتوافق على مضض. ثم ينشأ بينهما إعجابٌ .', 'the-bridges-of-madison-county-1995', 'https://m.media-amazon.com/images/M/MV5BOTczNjIwMDM0MF5BMl5BanBnXkFtZTgwNzEzNTU1NTM@._V1_SX300.jpg', 7.6, 'BluRay', 0, 1, 3857, '2019-04-14 09:56:56', '2019-04-14 09:57:09'),
(3854, 'مشاهدة فيلم Groundhog Day 1993 مترجم', 'مشاهدة فيلم الكوميديا والفانتازيا Groundhog Day 1993 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. تدور أحداث الفيلم حول مذيع الأحوال الجوية فيل (بيل موراي)؛ الذي يُطلب منه وفريقه المعاون السفر إلى بنسلفانيا يوم 1 فبراير لتغطية فعاليات يوم احتفالي خاص لديهم. فيسافر متذمراً، لكن عاصفة ثلجية تضرب البلدة وتحول من دون عودة الفريق، فيضطرون إلى الاستمرار هناك. في اليوم التالي، يستيقظ فيل ليجد نفسه مازال في يوم 1 فبراير، ويستمر تكرار ذلك كل يوم، فيقرر أن يستغل ذلك لصالحه بأنانية.', 'groundhog-day-1993', 'https://m.media-amazon.com/images/M/MV5BZWIxNzM5YzQtY2FmMS00Yjc3LWI1ZjUtNGVjMjMzZTIxZTIxXkEyXkFqcGdeQXVyNjU0OTQ0OTY@._V1_SX300.jpg', 8, 'BluRay', 0, 1, 3858, '2019-04-14 09:57:05', '2019-04-14 09:57:08'),
(3855, 'مشاهدة فيلم Happy Gilmore 1996 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والرياضي Happy Gilmore 1996 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب يكتشف ” هابى جيلمور ” بأنه يمتلك قدرات تجعله الأفضل بلعبة الهوكى كما يعتبر صاحب الضربة الأقوى فى تاريخ الهوكى فيتجه الى المنافسة على البطولات لربح المال من اجل انقاذ منزل جدته الذى يعد مهدد بالحجز عليه بسبب الديون , ولكن ” هابى ” يكتشف انه على الرغم من قدراته يفتقر الى الخبرة التى قد تهدد فوزه بالبطولة .', 'happy-gilmore-1996', 'https://m.media-amazon.com/images/M/MV5BZWI2NjliOTYtZjE1OS00YzAyLWJjYTQtYWNmZTQzMTQzNzVjXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 7, 'BluRay', 0, 1, 3859, '2019-04-14 09:57:07', '2019-04-14 09:57:08'),
(3908, 'مشاهدة فيلم Heat 1995 مترجم', 'مشاهدة فيلم Heat 1995 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر تدور قصة الفيلم حول عصابة محترفة تعمل لحساب بعض الأشخاص وتختص بسرقة البنوك وصناديق الإئتمان ويدير هذه العصابة مجرم ذكي هو (روبرت دينيرو). تؤدي العصابة عملية سرقة ضخمة في لوس أنجلوس ويحقق في ذلك رجال الشرطة بقيادة الملازم (ألباتشينو) الذي يسعى لحل تلك القضية والقبض على هذه العصابة.', 'heat-1995', 'https://m.media-amazon.com/images/M/MV5BNDc0YTQ5NGEtM2NkYS00MWRhLThiNzAtNmY3NWU3YzNkMjIyXkEyXkFqcGdeQXVyNzkwMjQ5NzM@._V1_SX300.jpg', 8.2, 'BluRay', 0, 1, 3912, '2019-04-14 10:01:36', '2019-04-14 12:57:12'),
(3909, 'مشاهدة فيلم Clear and Present Danger 1994 مترجم', 'مشاهدة وتحميل فيلم الاكشن والجريمة Clear and Present Danger 1994 مترجم بجودة BluRay كامل أون لاين. يشارك محلل وكالة المخابرات المركزية جاك رايان في حرب غير مشروعة من جانب الحكومة الامريكية ضد كارتل رجل مخدرات كولومبيا', 'clear-and-present-danger-1994', 'https://m.media-amazon.com/images/M/MV5BNDczOWNiMmEtZjA4MS00NDMzLWExNTktYjc0MGU0YTQ3ZDExXkEyXkFqcGdeQXVyNjU0OTQ0OTY@._V1_SX300.jpg', 6.9, 'BluRay', 0, 1, 3913, '2019-04-14 10:01:46', '2019-04-14 12:57:12'),
(3910, 'مشاهدة فيلم Mission Impossible 1996 مترجم', 'مشاهدة فيلم Mission Impossible 1996 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر تدور أحداث القصة حول جيم فيليبس، وبعد التخطيط لتنفيذ مهمة معينة، تم إرساله مع زوجته كلير وشريكه إيثان هانت إلى مدينة براغ، فشلت المهمة المخطط لها ولم ينجو من العملية سوى إيثان هانت، بدأ مدير الوكالة الشك في إيثان بأنه السبب الرئيسي لفشل هذه المهمة، تتوجه إثيان نحو إثبات براءته بمختلف الطرق والأساليب الممكنة واكتشاف المتورط الحقيقي في الإيقاع بهم وإفشال المهمة.', 'mission-impossible-1996', 'https://m.media-amazon.com/images/M/MV5BMTc3NjI2MjU0Nl5BMl5BanBnXkFtZTgwNDk3ODYxMTE@._V1_SX300.jpg', 7.1, 'BluRay', 0, 1, 3914, '2019-04-14 10:02:22', '2019-04-14 12:57:11'),
(3911, 'مشاهدة فيلم Childs Play 3 1991 مترجم', 'مشاهدة وتحميل فيلم الرعب والاثارة Childs Play 3 1991 مترجم بجودة BluRay كامل أون لاين. بيلي ماديسون تدور قصة الفيلم حول رجل غير ناضج وكسول، يتوجب عليه أن يعيد دراسته من الصف الأول وحتى الصف الثاني عشر، كل هذا لكي يرث فندق والده الإمبراطوري.', 'childs-play-3-1991', 'https://images-na.ssl-images-amazon.com/images/M/MV5BN2VjYWRmZTUtYTk1ZS00NDdmLTk1ZWUtNTg1YTYxZWZmODFiXkEyXkFqcGdeQXVyMTI2NjEzOTg@._V1_SX300.jpg', 7.8, 'BluRay', 0, 1, 3915, '2019-04-14 10:02:32', '2019-04-14 12:57:11'),
(3912, 'مشاهدة فيلم Billy Madison 1995 مترجم', 'مشاهدة و تحميل فيلم الكوميديا Billy Madison 1995 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة بيلي ماديسون تدور قصة الفيلم حول رجل غير ناضج وكسول، يتوجب عليه أن يعيد دراسته من الصف الأول وحتى الصف الثاني عشر، كل هذا لكي يرث فندق والده الإمبراطوري.', 'billy-madison-1995', 'https://m.media-amazon.com/images/M/MV5BMzcyMjZmNjctNGNhMS00ZmQxLWFkNzQtYTIxYjVkYmU1NmNmXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 6.4, 'BluRay', 0, 1, 3916, '2019-04-14 10:02:41', '2019-04-14 12:57:10'),
(3913, 'مشاهدة فيلم Men In Black 1997 مترجم', 'مشاهدة و تحميل فيلم المغامره والكوميديا Men In Black 1997 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة تدور أحداث الفلم في المستقبل في إطار كوميدي، حيث تستعين المنظمة السرية لمراقبة نشاط الكائنات الفضائية على كوكب الأرض بجهود المحققين (كاي) ، و(جاي) ، اللذين يدخلان في سيناريو مميت ، حيث يواجهان قاتلا محترفا من الفضاء هبط إلى الأرض لاغتيال اثنين من سفراء المجرات المعارضة .', 'men-in-black-1997', 'https://m.media-amazon.com/images/M/MV5BOTlhYTVkMDktYzIyNC00NzlkLTlmN2ItOGEyMWQ4OTA2NDdmXkEyXkFqcGdeQXVyNTAyODkwOQ@@._V1_SX300.jpg', 7.3, 'BluRay', 0, 1, 3917, '2019-04-14 10:03:06', '2019-04-14 12:57:10'),
(3914, 'مشاهدة فيلم Big Daddy 1999 مترجم', 'مشاهدة و تحميل فيلم الكوميديا والدراما Big Daddy 1999 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة يعمل سوني كوفاكس (آدم ساندلر) في أعمال حرة بسيطة بنيويورك، على الرغم أنه خريج كلية الحقوق، إلا أن طبعه الكسولي الذي لا يعتمد عليه ولا يتحمل المسؤولية، معتمدا في معيشته على إستثماره من تعويض مالي حصل عليه إثر حادث سيارة.', 'big-daddy-1999', 'https://m.media-amazon.com/images/M/MV5BYjAzNzQ4YzEtZWFlOS00YWVkLWE2NDctZDBiZTUxYjgwOTYzXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 6.4, 'BluRay', 0, 1, 3918, '2019-04-14 10:03:20', '2019-04-14 12:57:09'),
(3915, 'مشاهدة فيلم Malice 1993 مترجم', 'مشاهدة و تحميل فيلم الجريمة والغموض Malice 1993 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة زوجان متحابان (جيد) و(ترايسى) يعيشان معا في سعادة، ولكنهما يرغبان في إنجاب الأطفال، الزوجة (ترايسى) تعلم الفنون، بينما الزوج (جيد) هو عميد لإحدى الكليات، وبالتالي لديهما مكانة مرموقة، لم تعد الأمور كما كانت عندما أخذ (جيد) زوجته (ترايسى) إلى الطبيب وعلم منه كل الأمور كاملة. ويقع ما لم يكن في الحسبان.', 'malice-1993', 'https://m.media-amazon.com/images/M/MV5BYTA4NWFkOGItN2Q2NS00MDdlLTliMDYtZWEwNmU1MmVkMzQ4XkEyXkFqcGdeQXVyNjU0NTI0Nw@@._V1_SX300.jpg', 6.4, 'BluRay', 0, 1, 3919, '2019-04-14 10:03:32', '2019-04-14 12:57:08'),
(3916, 'مشاهدة فيلم Batman And Robin 1997 مترجم', 'مشاهدة وتحميل فيلم الاكشن والخيال العلمي Batman And Robin 1997 بجودة BluRay مترجم اون لاين وتحميل مباشر. يعود (باتمان) و(روبن) للعمل معا لحماية مدينة جوثام من المجرمين؛ حيث يواجهوا (مستر فريز)؛ الرجل الجليدى العالم، والدكتور الشهير الذي أصيب بمرض غريب يجعله متجمدا دائما والذي يقوم بسرقة الألماس من كل المدينة لأسباب غير معلومة. وعلى الجانب الأخر (دكتور باميلا) عالمة النبات؛ التي تصاب بمرض غريب يجعلها (ايفى السامة)؛ التي تستطيع تسميم أى شيء تلمسه. تتحد مع مستر فريز للتخلص من المدينة بأكملها.', 'batman-and-robin-1997', 'https://m.media-amazon.com/images/M/MV5BMTk3MzU1OTM2Nl5BMl5BanBnXkFtZTgwOTIyODM1MjE@._V1_SX300.jpg', 6.2, 'BluRay', 0, 1, 3920, '2019-04-14 10:07:21', '2019-04-14 12:57:08'),
(3917, 'مشاهدة فيلم X500 2016 مترجم', 'مشاهدة فيلم X500 2016 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر ” اكس 500 ” حول على بعد آلاف الكيلومترات ، يخضع ثلاثة مهاجرين شباب لتحولات عقلية وعاطفية وبدنية من أجل البقاء على قيد الحياة لعنف عوالمهم الجديدة', 'x500-2016', 'https://m.media-amazon.com/images/M/MV5BMTQwNDM1NjA5MV5BMl5BanBnXkFtZTYwNTQ2NjM3._V1_SX300.jpg', 6.2, 'WEB-DL', 0, 1, 3921, '2019-04-14 12:49:11', '2019-04-14 12:57:08'),
(3918, 'مشاهدة فيلم Soccer Killer 2017 مترجم', 'مشاهدة فيلم الكوميديا والرياضي Soccer Killer 2017 مترجم بجودة DVDRip مشاهدة مباشرة اون لاين. ” سفاح كرة القدم ” حول بحكم نداء القدر مجموعة يلعبون كرة القدم في مواجهة فريق من الأشخاص الغريبين في محاولة لغطس الكراهية والكبرياء لهزيمة ربما تتحقق لاول مره في تاريخ كرة الصين الدولية', 'soccer-killer-2017', 'https://m.media-amazon.com/images/M/MV5BY2ExNjk0MjQtZDRmYS00NDU5LTkwNTEtNjRlN2I0OWYyNGNlXkEyXkFqcGdeQXVyMTExNDQ2MTI@._V1_SX300.jpg', 3.9, 'DVDRip', 0, 1, 3922, '2019-04-14 12:49:15', '2019-04-14 12:57:08'),
(3919, 'مشاهدة فيلم Forward 2016 مترجم', 'مشاهدة وتحميل فيلم الرعب والاثارة Forward 2016 مترجم بجودة WEB-DL كامل اون لاين. ” التقدم ” حول اثنين من المقاتلين سيواجهون اكبر مخاوفهم عندما يقحمون أنفسهم في أبواب الجحيم .', 'forward-2016', 'uploads/2805796466.jpg', 4.9, 'WEB-DL', 0, 1, 3923, '2019-04-14 12:49:24', '2019-04-14 12:57:07'),
(3920, 'مشاهدة فيلم I Can Only Imagine 2018 مترجم', 'مشاهدة وتحميل فيلم الدراما والعائلي I Can Only Imagine 2018 بجودة HDCAM مترجم كامل اون لاين مشاهدة مباشرة يوتيوب ” أستطيع فقط تخيل ” حول إن القصة الحقيقية الملهمة والمجهولة وراء الحبيب ، وهو الرسم البياني الذي يتصدر الأغنية التي تجلب الأمل إلى الكثير من الناس هو تذكير قوي بقوة الاستغفار الحقيقي', 'i-can-only-imagine-2018', 'https://m.media-amazon.com/images/M/MV5BMTRjNDc5NTAtZGJlYS00NTg4LTk2NTEtNGUwY2NiZWM3YTY2XkEyXkFqcGdeQXVyNTQ3MjE4NTU@._V1_SX300.jpg', 7.4, 'HDCAM', 0, 1, 3924, '2019-04-14 12:49:34', '2019-04-14 12:57:07'),
(3921, 'مشاهدة فيلم Red Planet 2000 مترجم', 'مشاهدة وتحميل فيلم الاكشن والخيال العلمي Red Planet 2000 مترجم بجودة BluRay كامل أون لاين. في المستقبل، وعندما تتعرض الأرض لبداية احتضارها، لا يصبح أمام البشر سوى الانتقال إلى المريخ وبدء استيطانه، لهذا الغرض يتم إرسال فريق من الخبراء والمختصين في مختلف المجالات كي يقوموا بتجهيز أول مستعمرة للبشر، لكن تدب الخلافات بين الفريق، وبمجرد هبوطهم تتحطم معداتهم، فيكون عليهم التعاون معًا من أجل البقاء أحياء على سطح الكوكب.', 'red-planet-2000', 'https://m.media-amazon.com/images/M/MV5BMTY2MzE0MjAwOF5BMl5BanBnXkFtZTYwNDM4Mzg2._V1_SX300.jpg', 5.7, 'BluRay', 0, 1, 3925, '2019-04-14 12:49:51', '2019-04-14 12:57:06'),
(3922, 'مشاهدة فيلم The Throne 2015 مترجم', 'مشاهدة وتحميل فيلم الدراما والتاريخي The Throne 2015 مترجم بجودة BluRay كامل اون لاين. تدور أحداث فيلم حول حياة ولي العهد “سادو”، وريث العرش الذي كان يحلمُ بإصلاح حُكم البلاد، وحينما وصلَ لسنّ الـ27، حُكم عليه بالإعدام من قبل والده، الملك “يونغ جو”. وذلكَ بحبسهِ في صندوق الأرز لمُدة ثمانية أيام حتى اختنق وماتَ جوعًا.', 'the-throne-2015', 'https://m.media-amazon.com/images/M/MV5BNzFlZmExYTYtMDI2ZC00YjI1LTgyODQtNTUyNGY3NjY0ZGRkXkEyXkFqcGdeQXVyODA4ODIwNDM@._V1_SX300.jpg', 7, 'BluRay', 0, 1, 3926, '2019-04-14 12:50:02', '2019-04-14 12:57:05'),
(3923, 'مشاهدة فيلم Tikkun 2015 مترجم', 'مشاهدة وتحميل فيلم الدراما والغموض Tikkun 2015 بجودة DVDRip مترجم كامل اون لاين مشاهدة مباشرة يوتيوب يتم إحياء عالم متدين جدا بعد الموت لمدة 40 دقيقة. بعد عودته إلى الحياة، يشعر فجأة بصحوة غريبة في جسده ويشتبه في أن الله يختبره.', 'tikkun-2015', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTgxNTk4ODE1NF5BMl5BanBnXkFtZTgwMjMzNTg4OTE@._V1_SX300.jpg', 6.5, 'DVDRip', 0, 1, 3927, '2019-04-14 12:50:05', '2019-04-14 12:57:04'),
(3924, 'مشاهدة فيلم Touched With Fire 2015 مترجم', 'مشاهدة وتحميل فيلم الدراما والرومانسية Touched With Fire 2015 مترجم بجودة BluRay كامل اون لاين. فى أطار من الدراما والرومانسية حول اثنين من المرضي بين القطبين في مستشفى للأمراض النفسية حيث تبدا قصة حب تجمع كل من الجمال والرعب فى حالتهم.', 'touched-with-fire-2015', 'https://m.media-amazon.com/images/M/MV5BMTc1NTE0MTAzNV5BMl5BanBnXkFtZTgwNzczNzU0NzE@._V1_SX300.jpg', 6.2, 'BluRay', 0, 1, 3928, '2019-04-14 12:50:18', '2019-04-14 12:57:04'),
(3925, 'مشاهدة فيلم Truman 2015 مترجم', 'مشاهدة فيلم Truman 2015 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر تدور احداث الفيلم حول قيام (توم) بزيارة غير متوقعة لصديقه (جوليان) الذي يعيش في كندا، وهناك يجد الكلب (ترومان) الكلب الذي يمتلكه (جوليان)، والذي يتشارك معهم في لحظات مثيرة ومفاجآت مثيرة للدهشة، تحدث لهم بدافع من الوضع المعقد ل(جوليان).', 'truman-2015', 'https://m.media-amazon.com/images/M/MV5BZGI3ZjI3ZTgtMmUwMy00YTgzLWIyYzQtMzg3ZWMyMjVlYThmXkEyXkFqcGdeQXVyMzE1ODcwNDc@._V1_SX300.jpg', 7.3, 'BluRay', 0, 1, 3929, '2019-04-14 12:50:27', '2019-04-14 12:57:01'),
(3926, 'مشاهدة فيلم Unfinished Business 2015 مترجم', 'مشاهدة وتحميل فيلم الكوميديا Unfinished Business 2015 مترجم بجودة BluRay كامل أون لاين. تدور أحداث الفيلم حول رجل أعمال مثابر، وصاحب شركة صغيرة، يسافر مع شريكيه في العمل إلى (أوروبا) من أجل إتمام واحدة من أهم الصفقات التجارية في مسيرتهم العملية، والتي ستساهم في الارتقاء بوضع الشركة، ولكن ما كان يبدو في النهاية على أنه إجراء روتيني يتحول إلى جنون مطبق بكل ما تحمله الكلمة من معنى.', 'unfinished-business-2015', 'https://m.media-amazon.com/images/M/MV5BNGMwYjc3ZWEtNjMxNS00MzdkLWEwYWQtYWRkMDUwZWRhMjE5XkEyXkFqcGdeQXVyNDk3NzU2MTQ@._V1_SX300.jpg', 5.4, 'BluRay', 0, 1, 3930, '2019-04-14 12:50:41', '2019-04-14 12:57:00'),
(3927, 'مشاهدة فيلم Villmark 2 2015 مترجم', 'مشاهدة فيلم Villmark 2 2015 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر خمسة عمال يأخدوا علي عاتقهم مهمة معالجة مضخة للنفايات الخطرة قبل هدمها . لكن هذه المهمة لم تكن كما يعتقدوا .', 'villmark-2-2015', 'https://m.media-amazon.com/images/M/MV5BNDQ4YTQ0MGEtZDE1Yy00N2U2LWEwMmQtMjVjMGI3NjY0NzA4XkEyXkFqcGdeQXVyNTY2NTA1Ng@@._V1_SX300.jpg', 5.4, 'BluRay', 0, 1, 3931, '2019-04-14 12:50:59', '2019-04-14 12:57:00'),
(3928, 'مشاهدة فيلم Waffle Street 2015 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والدراما Waffle Street 2015 مترجم بجودة HDRip كامل أون لاين. تدور احداث فيلم حول (أدامز) افضل واسرع طاه فى المدينة، حيث يتميز بالاخلاص والصداقة الغير متوقعه، حيث انه تم اختيارة للعمل فى مطعم مشهور يعمل 24 الساعه حيث يدعى معرفتة بالامور المالية', 'waffle-street-2015', 'https://m.media-amazon.com/images/M/MV5BMjIxNjQ5NDUyMF5BMl5BanBnXkFtZTgwNDA3ODU4NzE@._V1_SX300.jpg', 6.2, 'HDRip', 0, 1, 3932, '2019-04-14 12:51:14', '2019-04-14 12:56:59'),
(3929, 'مشاهدة فيلم A Bigger Splash 2015 مترجم', 'مشاهدة فيلم الدراما والاثارة A Bigger Splash 2015 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. تنقطع الأجازة التي تقضيها أسطورة موسيقى الروك ماريان لين (تيلدا سوينتون) مع شريكها (بول) بواسطة مُنتجها السابق هاري (رالف فينيس)، الذي يصل بشكل غير متوقع مع ابنته بينيلوب (داكوتا جونسون)، مما أدى الى سلسلة من مواقف متوترة على نحو متزايد من الغيرة والرغبة.', 'a-bigger-splash-2015', 'https://m.media-amazon.com/images/M/MV5BMTkxNzk3NzMwN15BMl5BanBnXkFtZTgwODc3ODQ4NzE@._V1_SX300.jpg', 6.4, 'BluRay', 0, 1, 3933, '2019-04-14 12:51:28', '2019-04-14 12:56:58'),
(3930, 'مشاهدة فيلم Family Blood 2018 مترجم', 'مشاهدة وتحميل فيلم الرعب والاثارة Family Blood 2018 بجودة WEB-DL مترجم اون لاين وتحميل مباشر. ” دم عائلى ” حول ايلي مدمنة مخدرات متعافية انتقلت للتو الى مدينة جديدة مع طفليها المراهقين. عانت لتظل نظيفة في الماضي ومصممة على انجاح الامر هذه المرة وايجاد عمل مستقر وحضور اجتماعاتها بانتظام. لسوء الحظ اصدقاء جدد ووظيفة جديدة وفرصة لحياة جديدة لا يمكنها منع ايلي من الانزلاق مجددا. تتغير حياتها حين تلتقي بكريستوفر مدمن من نوع مختلف يجبر ابنها وابنتها على قبول ايلي الجديدة.', 'family-blood-2018', 'https://m.media-amazon.com/images/M/MV5BZWYyOWZkMjgtMzFmZS00NGI2LThiMmEtMTQwYTY3YTU2MGJiXkEyXkFqcGdeQXVyMjY5ODI4NDk@._V1_SX300.jpg', 4.2, 'WEB-DL', 0, 1, 3934, '2019-04-14 12:51:45', '2019-04-14 12:56:58'),
(3931, 'مشاهدة فيلم Altered Perception 2017 مترجم', 'مشاهدة وتحميل فيلم الفانتازيا والغموض Altered Perception 2017 مترجم بجودة WEB-DL كامل أون لاين. وجهة نظر مختلفة ” حول دواء يغير وجهات النظر اثناء التوتر والصدمات يتم الاعلان عنه كعلاج للتوتر السياسي الاجتماعي. يتطوع العديد من الازواج للتجارب البشرية لكن ينتهي بهم المطاف باكثر مما كانوا يحلمون به.', 'altered-perception-2017', 'https://m.media-amazon.com/images/M/MV5BMTU1MDIyMzIwMF5BMl5BanBnXkFtZTgwMTMzNTY1MDE@._V1_SX300.jpg', 3.2, 'WEB-DL', 0, 1, 3935, '2019-04-14 12:52:03', '2019-04-14 12:56:57'),
(3932, 'مشاهدة فيلم DeadThirsty 2017 مترجم', 'مشاهدة فيلم DeadThirsty 2017 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر ” ديدثيرستي ” حول عام 1992 اثناء انتشار كابوس عقار الهلوسة مع الحفلات الماجنة والجنس غير القانوني يكتشف رواد ملاه شباب العالم الاجرامي لديدثيرستي.', 'deadthirsty-2017', 'https://m.media-amazon.com/images/M/MV5BZGZiNzI3ZTEtOTYwOS00N2I4LTk3ZGYtMDE1MDQ2Zjk5OGMzXkEyXkFqcGdeQXVyNTgwOTM3OTg@._V1_SX300.jpg', 4.5, 'WEB-DL', 0, 1, 3936, '2019-04-14 12:52:40', '2019-04-14 12:56:56'),
(3933, 'مشاهدة فيلم Gehenna: Where Death Lives 2016 مترجم', 'مشاهدة وتحميل فيلم الرعب والغموض Gehenna: Where Death Lives 2016 بجودة WEB-DL مترجم كامل اون لاين مشاهدة مباشرة يوتيوب جهنم: حيث يعيش الموت ” حول مجموعة من الزوار من جزيرة (سايبان) يبحثون عن مواقع لبناء أحدث منتجعات شركتهم، وبمجرد إيجادهم البقعة التي ظنوها هي الأمثل لبناء المنتجع، يكتشفون مخبأ خفي عن الممتلكات المعلنة فيقررون استكشافه؛ ويدركون بعد فوات الأوان بأن من الفضول ما قتل.', 'gehenna-where-death-lives-2016', 'https://m.media-amazon.com/images/M/MV5BODYzMjQ5ODg3M15BMl5BanBnXkFtZTgwODUyNTc1NzE@._V1_SX300.jpg', 5, 'WEB-DL', 0, 1, 3937, '2019-04-14 12:52:52', '2019-04-14 12:56:56'),
(3934, 'مشاهدة فيلم The Cleanse 2016 مترجم', 'مشاهدة و تحميل فيلم الكوميديا والدراما The Cleanse 2016 مترجم اون لاين جودة WEB-DL وتحميل مباشر مشاهدة اون لاين مباشرة ” المطهر ” حول رجل حزين يحضر تراجع روحاني لتطهير نفسه وإصلاح حياته المكسورة.', 'the-cleanse-2016', 'https://m.media-amazon.com/images/M/MV5BMjMyNjk4OTk3Nl5BMl5BanBnXkFtZTgwODUyNzEyNTM@._V1_SX300.jpg', 5.4, 'WEB-DL', 0, 1, 3938, '2019-04-14 12:53:03', '2019-04-14 12:56:56'),
(3935, 'مشاهدة فيلم The Maus 2017 مترجم', 'مشاهدة و تحميل فيلم الدراما والفانتازيا The Maus 2017 مترجم اون لاين جودة WEB-DL وتحميل مباشر مشاهدة اون لاين مباشرة ” الضريح ” اليكس وثيلما زوجان متحابان في رحلة الى قلب البوسنة وهيرسيكوفنيا. فجاة تشعر ثيلما ان احدهم يطاردهما. تذهب الى تميمتها الاسلامية مما يجعل القوة الغامضة تظهر من الغابة.', 'the-maus-2017', 'https://m.media-amazon.com/images/M/MV5BY2E4ZTZjMTEtYTU3Ni00NDQ1LTlmOTctNjNjYTEzYWM3NzEyXkEyXkFqcGdeQXVyMjUxOTUyOTI@._V1_SX300.jpg', 4.2, 'WEB-DL', 0, 1, 3939, '2019-04-14 12:53:19', '2019-04-14 12:56:55'),
(3936, 'مشاهدة فيلم Nowhere to Run 1993 مترجم', 'مشاهدة وتحميل فيلم الاكشن والجريمة Nowhere to Run 1993 مترجم بجودة bluray كامل اون لاين. يحمل الكثير من أجواء الحركة والإثارة. يقضي سام جيلين (جان كلود فاندام) عقوبة السجن بسبب اتهامه في قتل حارس بنك في أثناء آخر عمليات السرقة التي قام بها. ينجح سام في الهرب ويذهب إلى تلك المزرعة النائية؛ التي تم إخفاء النقود المسروقة بها.', 'nowhere-to-run-1993', 'https://m.media-amazon.com/images/M/MV5BZDk1MmVmMWYtYzU3Mi00OWViLWJjMjYtOTFhZWJjNjdmZGQ0XkEyXkFqcGdeQXVyNDc2NjEyMw@@._V1_SX300.jpg', 5.6, 'bluray', 0, 1, 3940, '2019-04-14 12:53:42', '2019-04-14 12:56:55'),
(3937, 'مشاهدة فيلم Forgive Us Our Debts 2018 مترجم', 'مشاهدة وتحميل فيلم الدراما Forgive Us Our Debts 2018 مترجم بجودة HD كامل اون لاين. مشاهدة فيلم الدراما Forgive Us Our Debts 2018 مترجم بجودة HD مشاهدة مباشرة اون لاين', 'forgive-us-our-debts-2018', 'https://m.media-amazon.com/images/M/MV5BYjY1YTZkMGMtNGNlNC00YzllLTkxNjMtNzE4Y2U1MWIyYzkzXkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg', 6.2, 'HD', 0, 1, 3941, '2019-04-14 12:53:57', '2019-04-14 12:56:53'),
(3939, 'مشاهدة فيلم Downrange 2017 مترجم', 'مشاهدة و تحميل فيلم الاثارة Downrange 2017 مترجم اون لاين جودة WEB-DL وتحميل مباشر مشاهدة اون لاين مباشرة ” أسفل المدى ” حول بعد تعثر مجموعة من اﻷصدقاء على الطريق بسبب فراغ إحدى العجلات، تصير هذه المجموعة هدفًا ﻷحد القناصين.', 'downrange-2017', 'https://m.media-amazon.com/images/M/MV5BMDIwMzgzYzMtYTdiOS00ZjcxLTk1ZTAtM2ExZTVlNmY2NzEyXkEyXkFqcGdeQXVyMTM4NTIzMTM@._V1_SX300.jpg', 5.4, 'WEB-DL', 0, 1, 3943, '2019-04-14 12:54:33', '2019-04-14 12:56:51'),
(3941, 'مشاهدة فيلم Alex and the List 2018 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والرومانسية Alex and the List 2018 مترجم بجودة WEB-DL كامل أون لاين. ” اليكس والقائمة ” حول اليكس مدرب كلاب محبوب يحب امراة عظيمة تدعى كاثرين فهي ذكية وموهوبة ومن عائلة جيدة. تحب كاثرين حس دعابة اليكس البديهية وصدقه وقدرته عل الاستماع. حين يقرر اليكس طلب الزواج منها يفاجأ اليكس حين تضع كاثرين قائمة مفصلة من التحسينات التي فكرت بها جيدا وتشعر ان على اليكس تطبيقها ليكونا الثنائي المثالي.', 'alex-and-the-list-2018', 'uploads/241680190773.jpg', NULL, 'WEB-DL', 0, 1, 3945, '2019-04-14 12:54:43', '2019-04-14 12:56:49'),
(3942, 'مشاهدة فيلم The Manor 2018 مترجم', 'مشاهدة وتحميل فيلم الرعب The Manor 2018 مترجم بجودة DVDRip كامل أون لاين. ” قصر اندرز ” حول مريضة نفسية تدعى ايمي هانتر والاحداث الرهيبة التي تتبعها منذ خروجها من مصحة د. تريفنياك. والدة ايمي جاين تشعر انه من الافضل ان تحيط ابنتها بالجو العائلي الدافئ في قصر اندرز ودعت عائلة ايمي المتفرقة منذ وقت طويل للانضمام اليهما في القصر. لكن للقصر خطط اعمق لعائلة هانتر حين يصل المقتحمون واتباع الشعائر للمساعدة على احياء القوى الشيطانية القديمة اكا مانا خلال وقت قصير ليشيعوا الجنون ويذرفوا الدماء.', 'the-manor-2018', 'https://m.media-amazon.com/images/M/MV5BNTczNTA2OTA3MV5BMl5BanBnXkFtZTcwODE5MTU0OQ@@._V1_SX300.jpg', 6.9, 'DVDRip', 0, 1, 3946, '2019-04-14 12:54:59', '2019-04-14 12:56:48'),
(3943, 'مشاهدة فيلم The Con Is On 2018 مترجم', 'مشاهدة و تحميل فيلم الكوميديا The Con Is On 2018 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة ” وتستمر الخدعة ” حول في محاولتهما لتجنب دفع دين قمار ضخم لعضو عصابة شرير في انجلترا يهرب الزوجان الى لوس انجلوس ويخططان لسرقة مجوهرات.', 'the-con-is-on-2018', 'https://m.media-amazon.com/images/M/MV5BY2Q3OWU0NTEtNWY4ZS00M2U5LWI5NTAtNTM5NjhmMWRmY2U5XkEyXkFqcGdeQXVyOTg4MDYyNw@@._V1_SX300.jpg', 4.7, 'BluRay', 0, 1, 3947, '2019-04-14 12:55:01', '2019-04-14 12:56:48'),
(3944, 'مشاهدة فيلم Return of the Scarecrow 2018 مترجم', 'مشاهدة وتحميل فيلم الرعب Return of the Scarecrow 2018 بجودة WEB-DL مترجم كامل اون لاين مشاهدة مباشرة يوتيوب ” عودة الفزاعة ” حول اسطورة ريفية تتحدث عن فزاعة شريرة التي تزداد قوتها حتى لم بعد من الممكن احتواء شرها وتستيقظ وتعود باستمرار لتطلق رعبها. لكن مزحة سارت بشكل سيئ نتج عنها سوء فهم وليلة سيعيشها مجموعة من المخيمين وبعض الريفيين لن ينسوها طوال حياتهم.', 'return-of-the-scarecrow-2018', 'https://m.media-amazon.com/images/M/MV5BZTQ1NzUwM2QtZTYwNi00ZjMwLTlhNTYtYmRjYmY1M2RjNjNkXkEyXkFqcGdeQXVyODQ0NTg0OA@@._V1_SX300.jpg', 2.8, 'WEB-DL', 0, 1, 3948, '2019-04-14 12:55:09', '2019-04-14 12:56:46'),
(3945, 'مشاهدة فيلم Mobile Homes 2017 مترجم', 'مشاهدة وتحميل فيلم الدراما Mobile Homes 2017 بجودة WEB-DL مترجم اون لاين وتحميل مباشر. ” منازل متنقلة ” حول أم شابة تنتقل من فندق صغير إلى آخر برفقة حبيبها وابنها في الثامنة من عمره. يؤثر التنقل الدائم عليهم ويودي بحياتهم للصخب والتشتت، إلى أن يظهر اكتشاف مجتمع المنزل المتنقل الذي يمنحهم حياة بديلة أكثر استقرارًا.', 'mobile-homes-2017', 'https://m.media-amazon.com/images/M/MV5BMTc3OTgwNzQ1NF5BMl5BanBnXkFtZTgwMDY3MjA1NjM@._V1_SX300.jpg', 6.1, 'WEB-DL', 0, 1, 3949, '2019-04-14 12:55:29', '2019-04-14 12:56:45'),
(3946, 'مشاهدة فيلم A Monks Madness 2018 مترجم', 'مشاهدة فيلم A Monks Madness 2018 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر ” راهب الجنون ” يشكو آلهة في السماء إلى الإمبراطور اليشم حول النكات العملية الخبيثة التي لعبتها عليهم بواسطة التنين المقاتل لوهان', 'a-monks-madness-2018', 'https://m.media-amazon.com/images/M/MV5BNDUzNDNiODItYjQ1ZC00NDM1LWI0NDEtMWZlYzg0MmE4ZGZhXkEyXkFqcGdeQXVyMTU3OTI3MjM@._V1_SX300.jpg', 0, 'WEB-DL', 0, 1, 3950, '2019-04-14 12:55:51', '2019-04-14 12:56:45'),
(3947, 'مشاهدة فيلم Puerto Ricans in Paris 2015 مترجم', 'مشاهدة فيلم الكوميديا Puerto Ricans in Paris 2015 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. تدور أحداث الفيلم حول اثنيّن من شرطة مباحث (بورتريكو)، واللذان يتوجها إلى (باريس) لتعقب حقيبة مسروقة.', 'puerto-ricans-in-paris-2015', 'https://m.media-amazon.com/images/M/MV5BMTk3ODA5NzA0N15BMl5BanBnXkFtZTgwMTc4OTY3ODE@._V1_SX300.jpg', 5.3, 'BluRay', 0, 1, 3951, '2019-04-14 12:56:23', '2019-04-14 12:56:44'),
(3948, 'مشاهدة فيلم Rams 2015 مترجم', 'مشاهدة فيلم Rams 2015 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر في إحدى القرى الأيسلندية، يعيش الشقيقان (جومي وكيدي) جنبًا إلى جنب، ويعملان في مجال المواشي، وعلى الرغم من مشاركتهما لنفس الأرض، لكنهما لا يتحدثان إلى بعضهما البعض منذ أربعة عقود، وبعد انتقال مرض عضال إلى الأغنام التي بحوزة (كيدي)، تصير القرية بأكملها واقعة تحت تهديد غير مسبوق، ويهدد في المقام الأول مصادر رزقهم.', 'rams-2015', 'https://m.media-amazon.com/images/M/MV5BNWI4MTg1OWMtZGQ0OC00Yzk3LTkwZDAtNzg1ZGFjZTExZTUzXkEyXkFqcGdeQXVyMzQ5Njc3OTg@._V1_SX300.jpg', 7.3, 'BluRay', 0, 1, 3952, '2019-04-14 12:56:39', '2019-04-14 12:56:44'),
(3949, 'مشاهدة فيلم Scouts Guide to the Zombie Apocalypse 2015 مترجم', 'مشاهدة و تحميل فيلم الاكشن والكوميديا Scouts Guide to the Zombie Apocalypse 2015 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة تدور أحداث الفيلم حول ثلاثة من (آل سكوت) الذين يقضون آخر ليلة لهم في معسكر خارجي، ولكنهم يجدون أنفسهم أمام انتشار عدوى الزومبي، والآن عليهم أن ينقذوا أصدقاءهم والبشرية عمومًا من انتشار هذه العدوى. أثناء ذلك يكتشفون معنى الصداقة الحقيقي عند وقوفهم بجانب بعضهم في مواجهة الزومبي.', 'scouts-guide-to-the-zombie-apocalypse-2015', 'https://m.media-amazon.com/images/M/MV5BMTY4NjczNjE4OV5BMl5BanBnXkFtZTgwODk0MjQ5NjE@._V1_SX300.jpg', 6.3, 'BluRay', 0, 1, 3953, '2019-04-14 13:02:14', '2019-04-14 13:08:23'),
(3950, 'مشاهدة فيلم Sleeping Giant 2015 مترجم', 'مشاهدة وتحميل فيلم المغامره والدراما Sleeping Giant 2015 بجودة BluRay مترجم اون لاين وتحميل مباشر. بينما يقضون الصيف في كوخ على شواطئ بحيرة (سوبريور)، يتعامل ثلاثة مراهقين مع مللهم وسأمهم باكتشاف حدود خبراتهم واختبارها.', 'sleeping-giant-2015', 'https://m.media-amazon.com/images/M/MV5BYTA0OWE3YjEtNTkwMS00YmNjLTg1YzMtOTExMDVlNWYxNDhiXkEyXkFqcGdeQXVyMzEyNzYxODA@._V1_SX300.jpg', 6.7, 'BluRay', 0, 1, 3954, '2019-04-14 13:02:23', '2019-04-14 13:08:22'),
(3951, 'مشاهدة فيلم Spanish Affair 2 2015 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والرومانسية Spanish Affair 2 2015 مترجم بجودة BluRay كامل اون لاين. يُسلّط الضوء على الريف الإسباني عندما ينطلق رجل من منطقة إقليم “الباسك” في مهمة لمنع ابنته من الزواج من رجل من منطقة “كتالونيا”.', 'spanish-affair-2-2015', 'https://m.media-amazon.com/images/M/MV5BMjI5NTM0MDg5Nl5BMl5BanBnXkFtZTgwNjQxNTYxMjE@._V1_SX300.jpg', 6.6, 'BluRay', 0, 1, 3955, '2019-04-14 13:02:31', '2019-04-14 13:08:21'),
(3952, 'مشاهدة فيلم Sunset Song 2015 مترجم', 'مشاهدة وتحميل فيلم الدراما Sunset Song 2015 مترجم بجودة BluRay كامل اون لاين. تدور أحداث القصة حول المعلمة (كريس جوثري)، والتي تتخلى عن مهنة التدريس بهدف الحفاظ على المزرعة بالتعاون مع والدها بالرغم من قسوة قلبه وتعامله الجاف معها، تتزوج كريس من أحد المزارعين، لكن تتدهور العلاقة بينهما مع اندلاع الحرب العالمية الأولى.', 'sunset-song-2015', 'https://m.media-amazon.com/images/M/MV5BMTAzOTEwNzAyNTJeQTJeQWpwZ15BbWU4MDgyNzE2OTcx._V1_SX300.jpg', 6.4, 'BluRay', 0, 1, 3956, '2019-04-14 13:02:33', '2019-04-14 13:08:21'),
(3953, 'مشاهدة فيلم Tanna 2015 مترجم', 'مشاهدة و تحميل فيلم المغامره والدراما Tanna 2015 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة على إحدى الجزر على المحيط الهادئ في الغابات الاستوائية والتي يهيمن عليها بركان نشيط، تحدث هذه القصة القلبية، حيث القوانين القبيلة تمنع العشق والاتفاق بين القدماء و الجدد.', 'tanna-2015', 'https://m.media-amazon.com/images/M/MV5BMjEwNjEzOTU0OV5BMl5BanBnXkFtZTgwMjYyMzQ3NjE@._V1_SX300.jpg', 6.9, 'BluRay', 0, 1, 3957, '2019-04-14 13:02:44', '2019-04-14 13:08:20'),
(3954, 'مشاهدة فيلم The Boys Who Cried Wolf 2015 مترجم', 'مشاهدة وتحميل فيلم الدراما The Boys Who Cried Wolf 2015 مترجم بجودة BluRay كامل أون لاين. وان جوو (Park Jong-Hwan) ممثّل مسرحي ولكنه يقوم بكسب المال عنْ طريق لعب أدوار خاصة يطلبها منهُ العُملاء. يُطلبْ منه أنْ يكون شاهدًا في قضية قتل منْ قِبل والدة الضحية. بالرُغم من أنه لم يرغب بذلك، ولكنهُ كان بحاجة للمال. ممّا دفعهُ للذهاب إلى مركز الشرطة وتقديم شهادة زور. يكتشف وان جوو بأنّ هناكَ حقيقة أخرى وراء القضية، ويُدرك بأنهُ ارتكبَ خطأً كبيرًا سيعود عليه بعواقبَ وخيمة.', 'the-boys-who-cried-wolf-2015', 'https://images-na.ssl-images-amazon.com/images/M/MV5BOGQ5YzNjZmYtZGExNS00ZTQyLWFlMjgtZDNmZmUxNDE1MjJlXkEyXkFqcGdeQXVyNTI5NjIyMw@@._V1_SX300.jpg', 6.6, 'BluRay', 0, 1, 3958, '2019-04-14 13:02:54', '2019-04-14 13:08:19'),
(3955, 'مشاهدة فيلم The Childhood of a Leader 2015 مترجم', 'مشاهدة وتحميل فيلم الدراما The Childhood of a Leader 2015 بجودة BluRay مترجم اون لاين وتحميل مباشر. قصة يقشعر لها الأبدان عن صعود الفاشية، وتدور الأحداث حول صبي أمريكي يعيش في (فرنسا) عام 1918 يعمل لحسابة الحكومة الأمريكية في إنشاء معاهدة فرساي؛ الأمر الذي يساعده على تكوين معتقداته، ونشهد من خلاله ميلاد الأنا المرعبة عنده.', 'the-childhood-of-a-leader-2015', 'https://m.media-amazon.com/images/M/MV5BMTQ3NTU5ODMzNV5BMl5BanBnXkFtZTgwNTM5NTEzOTE@._V1_SX300.jpg', 6.1, 'BluRay', 0, 1, 3959, '2019-04-14 13:03:01', '2019-04-14 13:08:18'),
(3956, 'مشاهدة فيلم The Dream Children 2015 مترجم', 'مشاهدة وتحميل فيلم الدراما The Dream Children 2015 مترجم بجودة BluRay كامل أون لاين. الفيلم لا ينصح به لمن هم اقل من 21 عاما نظرا لبعض المشاهد القاسيه قصه الفيلم تدور حول شابين اليكس وستيفن تنشأ بينهما علاقه جنسيه فيما يريد اليكس ان يصبح ابا لطفل لكن ستيفن يخشي ان يدخل في مرحله من عدم الامن وعدم الاستقرار ومزيد من السطحيه اصبح غير قادر علي التعامل بالطريقه الشرعيه في التبني وفي نفس الوقت يريد ان يصبح ابا فقرروا الذهاب الي السوق السوداء وتبني طفل من امرءاه شابه يائسه ولكن يحدث ما لا في الحسبان .', 'the-dream-children-2015', 'https://m.media-amazon.com/images/M/MV5BMTk3MTE0MDMzNF5BMl5BanBnXkFtZTgwMzUwOTMxMjE@._V1_SX300.jpg', 5.3, 'BluRay', 0, 1, 3960, '2019-04-14 13:03:12', '2019-04-14 13:08:17'),
(3957, 'مشاهدة فيلم The Escort 2016 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والدراما The Escort 2016 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب تدور أحداث الفيلم حول الصحافي ميتش كوبر (مايكل دونجر)، البالغ من العمر 27 عامًا، عزب، مفلس، مدمن للجنس، يئس من إيجاد موضوع شيق يكتب عنه، فيقرر الانخراط في عالم العاهرات لعله يجد ما يبحث عنه، ويبدأ في تتبع ناتالي (ليندسي فونيسكا) عاهرة ذات شخصية مشوقة، حيث تلقت تعليمها في جامعة (ستانفورد).', 'the-escort-2016', 'https://m.media-amazon.com/images/M/MV5BNTgzNDgzNDAyMF5BMl5BanBnXkFtZTgwMTgxOTkzNjE@._V1_SX300.jpg', 6, 'BluRay', 0, 1, 3961, '2019-04-14 13:03:14', '2019-04-14 13:08:16');
INSERT INTO `movies` (`id`, `name`, `description`, `slug`, `image_url`, `ratings`, `quality`, `views`, `category_id`, `server_links`, `created_at`, `updated_at`) VALUES
(3958, 'مشاهدة فيلم The Forbidden Room 2015 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والغموض The Forbidden Room 2015 مترجم بجودة BluRay كامل أون لاين. حول حطاب غريب يظهر بطريقة غامضة على متن غواصة عالقة تحت الماء لاشهر مع حمولة غير مستقرة. بينما يحاول الطاقم المرتعب شق طريقهم خلال اروقة الغواصة الملعونة يجدون انفسهم في رحلة داخل اعمق مخاوفهم واسواها.', 'the-forbidden-room-2015', 'https://m.media-amazon.com/images/M/MV5BMTYzMTkyNjE4OF5BMl5BanBnXkFtZTgwMzU3MTQwNzE@._V1_SX300.jpg', 6.1, 'BluRay', 0, 1, 3962, '2019-04-14 13:03:21', '2019-04-14 13:08:15'),
(3959, 'مشاهدة فيلم The Last House on Cemetery Lane 2015 مترجم', 'مشاهدة وتحميل فيلم الرعب The Last House on Cemetery Lane 2015 مترجم بجودة BluRay كامل أون لاين. تدور احداث فيلم الرعب فى اطار من الاثاره وارعب حول منزل قديم مبنى فى مزرعه فى (ويلز) يسكنه اشخاص ويكتشفو ان المنزل يوجد به اوراح شريره تلاحقهم.', 'the-last-house-on-cemetery-lane-2015', 'https://m.media-amazon.com/images/M/MV5BMjMzODE0MzQzOV5BMl5BanBnXkFtZTgwMDM5Nzg0NDE@._V1_SX300.jpg', 3.5, 'BluRay', 0, 1, 3963, '2019-04-14 13:03:28', '2019-04-14 13:08:14'),
(3960, 'مشاهدة فيلم The High Sun 2015 مترجم', 'مشاهدة فيلم The High Sun 2015 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر يتناول الفيلم ثلاث قصص حب مختلفة تدور أحداث كل منها في ثلاث حقب زمنية متعاقبة في قريتين متجاورتين في البلقان، واللتان اشتهرتا بتاريخ طويل للغاية من العداء والكراهية بين مختلف العرقيات.', 'the-high-sun-2015', 'https://m.media-amazon.com/images/M/MV5BMTQ4NDg0MTU4MV5BMl5BanBnXkFtZTgwODY0ODk1NTE@._V1_SX300.jpg', 7.2, 'BluRay', 0, 1, 3964, '2019-04-14 13:03:41', '2019-04-14 13:08:13'),
(3961, 'مشاهدة فيلم The Minds Eye 2015 مترجم', 'مشاهدة وتحميل فيلم الاكشن والرعب The Minds Eye 2015 مترجم بجودة BluRay كامل اون لاين. “زاك كونورز” و”رايتشل ميدوز” اللذان ولدا مع قدرات تحريك عن بعد مذهلة. عندما يتسرب خبر عن قدراتهما الخارقة يجدان نفسيهما سجينين لدى “مايكل سلوفاك” وهو طبيب مختل ينوي أن يحصد قدراتهما. بعد محاولة هروب جريئة يتحرران من مؤسسته الشريرة ولكن الطبيب الفاسد لن يمنعه شيء من تتبعهما حتى يتمكن من متابعة أخذ قوتيهما واستغلالها لمصلحته.', 'the-minds-eye-2015', 'https://m.media-amazon.com/images/M/MV5BODAxNWExMzMtYzg1OC00ZmY1LThiOTgtNzQ0NGIzYTczN2MxXkEyXkFqcGdeQXVyNTM3MDMyMDQ@._V1_SX300.jpg', 3.4, 'BluRay', 0, 1, 3965, '2019-04-14 13:03:52', '2019-04-14 13:08:12'),
(3962, 'مشاهدة فيلم The Rezort 2015 مترجم', 'مشاهدة وتحميل فيلم الرعب والخيال العلمي The Rezort 2015 مترجم بجودة BluRay كامل اون لاين. بعد حدوث هجوم كاد أن يدمر العالم من قبل الزومبي يستعيد البشر السيطرة مجددا. إذا وجد أحد الزومبي طريقه بالمصادفة إلى الحياة اليومية للبشر يتم التخلص منه من قبل السلطات على الفور. في هذا اليوم وهذا العصر يعرف البشر كيف يتعاملون مع الزومبي.', 'the-rezort-2015', 'https://m.media-amazon.com/images/M/MV5BYWMzMzgwMjItMGI1ZC00MGY0LTgwY2MtMWQ0NzQ2MDZiMDE0XkEyXkFqcGdeQXVyMjExMDIwNzA@._V1_SX300.jpg', 5.3, 'BluRay', 0, 1, 3966, '2019-04-14 13:04:14', '2019-04-14 13:08:11'),
(3963, 'مشاهدة فيلم The Search for Freedom 2015 مترجم', 'مشاهدة وتحميل فيلم الوثائقي The Search for Freedom 2015 مترجم بجودة BluRay كامل أون لاين. إن البحث عن الحرية هو قصة ثورة ثقافية تغذيها رغبة الإنسان في العيش في الوقت الراهن وتفعل ما يجعلك تشعر بأنك على قيد الحياة.', 'the-search-for-freedom-2015', 'https://m.media-amazon.com/images/M/MV5BMjE2MTA5MzMzNl5BMl5BanBnXkFtZTgwMjQzNDE2NjE@._V1_SX300.jpg', 6.9, 'BluRay', 0, 1, 3967, '2019-04-14 13:04:27', '2019-04-14 13:08:11'),
(3964, 'مشاهدة فيلم The Surprise 2015 مترجم', 'مشاهدة فيلم The Surprise 2015 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر تدور أحداث الفيلم في طابع رومانسي كوميدي حول شخصين يوقعان مع شركة من أجل إنهاء حياتهم مع مليونير مكتئب وشابة أصيبت بخيبة أمل في الحب ويحاولان إيجاد وسلة تخرجهما من هاته} العقود.', 'the-surprise-2015', 'https://m.media-amazon.com/images/M/MV5BOTAxOTg1MTY5NV5BMl5BanBnXkFtZTgwMTk5NTA5NTE@._V1_SX300.jpg', 6.7, 'BluRay', 0, 1, 3968, '2019-04-14 13:04:40', '2019-04-14 13:08:10'),
(3965, 'مشاهدة فيلم The Adderall Diaries 2015 مترجم', 'مشاهدة فيلم الجريمة والدراما The Adderall Diaries 2015 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. يعاني كاتب من وضع حرج مقارنًة بنجاحاته السابقة، وذلك بسبب عجزه مؤخرًا عن الكتابة، فيتعاطي عقاقير مخدرة، ويقاسي مشاكل في علاقاته، باﻹضافة إلى مجموعة من مشكلات الأبوّة المُعقدّة، فيلجأ إلى تحليل وفك طلاسم سلسلة جرائم قتل غريبة لكتابة أجزاء جديدة من مؤلفاته.', 'the-adderall-diaries-2015', 'https://m.media-amazon.com/images/M/MV5BMDE1OWEyOTYtNjRlYy00MDhiLWE1NzMtNjc0MmZkZjQyZWY0XkEyXkFqcGdeQXVyMjc0MjUzMzU@._V1_SX300.jpg', 5.2, 'BluRay', 0, 1, 3969, '2019-04-14 13:04:48', '2019-04-14 13:08:09'),
(3966, 'مشاهدة فيلم The Ardennes 2015 مترجم', 'مشاهدة وتحميل فيلم الدراما The Ardennes 2015 بجودة BluRay مترجم اون لاين وتحميل مباشر. تتخذ عملية سرقة منزل مسارًا خاطئًا‎، ويتمكن اللص (ديف) من الهرب ويترك شقيقه (كينيث) الذي يتم القبض عليه بتهمة السرقة، وبعد أربع سنوات يتم الإفراج عنه، حيث يحدث له الكثير من التغيير داخل السجن، في حين تحولت حياة (ديف) إلى مسارها الصحيح، ورغم محاولة مساعدته لشقيقه (كينيث)، إلا أن التوتر يزداد بينهما، حيث يرغب (كينيث) في استعادة صديقته السابقة (سيلفي).', 'the-ardennes-2015', 'https://m.media-amazon.com/images/M/MV5BNTA4ODQwOTItODAwOS00YmQ1LTg4OGMtZjRlN2YyNTM1YzU4XkEyXkFqcGdeQXVyMjA0MzYwMDY@._V1_SX300.jpg', 6.8, 'BluRay', 0, 1, 3970, '2019-04-14 13:05:00', '2019-04-14 13:08:08'),
(3967, 'مشاهدة فيلم The Clan 2015 مترجم', 'مشاهدة فيلم السيرة الذاتية والجريمة The Clan 2015 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. تدور أحداث الفيلم حول العائلة التي خطفت وقتلت الناس في فترة الثمانينات. يعتبر فيلم “عائلة كلان” الأرجنتيني واحدا من افضل افلام الاثارة والغموض.', 'the-clan-2015', 'https://m.media-amazon.com/images/M/MV5BMTQ5ODMwMjg5OF5BMl5BanBnXkFtZTgwODYyOTE2NjE@._V1_SX300.jpg', 7, 'BluRay', 0, 1, 3971, '2019-04-14 13:05:10', '2019-04-14 13:08:07'),
(3968, 'مشاهدة فيلم The Daughter 2015 مترجم', 'مشاهدة وتحميل فيلم الدراما The Daughter 2015 بجودة BluRay مترجم اون لاين وتحميل مباشر. تدور أحداث الفيلم حول قصة رجل يدعى كريستيان (بول شنايدر) الذي يعود إلى مسقط رأسه ليكتشف سر خطير عن عائلته تم دفنه منذ فترة طويلة، وكل المحاولات لوضع الأمور في نصابها من جديد تهدد حياة كل من غادر المنزل قبل سنوات.', 'the-daughter-2015', 'https://m.media-amazon.com/images/M/MV5BMTY2MzA0MTUyMl5BMl5BanBnXkFtZTgwMTkyMjEyNzE@._V1_SX300.jpg', 6.6, 'BluRay', 0, 1, 3972, '2019-04-14 13:05:16', '2019-04-14 13:08:07'),
(3969, 'مشاهدة فيلم The Dramatics A Comedy 2015 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والرومانسية The Dramatics A Comedy 2015 مترجم بجودة BluRay كامل اون لاين. كوميديا رومانسية حول حلوة، ولكن شدد خارج الممثلة، الذي يحط بشكل غير متوقع دور البطولة في جنسية صريحة التكيف المصغرة سلسلة من الأكثر مبيعا، المثيرة الفرخ مضاءة الرواية ولها المحبة، ولكن للتعذيب ستونر صديقها، الذي هو اضطر للتعامل معها. وهو مبني على حياة كات فوستر وسكوت روجرز، الذي شارك في صاغها السيناريو وشارك نجم في الفيلم، وفن التمثيل يصادف أول فيلم معا والإخراجية الأولى رودجر ل.', 'the-dramatics-a-comedy-2015', 'https://m.media-amazon.com/images/M/MV5BMTQ1NDIwNjM0N15BMl5BanBnXkFtZTgwMDQ1NzgxNDE@._V1_SX300.jpg', 4.7, 'BluRay', 0, 1, 3973, '2019-04-14 13:05:23', '2019-04-14 13:08:06'),
(3970, 'مشاهدة فيلم Duck Butter 2018 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والدراما Duck Butter 2018 بجودة WEB-DL مترجم اون لاين وتحميل مباشر. ” زبدة البطة ” تقرر امرأتان غير راضيتين عن خيانة الأمانة التي تراها في المواعدة والعلاقات ، عقد اتفاق يقضيان 24 ساعة معًا على أمل العثور على طريقة جديدة لخلق الحميمية', 'duck-butter-2018', 'https://m.media-amazon.com/images/M/MV5BMTU4MTMxMTM4NV5BMl5BanBnXkFtZTgwNjAzNjAxNTM@._V1_SX300.jpg', 5.3, 'WEB-DL', 0, 1, 3974, '2019-04-14 13:05:45', '2019-04-14 13:08:05'),
(3971, 'مشاهدة فيلم I Am Not an Easy Man 2018 مترجم', 'مشاهدة و تحميل فيلم الكوميديا I Am Not an Easy Man 2018 مترجم اون لاين جودة WEB-DL وتحميل مباشر مشاهدة اون لاين مباشرة ” لستُ رجلًا سهلًا ” حول يتذوق متعصب وقح طعم مرارة نفس الكأس عندما يستيقظ في عالم تهيمن عليه النساء ويتواجه مع مؤلفة صاحبة سلطة.', 'i-am-not-an-easy-man-2018', 'https://m.media-amazon.com/images/M/MV5BYzM3OGM1OGUtMzE0Yi00OGM2LWFlNjItMGIwNmE4ODhkY2E2XkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg', 6.4, 'WEB-DL', 0, 1, 3975, '2019-04-14 13:06:08', '2019-04-14 13:08:04'),
(3972, 'مشاهدة فيلم Where the Truth Lies 2005 مترجم', 'مشاهدة و تحميل فيلم الجريمة والدراما Where the Truth Lies 2005 مترجم اون لاين جودة WEB-DL وتحميل مباشر مشاهدة اون لاين مباشرة “حيث تكمن الحقيقه ” حول تدور أحداث الفيلم في قالب من الجريمة والغموض . تتميز الصحافية الشابة (كارين أوكونور) بالموضوعات الصحافية التي تكتبها عن المشاهير ، تحاول (كارين) أن تكشف النقاب عن حقيقة حادثة قديمة وقعت قبل سنوات ، يتعلق الحادث بالعثور على جثة فتاة في غرفة فندق خاصة بثنائي كوميدي شهير هما (فينس كولينز) ، و(لاني موريس) ، وبالرغم من أن الاثنين لم تتم إدانتهما بشيء لامتلاكهما حجة غياب قوية ، ولكن الحادث في الوقت ذاته أنهى مستقبلهما الفني .', 'where-the-truth-lies-2005', 'https://m.media-amazon.com/images/M/MV5BMTI2NzQ3ODc3OV5BMl5BanBnXkFtZTcwMjEzMTEzMQ@@._V1_SX300.jpg', 6.5, 'WEB-DL', 0, 1, 3976, '2019-04-14 13:06:22', '2019-04-14 13:08:03'),
(3973, 'مشاهدة فيلم Fishbowl California 2018 مترجم', 'مشاهدة فيلم Fishbowl California 2018 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر ” كاليفورنيا الضيقة ” حول رجل يكافح ليجد هدفا في الحياة تنوره ارملة سكيرة مريضة.', 'fishbowl-california-2018', 'https://m.media-amazon.com/images/M/MV5BMjIwMDYzMzc4Nl5BMl5BanBnXkFtZTgwNjgzMzQwNDI@._V1_SX300.jpg', 5.4, 'WEB-DL', 0, 1, 3977, '2019-04-14 13:06:34', '2019-04-14 13:08:03'),
(3974, 'مشاهدة فيلم The Leisure Seeker 2017 مترجم', 'مشاهدة وتحميل فيلم المغامره والكوميديا The Leisure Seeker 2017 بجودة BluRay مترجم اون لاين وتحميل مباشر. ” الباحثة عن الترفيه ” حول زوجان ينطلقان في رحلة لا تُنسى داخل شاحنتهما القديمة، والتي يسمونها “الباحثة عن الترفيه”. يسافران من (بوسطن) إلى منزل (أرنست هيمنجواي) في (كاي ويست)؛ فيستعيدان شغفهما بالحياة وحبهما لبعضهما البعض في رحلتهما على الطريق، والتي تمدهما بالإلهام والمفاجآت حتى نهايتها.', 'the-leisure-seeker-2017', 'https://m.media-amazon.com/images/M/MV5BMTg1NTg2MzcyNF5BMl5BanBnXkFtZTgwNjMwMDIzNDM@._V1_SX300.jpg', 6.6, 'BluRay', 0, 1, 3978, '2019-04-14 13:06:46', '2019-04-14 13:08:02'),
(3975, 'مشاهدة فيلم County Line 2017 مترجم', 'مشاهدة وتحميل فيلم الاكشن والدراما County Line 2017 مترجم بجودة WEB-DL كامل أون لاين. ” حدود المقاطعه ” حول جندي البحرية القوي والعنيد الدن روكويل فقد رغبته في اعادة انتخابه كمامور لمقاطعة ماكسفيل. يقرر التقاعد وقبول ان بريستون الشرطي اللبق الاكثر سياسة وقد اخذ مكانه شرطي هو معلمه. ماتت زةجة الدن ولا يزال حزينا يقضي معظم وقته في الاهتمام بالدجاج والخنازير وحيوانات المزرعة التي احبتها في مزرعتهما. حتى ابنته امبر التي تسير على خطاه العسكرية وعلى وشك التجند لا يمكنها اراحته من تعبه. صديق الدن المقرب هو المامور كلينت ثورن الذي اعيد انتخابه في مقاطعة يورك القريبة.', 'county-line-2017', 'https://m.media-amazon.com/images/M/MV5BYWY4ZDZhNTctZmJkMi00ZDY5LThmNTUtNDBjOWVlMmVmZjE1XkEyXkFqcGdeQXVyNjAxMTI1Mzk@._V1_SX300.jpg', 5.2, 'WEB-DL', 0, 1, 3979, '2019-04-14 13:06:56', '2019-04-14 13:08:01'),
(3976, 'مشاهدة فيلم Black Cop 2017 مترجم', 'مشاهدة وتحميل فيلم الدراما Black Cop 2017 بجودة WEB-DL مترجم اون لاين وتحميل مباشر. ” الشرطي الاسود ” يتم دفع ضابط شرطة أسود إلى الحافة ، ويخرج إحباطاته من المجتمع المتميز الذي أقسم اليمين على حمايته', 'black-cop-2017', 'https://m.media-amazon.com/images/M/MV5BMTk2YmUwNDYtMGI0MC00ZTk2LTk3OTgtNjlhN2Y4OTFiYmM5XkEyXkFqcGdeQXVyMjE4NzUxNDA@._V1_SX300.jpg', 5.1, 'WEB-DL', 0, 1, 3980, '2019-04-14 13:07:12', '2019-04-14 13:08:00'),
(3977, 'مشاهدة فيلم The Redeeming 2018 مترجم', 'مشاهدة وتحميل فيلم الدراما والغموض The Redeeming 2018 مترجم بجودة WEB-DL كامل اون لاين. ” التحرير ” حول ام عزباء مضطربة تواجه غريبا غامضا واصداء ماضيها لحماية منزلها.', 'the-redeeming-2018', 'https://m.media-amazon.com/images/M/MV5BNjJhMjI2MTAtZmY2OS00MTUyLWE0NTctYTc5MzVlYzRhOTQ1XkEyXkFqcGdeQXVyMTg0NTc1NQ@@._V1_SX300.jpg', 4.1, 'WEB-DL', 0, 1, 3981, '2019-04-14 13:07:13', '2019-04-14 13:07:59'),
(3978, 'مشاهدة فيلم The Unattainable Story 2017 مترجم', 'مشاهدة فيلم الدراما The Unattainable Story 2017 مترجم بجودة WEB-DL مشاهدة مباشرة اون لاين. ” قصة غير قابلة للتحقيق ” خلال ليلة الافتتاح للمسرحية التي تتعامل مع الصراعات بين الحب والعمل ، كان سكيني مخرج المسرح المسيطر لديه عيد الغطاس عن كيفية تلاقي هذه المسرحية. بينما يتأمل في تعاونه مع جاكلين ، الكاتب الضعيف والمراوغ ، يدرك أنه في الحقيقة لم يكن يسيطر على القصة ، لكنه كان يتلاعب به طوال الوقت ليس فقط ليجعله يدير المسرحية بالطريقة تريد ، ولكن أيضا لتحفيز إبداعها', 'the-unattainable-story-2017', 'https://m.media-amazon.com/images/M/MV5BMmU2YWM0ZjctNDM1Ny00MGVhLWJkYWEtMjFhNzkyNjJjYmYwL2ltYWdlXkEyXkFqcGdeQXVyMjEwODc1NTk@._V1_SX300.jpg', 5.6, 'WEB-DL', 0, 1, 3982, '2019-04-14 13:07:31', '2019-04-14 13:07:58'),
(3979, 'مشاهدة فيلم Avengers Grimm Time Wars 2018 مترجم', 'مشاهدة وتحميل فيلم الاكشن والمغامره Avengers Grimm Time Wars 2018 مترجم بجودة BluRay كامل أون لاين. ” الغريم المنتقمون: حروب الزمن ” حين يحاول رامبلستليسكين الاستيلاء على الارض لمرة والى الابد يحاول فريق الافنجرز غريم تعقبه عبر الزمن لهزيمته', 'avengers-grimm-time-wars-2018', 'https://m.media-amazon.com/images/M/MV5BMDQwYTMwODItNWQ5Zi00ZTkyLWEzMDctOGM0NGVlOTg3MGRlXkEyXkFqcGdeQXVyMjM0ODM1NTE@._V1_SX300.jpg', 2.4, 'BluRay', 0, 1, 3983, '2019-04-14 13:07:54', '2019-04-14 13:07:57'),
(3980, 'مشاهدة فيلم Darc 2018 مترجم', 'مشاهدة وتحميل فيلم الاثارة Darc 2018 بجودة WEB-DL مترجم كامل اون لاين مشاهدة مباشرة يوتيوب ” دارك “اسقاط عصابة دولية للاتجار بالبشر، يطلب عميل إنتربول المساعدة من مجرم وحشي لديه معرفة وثيقة بعصابة “الياكوزا”', 'darc-2018', 'https://m.media-amazon.com/images/M/MV5BMjFiZmExN2YtNmMyNy00NTc5LWI0YWYtMTI0YzVlM2I2YTk0XkEyXkFqcGdeQXVyMTU5ODE5ODI@._V1_SX300.jpg', 5.8, 'WEB-DL', 0, 1, 3984, '2019-04-14 13:07:56', '2019-04-14 13:07:57'),
(3984, 'فيلم Star Trek: Nemesis 2002 مترجم اون لاين', 'مشاهدة فيلم الاكشن والمغامره Star Trek: Nemesis 2002 مترجم بجودة BrRip مشاهدة مباشرة اون لاين.', 'star-trek-nemesis-2002', 'https://m.media-amazon.com/images/M/MV5BMjAxNjY2NDY3NF5BMl5BanBnXkFtZTcwMjA0MTEzMw@@._V1_SX300.jpg', 6.4, '0', 0, 1, 3988, '2019-04-14 13:09:51', '2019-04-14 13:16:28'),
(3990, 'مشاهدة فيلم My Perfect Romance 2018 مترجم', 'مشاهدة وتحميل فيلم الرومانسية My Perfect Romance 2018 بجودة WEB-DL مترجم كامل اون لاين مشاهدة مباشرة يوتيوب ” قصتي الرومانسية المثالية ” حول المدير التنفيذي الجديد في شركة روبنسون تك ويس روبنسون يبحث عن افكار جديدة لزيادة مبيعات الشركة. فيفيان بلاير مكورة برامج تشارك برنامج مواعدة كانت تعمل عليه يدعى التكابق المثالي. يرى ويس فرصة وامكانية لقلب الشركة راسا على عقبواطلاق الخدمة. بينما يتم تحدي الشريكين لاستخدام البرنامج لايجاد الحب تظهر هذه الحسابات نتائج مثيرة للاهتمام.', 'my-perfect-romance-2018', 'https://m.media-amazon.com/images/M/MV5BOTEzZTZjODYtMzE5NS00ZDFjLTk0ZjQtNDU0ZjU5ZTFhMGQ2XkEyXkFqcGdeQXVyNjI4Mzg5OTg@._V1_SX300.jpg', 4.7, 'WEB-DL', 0, 1, 3994, '2019-04-14 13:10:52', '2019-04-14 13:16:24'),
(3992, 'مشاهدة فيلم The Last Seduction 1994 مترجم', 'مشاهدة وتحميل فيلم الجريمة والدراما The Last Seduction 1994 مترجم بجودة BluRay كامل أون لاين. (بريجيت) امرأة شابة جميلة، تكاد تمتلك كل شيء، فهي ذكية وجميلة ومتزوجة من طبيب هو (جورجي كلاي)، تقنعه ببيع الكوكايين المستخدم لأغراض طبية، من أجل الثراء السريع، لكنها تهرب بالنقود التي تبلغ مليون دولار؛ مما يهدد حياة (كلاي)، الذي يبعث وراءها مخبرين لتتيعها، تختبئ في مدينة صغيرة، وتقابل (مايك سويل) الذي يفتنه جمالها، ويقرر مساعدتها في الاحتفاظ بالنقود والهرب.', 'the-last-seduction-1994', 'https://m.media-amazon.com/images/M/MV5BZmYwYWRhY2MtNTU3NS00M2E0LWI5YjUtY2M1NGJkM2Y4NTdmXkEyXkFqcGdeQXVyNjU0NTI0Nw@@._V1_SX300.jpg', 7.1, 'BluRay', 0, 1, 3996, '2019-04-14 13:10:53', '2019-04-14 13:16:22'),
(3994, 'مشاهدة فيلم Dragon: The Bruce Lee Story 1993 مترجم', 'مشاهدة وتحميل فيلم الاكشن والسيرة الذاتية Dragon: The Bruce Lee Story 1993 مترجم بجودة BluRay كامل اون لاين. يعد هذا الفيلم من نوعية أفلام السيرة الذاتية ، حيث يتناول قصة حياة (بروس لي) خبير الفنون القتالية الشهير ، وبطل الكونغ فو ، ونشأته الأولى في (الصين ، وهونج كونج) ، ومن ثم انتقاله إلى (الولايات المتحدة) ، و(هوليود) ، وشهرته هناك ، وقيامه ببطولة العديد من الأفلام الناجحة ، والذي كان القتال فيها هو محورها الأساسي ، وحتى موته الغامض .', 'dragon-the-bruce-lee-story-1993', 'https://m.media-amazon.com/images/M/MV5BNDU4Yzk0M2YtZjUzNy00MmVjLWJmMDEtMzNlODU1NzdhZDQzXkEyXkFqcGdeQXVyNjc4ODQwNzg@._V1_SX300.jpg', 7, 'BluRay', 0, 1, 3998, '2019-04-14 13:11:06', '2019-04-14 13:16:20'),
(3998, 'مشاهدة فيلم A Tale of Two Sisters 2003 مترجم', 'مشاهدة فيلم الدراما والرعب A Tale of Two Sisters 2003 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. بعد أن تمضي شقيقتان بعض الوقت في مصح للأمراض العقلية تعودان إلى منزل أبيهما وزوجته ويواجهان إضافة إلى زوجة أبيهما القاسية وجود شبح في المنزل.', 'a-tale-of-two-sisters-2003', 'https://m.media-amazon.com/images/M/MV5BZDc2ZmYzMzEtZDA2My00MDViLTkwYzAtNjZjYmFiZjVkYzcxXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 7.2, 'BluRay', 0, 1, 4002, '2019-04-14 13:11:25', '2019-04-14 13:16:17'),
(4000, 'مشاهدة فيلم Sick: Survive the Night 2012 مترجم', 'مشاهدة و تحميل فيلم الرعب والخيال العلمي Sick: Survive the Night 2012 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة بعد عامين من اندلاع المرض ، يكافح الباقون يومًا بعد يوم من أجل البقاء. ومع زيادة نشاط المصابين في الليل ، يبحث ثلاثة أشخاص عن ملجأ في منزل فارغ ، ولكن مع نقص الإمدادات ، سيكونون محظوظين لإحيائهم على قيد الحياة.', 'sick-survive-the-night-2012', 'https://m.media-amazon.com/images/M/MV5BMjE4MTAwMDYwNF5BMl5BanBnXkFtZTcwNDEwODczNw@@._V1_SX300.jpg', 2.9, 'BluRay', 0, 1, 4004, '2019-04-14 13:11:34', '2019-04-14 13:16:15'),
(4001, 'مشاهدة فيلم The Little Death 2014 مترجم', 'مشاهدة فيلم الكوميديا والدراما The Little Death 2014 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. كوميديا عن الجنس والحب والعلاقات والمحرمات. في قصة متعددة السرد، وراء الأبواب المغلقة ,من الضواحي تبدو طبيعية.', 'the-little-death-2014', 'https://m.media-amazon.com/images/M/MV5BMTgzOTM0OTIyMV5BMl5BanBnXkFtZTgwNzk0NDMzMjE@._V1_SX300.jpg', 7.1, 'BluRay', 0, 1, 4005, '2019-04-14 13:11:46', '2019-04-14 13:16:11'),
(4004, 'مشاهدة فيلم The Lookalike 2014 مترجم', 'مشاهدة وتحميل فيلم الجريمة والدراما The Lookalike 2014 بجودة BluRay مترجم اون لاين وتحميل مباشر. وفاة سيدى سيدفع بطلا سابقا لكرة السلة وجمال صماء ومدمنا وممثلة طموحة إلى قصة حب غير متوقعة وسعي يائس لاسترضاء سيد المخدرات وليام سبينكس', 'the-lookalike-2014', 'https://m.media-amazon.com/images/M/MV5BNjg3OTcxNDY0N15BMl5BanBnXkFtZTgwNzY2Nzk5MjE@._V1_SX300.jpg', 5.5, 'BluRay', 0, 1, 4008, '2019-04-14 13:11:58', '2019-04-14 13:16:08'),
(4005, 'مشاهدة فيلم Dear White People 2014 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والدراما Dear White People 2014 مترجم بجودة BluRay كامل اون لاين. تدور قصة الفيلم حول العنصرية التي يتعرض لها الطلاب السود (الأمريكيين الأفارقة) من قبل الطلاب البيض من خلال أربعة طلاب سود في كلية (إيفي). ويكشف الفيلم مدى العرقية والعنصرية في أمريكا رغم كافة مظاهر التحضر هناك.', 'dear-white-people-2014', 'https://m.media-amazon.com/images/M/MV5BMjMzMjc5MjIzNV5BMl5BanBnXkFtZTgwNTY4OTQ2MjE@._V1_SX300.jpg', 6.1, 'BluRay', 0, 1, 4009, '2019-04-14 13:12:07', '2019-04-14 13:16:08'),
(4007, 'مشاهدة فيلم Love Is Strange 2014 مترجم', 'مشاهدة وتحميل فيلم الدراما والرومانسية Love Is Strange 2014 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب تدور أحداث الفيلم حول رجلين مثليين، هما (بن)، و(جورج)، عاشا معًا لمدة أربعة عقود كاملة، ويقرران الزواج من بعضهما البعض في (مانهاتن)، لكن ما لم يكن في الحسبان خسارة (جورج) لعمله، مما اضطر كلاهما أن يتركا الشقة التي يعيشان بها معًا، ويضطر كلاهما كل على حدة للانتقال والعيش في مكان مختلف لحين العثور على مكان جديد يجمعهما معًا من جديد.', 'love-is-strange-2014', 'https://m.media-amazon.com/images/M/MV5BMTk5MTkxOTI1N15BMl5BanBnXkFtZTgwNzAwNDA4MTE@._V1_SX300.jpg', 6.7, 'BluRay', 0, 1, 4011, '2019-04-14 13:12:15', '2019-04-14 13:16:06'),
(4008, 'فيلم The Woman in Unit 23B 2016 مترجم اون لاين', 'مشاهدة فيلم The Woman in Unit 23B 2016 بجودة HDRip مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر', 'the-woman-in-unit-23b-2016', 'uploads/171351409452.jpg', NULL, 'HDRip', 0, 1, 4012, '2019-04-14 13:12:20', '2019-04-14 13:16:05'),
(4009, 'مشاهدة فيلم #Captured 2017 مترجم', 'مشاهدة و تحميل فيلم الاثارة #Captured 2017 مترجم اون لاين جودة HDRip وتحميل مباشر مشاهدة اون لاين مباشرة مجموعة من أطفال المدارس الثانوية المتميزين يديرون غرفة دردشة غير شرعية حيث يبثون أغراضهم الدعائية التي تغذي الجنس لدفع المشاهدين على الإنترنت. لا يعرفون أن هناك متعصبا قاتلا في مهمة لتخليص الإنترنت من الخطيئة.', 'captured-2017', 'https://ia.media-imdb.com/images/M/MV5BNDExYTRlZjktNTFhMy00N2YxLWFiYjctZTMzYmZiZTI5MjgwXkEyXkFqcGdeQXVyNjU0NTI0Nw@@._V1_SX300.jpg', 5.7, 'HDRip', 0, 1, 4013, '2019-04-14 13:12:26', '2019-04-14 13:16:05'),
(4012, 'مشاهدة فيلم The Carter Effect 2017 مترجم', 'مشاهدة فيلم الوثائقي The Carter Effect 2017 مترجم بجودة WEB-DL مشاهدة مباشرة اون لاين. مشاهدة الفيلم الوثائقي The Carter Effect 2017 مترجم بجودة 720p WEB-DL مشاهدة مباشرة اون لاين', 'the-carter-effect-2017', 'https://m.media-amazon.com/images/M/MV5BOWY3ZDA5ZTItMGEwZi00OThjLWJlMzctZjhjNDgwOWE3M2ZmXkEyXkFqcGdeQXVyOTg4MDc4Nw@@._V1_SX300.jpg', 7.1, 'WEB-DL', 0, 1, 4016, '2019-04-14 13:12:46', '2019-04-14 13:15:59'),
(4016, 'مشاهدة فيلم Shimauma 2016 مترجم', 'مشاهدة و تحميل فيلم الجريمة والاثارة Shimauma 2016 مترجم اون لاين جودة WEB-DL وتحميل مباشر مشاهدة اون لاين مباشرة تدير درة (Ryo Ryusei) وشركاؤها برنامج لعبة البادجر لابتزاز الضحايا من المال. يوم واحد رغم ذلك ، يبدو أن هدفهم رجل عادي ، لكنه يختار أن يكون يكوزا تقع دورا وشركاؤه في عالم أكثر ظلمة. درة خطوات في الأعمال التجارية التي تقدم للانتقام من الآخرين بأي وسيلة ضرورية', 'shimauma-2016', 'uploads/141737776154.jpg', NULL, 'WEB-DL', 0, 1, 4020, '2019-04-14 13:13:00', '2019-04-14 13:15:56'),
(4018, 'مشاهدة فيلم Juarez 2045 2017 مترجم', 'مشاهدة فيلم الاكشن والمغامره Juarez 2045 2017 مترجم بجودة HDRip مشاهدة مباشرة اون لاين. في عام 2045. تصاعدت الحرب على المخدرات في المكسيك كعقار لا يرحم يستخدم كارتل الروبوتات لإنفاذ عملياتها', 'juarez-2045-2017', 'https://m.media-amazon.com/images/M/MV5BMTgyODY1MDE1Nl5BMl5BanBnXkFtZTgwNjAwMTAyMjE@._V1_SX300.jpg', 7.3, 'HDRip', 0, 1, 4022, '2019-04-14 13:13:06', '2019-04-14 13:15:55'),
(4020, 'مشاهدة فيلم The Beach House 2018 مترجم', 'مشاهدة وتحميل فيلم الدراما The Beach House 2018 مترجم بجودة HDTV كامل أون لاين. تتبع القصة كاريتا “كارا” روتليدج ، وهي امرأة حاولت أن تتخطى الماضي الصعب ولكنها مضطرة للتعامل مع التاريخ وجها لوجه عندما تعود لإصلاح منزل الشاطئ العائلي. خلال عاصفة مدمرة ، تنقذ كارا وأمها مئات السلاحف البحرية من موت محقق وتتعلم بعض حقائق الحياة الحقيقية في العملية', 'the-beach-house-2018', 'https://m.media-amazon.com/images/M/MV5BOTNjODUxMWMtNzcyZS00MDEwLWE1OGEtOTJkODhhODI2Y2ZjXkEyXkFqcGdeQXVyNjk2Mjc2OTI@._V1_SX300.jpg', 6.7, 'HDTV', 0, 1, 4024, '2019-04-14 13:13:19', '2019-04-14 13:15:53'),
(4022, 'مشاهدة فيلم Most Likely to Murder 2018 مترجم', 'مشاهدة وتحميل فيلم الكوميديا Most Likely to Murder 2018 مترجم بجودة WEB-DL كامل أون لاين. بطل الثانوية السابق بيلي يعود الى مسقط راسه متوقعا ان تكون الامور كما كانت. بدلا من هذا يجد ان كل اصدقائه قد انتقلوا وصديقته السابقة تواعد منبوذا سابقا في الثانوية. لذا يصبح بيلي مهووسا باثبات ان المنبوذ مسؤول عن جريمة قتل غامضة.', 'most-likely-to-murder-2018', 'https://m.media-amazon.com/images/M/MV5BYWNmYTU5YzEtOGYwMS00OTU3LTg1ZWEtNGMxMGYzMDIzNWZiXkEyXkFqcGdeQXVyNDExMzMxNjE@._V1_SX300.jpg', 5.2, 'WEB-DL', 0, 1, 4026, '2019-04-14 13:13:26', '2019-04-14 13:15:51'),
(4024, 'مشاهدة فيلم Veronica Guerin 2003 مترجم', 'مشاهدة فيلم Veronica Guerin 2003 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر تعمل الأيرلندية (فيرونيكا جيرين) صحفية وتتسم بالشجاعة وتسعى وراء المتاعب من أجل الكشف عن غموض تجارة المخدرات، وخاصة في مدينة (دبلن)، وتبدأ بالتعامل مع صغار المدمنين الذين ينتشرون بالشوارع، في محاولة منها للوصول إلى كبار تجار المخدرات،حتى تتعرف على (جون ترينور) الذي يمثل مصدرها الرئيسي في الحصول على بعض مصادر المعلومات في عالم الإجرام.', 'veronica-guerin-2003', 'https://m.media-amazon.com/images/M/MV5BZWZhZDdiMDYtYTRkMi00MzEzLWI0NjgtZjJjODFmN2ZjNmZmXkEyXkFqcGdeQXVyMTAwMzUyOTc@._V1_SX300.jpg', 6.9, 'WEB-DL', 0, 1, 4028, '2019-04-14 13:13:34', '2019-04-14 13:15:50'),
(4026, 'مشاهدة فيلم What a Girl Wants 2003 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والدراما What a Girl Wants 2003 بجودة WEB-DL مترجم كامل اون لاين مشاهدة مباشرة يوتيوب دافني رينولدز (أماندا بيانيس) لديها كل ما ترغب به أي فتاة في العالم، فهي على علاقة قوية بوالدتها ليبي (كيلي بريستون)، التي توفر لها مساحة من الحرية لتعيش حياتها بأسلوب مختلف عن أقرانها، إلا أنها لم تشعر يوما بأن كل شيء على ما يرام. فهي دوما ما كانت تحلم بأن تلتقي بوالدها البريطاني الذي كان على علاقة بوالدتها منذ ما يقرب من 17 عاما، إلا إن أسرته الارستقراطية رفضت ارتباطه بأمها الأمريكية.', 'what-a-girl-wants-2003', 'https://m.media-amazon.com/images/M/MV5BOTllOWQyNzktMTE5OS00NzJkLTgyYjUtNjIwY2Y4OThhNjgxL2ltYWdlXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 5.9, 'WEB-DL', 0, 1, 4030, '2019-04-14 13:13:43', '2019-04-14 13:15:48'),
(4027, 'مشاهدة فيلم My One and Only 2009 مترجم', 'مشاهدة و تحميل فيلم المغامره والسيرة الذاتية My One and Only 2009 مترجم اون لاين جودة BrRip وتحميل مباشر مشاهدة اون لاين مباشرة تبدأ الأحداث عندما تقوم سيدة المجتمع الجميلة (آن ديفيرو) بهجرة زوجها (دان) ، لتبدأ مع ابنيها المراهقين (جورج) و(روبي) أغرب رحلة ؛ لتتمكن في الرحلة من العثور على رجل ثري توقعه في حبها ، حتى يقوم بالاعتناء بولديها والإنفاق عليهما ، فتتعرض (آن) وابناها للكثير من المواقف الغريبة والمضحكة ، وتدور الأحداث إلى أن تصل إلى النهاية . ولكن هل ستتمكن الأم من تحقيق هدفها في نهاية المطاف ؟', 'my-one-and-only-2009', 'https://m.media-amazon.com/images/M/MV5BMTkxMDI1MjExNF5BMl5BanBnXkFtZTcwNzA1MzQ3Mg@@._V1_SX300.jpg', 6.6, '0', 0, 1, 4031, '2019-04-14 13:13:50', '2019-04-14 13:15:47'),
(4029, 'مشاهدة فيلم Hard Target 1993 مترجم', 'مشاهدة وتحميل فيلم الاكشن والاثارة Hard Target 1993 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب ناتاشا بيندر تذهب إلى نيو أورليانز لتقصى أثر والدها؛ الذي اختفى فجأة من دون مقدمات، في أثناء بحثها عنه تتعرف على شخص قوى وجاد جدا يدعي تشانس، يساعدها في البحث عنه ليكتشفا أن والدها تم قتله بسبب منظمة تقوم باختطاف الناس لإشراكهم في عمليات صيد بشري؛ حيث إنهم يستفيدون من الإضراب الذي تقوم به الشرطة في الولاية.', 'hard-target-1993', 'https://m.media-amazon.com/images/M/MV5BOTUxNmZiOWQtOWFmMy00YTU1LTkzMGItOTRhZDA0ZDAwMDE5XkEyXkFqcGdeQXVyNDc2NjEyMw@@._V1_SX300.jpg', 6.1, 'BluRay', 0, 1, 4033, '2019-04-14 13:14:02', '2019-04-14 13:15:46'),
(4030, 'فيلم K-19: The Widowmaker 2002 مترجم اون لاين', 'مشاهدة فيلم الدراما والتاريخي K-19: The Widowmaker 2002 مترجم بجودة BluRay مشاهدة مباشرة اون لاين.', 'k-19-the-widowmaker-2002', 'uploads/27374679383.jpg', NULL, 'BluRay', 0, 1, 4034, '2019-04-14 13:14:05', '2019-04-14 13:15:45'),
(4031, 'مشاهدة فيلم Primal Rage 2018 مترجم', 'مشاهدة وتحميل فيلم الرعب Primal Rage 2018 مترجم بجودة WEB-DL كامل أون لاين. تدور احداث قصه فيلم الرعب Primal Rage 2018 ” غضب بدائي ” حول رحلة زوجين التقيا حديثا عبر المحيط الاطلنطي غي الشمال الغربي تتحول الى كابوس بينما يجبران على مواجهة الطبيعة والمحليين غير الودودين ومخلوق متوحش معروف لدى الامريكيين الاصليين باوما.', 'primal-rage-2018', 'https://ia.media-imdb.com/images/M/MV5BMTg3MDQ4NTM2Nl5BMl5BanBnXkFtZTcwNzg4NTAzMQ@@._V1_SX300.jpg', 5.5, 'WEB-DL', 0, 1, 4035, '2019-04-14 13:14:10', '2019-04-14 13:15:44'),
(4033, 'مشاهدة فيلم Samson 2018 مترجم', 'مشاهدة وتحميل فيلم الاكشن والدراما Samson 2018 بجودة WEB-DL مترجم كامل اون لاين مشاهدة مباشرة يوتيوب يهودي يُمنَح قوة غير اعتيادية كقدرة خارقة، عليه أن يستجيب لنداء الآلهة في أن يقود شعبه ويحررهم من الاستعباد.. بعد أن تدفعه حماسة شبابه إلى زواج مأساوي، تقوده أعماله الانتقامية إلى صراع مباشر مع الجيش الفلسطيني، في حين يعمل شقيقه على تصعيد تمرد قبلي وتأجيجه.', 'samson-2018', 'https://m.media-amazon.com/images/M/MV5BYThiMjg4ZDAtNjk5ZS00ZTUxLThmM2ItMGI0ZTE1NjRhNWNmXkEyXkFqcGdeQXVyNTQ3MjE4NTU@._V1_SX300.jpg', 4.4, 'WEB-DL', 0, 1, 4037, '2019-04-14 13:14:23', '2019-04-14 13:15:43'),
(4034, 'مشاهدة فيلم The Gauntlet 1977 مترجم', 'مشاهدة فيلم The Gauntlet 1977 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر تدور احداث الفيلم عندما يتم تكليف شرطي عادي ولكنه صعب الطباع بمهمة مرافقة عاهرة من لاس فيجاس إلى فينيكس، لكي تستطيع الإدلاء بشهادتها في قضية بخصوص ممارسة البغاء، لكن المشكلة أن الكثير من الناس تراهنوا على ألا يدعوها تعيش وتبقى على قيد الحياة في المدينة، فما الذي سيحدث؟', 'the-gauntlet-1977', 'https://m.media-amazon.com/images/M/MV5BNGRiYWQ5YzYtNzM5MC00NjUwLWEyN2ItYmM5MzMzZGQ1ODVmXkEyXkFqcGdeQXVyNjc1NTYyMjg@._V1_SX300.jpg', 6.4, 'BluRay', 0, 1, 4038, '2019-04-14 13:14:24', '2019-04-14 13:15:41'),
(4036, 'مشاهدة فيلم Dunston Checks In 1996 مترجم', 'مشاهدة فيلم الكوميديا والمغامره Dunston Checks In 1996 مترجم بجودة WEB-DL مشاهدة مباشرة اون لاين. حارس على باب أحد الفنادق الفاخرة؛ التي تمتلكها السيدة (ديبرو).، تخبره أن هناك محققًا سيأتي متخفيا للفندق الفترة القادمة لتقييمه، وعليه أن يبدو في أفضل وضع، حتى يمكنه أن يحصل على ترقية، وليتمكن من أخد ابنيه (بريان) و(كايل) في إجازة. لكن يصل إلى الفندق (رتيدليدج) سارق المجوهرات، والشمابنزى المدرب الخاص به لتنقلب الأمور رأسا على عقب.', 'dunston-checks-in-1996', 'https://m.media-amazon.com/images/M/MV5BN2RhOTA4YzAtNTg3NC00NmYxLWI1YjQtYzM4NTJlYzVhZGYwXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 5.3, 'WEB-DL', 0, 1, 4040, '2019-04-14 13:14:33', '2019-04-14 13:15:40'),
(4037, 'فيلم Cube²: Hypercube 2002 مترجم اون لاين', 'مشاهدة وتحميل فيلم الخيال العلمي والاثارة Cube²: Hypercube 2002 مترجم بجودة BluRay كامل أون لاين.', 'cube-hypercube-2002', 'https://m.media-amazon.com/images/M/MV5BNWFmNDJhNTMtNmIzNy00MmI4LThlMDktOTdiM2ExMjI2MWE1XkEyXkFqcGdeQXVyNTIzOTk5ODM@._V1_SX300.jpg', 5.6, 'BluRay', 0, 1, 4041, '2019-04-14 13:14:40', '2019-04-14 13:15:39'),
(4038, 'مشاهدة فيلم Fear Island 2009 مترجم', 'مشاهدة وتحميل فيلم الرعب والغموض Fear Island 2009 مترجم بجودة WEB-DL كامل اون لاين. حادث انفجار فى جزيرة منعزلة وهناك خمسة اشخاص محاصرين فى وسط الجزيرة وغير قادر على الاتصال للحصول على مساعدة فانهم يصبحون فريسة لقاتل غامض يسعي للانتقام ولكن عليهم مواجهة الموت واحدا تلو الآخر', 'fear-island-2009', 'https://m.media-amazon.com/images/M/MV5BMTQyMjc1NjQ4Nl5BMl5BanBnXkFtZTcwOTQ4ODM4Mg@@._V1_SX300.jpg', 5.2, 'WEB-DL', 0, 1, 4042, '2019-04-14 13:14:44', '2019-04-14 13:15:38'),
(4039, 'مشاهدة فيلم Hoot 2006 مترجم', 'مشاهدة وتحميل فيلم المغامره والكوميديا Hoot 2006 مترجم بجودة DVDRip كامل اون لاين. روي فتى مراهقٌ يعاني من الوحدة بالرغم من وجوده وسط أهله، إلا أنه يجد صعوبةً في تكوين صداقات، يتعرف على أحد الشباب غريبي الأطوار الذي يجري بالغابة حافي القدمين ويسعى للتعرف عليه، في الوقت ذاته تحاول إحدى الفتيات نصحه بالابتعاد عنه؛ إلا أن حب الفضول يدفعه ليتعرف عليه ويكتشف بأنه شقيق تلك الفتاة وهارب من العسكرية ،وأنه يقضي معظم وقته بالغابة لحبه الشديد لنوعٍ معينٍ من طيور البوم مهدد بالانقراض ،فيتفق معه روي على أن يساعده في حماية ذلك الطائر.', 'hoot-2006', 'https://m.media-amazon.com/images/M/MV5BMTUwNzA3NTczNl5BMl5BanBnXkFtZTcwNzg2NDQzMQ@@._V1_SX300.jpg', 5.6, 'DVDRip', 0, 1, 4043, '2019-04-14 13:14:45', '2019-04-14 13:15:37'),
(4041, 'مشاهدة فيلم The Silent House 2010 مترجم', 'مشاهدة وتحميل فيلم المغامره والدراما The Silent House 2010 بجودة DVDRip مترجم كامل اون لاين مشاهدة مباشرة يوتيوب قصة الفيلم قصة حقيقية حدثت في أواخر الأربعينيات من القرن الماضي في قرية صغيرة بـ(أوروغواي)، تدور أحداث الفيلم في كوخ صغير، تضطر (لورا) ووالدها للإقامة فيه ليلة، لكن أحداثا مريبة تحدث تجعلها ليلة مروعة.', 'the-silent-house-2010', 'https://m.media-amazon.com/images/M/MV5BMTQ0NDQyNDMxMl5BMl5BanBnXkFtZTcwNjM2MDU5NA@@._V1_SX300.jpg', 5.4, 'DVDRip', 0, 1, 4045, '2019-04-14 13:14:54', '2019-04-14 13:15:35'),
(4042, 'مشاهدة فيلم No Retreat No Surrender 1986 مترجم', 'مشاهدة و تحميل فيلم الاكشن والكوميديا No Retreat No Surrender 1986 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة تدور الأحداث حول جايسون وبروس بعد تعرضهما للضرب مرات عديدة، يلجأ جايسون لاستخدام مهاراته المكتسبة حديثا لحفظ ولاية سياتل من الجريمة، ومواجته بفن الدفاع عن النفس.', 'no-retreat-no-surrender-1986', 'https://m.media-amazon.com/images/M/MV5BNjQxOWM0YjgtNGRlMC00ZGQzLWJkZTUtNjU4NjZhNDE0Njk4XkEyXkFqcGdeQXVyMjY3MjUzNDk@._V1_SX300.jpg', 5.7, 'BluRay', 0, 1, 4046, '2019-04-14 13:15:04', '2019-04-14 13:15:34'),
(4044, 'مشاهدة فيلم Sieranevada 2016 مترجم', 'مشاهدة و تحميل فيلم الكوميديا والدراما Sieranevada 2016 مترجم اون لاين جودة WEB-DL وتحميل مباشر مشاهدة اون لاين مباشرة بعد ثلاثة أيام من الاعتداء اﻹرهابي على مقرات مجلة تشارلي إيبدو بالعاصمة الفرنسية باريس، وبعد 40 يومًا من وفاة والده، يقضي الطبيب اﻷربعيني لاري ليلة السبت مع العائلة ﻹحياء ذكرى اﻷب الراحل، لكن هذا التجمع لا يسير وفق ما هو مخطط له، حيث يصير لاري مرغمًا على مواجهة ماضيه اﻷليم.', 'sieranevada-2016', 'https://m.media-amazon.com/images/M/MV5BMjk0ZGNiOWMtYmUzMi00ZWMzLWE5MjAtNWJkODBiYWJjYWY3XkEyXkFqcGdeQXVyNDkzNTM2ODg@._V1_SX300.jpg', 7.5, 'WEB-DL', 0, 1, 4048, '2019-04-14 13:15:16', '2019-04-14 13:15:33'),
