(4056, 'مشاهدة فيلم Food Choices 2016 مترجم', 'مشاهدة وتحميل فيلم الوثائقي Food Choices 2016 بجودة WEB-DL مترجم اون لاين وتحميل مباشر. وثائقي يستكشف التأثير الذي يتركه اختيار نوعية الطعام على صحة الناس وكوكبنا والمخلوقات الأخرى التي تشاركنا الحياة على الأرض، كما يلقي الضوء على المفاهيم الخاطئة المتعلقة بالطعام والحمية ويعرض وجهات نظر جديدة حول هذه الأمور.', 'food-choices-2016', 'https://m.media-amazon.com/images/M/MV5BYTIwZWMzYTctOWRmMi00ODUyLTgzYTAtZWIzZTZhM2VjYTJlXkEyXkFqcGdeQXVyNTU5NTMzNDY@._V1_SX300.jpg', 7.4, 'WEB-DL', 0, 1, 4060, '2019-04-14 13:19:23', '2019-04-14 13:24:05'),
(4057, 'مشاهدة فيلم Avengers Infinity War 2018 مترجم', 'مشاهدة وتحميل فيلم الاكشن والمغامره Avengers Infinity War 2018 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب يواصل المنتقمون وحلفاؤهم حماية العالم من تهديدات كبيرة جدًا على أن يتعامل أحدهم معها بمفرده. حيث يظهر (ثانوس)، طاغية جديد قادم من الظلال الكونية يبث الخوف في المجرات، وهدفه هو جمع الأحجار الستة اللانهائية ليبلغ قوة لا محدودة، مما يضع الجميع أمام معركة فاصلة يتوقف عليها مصير اﻷرض', 'avengers-infinity-war-2018', 'https://m.media-amazon.com/images/M/MV5BMjMxNjY2MDU1OV5BMl5BanBnXkFtZTgwNzY1MTUwNTM@._V1_SX300.jpg', 8.5, 'BluRay', 1, 1, 4061, '2019-04-14 13:19:33', '2019-04-14 15:32:49'),
(4058, 'مشاهدة فيلم Prescription for Danger 2017 مترجم', 'مشاهدة وتحميل فيلم الاثارة Prescription for Danger 2017 مترجم بجودة HDTV كامل اون لاين. ايفي فيشر في قمة مهارتها مالكة عمل ناجحة ومثيرة. انها النموذج المثالي لامراة في الثلاثين بحياة شخصية عادية ومهنة نشطة. لكن اثناء لقاء مهم مع مستثمر يبدا جسد ايفي في خذلانها. بدات بدوار وصداع شديد تنهار ايفي. يتدخل د. مارك ريان وهو طبيب فاسد مستعد لتغذية رغبته في السلطة وايفي هي هدفه المثالي. سيدة الاعمال القوية على وشك ان تواجه موتها. لكن تصدم ايفي حين تعرف ان د. ريان الشخص الذي تثق به لديه الوصفة الاخيرة لتدميرها.', 'prescription-for-danger-2017', 'uploads/5167037707.jpg', NULL, 'HDTV', 0, 1, 4062, '2019-04-14 13:19:41', '2019-04-14 13:23:58'),
