(4075, 'مشاهدة فيلم Human Flow 2017 مترجم', 'مشاهدة وتحميل فيلم الوثائقي Human Flow 2017 مترجم بجودة WEB-DL كامل اون لاين. تدور احداث الفيلم حول 65 مليون شخص حول العالم، أجبروا على ترك منازلهم للهروب من المجاعة أو تغير المناخ أو الحرب، حيث يتعرض لرحلة هؤلاء اللاجئين بكل جوانبها من عبور الحدود والتخييم وأوضاع المخيمات والمخاطر التي تصاحب رحلتهم ومنها الموت.', 'human-flow-2017', 'https://m.media-amazon.com/images/M/MV5BMTU4ODI2NjIzNF5BMl5BanBnXkFtZTgwNDQwMzUyMzI@._V1_SX300.jpg', 6.9, 'WEB-DL', 0, 1, 4079, '2019-04-14 13:22:19', '2019-04-14 13:23:25'),
(4078, 'مشاهدة فيلم House of Flying Daggers 2004 مترجم', 'مشاهدة وتحميل فيلم الاكشن والمغامره House of Flying Daggers 2004 مترجم بجودة BluRay كامل اون لاين. ضابط شرطة رومانسي برتبة نقيب يخرج عضوة جميلة في مجموعة متمردة من السجن لمساعدتها على الانضمام لزملاءها، ولكن الأمور ليست كما تبدو.', 'house-of-flying-daggers-2004', 'https://m.media-amazon.com/images/M/MV5BMWYzM2JmOWItN2IxZC00MmFjLWEyMTQtYTQ2ODBiNjRlYmZlXkEyXkFqcGdeQXVyNzI1NzMxNzM@._V1_SX300.jpg', 7.6, 'BluRay', 0, 1, 4082, '2019-04-14 13:22:31', '2019-04-14 13:23:22'),
(4082, 'مشاهدة فيلم Corpse Party Book of Shadows 2016 مترجم', 'مشاهدة و تحميل فيلم الرعب Corpse Party Book of Shadows 2016 مترجم اون لاين جودة BrRip وتحميل مباشر مشاهدة اون لاين مباشرة يعود طلاب كيساجيري إلى المستوى الأساسي في المضيف السماوية الابتدائية حيث تموت ذكرياتك إلى الأبد', 'corpse-party-book-of-shadows-2016', 'https://m.media-amazon.com/images/M/MV5BOWY5ZTM2NzItZjcwNS00MzRkLTg3ZDYtZGI1MjVkN2ZhMzg0XkEyXkFqcGdeQXVyNjEwNTM2Mzc@._V1_SX300.jpg', 5, '0', 0, 1, 4086, '2019-04-14 13:22:37', '2019-04-14 13:23:18'),
(4083, 'مشاهدة فيلم The Divine Weapon 2008 مترجم', 'مشاهدة وتحميل فيلم الدراما The Divine Weapon 2008 بجودة BluRay مترجم اون لاين وتحميل مباشر. تدور احداث قصه فيلم الاكشن و الدراما The Divine Weapon 2008 عن قصه ملحميه كوريه .', 'the-divine-weapon-2008', 'https://m.media-amazon.com/images/M/MV5BMTcyNjY3MzY3OV5BMl5BanBnXkFtZTgwOTQzNzE1MjE@._V1_SX300.jpg', 6.1, 'BluRay', 0, 1, 4087, '2019-04-14 13:22:42', '2019-04-14 13:23:17'),
(4086, 'مشاهدة فيلم Fox Trap 2016 مترجم', 'مشاهدة و تحميل فيلم الرعب Fox Trap 2016 مترجم اون لاين جودة DVDRip وتحميل مباشر مشاهدة اون لاين مباشرة تدور احداث قصه فيلم الرعب Fox Trap 2018 بعد مرور خمس سنوات من حادث مروّع يترك شابة صغيرة مُعاقة وعاجزة، تُدعَى المجموعة المسئولة عن الحادث إلى منزل مُلحق بمزرعة في الريف لجمع شملهم، ومع ضآلة معرفتهم بما يُخطَط لهم، يدركون أنهم مسُتهدفين من قبل ملثمين مهووسين عازمين على الانتقام منهم.', 'fox-trap-2016', 'https://m.media-amazon.com/images/M/MV5BMGJmYzJiMzAtOTliMS00MjZlLTg2YTUtMDdjZGFiOWMyMDgyXkEyXkFqcGdeQXVyNTMzMzM3MzI@._V1_SX300.jpg', 5.4, 'DVDRip', 0, 1, 4090, '2019-04-14 13:22:49', '2019-04-14 13:23:15'),
(4088, 'مشاهدة فيلم Oddball 2015 مترجم', 'مشاهدة وتحميل فيلم المغامره والعائلي Oddball 2015 بجودة BluRay مترجم اون لاين وتحميل مباشر. تدور أحداث القصة الحقيقية حول قيام مزارع الدجاج (شاين جاكبسون) بالتعاون مع أكبر أحفاده بتدريب كلب غريب الأطوار بهدف حماية البطاريق البرية من هجمات الثعالب المتعاقبة عليهم وحماية أراضيهم على ساحل البحر ولم شمل أسرتهم.', 'oddball-2015', 'https://images-na.ssl-images-amazon.com/images/M/MV5BYzhlM2FiZmMtMGZjNC00MzVkLWJlZGQtMTJlYWFhODY3ZmM0XkEyXkFqcGdeQXVyNTA1NDY3NzY@._V1_SX300.jpg', 6.7, 'BluRay', 0, 1, 4092, '2019-04-14 13:23:02', '2019-04-14 13:23:14'),
(4089, 'مشاهدة فيلم 2015 مترجم', 'مشاهدة وتحميل فيلم الدراما والتاريخي 2015 بجودة BluRay مترجم اون لاين وتحميل مباشر. تدور أحداث الفيلم حول وقائع الحرب العالمية الثانية عام 1944 على الأراضي الاستونية، من التلال الزرقاء وحتى شبه الجزيرة، حيث يستعرض لنا تلك الوقائع من خلال أعين الجنود الاستونيين، والذين اضطروا لاختيار أحد جانبي القتال ومحاربة أبناء قومهم.. القرارات والاختيارات لابد وأن تُتَخذ، ليس مِن قِبل الجنود فقط، ولكن من قِبل أحبائهم أيضًا.', '2015', 'uploads/31461787372.jpg', NULL, 'BluRay', 0, 1, 4093, '2019-04-14 13:23:13', '2019-04-14 13:23:13'),
(4094, 'فيلم Ouija: The Awakening 2017 مترجم اون لاين', 'مشاهدة وتحميل فيلم الاثارة Ouija: The Awakening 2017 مترجم بجودة HDRip كامل أون لاين.', 'ouija-the-awakening-2017', 'uploads/9916261555.jpg', 0, 'HDRip', 0, 1, 4098, '2019-04-14 13:24:36', '2019-04-14 13:32:28'),
(4096, 'فيلم Stuart: A Life Backwards 2007 مترجم اون لاين', 'مشاهدة و تحميل فيلم الدراما Stuart: A Life Backwards 2007 مترجم اون لاين جودة HD وتحميل مباشر مشاهدة اون لاين…', 'stuart-a-life-backwards-2007', 'https://m.media-amazon.com/images/M/MV5BM2UwNDBlOTEtODExZC00YzA2LWIyYWUtMzY3NDUzMGMyNTAwXkEyXkFqcGdeQXVyNDM5OTY5MzI@._V1_SX300.jpg', 7.9, 'HD', 0, 1, 4100, '2019-04-14 13:25:15', '2019-04-14 13:32:27'),
(4103, 'فيلم Team America: World Police 2004 مترجم اون لاين', 'مشاهدة وتحميل فيلم الاكشن والكوميديا Team America: World Police 2004 بجودة BluRay مترجم اون لاين وتحميل مباشر.', 'team-america-world-police-2004', 'https://m.media-amazon.com/images/M/MV5BMTM2Nzc4NjYxMV5BMl5BanBnXkFtZTcwNTM1MTcyMQ@@._V1_SX300.jpg', 7.2, 'BluRay', 0, 1, 4107, '2019-04-14 13:27:11', '2019-04-14 13:32:22'),
(4104, 'مشاهدة فيلم All Roads Lead To Rome 2015 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والرومانسية All Roads Lead To Rome 2015 مترجم بجودة BluRay كامل اون لاين. تدور أحداث الفيلم حول الأم (ماجي) وابنتها المراهقة (سمر)، حيث تعاني ماجي العديد من المتاعب معها في تلك المرحلة الهامة من حياتها، تقرر الأم العودة إلى قرية (توسكان) التي نشأت فيها، فتقابل المزارع الأعزب (لوكا) والذي لا يزال يعيش مع والدته (كارمن)، والتي تأخذ قرارها بالسفر إلى مدينة روما الإيطالية لملاقاة حبيبها، فتسرق سيارة لوكا وترحل بها إلى هناك.', 'all-roads-lead-to-rome-2015', 'https://m.media-amazon.com/images/M/MV5BMTYwODU2MjkzNl5BMl5BanBnXkFtZTgwNDQyMTY2NzE@._V1_SX300.jpg', 4.9, 'BluRay', 0, 1, 4108, '2019-04-14 13:27:18', '2019-04-14 13:32:22'),
(4105, 'فيلم The Dead 2: India 2013 مترجم اون لاين', 'مشاهدة وتحميل فيلم الرعب The Dead 2: India 2013 بجودة BluRay مترجم اون لاين وتحميل مباشر.', 'the-dead-2-india-2013', 'uploads/19634393731.jpg', NULL, 'BluRay', 0, 1, 4109, '2019-04-14 13:27:21', '2019-04-14 13:32:21'),
(4106, 'مشاهدة فيلم I Believe in Miracles 2015 مترجم', 'مشاهدة وتحميل فيلم الوثائقي والتاريخي I Believe in Miracles 2015 مترجم بجودة BluRay كامل اون لاين. تدور أحداث الفيلم حول فريق نوتينغهام فورست الذي صنع تاريخ من قبل الزئبقي برايان كلوف ومساعدهُ بيتر تايلور .', 'i-believe-in-miracles-2015', 'https://m.media-amazon.com/images/M/MV5BNzEwODk5OTkyOV5BMl5BanBnXkFtZTgwOTU4NzcyNzE@._V1_SX300.jpg', 7.8, 'BluRay', 0, 1, 4110, '2019-04-14 13:27:21', '2019-04-14 13:32:20'),
(4107, 'مشاهدة فيلم Love The Coopers 2015 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والفانتازيا Love The Coopers 2015 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب تدور أحداث القصة عندما تجتمع أربعة أجيال مختلفة من عائلة (آل كوبر) في عشية عيد الكريسماس السنوي، حيث تقع مجموعة من الأحداث وتحضر بعض الشخصيات الغير متوقعة، مما يقلب الليلة رأسًا على عقب، مؤدية بهم إلى إعادة تقييم الروابط العائلية بينهم ومعرفة قيمة الإجازة والعائلة والتواجد المستمر مع بعضهم البعض.', 'love-the-coopers-2015', 'https://m.media-amazon.com/images/M/MV5BMjE4NTkyODk4NF5BMl5BanBnXkFtZTgwNjY0NzkxNzE@._V1_SX300.jpg', 5.8, 'BluRay', 0, 1, 4111, '2019-04-14 13:27:29', '2019-04-14 13:32:19');
INSERT INTO `movies` (`id`, `name`, `description`, `slug`, `image_url`, `ratings`, `quality`, `views`, `category_id`, `server_links`, `created_at`, `updated_at`) VALUES
(4108, 'مشاهدة فيلم One Million Klicks 2015 مترجم', 'مشاهدة وتحميل فيلم الاكشن One Million Klicks 2015 مترجم بجودة BluRay كامل أون لاين. تدور احداث قصة فيلم فى اطار من الاكشن حول مقاتل بقلب من الذهب لدية الخبرة فى القتال على الحلبة بالرغم من ذلك يجد نفسه في بطولة فنون الدفاع عن النفس تحت الأرض يتدفقون على شبكة إنترنت وتتوالى الاحداث. مشاهدة وتحميل الفيلم من خلال موقع (سينما فور اب).', 'one-million-klicks-2015', 'uploads/3471976925.jpg', NULL, 'BluRay', 0, 1, 4112, '2019-04-14 13:27:38', '2019-04-14 13:32:18'),
(4110, 'مشاهدة فيلم Palm Trees in the Snow 2015 مترجم', 'مشاهدة فيلم الدراما والرومانسية Palm Trees in the Snow 2015 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. تدور احداث فيلم حول (كيليان) هو شاب لم يغادر الجبال من هويسكا التى شهدت نشاتة يكبر حتى عام 1953 ، حيث انه قرر ان يسافر إلى جزيرة غريبة من فرناندو بو للعمل في حقل الكاكاو جنبا إلى جنب مع والده وشقيقه. خلال 20 عاماً في هذه الجزيرة ستقوم برحلة نحو النضج والمعرفة، بل سيكون أيضا للتعامل مع الألم والخسارة.', 'palm-trees-in-the-snow-2015', 'https://m.media-amazon.com/images/M/MV5BODAyYmY5NTQtZTE4YS00YzMzLWFiZmQtNWYwYjUxMTU4Yzg1XkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg', 7.4, 'BluRay', 0, 1, 4114, '2019-04-14 13:27:50', '2019-04-14 13:32:17'),
(4111, 'مشاهدة فيلم Lusers 2015 مترجم', 'مشاهدة وتحميل فيلم المغامره والكوميديا Lusers 2015 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب عندما يتوه ثلاثة رجال في غابة “الأمازون” في طريقهم إلى نهائي كأس العالم، يتحتّم عليهم العثور على سبيل للخروج منها سيرًا على الأقدام.', 'lusers-2015', 'https://images-na.ssl-images-amazon.com/images/M/MV5BZGE4YzNlYzUtMWI4MC00NDg3LWI3ZTktY2UyZGRiNzE3ZTY0XkEyXkFqcGdeQXVyMTcxNTYyMjM@._V1_SX300.jpg', 4.9, 'BluRay', 0, 1, 4115, '2019-04-14 13:28:00', '2019-04-14 13:32:16'),
(4112, 'مشاهدة فيلم Hello I Must Be Going 2012 مترجم', 'مشاهدة فيلم Hello I Must Be Going 2012 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر مطلقة شابة تضطرها الظروف إلى اﻹنتقال للإقامة مع والديها في ضواحي كونيتيكت، وهناك تقيم علاقة حب مع شاب يجدد حبها للحياة ويساعدها على اﻹستقلال والشعور بالاطمئنان بعد ما فاتها لسنوات.', 'hello-i-must-be-going-2012', 'https://m.media-amazon.com/images/M/MV5BMzkzMDc0Nzg5OF5BMl5BanBnXkFtZTcwMDU0MzAyOA@@._V1_SX300.jpg', 6.2, 'BluRay', 0, 1, 4116, '2019-04-14 13:28:09', '2019-04-14 13:32:15'),
(4114, 'مشاهدة فيلم Disturbing the Peace 2016 مترجم', 'مشاهدة وتحميل فيلم الوثائقي Disturbing the Peace 2016 مترجم بجودة BluRay كامل أون لاين. يُرافق هذا الوثائقي مجموعة من الجنود الفلسطينيين والإسرائيليين السابقين الذين ضاقوا ذرعًا بالحرب وشكلوا مجموعة تدافع عن السلام دون عنف.', 'disturbing-the-peace-2016', 'https://m.media-amazon.com/images/M/MV5BMjM4MjY4NzM1Nl5BMl5BanBnXkFtZTgwMzU1NTc5OTE@._V1_SX300.jpg', 7.6, 'BluRay', 0, 1, 4118, '2019-04-14 13:28:19', '2019-04-14 13:32:14'),
(4116, 'مشاهدة فيلم Age of Ice 2014 مترجم', 'مشاهدة فيلم الاكشن والمغامره Age of Ice 2014 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. تدور قصة الفيلم حول وقوع زلازل هائلة، مما يتسبب في فتح الطبقات التكتونية في المنطقة العربية، وهو ما جعل الجو يتغير ودرجات الحرارة تنخفض، وهو ما يبشر ببداية عصر جليدي جديد، وفي هذه الأثناء تكون عائلة جونز في مصر، حيث يقضون عطلتهم، وحينها يتوجب عليهم الكفاح من أجل مواجهة هذا البرد الشديد.', 'age-of-ice-2014', 'https://m.media-amazon.com/images/M/MV5BMzYyODQ3NzAxMV5BMl5BanBnXkFtZTgwNDQ1MDUxMzE@._V1_SX300.jpg', 1.9, 'BluRay', 0, 1, 4120, '2019-04-14 13:28:29', '2019-04-14 13:32:12'),
(4118, 'مشاهدة فيلم Ben 1972 مترجم', 'مشاهدة وتحميل فيلم الرعب والاثارة Ben 1972 مترجم بجودة BluRay كامل اون لاين. فتى وحيد يصادق بن ، زعيم مجموعة عنيفة من الجرذان القاتلة.', 'ben-1972', 'https://m.media-amazon.com/images/M/MV5BYzBmMTMxNzUtMzNhMi00NDE2LWFjNjQtOTUyOGQ5MjcyMjU3XkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 5.3, 'BluRay', 0, 1, 4122, '2019-04-14 13:28:39', '2019-04-14 13:32:10'),
(4120, 'مشاهدة فيلم The Sea Inside 2004 مترجم', 'مشاهدة وتحميل فيلم السيرة الذاتية والدراما The Sea Inside 2004 مترجم بجودة BluRay كامل أون لاين. يروي الفيلم قصة حياة الإسباني (رامون سامبيدرو)، الذي خاض حملة لمدة 30 عامًا للفوز بالحق في إنهاء حياته بكرامة، ويستكشف الفيلم علاقات رامون مع امرأتين؛ (جوليا) وهى محامية تدعم قضيته، و(روزا) وهي امرأة محلية تريد إقناعه بأن الحياة تستحق أن تُعاش. تستلهم من حبه السيدتان إنجاز الأشياء التي كانتا لا تعتقدان في السابق أنها يمكن تحقيقها. على الرغم من رغبته في الموت، يعلّم رامون الجميع معنى وقيمة الحياة.', 'the-sea-inside-2004', 'https://m.media-amazon.com/images/M/MV5BMjE0NDk2NjgwMV5BMl5BanBnXkFtZTYwMTgyMzA3._V1_SX300.jpg', 8, 'BluRay', 0, 1, 4124, '2019-04-14 13:28:48', '2019-04-14 13:32:09'),
(4122, 'مشاهدة فيلم Un lac 2008 مترجم', 'مشاهدة وتحميل فيلم الدراما Un lac 2008 بجودة BluRay مترجم اون لاين وتحميل مباشر. تدور أحداث القصة في بلد لا نعرف عنه شيئاً: بلد من الثلوج وغابات كثيفة في مكان ما في الشمال. تعيش عائلة في منزل منعزل بالقرب من بحيرة. أليكسي ، الأخ ، شاب ذو قلب نقي. حطاب. فرحة النشوة ، نوبات الصرع ، هو مفتوح بالكامل على الطبيعة التي تحيط به. اليكسي قريب بشكل رهيب من شقيقته الصغرى ، هيج. أمهما العمياء ، والدهما وشقيقهما الصغير هما الشاهدان الصامتان لحبهما الساحق. غريب يصل ، شاب يكاد لا يكبره أن اليكسي …', 'un-lac-2008', 'https://m.media-amazon.com/images/M/MV5BM2M5ZjQ5NTEtOGI5Ni00MTk0LTgwYjItMzNiNDdkMDUwZjRhXkEyXkFqcGdeQXVyNTQxNDA2ODk@._V1_SX300.jpg', 6.6, 'BluRay', 0, 1, 4126, '2019-04-14 13:28:57', '2019-04-14 13:32:08'),
(4123, 'مشاهدة فيلم Lazer Team 2015 مترجم', 'مشاهدة وتحميل فيلم الاكشن والكوميديا Lazer Team 2015 مترجم بجودة BluRay كامل اون لاين. تدور أحداث القصة حول اعتقاد البشر بعدم وجود حياة في العالم سوى تلك المعتادة على كوكب الأرض، لكن على خلاف المتوقع تصل رسالة مُشفرّة من كائنات فضائية تحاول القيام بدورها المعهود في حماية الأرض والبشر منذ سنوات عديدة، ولكن الكائنات الفضائية ونظرًا لمصاعب التواصل، تحاول تجنيد بطلًا من البشر ليقوم بإرتداء بدلة فضائية واستخدامها لحماية الكوكب حتى تصل السفينة الفضائية وتنفذ بدورها.', 'lazer-team-2015', 'https://m.media-amazon.com/images/M/MV5BODU0MDM0ODMyN15BMl5BanBnXkFtZTgwMzk1MTk3NzE@._V1_SX300.jpg', 5.6, 'BluRay', 0, 1, 4127, '2019-04-14 13:28:58', '2019-04-14 13:32:07'),
(4124, 'مشاهدة فيلم Journey to Space 2015 مترجم', 'مشاهدة وتحميل فيلم الوثائقي والمغامره Journey to Space 2015 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب الكشف عن عهد جديد من اسكشاف الفضاء الواسع لم يسبق له مثيل على شكل شاشة فيلم عملاقة مثيرة..', 'journey-to-space-2015', 'https://m.media-amazon.com/images/M/MV5BZmQ2ZTliMGYtNjY2OS00YzIwLWJlMTctOGU0NGNmNzFhNGZlXkEyXkFqcGdeQXVyMTQxMzU0Nzk@._V1_SX300.jpg', 6.5, 'BluRay', 0, 1, 4128, '2019-04-14 13:29:00', '2019-04-14 13:32:07'),
(4125, 'فيلم Leprechaun: Origins 2014 مترجم اون لاين', 'مشاهدة وتحميل فيلم الفانتازيا والرعب Leprechaun: Origins 2014 بجودة BluRay مترجم اون لاين وتحميل مباشر.', 'leprechaun-origins-2014', 'https://m.media-amazon.com/images/M/MV5BMTQ0MTQ0OTY3NV5BMl5BanBnXkFtZTgwNjMxODc3MTE@._V1_SX300.jpg', 3.3, 'BluRay', 0, 1, 4129, '2019-04-14 13:29:04', '2019-04-14 13:32:07'),
(4126, 'مشاهدة فيلم Jack of the Red Hearts 2015 مترجم', 'مشاهدة وتحميل فيلم الدراما والعائلي Jack of the Red Hearts 2015 مترجم بجودة BluRay كامل أون لاين. تدور أحداث القصة حول (جاكلين) التي تكره أن يدعوها أحد بهذا الاسم وتفضل اسم (جاك)، تحاول جاك كسر القانون وربح المال بهدف إنقاذ أختها الصغيرة (كوك)، وتعاني جاك من صعوبة في التواصل مع ابنتها الصغيرة.', 'jack-of-the-red-hearts-2015', 'https://m.media-amazon.com/images/M/MV5BNzI5NjA0MjctNjJmMS00MzFlLTlmOTMtZjkwMGM2MTNkOTllXkEyXkFqcGdeQXVyNDQwMTQ5ODk@._V1_SX300.jpg', 7.2, 'BluRay', 0, 1, 4130, '2019-04-14 13:29:12', '2019-04-14 13:32:06'),
(4128, 'مشاهدة فيلم Ixcanul 2015 مترجم', 'مشاهدة فيلم الدراما Ixcanul 2015 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. تدور أحداث الفيلم حول (ماريا)، الفتاة البالغة من العمر 17 عامًا تشيكية الأصل، والتي تعيش مع والديها في مزرعة البن عند سفح بركان نشط في جواتيمالا، وهي على وشك الزواج من رئيس العمال في المزرعة، لكن (ماريا) تتوق لاكتشاف العالم على الجانب الآخر من الجبل، وهو المكان الذي لا تستطيع حتى أن تتخيله، لذلك تقوم بإغواء حاصد البن الذي يريد الهرب إلى (الولايات المتحدة الأمريكية)، ولكن عندما يتركها وراءه، تكتشف (ماريا) عالمًا جديدًا.', 'ixcanul-2015', 'https://m.media-amazon.com/images/M/MV5BMTUyMjUwMDk2NV5BMl5BanBnXkFtZTgwMzU4NTUzOTE@._V1_SX300.jpg', 7.2, 'BluRay', 0, 1, 4132, '2019-04-14 13:29:24', '2019-04-14 13:32:02'),
(4129, 'فيلم Love, Wedding, Marriage 2011 مترجم اون لاين', 'مشاهدة وتحميل فيلم الكوميديا Love, Wedding, Marriage 2011 مترجم بجودة BluRay كامل أون لاين.', 'love-wedding-marriage-2011', 'https://m.media-amazon.com/images/M/MV5BMTYxOTUxMTkyNl5BMl5BanBnXkFtZTcwMTU2ODAyNQ@@._V1_SX300.jpg', 5, 'BluRay', 0, 1, 4133, '2019-04-14 13:29:27', '2019-04-14 13:32:01'),
(4130, 'مشاهدة فيلم A Haunting In Cawdor 2015 مترجم', 'مشاهدة وتحميل فيلم الرعب والاثارة A Haunting In Cawdor 2015 مترجم بجودة BluRay كامل أون لاين. تدور احداث فيلم A Haunting in Cawdor 2015 في هذه الرواية المتوترة من الإرهاب النفسي، فيفيان ميلر (شيلبي الشباب) هو فى العشرينات شباب و امرأة الذي يقضي عقوبة السجن لها في برنامج العمل الصحفي في الغرب الأوسط.', 'a-haunting-in-cawdor-2015', 'https://m.media-amazon.com/images/M/MV5BMjA0MTY1NDA3NF5BMl5BanBnXkFtZTgwODc3NjI2OTE@._V1_SX300.jpg', 3.3, 'BluRay', 0, 1, 4134, '2019-04-14 13:29:33', '2019-04-14 13:32:00'),
(4132, 'مشاهدة فيلم A Novel Romance 2015 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والعائلي A Novel Romance 2015 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب يحكي هذا الفيلم عن الروائي العاطفي “ليام برادلي”، الذي يقوم بدوره “ديلان بروس”، حيث حاز على نجاح ساحق من خلال الكتب الثلاثة التي كتبها تحت الاسم المستعار “غابرييل أوغست”، ولكن بشكل غامض فإن الأعداد الغفيرة التي تقرأ كتبه لا تعرفه، ومن خلال أول كتاب يقوم بتأليفه كوسيلة للتعافي من علاقة فاشلة…', 'a-novel-romance-2015', 'https://m.media-amazon.com/images/M/MV5BMTYwMTk4NzQ2OV5BMl5BanBnXkFtZTgwNTY0ODM0NDE@._V1_SX300.jpg', 6.5, 'BluRay', 0, 1, 4136, '2019-04-14 13:29:41', '2019-04-14 13:31:59'),
(4133, 'فيلم Sinbad: The Fifth Voyage 2014 مترجم اون لاين', 'مشاهدة وتحميل فيلم الاكشن والمغامره Sinbad: The Fifth Voyage 2014 مترجم بجودة BluRay كامل اون لاين.', 'sinbad-the-fifth-voyage-2014', 'https://m.media-amazon.com/images/M/MV5BMTk2MTc5ODM0Nl5BMl5BanBnXkFtZTgwMDkwMTA5MjE@._V1_SX300.jpg', 5.4, 'BluRay', 0, 1, 4137, '2019-04-14 13:29:49', '2019-04-14 13:31:58'),
(4134, 'مشاهدة فيلم Already Tomorrow In Hong Kong 2015 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والرومانسية Already Tomorrow In Hong Kong 2015 بجودة BluRay مترجم اون لاين وتحميل مباشر. تدور أحداث الفيلم حول روبي، الفتاة ذات الأصول الأمريكية الصينية التي تزور هونج كونج لأول مرة، حيث تقع في حب المغترب الأمريكي جوش الذي يرشدها على الطريق في هونج كونج، ولكن التوقيت لم يكن في صالحهما، وفي وسط السير والكلام الرومانسي بينهما في هذه المدينة الجميلة، يحاول الفيلم الإجابة على سؤال: ماذا لو التقيت بالإنسان المناسب في الوقت الخطأ؟', 'already-tomorrow-in-hong-kong-2015', 'https://m.media-amazon.com/images/M/MV5BNTA5OTUzNDQ2M15BMl5BanBnXkFtZTgwNzM2NzYxNzE@._V1_SX300.jpg', 6.5, 'BluRay', 0, 1, 4138, '2019-04-14 13:29:53', '2019-04-14 13:31:57'),
(4136, 'مشاهدة فيلم Anesthesia 2015 مترجم', 'مشاهدة وتحميل فيلم الجريمة والدراما Anesthesia 2015 مترجم بجودة BluRay كامل اون لاين. تدور أحداث القصة حول عملية السطو المسلح التي تعرض لها الأستاذ (والتر زارو) من قبل أحد المجرمين، يقوم والتر بالاتصال بصديقه (سام) ليوقظه من نومه بعد ليلة رومانسية في المدينة، يصل سام بعد محاولات عديدة من صديقه للرد عليه، ويسقط والتر بين يدي سام نتيجة إصابته خلال السطو المسلح، في نظرة واسعة للحياة في مدينة نيويورك من محاولات بعض الشباب فقدان عذريتهم ومحاولة سيدة مدمنة على الكحول للتوقف وغيرها من مظاهر الحياة المعتادة في تلك المدينة.', 'anesthesia-2015', 'https://m.media-amazon.com/images/M/MV5BNDUyMjgxNzQ4NV5BMl5BanBnXkFtZTgwNzkzMDA1NzE@._V1_SX300.jpg', 6.1, 'BluRay', 0, 1, 4140, '2019-04-14 13:30:00', '2019-04-14 13:31:52'),
(4138, 'مشاهدة فيلم Backgammon 2015 مترجم', 'مشاهدة وتحميل فيلم الدراما والغموض Backgammon 2015 مترجم بجودة BluRay كامل اون لاين. تدور أحداث القصة حول زيارة (لوسيان) وحبيبته (إليزابيث) لمنزل (أندرو) المنعزل بعيدًا لقضاء العطلة الأسبوعية معه، يجدان أن (ميراندا) شقيقة أندرو وحبيبها (جيرالد) قد سبقاهما بالفعل إلى المنزل، تتسبب ميراندا مع جيرالد في ضيق كل من حولهم بهما، وبعد خسارة جيرالد في لعب البوكر أمام لوسيان على كافة رهاناته حتى على ميراندا، وفي صباح اليوم التالي، يكتشف لوسيان مغادرة كل من إليزابيث وأندرو معًا من المنزل تاركين ميراندا معه، يقرر لوسيان استكمال عطلته في المنزل مع ميراندا.', 'backgammon-2015', 'https://m.media-amazon.com/images/M/MV5BMTgzNDg4NjE4Ml5BMl5BanBnXkFtZTgwMjU5Mjk3NzE@._V1_SX300.jpg', 3.4, 'BluRay', 0, 1, 4142, '2019-04-14 13:30:09', '2019-04-14 13:31:51'),
(4140, 'مشاهدة فيلم Band of Robbers 2015 مترجم', 'مشاهدة وتحميل فيلم المغامره والكوميديا Band of Robbers 2015 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب يقوم الفيلم بتخيل التطور الذي سارت إليه أحداث روايتي مغامرات توم سوير ومغامرات هاكلبيري فين للكاتب الأمريكي مارك توين بعد ان صار أبطال الروايتان رجال ناضجين في عصرنا الحالي، حيث يقرر هاكلبيري أن يترك حياة الجريمة بعد خروجه من السجنن لكن توم سوير الشرطي الفاسد يقرر أن يشكل تنظيم عصابي ويشرك فيه مجموعة من أصدقائه.', 'band-of-robbers-2015', 'https://m.media-amazon.com/images/M/MV5BMTczNTE3ODc0NF5BMl5BanBnXkFtZTgwODU1MDQyNzE@._V1_SX300.jpg', 6, 'BluRay', 0, 1, 4144, '2019-04-14 13:30:26', '2019-04-14 13:31:49'),
(4141, 'مشاهدة فيلم Belle Sebastian: The Adventure Continues 2015 مترجم', 'مشاهدة وتحميل فيلم المغامره والعائلي Belle Sebastian: The Adventure Continues 2015 بجودة BluRay مترجم اون لاين وتحميل مباشر. مغامرة ثانية قائمة على سيناريو حافل بمشاهد مؤثرة انسانية وساحرة مشهدياً، إن من جهة الطبيعة الخلابة التي تشبه بطاقة بريدية، أو من جهة الاكشن الذي جسّد لقطات استعراضية مبهرة مثل الحريق في الغابة ومشهد تحطّم الطائرة.', 'belle-sebastian-the-adventure-continues-2015', 'https://m.media-amazon.com/images/M/MV5BMTg1YjVlMDAtOGYwMS00NTEwLTg0MjMtNjhmZTRlYzYyMDUzXkEyXkFqcGdeQXVyNDQ2OTk4MzI@._V1_SX300.jpg', 6.5, 'BluRay', 0, 1, 4145, '2019-04-14 13:30:40', '2019-04-14 13:31:48'),
(4143, 'مشاهدة فيلم Black 2015 مترجم', 'مشاهدة فيلم Black 2015 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر منذ خمسة عشر عاما وهو عضو فى عصابة سيئة السمعة وتقع راسا على عقب فى الحب مع مروان الكاريزمية وهو طفل فى عصابة منافسة واجبرت اثنين من الشباب بوحشية على الاختيار بين الولاء للعصابة او الحب لبعضهم البعض', 'black-2015', 'https://m.media-amazon.com/images/M/MV5BNTI5MmE5M2UtZjIzYS00M2JjLWIwNDItYTY2ZWNiODBmYTBiXkEyXkFqcGdeQXVyNjQ2MjQ5NzM@._V1_SX300.jpg', 8.2, 'BluRay', 0, 1, 4147, '2019-04-14 13:30:52', '2019-04-14 13:31:46'),
(4145, 'مشاهدة فيلم Bulanti 2015 مترجم', 'مشاهدة وتحميل فيلم الدراما Bulanti 2015 مترجم بجودة BluRay كامل اون لاين. عند فقدان زوجته وابنه، يجب على أحمد أن يكافح مع الشعور بالوحدة.', 'bulanti-2015', 'https://m.media-amazon.com/images/M/MV5BZDg0NjQwNzctNWE4OC00NjAxLTkwNzMtNzdjNDFlZTRhM2Q3XkEyXkFqcGdeQXVyMTYzMDkwNjg@._V1_SX300.jpg', 6.3, 'BluRay', 0, 1, 4149, '2019-04-14 13:31:01', '2019-04-14 13:31:44'),
(4148, 'مشاهدة فيلم Cash Only 2015 مترجم', 'مشاهدة فيلم Cash Only 2015 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر تدور أحداث الفيلم حول مالك أراضي مهجورة يحاول بيأس أن يرد الأموال المنهوبة إلى مريض نفسي ومختل اجتماعيًا قام باختطاف ابنته.', 'cash-only-2015', 'https://m.media-amazon.com/images/M/MV5BMTcxMjcyMjE5N15BMl5BanBnXkFtZTgwNzA5OTY4ODE@._V1_SX300.jpg', 6.1, 'BluRay', 0, 1, 4152, '2019-04-14 13:31:16', '2019-04-14 13:31:42'),
(4149, 'مشاهدة فيلم Cemetery of Splendor 2015 مترجم', 'مشاهدة فيلم Cemetery of Splendor 2015 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر يحكي الفيلم قصة ربة منزل وحيدة في منتصف العمر، تميل إلى جندي مصاب باضطراب في النوم، وهو واحد من الجنود المصابين بنفس الاضطرابات، والذين تم إرسالهم إلى إحدى العيادات المتخصصة التي كانت في السابق مدرسة تقع فوق مقبرة ملكية قديمة ونادرة، وتقع معه في سلسلة من الهلاوس التي تستهدف الكثير من الأحلام الغريبة والأشباح والرومانسية، تخبرهم وسيطة روحية بوجود لعنة من تلك المقبرة للجنود تزيد من حالتهم المرضية.', 'cemetery-of-splendor-2015', 'https://m.media-amazon.com/images/M/MV5BMjE4NzUzNDIzNV5BMl5BanBnXkFtZTgwMjIyMjg3NzE@._V1_SX300.jpg', 6.8, 'BluRay', 0, 1, 4153, '2019-04-14 13:31:25', '2019-04-14 13:31:41'),
(4150, 'مشاهدة فيلم Chronic 2015 مترجم', 'مشاهدة فيلم Chronic 2015 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر يعمل (دافيد) ممرضًا متخصصًا مع الحالات المستعصية، وهو ممرض كفء، يكرس غالبية وقته لعمله بكل همة، ويقوم بتكوين علاقات قوية ومتينة مع مرضاه الذين يعمل معهم، ولكن بعيدًا عن عمله، لا يجيد (دافيد) إنجاز أي شيء على اﻹطلاق، فيصير من الجلي أن (دافيد) في حاجة ماسة لكل مريض يعمل معه لكي يؤكد ذاته أكثر فأكثر.', 'chronic-2015', 'https://m.media-amazon.com/images/M/MV5BMTY3NjcxNTgzNV5BMl5BanBnXkFtZTgwMjE3NTkyMDI@._V1_SX300.jpg', 6.6, 'BluRay', 0, 1, 4154, '2019-04-14 13:31:29', '2019-04-14 13:31:40'),
(4153, 'مشاهدة فيلم Closet Monster 2015 مترجم', 'مشاهدة وتحميل فيلم الدراما والفانتازيا Closet Monster 2015 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب تدور أحداث الفيلم حول مُراهق مُبدع غير يائس، والذي يخوض رحلة عصيبة عندما يُدفَع للهرب من مدينته ومسقط رأسه ومن الذكريات المؤرِّقة في طفولته المضطربة.', 'closet-monster-2015', 'https://m.media-amazon.com/images/M/MV5BMTg5MTM3ODMxOF5BMl5BanBnXkFtZTgwNzg3NzAyOTE@._V1_SX300.jpg', 7, 'BluRay', 0, 1, 4157, '2019-04-14 13:31:38', '2019-04-14 13:32:05'),
(4154, 'مشاهدة فيلم The People vs. Fritz Bauer 2015 مترجم', 'مشاهدة فيلم The People vs. Fritz Bauer 2015 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر تدور |أحداث الفيلم عن قصة الرجل الذي قدم المجرم النازي رفيع الشأن (أدولف ألشمان) إلى العدالة.', 'the-people-vs-fritz-bauer-2015', 'https://m.media-amazon.com/images/M/MV5BNjFjOGRjYjgtNGJjYi00Njg2LTlkMTItYjg4NWQ5OTRmYTczL2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyNDkzNTM2ODg@._V1_SX300.jpg', 7.1, 'BluRay', 0, 1, 4158, '2019-04-14 13:31:51', '2019-04-14 13:32:05'),
(4155, 'مشاهدة فيلم Do You Believe 2015 مترجم', 'مشاهدة وتحميل فيلم الدراما Do You Believe 2015 بجودة BluRay مترجم اون لاين وتحميل مباشر. يصدق عندما تهتز قس بالإيمان مرئية واعظ شارع الزاوية، وقال انه يتذكر أن الإيمان الحقيقي يتطلب دائما العمل. رده تشتعل رحلة آثار الجميع أنها تمس بطرق الله فقط يمكن أن تنسق.', 'do-you-believe-2015', 'uploads/3037078532.jpg', 0, 'BluRay', 0, 1, 4159, '2019-04-14 13:31:53', '2019-04-14 13:32:04'),
(4156, 'مشاهدة فيلم Five Nights In Maine 2015 مترجم', 'مشاهدة فيلم الدراما Five Nights In Maine 2015 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. تدور أحداث الفيلم عن شاب إفريقي أمريكي يعاني من خسارة زوجته المأساوية؛ فيسافر إلى ولاية (ماين) الريفية بحثًا عن إجابات من حماته، والتي تُثقل نفسها بالذنب والحزن لوفاة ابنتها.', 'five-nights-in-maine-2015', 'https://m.media-amazon.com/images/M/MV5BMjQ1NTAyMDc2MF5BMl5BanBnXkFtZTgwMjExNTYzOTE@._V1_SX300.jpg', 4.5, 'BluRay', 0, 1, 4160, '2019-04-14 13:32:02', '2019-04-14 13:32:03'),
(4157, 'مشاهدة فيلم Forever 2015 مترجم', 'مشاهدة وتحميل فيلم الدراما Forever 2015 مترجم بجودة BluRay كامل اون لاين. تدور أحداث الفيلم حول أليس التي تعمل كصحافية متخصصة في التحقيقات، وتعاني في حياتها من خسارة فادحة على المستوى الشخصي، لكنها ما ان تنضم إلى مجتمع جديد حتى تشعر بأنها تستعيد ذاتها من جديد.', 'forever-2015', 'https://m.media-amazon.com/images/M/MV5BMTQzMTUwMjQ3Nl5BMl5BanBnXkFtZTgwMTY2MDE5MjE@._V1_SX300.jpg', 8.3, 'BluRay', 0, 1, 4161, '2019-04-14 13:38:48', '2019-04-14 13:44:16'),
(4159, 'مشاهدة فيلم Girl Asleep 2015 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والعائلي Girl Asleep 2015 بجودة BluRay مترجم اون لاين وتحميل مباشر. فتاة على مشارف المراهقة، فينتابها الحزن لمفارقتها طفولتها.', 'girl-asleep-2015', 'https://m.media-amazon.com/images/M/MV5BMTA0MjczMDgzMjZeQTJeQWpwZ15BbWU4MDU3OTk2Nzkx._V1_SX300.jpg', 6.2, 'BluRay', 0, 1, 4163, '2019-04-14 13:39:00', '2019-04-14 13:44:15'),
(4160, 'مشاهدة فيلم Going Clear: Scientology the Prison of Belief 2015 مترجم', 'مشاهدة فيلم Going Clear: Scientology the Prison of Belief 2015 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر فيلم وثائقي يتناول بنظرة متعمقة الأعمال الداخلية للكنيسة السينتولوجية.', 'going-clear-scientology-the-prison-of-belief-2015', 'https://m.media-amazon.com/images/M/MV5BZjYxYTA0MWQtYWViYi00YmRhLWEzNzctMDkwMGQ5ODFmM2FjXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 8, 'BluRay', 0, 1, 4164, '2019-04-14 13:39:02', '2019-04-14 13:44:14'),
(4162, 'مشاهدة فيلم A Date With Miss Fortune 2015 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والرومانسية A Date With Miss Fortune 2015 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب كاتب يقع في حب امرأة تتداخل علاقاتها العائلية التقليدية مع حياتها.', 'a-date-with-miss-fortune-2015', 'https://m.media-amazon.com/images/M/MV5BMGNmMWVhODMtY2U4OC00OWY0LWEzMmItYzYyZDFkOGU1YzlmXkEyXkFqcGdeQXVyMTE1ODExNzg@._V1_SX300.jpg', 5.3, 'BluRay', 0, 1, 4166, '2019-04-14 13:39:31', '2019-04-14 13:44:13'),
(4164, 'مشاهدة فيلم 13 Minutes 2015 مترجم', 'مشاهدة و تحميل فيلم القصير والاثارة 13 Minutes 2015 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة 13 دقيقة فقط فصلت النجار (جورج إليسر) عن تغيير مجرى تاريخ العالم في 8 تشرين الثاني عام 1939، وضع (جورج) قنبلة خلف مجلس (أدولف هتلر) في بار بـ(ميونيخ)، ولكن (الفوهرر) غادر المبنى قبل الموعد المقرر، وبالتالي نجا من الاغتيال الذي كان يمكن أن يؤدي إلى نهاية مبكرة للحرب العالمية الثانية. (أوليفر) الذي على دراية بالأيام الأخيرة من سقوط الدكتاتورية النازية، يُسلط الضوء على هذا العمل الشجاع، ويحتفل بذكرى الرجل الذي كاد أن يُنهي الحرب وحده.', '13-minutes-2015', 'https://m.media-amazon.com/images/M/MV5BMTM5NjM0ODY1NF5BMl5BanBnXkFtZTcwMjk5NjI0Ng@@._V1_SX300.jpg', 6.1, 'BluRay', 0, 1, 4168, '2019-04-14 13:39:45', '2019-04-14 13:44:11'),
(4166, 'مشاهدة فيلم 10,000 Saints 2015 مترجم', 'مشاهدة فيلم الكوميديا والدراما 10,000 Saints 2015 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. يتتبع الفلم قصة الطفل (جود) ، ومراحل تحوله من الطفولة إلى المراهقة في ثمانينيات القرن العشرين في مدينة (نيويورك بالولايات المتحدة) ، يجتمع (جود) مع والده (إيثان هوك) ، وينتقل معه من (فيرمونت) إلى (نيويورك) ، حيث يبدأ التعرف على ثقافة وفنون الـ(Punk) ، التي تثير اهتمامه ، ويرتبط بها ارتباطًا شديدًا .', '10000-saints-2015', 'https://m.media-amazon.com/images/M/MV5BYzVmMTdjOTYtOTJkYS00ZTg2LWExNTgtNzA1N2Y0MDgwYWFhXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 7.8, 'BluRay', 0, 1, 4170, '2019-04-14 13:39:51', '2019-04-14 13:44:10'),
(4167, 'مشاهدة فيلم Woman in Gold 2015 مترجم', 'مشاهدة فيلم Woman in Gold 2015 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر اقتباسًا عن قصة حقيقية ماريا ألتمان (هيلين ميرين) امرأة يهودية في الثمانينيات من عمرها ، وكانت من الناجيات من مذابح الهولوكوست التي وقعت خلال الحرب العالمية الثانية ، وتتعاون مع محام شاب لرفع دعوى قضائية ضد الحكومة النمساوية من أجل المطالبة باستعادة لوحة (امرأة باللون الذهبي) ، التي تعد من أشهر لوحات الفنان (جوستاف كليمت) ، والتي سُلبت من عائلتها على يد النازيين خلال الحرب .', 'woman-in-gold-2015', 'https://m.media-amazon.com/images/M/MV5BMTExMTUxNDQ5MjdeQTJeQWpwZ15BbWU4MDk4NTgxMzQx._V1_SX300.jpg', 7.3, 'BluRay', 0, 1, 4171, '2019-04-14 13:39:52', '2019-04-14 13:44:09'),
(4168, 'مشاهدة فيلم Where to Invade Next 2015 مترجم', 'مشاهدة فيلم Where to Invade Next 2015 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر في قالب وثائقي، وفي إطار انتقاداته للسياسات اﻷمريكية، يفترض المخرج (مايكل مور) نية الولايات المتحدة اﻷمريكية لغزو دولة جديدة ليشاهد ما الذي يمكن أن تتعلمه الولايات المتحدة وتأخذه من تلك الأمة وما لدى تلك الشعوب لتقدمه للولايات المتحدة.', 'where-to-invade-next-2015', 'https://m.media-amazon.com/images/M/MV5BMTU3MjI2ODkzMF5BMl5BanBnXkFtZTgwMjkzMjY5NzE@._V1_SX300.jpg', 7.5, 'BluRay', 0, 1, 4172, '2019-04-14 13:39:56', '2019-04-14 13:44:08'),
(4169, 'مشاهدة فيلم War Pigs 2015 مترجم', 'مشاهدة وتحميل فيلم الاكشن والدراما War Pigs 2015 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب خلال فترة الحرب العالمية الثانية، يُمنح الكابتن جاك ووسيك فرصة جديدة ليكفر عن عاره من خلال تكليفه بقيادة فرقة مكونة من أشخاص منخفضي الكفاءات ليتوجه بهم خلف خطوط العدو من أجل الكشف والحصول على السلاح', 'war-pigs-2015', 'https://m.media-amazon.com/images/M/MV5BYjUyNjg3MjMtZGVkZS00MzUzLWJhM2UtNWM1ZWFlOTc4MzA5XkEyXkFqcGdeQXVyMDI4NjM1MQ@@._V1_SX300.jpg', 4.2, 'BluRay', 0, 1, 4173, '2019-04-14 13:39:57', '2019-04-14 13:44:07'),
(4171, 'مشاهدة فيلم The Wedding Ringer 2015 مترجم', 'مشاهدة وتحميل فيلم الكوميديا The Wedding Ringer 2015 مترجم بجودة BluRay كامل أون لاين. دوج هاريس (جوش جاد) شاب طيب للغاية وحسن السمعة، لكن تكمن المشكلة في كونه شخص انطوائي، وقد بقيت أيام معدودة على موعد حفل زفافه من محبوبته الجميلة جريتشن بالمر (كيلي كوكو سويتنج)، لكن ليس له أصدقاء', 'the-wedding-ringer-2015', 'https://m.media-amazon.com/images/M/MV5BMTk3MjQyNTUxNl5BMl5BanBnXkFtZTgwNjM3Mjk1MzE@._V1_SX300.jpg', 6.7, 'BluRay', 0, 1, 4175, '2019-04-14 13:40:06', '2019-04-14 13:44:05'),
(4173, 'مشاهدة فيلم VANish 2015 مترجم', 'مشاهدة فيلم VANish 2015 بجودة HD مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر أجبرت امرأة شابة للخطف في رحلة على الطريق من القتل والفوضى التي تحدث تماما في العطلات ..', 'vanish-2015', 'https://m.media-amazon.com/images/M/MV5BMTU3Nzc0MzMwM15BMl5BanBnXkFtZTgwMDk0NjEwNDE@._V1_SX300.jpg', 5.2, 'HD', 0, 1, 4177, '2019-04-14 13:40:12', '2019-04-14 13:44:04'),
(4174, 'مشاهدة فيلم The Rise of the Krays 2015 مترجم', 'مشاهدة وتحميل فيلم الجريمة والدراما The Rise of the Krays 2015 بجودة HD مترجم كامل اون لاين مشاهدة مباشرة يوتيوب إتنين من الملاكمين الهواة القدامي يتحولون إلي أكثر الأشخاص رعباً و شراً في كافة لندن .', 'the-rise-of-the-krays-2015', 'https://m.media-amazon.com/images/M/MV5BMTY2NDQ4MzA0OV5BMl5BanBnXkFtZTgwMzY3NTY4NzE@._V1_SX300.jpg', 5, 'HD', 0, 1, 4178, '2019-04-14 13:40:28', '2019-04-14 13:44:03'),
(4176, 'مشاهدة فيلم Uncanny 2015 مترجم', 'مشاهدة فيلم Uncanny 2015 بجودة HD مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر ', 'uncanny-2015', 'https://m.media-amazon.com/images/M/MV5BMTQ3ODU1NTY0Ml5BMl5BanBnXkFtZTgwODU0MzA3NjE@._V1_SX300.jpg', 6.3, 'HD', 0, 1, 4180, '2019-04-14 13:40:42', '2019-04-14 13:44:02'),
(4178, 'مشاهدة فيلم Tyke Elephant Outlaw 2015 مترجم', 'مشاهدة وتحميل فيلم الوثائقي Tyke Elephant Outlaw 2015 مترجم بجودة WEB-DL كامل أون لاين. يروي هذا الوثائقي القصة المؤسفة لحادث فيل السيرك الذي هاجم وقتل مدربه ثم انطلق هائجًا في شوارع “هونولولو” عام 1994.', 'tyke-elephant-outlaw-2015', 'https://m.media-amazon.com/images/M/MV5BMjAzNzk0ODcyM15BMl5BanBnXkFtZTgwOTg5MDkxNjE@._V1_SX300.jpg', 7.4, 'WEB-DL', 0, 1, 4182, '2019-04-14 13:40:54', '2019-04-14 13:44:00'),
(4180, 'مشاهدة فيلم The Unwilling 2016 مترجم', 'مشاهدة وتحميل فيلم الاثارة The Unwilling 2016 بجودة DVDRip مترجم كامل اون لاين مشاهدة مباشرة يوتيوب بعد موت اكبر بطريرك شرير يظهر صندوق غامض اثناء قراءة الوصية يجبر العائلة على التعرف على خطاياهم المميتة', 'the-unwilling-2016', 'https://ia.media-imdb.com/images/M/MV5BMWI1ZjY4M2QtOGNmNC00NGMwLWExYWItYzUxMTY3ZDYyNDRiXkEyXkFqcGdeQXVyMTE4NTI5NTA@._V1_SX300.jpg', 5.2, 'DVDRip', 0, 1, 4184, '2019-04-14 13:41:03', '2019-04-14 13:43:58'),
(4183, 'مشاهدة فيلم Gigli 2003 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والجريمة Gigli 2003 بجودة WEB-DL مترجم كامل اون لاين مشاهدة مباشرة يوتيوب يُكلف القاتل المأجور لاري جيجلي (بن إفليك) ذو الكفاءة المتواضعة في مجاله بمهمة جديدة، تطلب منه العصابة أن يقوم باختطاف الأخ ذي الإعاقة العقلية للمدعي العام في إحدى مقاطعات كاليفورنيا. يقوم جيجلي باختطاف الأخ من إحدى المصحات العقلية، ويحتجزه رهينة في منزله. يتم إرسال القاتلة ريكي (جنيفر لوبيز) للتأكد من عدم إفساد جيجلي للمهمة، ولكن الأمر ينتهي بالاثنين وقد وقعا في الحب. تتوالى الأحداث وسط العديد من المفارقات الطريفة.', 'gigli-2003', 'https://m.media-amazon.com/images/M/MV5BMTE5MTYxMDg5NV5BMl5BanBnXkFtZTYwNjc5MzQ3._V1_SX300.jpg', 2.4, 'WEB-DL', 0, 1, 4187, '2019-04-14 13:41:15', '2019-04-14 13:43:55'),
(4185, 'مشاهدة فيلم Sicilian Ghost Story 2017 مترجم', 'مشاهدة وتحميل فيلم الجريمة والدراما Sicilian Ghost Story 2017 بجودة DVDRip مترجم اون لاين وتحميل مباشر. شبح صقلية ” في قرية صغيرة بصقلية تقع على حافة غابة، يختفي (جوزيبي) الصبي ذو ال13 عام، لكن (لونا) التي تحبه، وهي زميلته في الفصل، ترفض أن تقبل فكرة اختفاءه الغامض، فتتمرد على الصمت والتواطؤ الذي يحيط بها، وتهبط إلى العالم المظلم الذي ابتلع (جوزيبي)، والبحيرة هي بداية مدخله الغامض.', 'sicilian-ghost-story-2017', 'https://m.media-amazon.com/images/M/MV5BYTA3MTdkMGMtNzA5Ni00MmVmLTgxNjctZDZhZmM0OWM4OTAyXkEyXkFqcGdeQXVyNTQwMDA5NTg@._V1_SX300.jpg', 6.6, 'DVDRip', 0, 1, 4189, '2019-04-14 13:41:27', '2019-04-14 13:43:54'),
(4187, 'مشاهدة فيلم Howards End 1992 مترجم', 'مشاهدة وتحميل فيلم الدراما والرومانسية Howards End 1992 مترجم بجودة BluRay كامل أون لاين. يتناول الفيلم ثلاث طبقات اجتماعية في بداية القرن العشرين بإنجلترا، فهناك (آل ويلكوكس) أثرياء العصر الفيكتوري من الأرستقراطيين الذين يملكون الكثير من المال، وهناك الطبقة البرجوازية المتعلمة التي يمثلها (آل شليجيل) والتي تتميز بالإنسانية وحب الناس، وأخيرًا هناك طبقة العمال الكادحة التي تحارب من أجل البقاء ويمثلها (آل باست). تتلاقى وتتداخل مصائر العائلات الثلاث وسط أجواء من الحب والكراهية والطمع والكبرياء.', 'howards-end-1992', 'https://m.media-amazon.com/images/M/MV5BMTk3MDY3NDc2NF5BMl5BanBnXkFtZTgwODcwNjgzOTE@._V1_SX300.jpg', 7.5, 'BluRay', 0, 1, 4191, '2019-04-14 13:41:45', '2019-04-14 13:43:52'),
(4188, 'فيلم Mr. Magoriums Wonder Emporium 2007 مترجم اون لاين', 'مشاهدة وتحميل فيلم الكوميديا والعائلي Mr. Magoriums Wonder Emporium 2007 مترجم بجودة BluRay كامل أون لاين.', 'mr-magoriums-wonder-emporium-2007', 'uploads/13803825485.jpg', NULL, 'BluRay', 0, 1, 4192, '2019-04-14 13:41:54', '2019-04-14 13:43:50'),
(4189, 'مشاهدة فيلم Incontrol 2017 مترجم', 'مشاهدة فيلم الدراما والخيال العلمي Incontrol 2017 مترجم بجودة WEB-DL مشاهدة مباشرة اون لاين. “مجموعة من طلاب الجامعة يكتشفون جهازًا غير مألوفًا، يسمح لهم بالسيطرة الكاملة على الآخرين، ورؤية العالم من داخل شخص آخر”.', 'incontrol-2017', 'https://m.media-amazon.com/images/M/MV5BNGJlY2Q2MWMtY2I0Yi00Nzc3LThiMTgtNWY4ZTM4Zjc3NjA2XkEyXkFqcGdeQXVyNDgyNzAxMzY@._V1_SX300.jpg', 4.4, 'WEB-DL', 0, 1, 4193, '2019-04-14 13:41:56', '2019-04-14 13:43:50'),
(4191, 'مشاهدة فيلم Porto 2016 مترجم', 'مشاهدة فيلم Porto 2016 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر “(ماتي) و(جيك) غرباء في (بورتو) بدأ كليهما بتجريب علاقة قصيرة، ثم يزداد الغموض ليعرفان أكثر عن بعضهما وحب الإستطلاع ليجربان أشياء أكثر، حتى ينتهي بهما المطاف بحب بعضهما البعض.”.', 'porto-2016', 'https://m.media-amazon.com/images/M/MV5BNzcyYjQ5MDgtZDU0NC00YjA4LWIxOTQtZDE1YTVmNzk3ZThlXkEyXkFqcGdeQXVyODM3MjA1NA@@._V1_SX300.jpg', 6.2, 'WEB-DL', 0, 1, 4195, '2019-04-14 13:42:05', '2019-04-14 13:43:48'),
(4193, 'مشاهدة فيلم The Disappearance of Eleanor Rigby: Her 2013 مترجم', 'مشاهدة وتحميل فيلم الدراما The Disappearance of Eleanor Rigby: Her 2013 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب قصة تُروى من منظور أنثوي، وهي قصة الزوجيّن (إليانو، وكونور)، اللذان يحاولان استعادة حياتهما بالحب الذي كان يغمر تفاصيلها، ويصلحان ما فسد من ماضيهما البعيد، ويصوّبان مسار علاقتهما ليصلا بها للشكل الأمثل.', 'the-disappearance-of-eleanor-rigby-her-2013', 'https://m.media-amazon.com/images/M/MV5BNTYwYTgyYzctMWE2NS00Yzg5LWEwMDQtNWFjMmM4NmNjY2ExXkEyXkFqcGdeQXVyMjQ1NjEyNzE@._V1_SX300.jpg', 6.9, 'BluRay', 0, 1, 4197, '2019-04-14 13:42:14', '2019-04-14 13:43:47'),
(4195, 'مشاهدة فيلم Tekken: Kazuyas Revenge 2014 مترجم', 'مشاهدة و تحميل فيلم الاكشن Tekken: Kazuyas Revenge 2014 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة يعاني شاب في مقتبل العمر من فقدان الذاكرة، ويحاول جاهدًا أن يتعرف على هويته الحقيقية، لكنه يكتشف أن هويته قد تعرضت للسرقة من منظمة إجرامية تعمل في الخفاء، وهو ما يدخله في مسار من الانتقام.', 'tekken-kazuyas-revenge-2014', 'uploads/21330199332.jpg', NULL, 'BluRay', 0, 1, 4199, '2019-04-14 13:42:17', '2019-04-14 13:43:45'),
(4197, 'مشاهدة فيلم Shes All That 1991 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والرومانسية Shes All That 1991 مترجم بجودة BluRay كامل اون لاين. فتاة لا تمتلك الشعبية أو المظهر المناسب أو أي شيء يجعلها تصبح فتاة الحفل في التخرج، تجتذب الرجل الأكثر شعبية في المدرسة بأسرها، الذي يحاول مصادقتها لتحويلها في ليلة التخرج إلى ملكة الحفل، رغم افتقارها لكل المؤهلات التي تجعلها كذلك.', 'shes-all-that-1991', 'uploads/22365308912.jpg', NULL, 'BluRay', 0, 1, 4201, '2019-04-14 13:42:28', '2019-04-14 13:43:43'),
(4198, 'مشاهدة فيلم In the Shadow 2012 مترجم', 'مشاهدة فيلم In the Shadow 2012 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر تشيكوسلوفاكيا السابقة : في خمسينيات القرن العشرين , يحقق النقيب هاكل في عملية سرقة مجوهرات و يتم حل القضية بسرعة , لكن يبدو ان لقضية اكثر تعقيداً من ذلك', 'in-the-shadow-2012', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTU3MzQ4OTI1Nl5BMl5BanBnXkFtZTcwNDIwODg3OA@@._V1_SX300.jpg', 7.1, 'BluRay', 0, 1, 4202, '2019-04-14 13:42:30', '2019-04-14 13:43:43'),
(4199, 'مشاهدة فيلم The Double Life of Veronique 1991 مترجم', 'مشاهدة فيلم The Double Life of Veronique 1991 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر (ويرونيكا) تعيش في بولندا، بينما (فيرونيكا) تعيش في باريس، ولا يعرفنا بعضهما البعض، عندما تحصل (ويرونيكا) على عملها في مدرسة الموسيقى، وتبدأ في العمل بجد وقوة في مكانها الجديد، تنهار وتموت في أول أداء لها، بينما تقرر (فيرونيكا) ألا تصبح مغنية.', 'the-double-life-of-veronique-1991', 'https://m.media-amazon.com/images/M/MV5BNDJmMTRlMWEtNDFiMi00MDI1LWFkMWYtOWQzZGM1MTZkYTMyXkEyXkFqcGdeQXVyNzMzNzY1OTQ@._V1_SX300.jpg', 7.8, 'BluRay', 0, 1, 4203, '2019-04-14 13:42:31', '2019-04-14 13:43:42'),
(4200, 'مشاهدة فيلم The Formula 2014 مترجم', 'مشاهدة فيلم الكوميديا والرومانسية The Formula 2014 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. اثنان من طلاب الهندسة يكتشفان صيغة رياضية لإثارة إعجاب النساء بكل سهولة، (كوين) الرومانسي الهادئ الذي غرق في حب معلمة شابة، و(غراهام) المهووس بالنساء الذي يعتقد أن مفتاح الإيقاع بامرأة أحلامه هو التودد قدر المستطاع، يستخدمان الصيغة من موعد لآخر فقط ليكتشفا أن الحب الحقيقي لا يمكن صناعته.', 'the-formula-2014', 'https://m.media-amazon.com/images/M/MV5BZGQ5YTZlYjEtNTNmOS00ZjBmLWE0ODItNjY5OTc4MjZkMGQ5XkEyXkFqcGdeQXVyNjUwNzk3NDc@._V1_SX300.jpg', 5.6, 'BluRay', 0, 1, 4204, '2019-04-14 13:42:32', '2019-04-14 13:43:41'),
