(4236, 'مشاهدة فيلم The Exorcism of Molly Hartley 2015 مترجم', 'مشاهدة وتحميل فيلم الرعب The Exorcism of Molly Hartley 2015 مترجم بجودة BluRay كامل أون لاين. حول شخص بالغ سقط تحت يد روح شريرة ويجب طردها من قبل كاهن سقط تحت يد الشياطين ..', 'the-exorcism-of-molly-hartley-2015', 'https://m.media-amazon.com/images/M/MV5BMjI3NjgyOTM4MV5BMl5BanBnXkFtZTgwNTM5MzEwNzE@._V1_SX300.jpg', 4.6, 'BluRay', 0, 1, 4240, '2019-04-14 13:47:33', '2019-04-14 13:51:19'),
(4237, 'مشاهدة فيلم The Dresser 2015 مترجم', 'مشاهدة و تحميل فيلم الدراما The Dresser 2015 مترجم اون لاين جودة HDTV وتحميل مباشر مشاهدة اون لاين مباشرة هو فيلم دراما، استنادا إلى مسرحية ناجحة، حول فاعل الشيخوخة ومساعده الشخصي.', 'the-dresser-2015', 'https://m.media-amazon.com/images/M/MV5BN2IxMWUwZWYtZmE1Yi00Yzk2LWE3NzYtNGZkMjdlM2I0MzhiXkEyXkFqcGdeQXVyNjY1NTQ0NDg@._V1_SX300.jpg', 7.7, 'HDTV', 0, 1, 4241, '2019-04-14 13:47:42', '2019-04-14 13:51:18'),
(4238, 'مشاهدة فيلم The Boy Next Door 2015 مترجم', 'مشاهدة وتحميل فيلم الرومانسية والاثارة The Boy Next Door 2015 بجودة BluRay مترجم اون لاين وتحميل مباشر. يدور الفيلم حول امرأة (جينيفر لوبيز) حصلت على الطلاق حديثاً، وتعيش مع ابنها. تتعرف على شاب وسيم انتقل حديثاً في المنزل المجاور لهم، ويُعتبر صديقاً لابنها، تتطور العلاقة إلى أن تأخد منحنى مرضي وخطير، وعندما تريد هي أن تضع حداً لهذة العلاقة للحفاظ على نفسها وابنها، يحدث ما لم يكن في الحسبان.', 'the-boy-next-door-2015', 'https://m.media-amazon.com/images/M/MV5BMTgxNTEyMTYzOV5BMl5BanBnXkFtZTgwNzQ4OTg5MjE@._V1_SX300.jpg', 4.7, 'BluRay', 0, 1, 4242, '2019-04-14 13:47:56', '2019-04-14 13:51:18'),
(4239, 'مشاهدة فيلم The Scorpion King 4: Quest for Power 2015 مترجم', 'مشاهدة فيلم The Scorpion King 4: Quest for Power 2015 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر عندما يتعرض للخيانة من قبل صديقه الذي كان يثق به، ماثيوس يحشد كل قوته ويمكر ل2015خصمه ..', 'the-scorpion-king-4-quest-for-power-2015', 'uploads/101394889777.jpg', NULL, 'BluRay', 0, 1, 4243, '2019-04-14 13:47:58', '2019-04-14 13:51:17'),
(4240, 'مشاهدة فيلم Terminus 2015 مترجم', 'مشاهدة فيلم Terminus 2015 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر تدور أحداث القصة حول تعرض (دايفيد شامبرلاين) لحادث مروع كاد أن يفتك بحياته خلال محاولته التواصل مع نيزك فضائي، وبعد الحادث وعلى شكل غير مُتوقع يتوصل دايفيد لاكتشاف غاية في الأهمية والخطورة ليس عليه أو المحيطين به فقط، ولكن يمثل خطورة على الجنس البشري على وجه الأرض.', 'terminus-2015', 'https://m.media-amazon.com/images/M/MV5BMTUyMjA5OTgyOV5BMl5BanBnXkFtZTgwOTkyMjQ5NTE@._V1_SX300.jpg', 5.4, 'BluRay', 0, 1, 4244, '2019-04-14 13:48:11', '2019-04-14 13:51:16'),
(4241, 'مشاهدة فيلم The Night Crew 2015 مترجم', 'مشاهدة وتحميل فيلم الاكشن والاثارة The Night Crew 2015 مترجم بجودة BluRay كامل أون لاين. يروي الفلم قصة مجموعة من صائدي المكافآت الذين يقضون ليلتهم في إحدى الفنادق الصحراوية ، والذي يواجهون فيه مجموعة من الهمج عبر الحدود ، كما يلاحظون أن السيدة الهاربة منهم وهي امرأة صينية شابة هي أكثر مما كانوا يتخيلون .', 'the-night-crew-2015', 'https://m.media-amazon.com/images/M/MV5BZjEzOTljNzMtNWJhMS00NTc4LTk2MzktMDcxYTI5NGNlYTZlXkEyXkFqcGdeQXVyNDA1NDA2NTk@._V1_SX300.jpg', 4.1, 'BluRay', 0, 1, 4245, '2019-04-14 13:48:19', '2019-04-14 13:51:15'),
(4242, 'مشاهدة فيلم Synchronicity 2015 مترجم', 'مشاهدة و تحميل فيلم الدراما والغموض Synchronicity 2015 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة تدور أحداث القصة حول أحد علماء الفيزياء، (بلايد رنر) حيث يقوم باختراع آلة زمنية قادرة على تخطي الزمان والمكان، تقع الآلة بين أيدي فتاة غامضة بينما يحاول (بلايد) إثبات صحة نظريته وتوصله لتلك الآلة، يسافر (بلايد) للماضي لإبطال تطويره تلك الآلة منعًا لسرقتها مستقبلًا، ولكنه يتعرض للعديد من المفاجآت التي تغير نظرته لكثير من الأمور.', 'synchronicity-2015', 'https://m.media-amazon.com/images/M/MV5BMTc2NDAyOTc4MV5BMl5BanBnXkFtZTgwNjE4Mjk0NzE@._V1_SX300.jpg', 5.5, 'BluRay', 0, 1, 4246, '2019-04-14 13:48:21', '2019-04-14 13:51:14'),
(4243, 'مشاهدة فيلم The Man Who Knew Infinity 2015 مترجم', 'مشاهدة وتحميل فيلم السيرة الذاتية والدراما The Man Who Knew Infinity 2015 مترجم بجودة BluRay كامل أون لاين. كان سرينيفاسا رامانوجان إينجار شابًا هنديًا ترعرع في ظروف بالغة الصعوبة وعاني طويلًا من الفقر، لكنه ينجح بعد البلوغ في الالتحاق بجامعة (كامبريدج)، حيث يثبت تفوقه الدراسي حتى يصير رائدًا في النظريات الرياضية، وذلك بتوجيه من أستاذه ج.هـ. هاردي.', 'the-man-who-knew-infinity-2015', 'https://m.media-amazon.com/images/M/MV5BMTU3Njg4MDM3OV5BMl5BanBnXkFtZTgwMjE5ODM3ODE@._V1_SX300.jpg', 7.2, 'BluRay', 0, 1, 4247, '2019-04-14 13:48:30', '2019-04-14 13:51:13'),
(4244, 'مشاهدة فيلم Sword of Vengeance 2015 مترجم', 'مشاهدة فيلم Sword of Vengeance 2015 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر تحاكي من خالق “مطرقة الالهة”، بطولة ستانلي ويبر (بورجيا) وانابيل واليس (انابيل)، والموضوعات من طاغية لا يرحم هدف القمع ومن ثم اكتشاف مقاتل الحرية المحتمل الذي هو بمثابة ميثاق شرف يطالب الانتقام الدموي.', 'sword-of-vengeance-2015', 'https://m.media-amazon.com/images/M/MV5BMTU1MDQ4ODIxN15BMl5BanBnXkFtZTgwMTA0NTAwNjE@._V1_SX300.jpg', 4.4, 'BluRay', 0, 1, 4248, '2019-04-14 13:48:31', '2019-04-14 13:51:12'),
(4245, 'مشاهدة فيلم Superfast! 2015 مترجم', 'مشاهدة فيلم Superfast! 2015 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر في إطار كوميدي ساخر، ينضم الشرطي المتخفي لوكاس وايت إلى مجموعة متسابقي السيارات التي يقودها فين سيرنتينو في لوس أنجلوس، والذين يخططون بدورهم للانقلاب على زعيم الجريمة في لوس أنجلوس خوان كارلوس دا سول والاستيلاء على الأموال التي يخفيها بحوزته، ولأجل ذلك يضع فين خطة جريئة وغريبة في نفس الوقت.', 'superfast-2015', 'https://m.media-amazon.com/images/M/MV5BNjM3MjQxNjkxM15BMl5BanBnXkFtZTgwMDIyMTA0NDE@._V1_SX300.jpg', 4.1, 'BluRay', 0, 1, 4249, '2019-04-14 13:48:41', '2019-04-14 13:51:11'),
(4246, 'مشاهدة فيلم The Lady in the Van 2015 مترجم', 'مشاهدة فيلم السيرة الذاتية والكوميديا The Lady in the Van 2015 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. في إطار درامي، تدور أحداث الفيلم، حول القصة الحقيقية التي حدثت لآلان بينيت الذي يكتشف في صبيحة إحدى الأيام وجود امرأة عجوز وهى السيدة شيبرد والتي قامت بايقاف شاحنتها المُعطلة التي تعيش فيها أمام بيته لفترة مؤقتة لحين تصليحها، وتمتد هذه الفترة “المؤقتة” لتصبح 15 عامًا.', 'the-lady-in-the-van-2015', 'https://m.media-amazon.com/images/M/MV5BOTY0MjM3NTQyOF5BMl5BanBnXkFtZTgwMzcwNjUxNzE@._V1_SX300.jpg', 6.7, 'BluRay', 0, 1, 4250, '2019-04-14 13:48:53', '2019-04-14 13:51:10'),
(4247, 'مشاهدة فيلم Ronaldo 2015 مترجم', 'مشاهدة وتحميل فيلم الوثائقي والسيرة الذاتية Ronaldo 2015 مترجم بجودة BluRay كامل أون لاين. الفيلم يحكي قصة تم تصوير على مدى اربعة عشر شهرا حيث يصور حياة الرجل الاكثر شهرة في عالم الرياضة كريستيانو رونالدو وحياته في الملاعب وحياته كأب ولقطات مثيرة ولاتنسى في حياته المهنية .', 'ronaldo-2015', 'https://m.media-amazon.com/images/M/MV5BNzMyMTM1MjQxNF5BMl5BanBnXkFtZTgwMjY4NTE5NjE@._V1_SX300.jpg', 6.4, 'BluRay', 0, 1, 4251, '2019-04-14 13:49:03', '2019-04-14 13:51:09'),
(4248, 'مشاهدة فيلم The Driftless Area 2015 مترجم', 'مشاهدة فيلم الجريمة والدراما The Driftless Area 2015 مترجم بجودة HD مشاهدة مباشرة اون لاين. تدور أحداث القصة حول حياة الشاب (بيير)، يعمل بيير كنادل في ملهى ولايفارقه التفاؤل، وبعد وفاة والديه يعود بيير إلى مدينته من أجل حضور الجنازة، يتعرف على (ستيلا) ويقع في غرامها، ويتورط في لعبة من أجل الفوز بحقيبة مليئة بالنقود، ولكن بالرغم من حلم الفوز بالحقيبة توجد جريمة غير معلوم مرتكبها قريبة أيضًا منه.', 'the-driftless-area-2015', 'https://m.media-amazon.com/images/M/MV5BMTUwNTMxNjkzMl5BMl5BanBnXkFtZTgwMzQyMzA5NzE@._V1_SX300.jpg', 5.3, 'HD', 0, 1, 4252, '2019-04-14 13:49:16', '2019-04-14 13:51:08'),
(4249, 'مشاهدة فيلم San Andreas Quake 2015 مترجم', 'مشاهدة فيلم الاكشن والخيال العلمي San Andreas Quake 2015 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. عندما يحذر LA عن حدوث زلزال من 12.7 زلزال وشيك، لا أحد يأخذ التحذير على محمل الجد. الآن على بلدها، وقالت انها سباقات ماسة للحصول على أسرتها إلى بر الأمان قبل وقوع زلزال لوس انجليس بصرف النظر عن البر الرئيسى.', 'san-andreas-quake-2015', 'https://m.media-amazon.com/images/M/MV5BOTA5MTk3NjgzMl5BMl5BanBnXkFtZTgwMDMyNTQzNTE@._V1_SX300.jpg', 2, 'BluRay', 0, 1, 4253, '2019-04-14 13:49:17', '2019-04-14 13:51:07'),
(4250, 'مشاهدة فيلم Scooby-Doo! And Kiss: Rock and Roll Mystery 2015 مترجم', 'مشاهدة فيلم Scooby-Doo! And Kiss: Rock and Roll Mystery 2015 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر تدور أحداث الفيلم حول مغامرة جديدة من مغامرات الكلب المحبوب “سكوبي دوبي”. تشترك العصابة مع فرد وحيد وهو “كيس” في كل ما هو جديد. انضمت العصابة إلى “كيس” وقاموا بالتحقيق في سلسلة مطاردات غريبة. بمساعدة “كيس” يكتشفون أن الساحرة القرمزية قد عادت لاستدعاء المدمرة من الاتجاه المقابل “لكيستيريا” و”دوس” الشرير قد وضع خطة مرعبة لتدمير الارض. فهل يستطيع دهاء العصابة وقوة “كيس”', 'scooby-doo-and-kiss-rock-and-roll-mystery-2015', 'uploads/21882792395.jpg', NULL, 'BluRay', 0, 1, 4254, '2019-04-14 13:49:21', '2019-04-14 13:51:06'),
(4251, 'مشاهدة فيلم The Girl King 2015 مترجم', 'مشاهدة فيلم The Girl King 2015 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر الفتاة ترسم صورة رائعة، كريستينا السويدية، ملكة من عمر ستة، التي تحارب القوى المحافظة التي هي ضد أفكارها لتحديث السويد والذين ليس لديهم تسامح لها الصحوة الجنسية.', 'the-girl-king-2015', 'https://m.media-amazon.com/images/M/MV5BMGRkNTcwYzQtNTczNi00MWExLWE3MWMtYTJjMmE2MDBlNTdmXkEyXkFqcGdeQXVyMzE0MjY5ODA@._V1_SX300.jpg', 5.9, 'BluRay', 0, 1, 4255, '2019-04-14 13:49:29', '2019-04-14 13:51:06');
INSERT INTO `movies` (`id`, `name`, `description`, `slug`, `image_url`, `ratings`, `quality`, `views`, `category_id`, `server_links`, `created_at`, `updated_at`) VALUES
(4252, 'مشاهدة فيلم Star Wars: The Force Awakens 2015 مترجم', 'مشاهدة وتحميل فيلم الاكشن والمغامره Star Wars: The Force Awakens 2015 بجودة BluRay مترجم اون لاين وتحميل مباشر. بعد 30 عام من هزيمة الإمبراطورية، يختبيء فارس الجيداي لوك سكايواكر في مكان سري لا توجد له أية اشارات سوى من خلال خريطة مخزنة داخل اﻹنسان الآلي BB8، وتعثر عليه الفتاة راي وتصطحبه معها، وتلتقي في طريقها بفين الجندي المنشق، ويهربان مع BB8 بسبب سعي لورد السيث كايلو رين الذي ينتمي للدرجة الأولى التي جاءت خلفًا لامبراطورية المجرة للحصول على الخريطة، ويكتشف راي وفين في رحلتهما تلك الكثير بعد لقائهما بهان سولو.', 'star-wars-the-force-awakens-2015', 'https://m.media-amazon.com/images/M/MV5BM2UzYjk5MTQtY2U3NC00ODlmLTg2ZGYtMDc1N2Q5YTc0OWViXkEyXkFqcGdeQXVyMjMyMjA0NTA@._V1_SX300.jpg', 7.2, 'BluRay', 0, 1, 4256, '2019-04-14 13:49:40', '2019-04-14 13:51:05'),
(4253, 'مشاهدة فيلم The Invitation 2015 مترجم', 'مشاهدة وتحميل فيلم الدراما والغموض The Invitation 2015 مترجم بجودة BluRay كامل أون لاين. في إطار أحداث غامضة تدعو للريبة والشك، (ويل) و(إيدن) كانا في يوم ما حبيبان، ولكن بعد موت ابنهما في حادثة مأساوية، اختفت (إيدن)، ولكنها بعد عامين رجعت ومعها زوج جديد، تدعو (ويل) إلى حفل في بيتهما القديم فيذهب، ولكنه يبدأ في الشك بأن (إيدن) وزوجها الجديد يملكان بعض النوايا الشريرة تجاهه.', 'the-invitation-2015', 'https://m.media-amazon.com/images/M/MV5BMTkzODMwNDkzOF5BMl5BanBnXkFtZTgwNDA4NzA1ODE@._V1_SX300.jpg', 6.7, 'BluRay', 0, 1, 4257, '2019-04-14 13:49:53', '2019-04-14 13:51:04'),
(4254, 'مشاهدة فيلم Summer Camp 2015 مترجم', 'مشاهدة وتحميل فيلم الرعب Summer Camp 2015 مترجم بجودة BluRay كامل اون لاين. تدور أحداث الفيلم في إطار مرعب ومثير، حول مجموعة من الشباب يقررون الذهاب إلى معسكر صيفي في الغابات من أجل الترفيه عن أنفسهم، ولكنهم لم ينعموا بأية رفاهية، حيث تظهر لهم مخلوقات شريرة، لا يعرفون غايتها، فيحاولون الفرار منها بكل جهودهم.', 'summer-camp-2015', 'https://m.media-amazon.com/images/M/MV5BMjQwMDAzNTE4Nl5BMl5BanBnXkFtZTgwNTExNjY3NjE@._V1_SX300.jpg', 5.1, 'BluRay', 0, 1, 4258, '2019-04-14 13:49:55', '2019-04-14 13:51:03'),
(4255, 'مشاهدة فيلم Romans 2017 مترجم', 'مشاهدة فيلم الدراما Romans 2017 مترجم بجودة DVDRip مشاهدة مباشرة اون لاين. تدور أحداث قصة فيلم الدراما Romans 2017 حول ضحية كبيرة من الاعتداء الجنسي في مرحلة الطفولة تواجه فظائع ماضيه', 'romans-2017', 'https://m.media-amazon.com/images/M/MV5BMTk4MDg2MTEyN15BMl5BanBnXkFtZTgwOTA0OTUzMjE@._V1_SX300.jpg', 6.5, 'DVDRip', 0, 1, 4259, '2019-04-14 13:50:08', '2019-04-14 13:51:02'),
(4256, 'مشاهدة فيلم Souvenir 2016 مترجم', 'مشاهدة فيلم الدراما والموسيقى Souvenir 2016 مترجم بجودة BrRip مشاهدة مباشرة اون لاين. يقع مغني مسابقة الأغنية الأوروبية المنسي ، الذي تلاشى في مصنع للحلويات ، في حب الملاكم الشاب الطموح. معا يقررون محاولة عودتها', 'souvenir-2016', 'https://m.media-amazon.com/images/M/MV5BZmJkZjVhNGUtOTg4MC00YzAwLTg4ZjEtZjAxYmVlNTlkOTgyXkEyXkFqcGdeQXVyNTQwMDA5NTg@._V1_SX300.jpg', 6, '0', 0, 1, 4260, '2019-04-14 13:50:20', '2019-04-14 13:51:01'),
(4257, 'مشاهدة فيلم Ace Ventura: Pet Detective 1994 مترجم', 'مشاهدة وتحميل فيلم الكوميديا Ace Ventura: Pet Detective 1994 مترجم بجودة BluRay كامل اون لاين. يسعى محقق أحمق متخصص في الحيوانات في البحث عن الدولفين – التميمة المفقودة لفريق كرة القدم', 'ace-ventura-pet-detective-1994', 'https://m.media-amazon.com/images/M/MV5BMjAzNTI0ODUxOF5BMl5BanBnXkFtZTgwNTQxNzQxMTE@._V1_SX300.jpg', 6.9, 'BluRay', 0, 1, 4261, '2019-04-14 13:50:30', '2019-04-14 13:51:01'),
(4258, 'مشاهدة فيلم Ace Ventura: When Nature Calls 1995 مترجم', 'مشاهدة وتحميل فيلم المغامره والكوميديا Ace Ventura: When Nature Calls 1995 بجودة BluRay مترجم اون لاين وتحميل مباشر. يعود “ايس فنتورا” مخبر الحيوانات الأليفة من التقاعد للتحقيق في اختفاء خفاش بيضاء نادرة، رمزا لقبيلة أفريقية.', 'ace-ventura-when-nature-calls-1995', 'https://m.media-amazon.com/images/M/MV5BNGFiYTgxZDctNGI4OS00MWU1LWIwOGUtZmMyNGQxYjVkZjQ3XkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 6.4, 'BluRay', 0, 1, 4262, '2019-04-14 13:50:39', '2019-04-14 13:51:00'),
(4259, 'مشاهدة فيلم G.I. Jane 1997 مترجم', 'مشاهدة وتحميل فيلم الاكشن والدراما G.I. Jane 1997 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب تصبح جوردان أونيل، الملازمة بالاستخبارات البحرية، حالة اختبار عندما يتم تجنيدها لتصبح أول امرأة يسمح لها بالتدريب في وحدة العمليات السرية المعروفة باسم الوحدة البحرية للعمليات البحرية والجوية والبرية، ولم تتوقع النجاح، والعديد من كبار العسكريين بما فيهم السيناتور ليليان ديهافن يراهنون على فشلها..', 'gi-jane-1997', 'https://m.media-amazon.com/images/M/MV5BYTJhOTY4M2EtNjA2Ny00YjBjLWE4MjItZjRiOTRhMGFjZmU4XkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 5.9, 'BluRay', 0, 1, 4263, '2019-04-14 13:50:48', '2019-04-14 13:50:59'),
(4260, 'مشاهدة فيلم Dinosaur 13 2014 مترجم', 'مشاهدة وتحميل فيلم الوثائقي Dinosaur 13 2014 بجودة BluRay مترجم اون لاين وتحميل مباشر. في عام 1990 اكتشف عالم الحفريات بيتر لارسون وفريقه من معهد بلاك هيلز للأبحاث الجيولوجية أعظم اكتشاف في العالم ، وهو أكبر هيكل لديناصور تي ريكس وجد في أي وقت مضى . ولكن خلال معركة لمدة عشر سنوات مع حكومة الولايات المتحدة والمتاحف ، والقبائل الأمريكية الأصلية، و علماء الحفريات المنافسين، وجدوا أنفسهم ليس فقط في صراع للحفاظ على ديناصور فقط ولكن يقاتلون من أجل حريتهم كذلك.', 'dinosaur-13-2014', 'https://m.media-amazon.com/images/M/MV5BZWQ1NTZjMjUtODNmZS00NTVhLWFhM2ItNWZiOTdjMzdhZTY2XkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 6.5, 'BluRay', 0, 1, 4264, '2019-04-14 13:50:57', '2019-04-14 13:50:58'),
(4262, 'مشاهدة فيلم What We Do in the Shadows 2014 مترجم', 'مشاهدة فيلم الكوميديا والرعب What We Do in the Shadows 2014 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. يستعرض الفيلم فى اطار كوميدى حياة شخصيات خيالية مختلفة مثل ” فياجو ” و ” ديسون ” و ” فالديستلاف ” وهم ثلاثه من الجيران المنتمين الى مصاصى الدماء يحاولوا معا التغلب على عقبات الحياة من خلال التغذى على دماء البشر وتجنب اشعة الشمس ولكن مع مرور مئات السنوات وبقائهم على قيد الحياة يواجهوا عقبات اخرى فى العالم الحديث مثل دفع ايجار الشقة والعمل لكسب المال .', 'what-we-do-in-the-shadows-2014', 'https://m.media-amazon.com/images/M/MV5BMjAwNDA5NzEwM15BMl5BanBnXkFtZTgwMTA1MDUyNDE@._V1_SX300.jpg', 7.7, 'BluRay', 0, 1, 4266, '2019-04-14 13:54:57', '2019-04-14 14:04:07'),
(4264, 'مشاهدة فيلم By the Gun 2014 مترجم', 'مشاهدة وتحميل فيلم الجريمة والدراما By the Gun 2014 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب تدور قصة الفيلم حول (نك تورتانو)، وهو مجرم طموح ولبق، وهو من مدينة بوسطن، حيث كان يعمل لسنوات كثيرة لحساب عصابة مافيا إيطالية، وكان يحترم زعيم العصابة بدرجة كبيرة، ولكن طموحه جعله يقوم بكل شيء لكي يثبت كفاءته حتى يصبح من الكبار داخل العصابة، هذا الطموح جعله يدخل في نزاع بينه وبين أحد ممولي العصابة، وينتج عن ذلك صراع كبير، فمن الذي سينتصر فيه؟.', 'by-the-gun-2014', 'https://m.media-amazon.com/images/M/MV5BMzgxMDIzOTEzMV5BMl5BanBnXkFtZTgwMzUzMDEwMzE@._V1_SX300.jpg', 4.8, 'BluRay', 0, 1, 4268, '2019-04-14 13:55:24', '2019-04-14 14:04:05'),
(4266, 'مشاهدة فيلم Dont Look Now 1973 مترجم', 'مشاهدة و تحميل فيلم الدراما والرعب Dont Look Now 1973 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة في أثناء زيارتهما إلى (فينيسيا) في (إيطاليا)، يقابل الزوجان (جون)، و(لورا) شقيقتين غريبتي الأطوار، تبدوان تعانيان من مشكلة نفسية، تخبر إحداهما (لورا) بأنها رأت روح ابنتهما (باكستر) التي ماتت في حادث غرق مؤلم للغاية، تتمسك (لورا) بالفكرة، في الوقت ذاته يقاومها (جون) بشدة، لكن يبدو أن (جون) يعاني من أزمة نفسية أكبر بسبب وفاة ابنته.', 'dont-look-now-1973', 'uploads/2527904504.jpg', NULL, 'BluRay', 0, 1, 4270, '2019-04-14 13:55:46', '2019-04-14 14:04:02'),
(4267, 'مشاهدة فيلم How to Steal a Million 1966 مترجم', 'مشاهدة فيلم الكوميديا والجريمة How to Steal a Million 1966 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. (بونيت) جامع تحف أسطوري، يقوم بعرض تحفة (كيلليني) البرونزية (تمثال فينوس في متاحف باريس المرموقة) مقابل مبالغ ضخمة من المال، لكن يقوم أحد المتاحف بعمل لجنة لتقييم التمثال، والحقيقة التي يخفيها (بونيت) أنه مزور محترف، تقرر (نيكول) ابنته الاستعانة باللص الراقي (سيمون دوميت) من أجل سرقة التمثال الذي يساوي مليون دولار قبل اكتشاف الحقيقة.', 'how-to-steal-a-million-1966', 'https://m.media-amazon.com/images/M/MV5BYTk4MTBjY2QtMjNiOS00MWZmLWE4MTUtMjc0NDA3YzE2ZTkxXkEyXkFqcGdeQXVyMTMxMTY0OTQ@._V1_SX300.jpg', 7.6, 'BluRay', 0, 1, 4271, '2019-04-14 13:55:58', '2019-04-14 14:04:02'),
(4269, 'مشاهدة فيلم مشاهد The Other Side Of Heaven 2001 مترجم', 'مشاهدة وتحميل فيلم المغامره والسيرة الذاتية مشاهد The Other Side Of Heaven 2001 بجودة WEB-DL مترجم كامل اون لاين مشاهدة مباشرة يوتيوب جون Groberg ، وهو طفل مزرعة من ايداهو فولز ، يعبر المحيطات ليصبح مبشرا في الجزر التونغية النائية والغريبة خلال 1950.', 'the-other-side-of-heaven-2001', 'https://m.media-amazon.com/images/M/MV5BNjA0NTY1NzM2MV5BMl5BanBnXkFtZTgwMzgyMzYzNTE@._V1_SX300.jpg', 6.5, 'WEB-DL', 0, 1, 4273, '2019-04-14 13:56:07', '2019-04-14 14:04:00'),
(4271, 'مشاهدة فيلم The French Lieutenants Woman 1981 مترجم', 'مشاهدة وتحميل فيلم الدراما والرومانسية The French Lieutenants Woman 1981 مترجم بجودة BrRip كامل أون لاين. قصة باحثة عن الحرية تقع في حب ملازم فرنسي، ولكنه يهجرها، فتفرض على نفسها العزلة عن مجتمعها، لتقابل قصة حب جديدة.', 'the-french-lieutenants-woman-1981', 'uploads/517668505.jpg', NULL, '0', 0, 1, 4275, '2019-04-14 13:56:17', '2019-04-14 14:03:58'),
