(4279, 'مشاهدة فيلم Linewatch 2008 مترجم', 'مشاهدة وتحميل فيلم الجريمة والدراما Linewatch 2008 مترجم بجودة WEB-DL كامل أون لاين. (مايكل ديكسون) ضابط يعمل في دورية على الحدود الأمريكية الجنوبية مع المكسيك، ويعيش حياة سعيدة مع زوجته (أنجيلا) وابنته الصغيرة (إيميلي). ولكنه لم يكن دائما ذلك الشرطي المستقيم ورب الأسرة المخلص، بل كان في الماضي عضوا في إحدى العصابات العنيفة في لوس أنجلوس قبل أن يقرر ترك الجريمة والعمل لحساب الشرطة.', 'linewatch-2008', 'https://m.media-amazon.com/images/M/MV5BMTk4MjU1NDY0NV5BMl5BanBnXkFtZTcwOTQyMjAwMg@@._V1_SX300.jpg', 5.5, 'WEB-DL', 0, 1, 4283, '2019-04-14 13:57:33', '2019-04-14 14:03:35'),
