(4315, 'مشاهدة فيلم The Diabolical 2015 مترجم', 'مشاهدة وتحميل فيلم الرعب والخيال العلمي The Diabolical 2015 بجودة BluRay مترجم اون لاين وتحميل مباشر. أم وحيدة، وأطفالها، استيقظت ليلا لتدمير روح عنيفة، وأن الخبراء ..', 'the-diabolical-2015', 'https://m.media-amazon.com/images/M/MV5BMzY3OTgzMTEwNl5BMl5BanBnXkFtZTgwMjIzNTQwNzE@._V1_SX300.jpg', 4.7, 'BluRay', 0, 1, 4319, '2019-04-14 14:02:00', '2019-04-14 14:03:05'),
(4318, 'مشاهدة فيلم Return to Sender 2015 مترجم', 'مشاهدة وتحميل فيلم الدراما والاثارة Return to Sender 2015 بجودة BluRay مترجم اون لاين وتحميل مباشر. ممرضة تعيش في بلدة صغيرة تذهب في موعد أعمى مع الرجل الذي ليس هو الرجل الذي تعنيه ..', 'return-to-sender-2015', 'https://m.media-amazon.com/images/M/MV5BMTkzMDU0MzYxM15BMl5BanBnXkFtZTgwNjAwNDUxNjE@._V1_SX300.jpg', 5.1, 'BluRay', 0, 1, 4322, '2019-04-14 14:02:16', '2019-04-14 14:03:02'),
(4320, 'مشاهدة فيلم Results 2015 مترجم', 'مشاهدة فيلم Results 2015 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر في إطار كوميدي، تتغير حياة مدربان شخصيان حينما يبدأ كلاهما بالتعامل مع عميل بالغ الثراء.', 'results-2015', 'https://m.media-amazon.com/images/M/MV5BMTQ4MjEzMzQ1Ml5BMl5BanBnXkFtZTgwODUyNTQzNTE@._V1_SX300.jpg', 5.4, 'BluRay', 0, 1, 4324, '2019-04-14 14:02:30', '2019-04-14 14:03:00'),
(4322, 'مشاهدة فيلم The Atticus Institute 2015 مترجم', 'مشاهدة و تحميل فيلم الرعب The Atticus Institute 2015 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة تبدأ أحداث الفيلم في خريف عام 1976، حين يتحول معمل صغير أسسه البروفيسور (هنري ويست) ليصير من مركز متخصص في الدراسات النفسية إلى المكان الرئيسي للحالة الوحيدة الموثقة من قبل الحكومة على سيطرة روح شريرة على المكان، ألا وهى الحالة الخاصة بـ(جوديث وينستيد)، وبعد أربعين عامًا من السرية المحيطة بهذا المعمل، تنكشف الأسرار أخيرًا أمام العامة.', 'the-atticus-institute-2015', 'https://m.media-amazon.com/images/M/MV5BMTY4NDI5OTI4MV5BMl5BanBnXkFtZTgwNzIyOTM4MzE@._V1_SX300.jpg', 5.5, 'BluRay', 0, 1, 4326, '2019-04-14 14:02:43', '2019-04-14 14:02:58'),
(4324, 'مشاهدة فيلم The World Made Straight 2015 مترجم', 'مشاهدة وتحميل فيلم الدراما The World Made Straight 2015 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب في مجتمع ريفي الآبالاش مسكون إرث مجزرة الحرب الأهلية، وهو رجل متمرد الشباب يكافح للهروب من العنف التي من شأنها أن تربط بينه وبين الماضي.', 'the-world-made-straight-2015', 'https://m.media-amazon.com/images/M/MV5BMTQ0MjgxMzExNl5BMl5BanBnXkFtZTgwMTkwNjI0MzE@._V1_SX300.jpg', 5.5, 'BluRay', 0, 1, 4328, '2019-04-14 14:02:55', '2019-04-14 14:02:57'),
(4333, 'مشاهدة فيلم The Core 2003 مترجم', 'مشاهدة فيلم The Core 2003 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر حين يكتشف العلماء توقف مركز الكرة الأرضية عن الدوران لسبب غير معروف، مما ينتج عن ذلك حدوث العديد من الكوراث الطبيعية، من ضرب العواصف الرعدية والزلازل قارات العالم، وتصرف الطيور بشكل وحشي، وتوقف ضربات القلب لتقتل العشرات.', 'the-core-2003', 'https://m.media-amazon.com/images/M/MV5BMTY3MTY3MzkzNl5BMl5BanBnXkFtZTYwNTAwNDk2._V1_SX300.jpg', 5.5, 'BluRay', 0, 1, 4337, '2019-04-14 14:07:06', '2019-04-14 14:13:12'),
(4334, 'مشاهدة فيلم The Last Samurai 2003 مترجم', 'مشاهدة وتحميل فيلم الاكشن والدراما The Last Samurai 2003 مترجم بجودة BluRay كامل اون لاين. يعيش الضابط (ناثان ألجرين) حياة بائسة منذ نهاية الحرب الأهلية الأمريكية. يتلقى ألجرين عرضًا مغريًا للسفر إلى اليابان والقيام بتدريب الجيش الياباني قليل الخبرة على طرق القتال الحديثة. يتعرض الجيش لهجمات متتالية من الساموراي الذين يرفضون فرض النظم الغربية على أسلوب حياتهم. تتسبب المعارك في وقوع ناثان أسيرًا في أيديهم، ويجد نفسه في ضيافة عائلة أحد الرجال الذين قتلهم طبقًا لعادات الساموراي.', 'the-last-samurai-2003', 'https://m.media-amazon.com/images/M/MV5BMzkyNzQ1Mzc0NV5BMl5BanBnXkFtZTcwODg3MzUzMw@@._V1_SX300.jpg', 7.7, 'BluRay', 0, 1, 4338, '2019-04-14 14:07:14', '2019-04-14 14:13:11'),
(4335, 'مشاهدة فيلم Sahara 2005 مترجم', 'مشاهدة وتحميل فيلم الاكشن والمغامره Sahara 2005 مترجم بجودة BluRay كامل أون لاين. يقوم المستكشف “ديرك بيت” بمغامرة العمر من أجل البحث عن سفينة حربية فقدت في الحرب الأهلية والمعروفة باسم “سفينة الموت” في صحراء غرب أفريقيا وتساعده طبيبة من الأمم المتحدة ويجري مطاردتهم من قبل دكتاتور لا يرحم.', 'sahara-2005', 'https://m.media-amazon.com/images/M/MV5BMjExOTM4NDUzNV5BMl5BanBnXkFtZTcwOTgzNzczMw@@._V1_SX300.jpg', 6, 'BluRay', 0, 1, 4339, '2019-04-14 14:07:24', '2019-04-14 14:13:10'),
(4336, 'مشاهدة فيلم The Island 2005 مترجم', 'مشاهدة وتحميل فيلم الاكشن والمغامره The Island 2005 مترجم بجودة BluRay كامل اون لاين. في عام 2019، يعيش لينكولن 6 إكو (إيوان ماكجريجور) في مكان مغلق، ويحلم مثل بقية قاطني هذا المكان بأن يتم اختيارهم للذهاب إلى “الجزيرة” التي تعد أخر مكان غير ملوث على ظهر الكوكب، لكنه يكتشف مع تطور الأحداث أنه هو وبقية القاطنين من المستنسخين الذين تم صنعهم خصيصاً من أجل تزويد الأعضاء البديلة للأثرياء، مما يدفعه للهروب من هذا المكان بصحبة رفيقته الجميلة جوردون 2 دلتا (سكارليت جوهانسون).', 'the-island-2005', 'https://m.media-amazon.com/images/M/MV5BMTAwNjk0NjM1ODReQTJeQWpwZ15BbWU3MDc1NjIxMzM@._V1_SX300.jpg', 6.9, 'BluRay', 0, 1, 4340, '2019-04-14 14:07:30', '2019-04-14 14:13:10'),
(4337, 'مشاهدة فيلم The Family Stone 2005 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والدراما The Family Stone 2005 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب ترافق سيدة أعمال محافظة وعصبية، صديقها وأسرته غريبة الأطوار للاحتفال بعيد الميلاد السنوي، ويرى أنها كالسمكة خارج الماء في طريقتها الحرة والحماسية للحياة.', 'the-family-stone-2005', 'https://m.media-amazon.com/images/M/MV5BNTkwMjM4MjMxMV5BMl5BanBnXkFtZTcwNjM1OTQzMQ@@._V1_SX300.jpg', 6.3, 'BluRay', 0, 1, 4341, '2019-04-14 14:07:38', '2019-04-14 14:13:09'),
(4338, 'مشاهدة فيلم Green Street Hooligans 2005 مترجم', 'مشاهدة وتحميل فيلم الجريمة والدراما Green Street Hooligans 2005 مترجم بجودة BluRay كامل أون لاين. طالب مطرود من جامعة هارفارد ينتقل للعيش في لندن، حيث ينظم هناك الى مجموعة متعصبة من مشجعي وست هام يونايتد.', 'green-street-hooligans-2005', 'https://m.media-amazon.com/images/M/MV5BMjExNTg3NzYwMV5BMl5BanBnXkFtZTcwMzcxMTEzMQ@@._V1_SX300.jpg', 7.5, 'BluRay', 0, 1, 4342, '2019-04-14 14:07:51', '2019-04-14 14:13:08'),
(4339, 'مشاهدة فيلم The Weather Man 2005 مترجم', 'مشاهدة فيلم The Weather Man 2005 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر تدور أحداث الفلم في إطار كوميدي درامي حول قارئ نشرة الأرصاد الجوية (ديفيد) الذي توشك حياته الزوجية على الانهيار ، فهو مهدد بالانفصال عن زوجته وأولاده ، أما على المستوى المهني فهو يحقق نجاحا كبيرا ، حتى أنه حصل على عرض أفضل للانتقال إلى (نيويورك) . هل يترك مشاكله خلفه ويسافر ؟ أم يبقى ليحافظ على أسرته ؟', 'the-weather-man-2005', 'https://m.media-amazon.com/images/M/MV5BMTQ4NzAxMTE3Ml5BMl5BanBnXkFtZTYwMDAwMjY3._V1_SX300.jpg', 6.6, 'BluRay', 0, 1, 4343, '2019-04-14 14:08:05', '2019-04-14 14:13:07'),
(4340, 'مشاهدة فيلم School of Rock 2003 مترجم', 'مشاهدة و تحميل فيلم الكوميديا والموسيقى School of Rock 2003 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة ديوي فين هو مغني وعازف غيتار يطرد من فرقته فيذهب للعمل كمدرس بديل في مدرسة إعدادية، حيث يسعى هناك لتحويل طلاب صفه الى فرقة روك.', 'school-of-rock-2003', 'https://m.media-amazon.com/images/M/MV5BMjEwOTMzNjYzMl5BMl5BanBnXkFtZTcwNjczMTQyMQ@@._V1_SX300.jpg', 7.1, 'BluRay', 0, 1, 4344, '2019-04-14 14:08:15', '2019-04-14 14:13:06'),
(4341, 'مشاهدة فيلم The League of Extraordinary Gentlemen 2003 مترجم', 'مشاهدة فيلم The League of Extraordinary Gentlemen 2003 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر يقود ألان كواتيرمين، أكبر مغامر بالعالم فريقا من الأبطال فوق العادة لم ير العالم مثيلاً لهم. يتكون الفريق الاستثنائي لكواتيرمين من كابتن نيمو, ومينا هاركر مصاصة الدماء دراكيولا, ورجل خفي هو رودني سكينر, وعميل أمريكي سري هو سويا, ودوريان جراي, د. جيكل ومستر هايد بالإضافة إلى (إم) مجند الفريق الغامض.', 'the-league-of-extraordinary-gentlemen-2003', 'https://m.media-amazon.com/images/M/MV5BZTFlOTdkMjEtNGVmMS00YTA3LThlNjQtMjAzZmFjZDAzNjllL2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 5.8, 'BluRay', 0, 1, 4345, '2019-04-14 14:08:33', '2019-04-14 14:13:05'),
