(4343, 'مشاهدة فيلم Under the Tuscan Sun 2003 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والدراما Under the Tuscan Sun 2003 بجودة BluRay مترجم اون لاين وتحميل مباشر. تعيش أستاذة الأدب والكاتبة (فرانسيس مايز) في سان فرانسيسكو، وهي تعاني في إكمال كتابها الأخير. تنقلب حياتها المستقرة رأسًا على عقب، عندما يطلب زوجها الانفصال حتى يتمكن من الزواج من المرأة التي تربطه بها علاقة سرية.', 'under-the-tuscan-sun-2003', 'https://m.media-amazon.com/images/M/MV5BOGY5ZjQ4M2ItMjQ0NC00NjY4LWIwYmEtMTIxNzFmNjA4YmJlXkEyXkFqcGdeQXVyNDk3NzU2MTQ@._V1_SX300.jpg', 6.8, 'BluRay', 0, 1, 4347, '2019-04-14 14:08:51', '2019-04-14 14:13:04'),
(4344, 'مشاهدة فيلم Wrong Turn 2003 مترجم', 'مشاهدة وتحميل فيلم الرعب Wrong Turn 2003 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب ستة أصدقاء يقومون بجولة داخل غابة بولايو فيرجينيا الغربية، لكنهم يجدوا أنفسهم محاصرون من قبل رجال مشوهين آكلي لحوم ا لبشر، ليبدأ الأصدقاء نضالهم من أجل البقاءأ منهم من يستطيع ومنهم من يكون وجبة طازجة لهولاء المسوخ.', 'wrong-turn-2003', 'https://m.media-amazon.com/images/M/MV5BMTQwMTkyMTY4M15BMl5BanBnXkFtZTYwMDc0NDE3._V1_SX300.jpg', 6.1, 'BluRay', 0, 1, 4348, '2019-04-14 14:09:00', '2019-04-14 14:13:03'),
(4345, 'مشاهدة فيلم Zathura: A Space Adventure 2005 مترجم', 'مشاهدة وتحميل فيلم الاكشن والمغامره Zathura: A Space Adventure 2005 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب تدور أحداث الفيلم حول (والتر) و(داني) الصغيران اللذان يتركهما والدهما مع شقيقتهما الكبرى (ليزا) التي تنشغل عنهما بالاستماع إلى الموسيقى. ثم يحتجز (والتر) – (داني) في قبو المنزل ويكتشف (داني) لعبة تعود للخمسينات تحمل اسم (زاسورا) ويحاول فهمها دون جدوى؛ فيستعين بشقيقه الأكبر (والتر) الذي يبعث باللعبة من أجل محاولة فهمها ثم يفاجأن بمنزلها يسبح في الفضاء الخارجي ومن حولهم النجوم.', 'zathura-a-space-adventure-2005', 'https://m.media-amazon.com/images/M/MV5BMDc1NzM1OTgtOGYxMS00ZWE1LWEzZWMtNWEyOTI2NDJjOTU2XkEyXkFqcGdeQXVyNjQzNzA2NjM@._V1_SX300.jpg', 6.2, 'BluRay', 0, 1, 4349, '2019-04-14 14:09:11', '2019-04-14 14:13:00'),
