(4350, 'مشاهدة فيلم The United States of Leland 2003 مترجم', 'مشاهدة و تحميل فيلم الدراما The United States of Leland 2003 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة أن يقوم مراهق في السادسة عشرة من عمره بتدخين سيجارته الاولى فهدا امر شبه عادي و يمكن ان يغفر له، و لكن .. ان يقوم هدا المراهق بطعن طفل معاق بسكين عدة طعنات قاتلة فهدا امر عجيب يستحق الوقوف عند مسبباته .', 'the-united-states-of-leland-2003', 'https://m.media-amazon.com/images/M/MV5BOWY0ZWQwZTUtOTE1Zi00MTAxLWJmY2QtMWI4NDQ2OTk3NmQ3XkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 7.1, 'BluRay', 0, 1, 4354, '2019-04-14 14:10:08', '2019-04-14 14:12:56'),
(4351, 'مشاهدة فيلم The Uninvited Guest 2004 مترجم', 'مشاهدة وتحميل فيلم الدراما والرعب The Uninvited Guest 2004 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب ماذا لو أدخلت غريباً لمنزلك ليستخدم الهاتف في منتصف الليل, وبينما كنت تنتظر في المطبخ, إذ به يختفي فجأة! هل خرج من المنزل؟ أم مازال مختبئاً بالداخل؟ هل زوايا المنزل الضيقة كافية ليختبىء فيها هذا الرجل الغريب؟ وهل صاحب المنزل مُحق بتهيوئاته أم أنه في طريقه للجنون؟', 'the-uninvited-guest-2004', 'https://m.media-amazon.com/images/M/MV5BMjRkNjFhZTgtMGMyZi00NzAwLTkxNDUtYThjOTQxMjQxNmY2XkEyXkFqcGdeQXVyNDE5MTU2MDE@._V1_SX300.jpg', 6.8, 'BluRay', 0, 1, 4355, '2019-04-14 14:10:20', '2019-04-14 14:12:55'),
(4352, 'مشاهدة فيلم The Rundown 2003 مترجم', 'مشاهدة فيلم The Rundown 2003 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر يريد (بيك) أن يترك عمله كصائد للجوائز، لكي يبدأ حياة هادئة، ولكن يتوجب عليه أولًا أن ينفذ عملية أخيرة. المهمة هي أن يتعقب (ترافيس) الذي ذهب إلى غابات الأمازون بالبرازيل للبحث عن كنز قديم؛ تقول الأساطير إنه موجود داخل الغابات.', 'the-rundown-2003', 'https://m.media-amazon.com/images/M/MV5BMWU3ZDYxZjMtZmYyOS00NWQyLTk1MmItNDg4ZWM2ZGQxOTNiXkEyXkFqcGdeQXVyMTMxMTY0OTQ@._V1_SX300.jpg', 6.7, 'BluRay', 0, 1, 4356, '2019-04-14 14:10:38', '2019-04-14 14:12:54'),
(4353, 'مشاهدة فيلم The Haunted Mansion 2003 مترجم', 'مشاهدة فيلم The Haunted Mansion 2003 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر يتلقى سمسار العقارات جيم إيفرز وزوجته وشريكته بالعمل سارة مكالمةً متأخرةً من صاحب أحد القصور ويُدعى إدوارد جرايسي، يرغب الرجل في بيع القصر الذي يملكه. يشعر جيم وسارة أن هذه فرصة ذهبية، يذهب الاثنان بصحبة طفليهما إلى القصر المنعزل الغامض.', 'the-haunted-mansion-2003', 'https://m.media-amazon.com/images/M/MV5BMTA3NDUwNzAxNzZeQTJeQWpwZ15BbWU3MDQyMTUwMDE@._V1_SX300.jpg', 5, 'BluRay', 0, 1, 4357, '2019-04-14 14:10:51', '2019-04-14 14:12:53'),
(4354, 'مشاهدة فيلم Surviving Christmas 2004 مترجم', 'مشاهدة فيلم Surviving Christmas 2004 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر ', 'surviving-christmas-2004', 'https://m.media-amazon.com/images/M/MV5BMTcwMTI4MTY3Ml5BMl5BanBnXkFtZTcwOTUzMjcyMQ@@._V1_SX300.jpg', 5.4, 'BluRay', 0, 1, 4358, '2019-04-14 14:11:00', '2019-04-14 14:12:52'),
(4355, 'مشاهدة فيلم Stuck on You 2003 مترجم', 'مشاهدة وتحميل فيلم الكوميديا Stuck on You 2003 مترجم بجودة BluRay كامل اون لاين. يعيش التوأم الملتصق “بوب ووالت” في بلدة هادئة، ويتميزان في مختلف الألعاب الرياضية. يفخر الاثنان بامتلاكهما لمطعم وجبات سريعة؛ حيث يعملان فيه بمهارة غير عادية مستفيدين من جسدهما الملتصق وحركتهما السريعة. يشعر والت برغبة كبيرة في خوض تجربة التمثيل، فيقنع شقيقه بوب بمساعدته على خوض تلك المغامرة.', 'stuck-on-you-2003', 'https://m.media-amazon.com/images/M/MV5BMTYwODE1MTc3NF5BMl5BanBnXkFtZTcwMjQxMzQyMQ@@._V1_SX300.jpg', 5.8, 'BluRay', 0, 1, 4359, '2019-04-14 14:11:11', '2019-04-14 14:12:51'),
(4356, 'مشاهدة فيلم Starsky Hutch 2004 مترجم', 'مشاهدة فيلم Starsky Hutch 2004 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر يخفق اثنين من رجال الشرطة في الامساك بالمجرمين في سيارة فورد حمراء وبيضاء وذلك بمساعدة شرطي فاسد “هجي بير”.', 'starsky-hutch-2004', 'https://m.media-amazon.com/images/M/MV5BMzU2NTQ1NTkxOV5BMl5BanBnXkFtZTcwNTE1MTEzMw@@._V1_SX300.jpg', 6.1, 'BluRay', 0, 1, 4360, '2019-04-14 14:11:20', '2019-04-14 14:12:50'),
(4357, 'مشاهدة فيلم Kinky Boots 2005 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والدراما Kinky Boots 2005 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب هناك ملكة السحب تأتي لإنقاذ رجل الذي، بعد وراثة مصنع الأحذية والده، يحتاج إلى تنويع منتجه إذا كان يريد للحفاظ على الأعمال واقفا على قدميه.', 'kinky-boots-2005', 'https://m.media-amazon.com/images/M/MV5BMTY5OTg0NDEyNV5BMl5BanBnXkFtZTcwNDQwOTMzMQ@@._V1_SX300.jpg', 7.1, 'BluRay', 0, 1, 4361, '2019-04-14 14:11:30', '2019-04-14 14:12:49'),
(4359, 'مشاهدة فيلم Runaway Jury 2003 مترجم', 'مشاهدة فيلم الجريمة والدراما Runaway Jury 2003 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. تقوم أرملة شابة برفع قضية على أحد مصانع تصنيع السلاح بعد وفاة زوجها في حادث إطلاق نار في ولاية نيو أورليانز الجنوبية، وتطالب بتعويض قيمته ملايين الدولارات؛ مما قد يتسبب في توريط أناس أثرياء، تلجأ إلى المحامي البارع (ويندال روهر) المقتنع بقضيتها، وتحاول إقناع (نيك إيستر) عضو هيئة المحلفين في أن يقوم بإقناع بقية المحلفين في الوقوف في صفها، ولو بدفع رشوة مالية كبيرة. فهل ستنجح في مسعاها؟', 'runaway-jury-2003', 'https://m.media-amazon.com/images/M/MV5BOTcwMmE5YWItNDkzMi00Yjk2LTk5ZjItMmY5ZDhhNWE0ZWRmXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 7.1, 'BluRay', 0, 1, 4363, '2019-04-14 14:11:43', '2019-04-14 14:12:47'),
(4360, 'مشاهدة فيلم Out of Time 2003 مترجم', 'مشاهدة وتحميل فيلم الاكشن والجريمة Out of Time 2003 مترجم بجودة BluRay كامل اون لاين. (مات وايتلوك) قائد الشرطة في مدينة بنايين كي؛ إحدى المدن الصغيرة بالقرب من ولاية فلوريدا، منفصل عن زوجته (اليكس) المحققة بشرطة ولاية فلوريدا. (مات) على علاقة بـ (آن) المصابة بالسرطان المنفصلة عن زوجها (كريس). حينما يخبرها الطبيب عن وجود علاج لحالتها، لكنه مكلف جدا…', 'out-of-time-2003', 'https://m.media-amazon.com/images/M/MV5BMjAxMTMzNTI5Ml5BMl5BanBnXkFtZTcwNDAwMTQ2NA@@._V1_SX300.jpg', 6.5, 'BluRay', 0, 1, 4364, '2019-04-14 14:11:48', '2019-04-14 14:12:47'),
(4362, 'مشاهدة فيلم Election 1999 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والدراما Election 1999 مترجم بجودة BluRay كامل اون لاين. يبدو أن (تريسي فليك) الطالبة المتميزة في المدرسة الثانوية ستفوز بالانتخابات الطلابية دون أي منافسة كالمعتاد، لكن المعلم (جيم ماكليستر) له خطة مختلفة فهو يحمل الكثير من الغضب تجاه (تريسي)، ويتمنى ألا تفوز؛ لذا فهو يقنع (بول ميتزلر) لاعب كرة القدم الأمريكية ذا الشعبية، أن يدخل المنافسة ضد (تريسي)؛ مما يثير الفوضى في المدرسة.', 'election-1999', 'https://m.media-amazon.com/images/M/MV5BYjViYWQ4NjAtZmUzNy00Nzg5LWJkMzctMTgwOTRhNjdjYWI3XkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 7.3, 'BluRay', 0, 1, 4366, '2019-04-14 14:11:54', '2019-04-14 14:12:45'),
(4365, 'فيلم Maria Sharapova: The Point 2017 مترجم اون لاين', 'مشاهدة وتحميل فيلم الوثائقي والسيرة الذاتية Maria Sharapova: The Point 2017 بجودة WEB-DL مترجم اون لاين وتحميل مباشر.', 'maria-sharapova-the-point-2017', 'https://m.media-amazon.com/images/M/MV5BMGM0NjBlZjktODM3My00YTkyLThjOTYtYjQzZDdjYjBjNDkxXkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg', 5.7, 'WEB-DL', 0, 1, 4369, '2019-04-14 14:12:10', '2019-04-14 14:12:43'),
(4366, 'مشاهدة فيلم Jingle All the Way 2 2014 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والعائلي Jingle All the Way 2 2014 بجودة BluRay مترجم اون لاين وتحميل مباشر. تدور أحداث الفيلم في اطار كوميدى حول ابنه لارى التي تريد دب في أعياد الميلاد، يتنافس الآباء في الحصول على هدية رائعة ليكون كل منهم أفضل أب وجعل عيد الميلاد أفضل من اي وقت مضى، ويبحث لارى على هدية مثالية وهي (الدب) لابنته البالغة من العمر ثماني سنوات وتتوالى الأحداث، ويسعى لارى لجعل ابنته سعيدة في أعياد الميلاد.', 'jingle-all-the-way-2-2014', 'https://m.media-amazon.com/images/M/MV5BMmJlYzViNzctMjQ1Ni00ZWQ4LThkN2YtMzI2ZGU5Nzk0NTAyXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 5.6, 'BluRay', 0, 1, 4370, '2019-04-14 14:12:11', '2019-04-14 14:12:43'),
(4367, 'مشاهدة فيلم Marvellous 2014 مترجم', 'مشاهدة فيلم الدراما Marvellous 2014 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. فيلم وثائقي يحكي قصة “نيل بلدوين” الذي ولد بعد الحرب العالمية الثانية ويعاني من صعوبة في التعلم، ولكنه محب للحياة. يترك “نيل” العمل في الجزارة بتشجيع من والدته لكي يعمل كمهرج بالسيرك وأطلق عليه اسم “نيلو”.', 'marvellous-2014', 'https://m.media-amazon.com/images/M/MV5BMTQzMjg2Njg4OF5BMl5BanBnXkFtZTgwMTcwMTk3MjE@._V1_SX300.jpg', 7.9, 'BluRay', 0, 1, 4371, '2019-04-14 14:12:21', '2019-04-14 14:12:42'),
(4369, 'مشاهدة فيلم Menace II Society 1993 مترجم', 'مشاهدة فيلم الجريمة والدراما Menace II Society 1993 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. في حي واتس بمدينة لوس أنجلوس، كاين هو شاب يبلغ من العمر عام ويعمل في تجارة المخدرات وسرقة السيارات على الرغم من عيشه في منزل جديه المتدينان.', 'menace-ii-society-1993', 'https://m.media-amazon.com/images/M/MV5BNTFlMDg2MGEtODk2My00MGNhLThkMDAtY2Y5OWNlM2FkNjQ1XkEyXkFqcGdeQXVyNTI4MjkwNjA@._V1_SX300.jpg', 7.5, 'BluRay', 0, 1, 4373, '2019-04-14 14:12:39', '2019-04-14 14:12:40'),
(4370, 'فيلم Lara Croft: Tomb Raider 2001 مترجم اون لاين', 'مشاهدة فيلم Lara Croft: Tomb Raider 2001 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر', 'lara-croft-tomb-raider-2001', 'https://m.media-amazon.com/images/M/MV5BNzMzODVjMWUtYmIxZS00NDlkLTlmNTktNjI5NTdhZjUzYzY1XkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 5.8, 'BluRay', 0, 1, 4374, '2019-04-14 14:12:45', '2019-04-14 14:23:45'),
(4371, 'فيلم The Assassin’s Code 2018 مترجم اون لاين', 'مشاهدة وتحميل فيلم الاثارة The Assassin’s Code 2018 بجودة HC HDRip مترجم اون لاين وتحميل مباشر.', 'the-assassins-code-2018', 'uploads/6235863291.jpg', NULL, 'HDRip', 0, 1, 4375, '2019-04-14 14:12:59', '2019-04-14 14:23:44'),
(4377, 'فيلم A Quiet Place 2018 مترجم اون لاين', 'مشاهدة فيلم A Quiet Place 2018 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر', 'a-quiet-place-2018', 'https://m.media-amazon.com/images/M/MV5BMjI0MDMzNTQ0M15BMl5BanBnXkFtZTgwMTM5NzM3NDM@._V1_SX300.jpg', 7.6, 'WEB-DL', 0, 1, 4381, '2019-04-14 14:15:58', '2019-04-14 14:23:37'),
(4381, 'مشاهدة فيلم The Virgin Suicides 1999 مترجم', 'مشاهدة و تحميل فيلم الدراما والرومانسية The Virgin Suicides 1999 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة في إطار تشويقي مثير، تدور الأحداث حول مجموعة من الأصدقاء يعيشون في أحد الضواحي في الريف الأمريكي في السبعينيات، يثير انتباههم عائلة أمريكية تحيا بها خمس من الفتيات الجميلات، يعشن عيشة صعبة في بيئة بها الكثير من القيود، والغموض، مما يثير فضولهم، ويدفعهم لمحاولة كشف السر وراء تلك الفتيات.', 'the-virgin-suicides-1999', 'https://m.media-amazon.com/images/M/MV5BNTMyMjI3MmItODIzNS00OWNiLWE5NTQtYmNhNGNlOTYyYWExXkEyXkFqcGdeQXVyMTA0MjU0Ng@@._V1_SX300.jpg', 7.2, 'BluRay', 0, 1, 4385, '2019-04-14 14:16:42', '2019-04-14 14:23:32'),
(4382, 'مشاهدة فيلم 21 Grams 2003 مترجم', 'مشاهدة فيلم 21 Grams 2003 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر (بول ريفرز) عالم رياضيات يعاني من مرض في القلب، ويحتاج إلي نقل قلب جديد ويرى الأطباء أن أمامه شهرا واحدا فقط ويموت، في الوقت نفسه التي تعاني فيه (كريستينا بيك) من إدمانها للمخدرات، إلا أنها تتمكن من التغلب على إدمانها لتعود إلى حياتها الطبيعية مع أطفالها وزوجها، ولكنها ما تلبث أن تتعرض لصدمة كبيرة عندما يقتل زوجها وأطفالها من قبل (جاك جوردون)…', '21-grams-2003', 'https://m.media-amazon.com/images/M/MV5BMjA4MjI2OTM5N15BMl5BanBnXkFtZTcwNDA1NjUzMw@@._V1_SX300.jpg', 7.7, 'BluRay', 0, 1, 4386, '2019-04-14 14:16:44', '2019-04-14 14:23:32'),
(4383, 'فيلم Mr. Right 2015 مترجم اون لاين', 'مشاهدة وتحميل فيلم الاكشن والكوميديا Mr. Right 2015 مترجم بجودة BluRay كامل اون لاين.', 'mr-right-2015', 'uploads/16512045534.jpg', 0, 'BluRay', 0, 1, 4387, '2019-04-14 14:16:57', '2019-04-14 14:23:30'),
(4384, 'مشاهدة فيلم House of Sand and Fog 2003 مترجم', 'مشاهدة وتحميل فيلم الجريمة والدراما House of Sand and Fog 2003 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب يتم طرد زوجة مهجورة من بيتها ويبدأ الصراع المأساوي مع أصحاب منزلها الجدد.', 'house-of-sand-and-fog-2003', 'https://m.media-amazon.com/images/M/MV5BMTIzMjQ5NzM2M15BMl5BanBnXkFtZTYwMzU2NDY3._V1_SX300.jpg', 7.6, 'BluRay', 0, 1, 4388, '2019-04-14 14:17:00', '2019-04-14 14:23:27'),
(4385, 'مشاهدة فيلم Identity 2003 مترجم', 'مشاهدة وتحميل فيلم الغموض والاثارة Identity 2003 مترجم بجودة BluRay كامل أون لاين. بعد أن تقطعت بهم السبل في فندق مهجور في نيفادا خلال عاصفة مطرية سيئة ، يتعرف عشرة غرباء على بعضهم البعض عندما يدركون أنه يتم قتلهم واحدا تلو الآخر.', 'identity-2003', 'https://m.media-amazon.com/images/M/MV5BMjE2NzgyNDYzNl5BMl5BanBnXkFtZTYwODM2Nzc2._V1_SX300.jpg', 7.3, 'BluRay', 0, 1, 4389, '2019-04-14 14:17:20', '2019-04-14 14:23:26'),
(4386, 'فيلم Mythica: The Darkspore 2015 مترجم اون لاين', 'مشاهدة و تحميل فيلم الاكشن والمغامره Mythica: The Darkspore 2015 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين…', 'mythica-the-darkspore-2015', 'https://m.media-amazon.com/images/M/MV5BMTQ1NDI0Nzg4MF5BMl5BanBnXkFtZTgwMTc4ODA2NTE@._V1_SX300.jpg', 5.7, 'BluRay', 0, 1, 4390, '2019-04-14 14:17:23', '2019-04-14 14:23:25'),
(4387, 'مشاهدة فيلم Looney Tunes: Back in Action 2003 مترجم', 'مشاهدة و تحميل فيلم الانيميشن والاكشن Looney Tunes: Back in Action 2003 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة تدور أحداث فيلم الرسوم المتحركة هذا في قالب عائلي يحمل العديد من المغامرات الشيقة. يغار (دافي داك) من نجاح (باجز باني) في هوليوود، ويقوم (باجز باني) بطلب علاوة، ولكن الموظفة المستاءة (كيت) تقوم بفصله وطرده خارج الاستديو. في الوقت ذاته يبحث (دريك)؛ الذي يعمل كمخاطر عن أبيه المفقود في لاس فيجاس. ينضم (دافي) إلى (دريك) ثم تلحق بهما (كيت) ومعها (باجز باني)، ويخوضون سويًا مغامرة مثيرة في مواجهة الأشرار.', 'looney-tunes-back-in-action-2003', 'https://m.media-amazon.com/images/M/MV5BMTkxNDk5MDQ2MF5BMl5BanBnXkFtZTYwMTA0Nzc2._V1_SX300.jpg', 5.7, 'BluRay', 0, 1, 4391, '2019-04-14 14:17:32', '2019-04-14 14:23:25'),
(4389, 'مشاهدة فيلم Lost in Translation 2003 مترجم', 'مشاهدة وتحميل فيلم الدراما Lost in Translation 2003 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب نجمة سينمائية تشعر بالفراغ ، يلتقي مع غريبة مهملة في طوكيو ، وتتشكل علاقة غير مرجحة.', 'lost-in-translation-2003', 'https://m.media-amazon.com/images/M/MV5BMTI2NDI5ODk4N15BMl5BanBnXkFtZTYwMTI3NTE3._V1_SX300.jpg', 7.8, 'BluRay', 0, 1, 4393, '2019-04-14 14:17:48', '2019-04-14 14:23:23'),
(4391, 'مشاهدة فيلم Master and Commander: The Far Side of the World 2003 مترجم', 'مشاهدة فيلم الاكشن والمغامره Master and Commander: The Far Side of the World 2003 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. خلال حروب نابليون كان لاكي جاك آوبري يرأس طاقم إحدى سفن صاحبة الجلالة. وعندما تتم مهاجمة السفينة من عدو قوي، تتعرض لأضرار بالغة ويصاب الكثير من أفراد طاقمها. وفي خطوة جريئة وخطيرة يقرر آوبري أن يبحر في مطاردة تحفها المخاطر عبر محيطين ليطارد أعداءه ويقبض عليهم. إنها مهمة تقرر مصير أمة أو تقضي على “لاكي جاك” وطاقمه.', 'master-and-commander-the-far-side-of-the-world-2003', 'https://m.media-amazon.com/images/M/MV5BMjA5NjYyMDM5NV5BMl5BanBnXkFtZTYwOTU5MDY2._V1_SX300.jpg', 7.4, 'BluRay', 0, 1, 4395, '2019-04-14 14:18:08', '2019-04-14 14:23:21'),
(4392, 'فيلم Mercenary: Absolution 2015 مترجم اون لاين', 'مشاهدة فيلم Mercenary: Absolution 2015 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر', 'mercenary-absolution-2015', 'https://m.media-amazon.com/images/M/MV5BMTY2NjY0NzYzOF5BMl5BanBnXkFtZTgwMDM2MzI4NDE@._V1_SX300.jpg', 4.5, 'BluRay', 0, 1, 4396, '2019-04-14 14:18:15', '2019-04-14 14:23:20'),
(4393, 'مشاهدة فيلم My Bosss Daughter 2003 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والرومانسية My Bosss Daughter 2003 مترجم بجودة BluRay كامل اون لاين. يوافق شاب على العمل لرئيسه في المنزل، ويعتقد انها سوف تكون فرصة مثالية ليكون على مقربة من المرأة التى هو مبهور بجمالها “ابنة رئيسه”. لكن هناك من يعتزم منعه من مهمته. بالإضافة الى ذلك عليه التعامل مع ابنة أخيه الأكبر، التي تهرب من تجار مخدرات محليين.', 'my-bosss-daughter-2003', 'uploads/7296588761.jpg', NULL, 'BluRay', 0, 1, 4397, '2019-04-14 14:18:20', '2019-04-14 14:23:19'),
(4394, 'مشاهدة فيلم National Security 2003 مترجم', 'مشاهدة وتحميل فيلم الاكشن والكوميديا National Security 2003 مترجم بجودة BluRay كامل اون لاين. تدور قصة الفيلم حول حارسي الأمن (إيرل) و(هانك) اللذان رفضتهما دائرة شرطة لوس أنجلوس. فأحدهما طرد من الخدمة، والآخر لم يتمكن من الالتحاق بها منذ البداية. وذات يوم تمكنا من كشف النقاب عن عملية تهريب كبيرة يقودها (ناش) وعصابته من المجرمين. وعندما حصلا على بعض البضائع المهربة، توجب عليهما الهروب من عصابة ناش وكذلك دائرة شرطة لوس أنجلوس. ترى ما هو مصيرهما؟', 'national-security-2003', 'https://m.media-amazon.com/images/M/MV5BOTgzZDQzNTQtY2NmMC00YTM1LWEwYmEtZGIwNmJmOTdiOTZlXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 5.6, 'BluRay', 0, 1, 4398, '2019-04-14 14:18:31', '2019-04-14 14:23:19'),
(4395, 'فيلم Mission: Impossible – Rogue Nation 2015 مترجم اون لاين', 'مشاهدة فيلم الاكشن والمغامره Mission: Impossible – Rogue Nation 2015 مترجم بجودة BluRay مشاهدة مباشرة اون لاين.', 'mission-impossible-rogue-nation-2015', 'https://m.media-amazon.com/images/M/MV5BOTFmNDA3ZjMtN2Y0MC00NDYyLWFlY2UtNTQ4OTQxMmY1NmVjXkEyXkFqcGdeQXVyNTg4NDQ4NDY@._V1_SX300.jpg', 7.4, 'BluRay', 0, 1, 4399, '2019-04-14 14:18:39', '2019-04-14 14:23:18');
INSERT INTO `movies` (`id`, `name`, `description`, `slug`, `image_url`, `ratings`, `quality`, `views`, `category_id`, `server_links`, `created_at`, `updated_at`) VALUES
(4396, 'مشاهدة فيلم Open Range 2003 مترجم', 'مشاهدة وتحميل فيلم الاكشن والدراما Open Range 2003 مترجم بجودة BluRay كامل أون لاين. في إطار درامي مشوق تدور الأحداث حول الرئيس (سبيرمان) ، (تشارلي وايت) ، (موس هاريسون) ، و(زر) ، الذين يقومون برعي ماشيتهم عبر البراري الواسعة ، وبعيدا عن عالم الحضارة ، يتقاسمون الصداقة فيما بينهم ، ولكن فجأة يجدون أنفسهم في مأزق من أجل الدفاع عن ماشيتهم ، ومصدر رزقهم ، وقيمهم ، وذلك عندما يحاول أحدهم الاستيلاء على ماشيتهم في بلدة بالقرب منهم .', 'open-range-2003', 'https://m.media-amazon.com/images/M/MV5BMTYyNjA4NTY3N15BMl5BanBnXkFtZTYwNjc0MDM3._V1_SX300.jpg', 7.5, 'BluRay', 0, 1, 4400, '2019-04-14 14:18:44', '2019-04-14 14:23:18'),
(4398, 'مشاهدة فيلم Bad Santa 2003 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والجريمة Bad Santa 2003 مترجم بجودة BluRay كامل أون لاين. تدور أحداث الفيلم حول رجل سكير يدعى (بيلي)، وقزم شرير يدعى (ماركوس)، واللذين يقومان كل عام في موسم أعياد الكريسماس بارتداء ملابس (سانتا كلوز) للاحتيال على المحلات التجارية، وسرقتها أثناء زحام المتسوقين في موسم الأعياد والإجازات، ولكن أثناء استعدادهما لتنفيذ خطتهما السنوية للسرقة..', 'bad-santa-2003', 'https://m.media-amazon.com/images/M/MV5BMjA4Njg1MDcwN15BMl5BanBnXkFtZTYwMzAxNjM3._V1_SX300.jpg', 7.1, 'BluRay', 0, 1, 4402, '2019-04-14 14:18:58', '2019-04-14 14:23:16'),
(4400, 'مشاهدة فيلم Basic 2003 مترجم', 'مشاهدة فيلم Basic 2003 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر تدور أحداث الفيلم حول ضابط الجيش السابق توم هاردي الذي يلجأ له صديقه الكولونيل لمساعدته في كشف غموض قتل أحد ضباط القوات الخاصة لزملائه اثناء عملية سرية بالادغال إلا أن الضابطة أوسبورن ترفض في بدء الامر مشاركة توم لما يحوم حوله من اشتباهات لقبوله رشاوى من تجار المخدرات المحللين إلى أن يتمكن توم من اثبات جدارته وحل اللغز', 'basic-2003', 'https://m.media-amazon.com/images/M/MV5BOGFjMTZmMWYtOGRlNS00YWU5LWI4MjMtY2QzZDk4YzY4OWRmXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 6.5, 'BluRay', 0, 1, 4404, '2019-04-14 14:19:13', '2019-04-14 14:23:14'),
(4402, 'مشاهدة فيلم Bruce Almighty 2003 مترجم', 'مشاهدة فيلم الكوميديا والدراما Bruce Almighty 2003 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. (بروس) هو مراسل قناة تلفزيونية، يتعرض لكثير من المتاعب نتيجة تجاوزه الخطوط الحمراء في تغطياته التلفزيونية، ولايحالفه التوفيق في حياته. وفي لحظة من لحظات اليأس يقوم بتوجيه كلام قاس للخالق، ويعلن كفره.', 'bruce-almighty-2003', 'https://m.media-amazon.com/images/M/MV5BNzMyZDhiZDUtYWUyMi00ZDQxLWE4NDQtMWFlMjI1YjVjMjZiXkEyXkFqcGdeQXVyNjU0OTQ0OTY@._V1_SX300.jpg', 6.7, 'BluRay', 0, 1, 4406, '2019-04-14 14:19:27', '2019-04-14 14:23:13'),
(4403, 'مشاهدة فيلم Cold Mountain 2003 مترجم', 'مشاهدة و تحميل فيلم المغامره والدراما Cold Mountain 2003 مترجم اون لاين جودة DVDRip وتحميل مباشر مشاهدة اون لاين مباشرة يتعرف إنمان (جود لو) على إيدا (نيكول كيدمان) في مقاطعة كولد ماونتن، ويقعان في حب بعضهما البعض، ولكن سرعان ما يُجند إنمان في الجيش ببسب نشوب الحرب الأهلية الأمريكية.', 'cold-mountain-2003', 'https://m.media-amazon.com/images/M/MV5BMTY3NTc5NzcyOF5BMl5BanBnXkFtZTcwMDM0NjQyMQ@@._V1_SX300.jpg', 7.2, 'DVDRip', 0, 1, 4407, '2019-04-14 14:19:30', '2019-04-14 14:23:12'),
(4404, 'فيلم Kung Fu Traveler 2017 مترجم اون لاين', 'مشاهدة و تحميل فيلم الاكشن والخيال العلمي Kung Fu Traveler 2017 مترجم اون لاين جودة WEB-DL وتحميل مباشر مشاهدة اون…', 'kung-fu-traveler-2017', 'https://m.media-amazon.com/images/M/MV5BNTExZmE1YTEtZjA2OC00NDM3LWFlODMtZjU4NjFiMzdhZjY1XkEyXkFqcGdeQXVyMzc0MDcxMA@@._V1_SX300.jpg', 5.6, 'WEB-DL', 0, 1, 4408, '2019-04-14 14:19:38', '2019-04-14 14:23:11'),
(4405, 'مشاهدة فيلم Daddy Day Care 2003 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والعائلي Daddy Day Care 2003 مترجم بجودة BluRay كامل أون لاين. يتم فصل (تشارلي) و(فيل) من عملهما بشركة الأغذية عقب الإخفاق في إحدى الحملات الإعلانية، ويؤدي ذلك إلى حرمان ابنيهما من الذهاب إلى أكاديمية تشابمان الباهظة. يتخبط تشارلي بحثًا عن وظيفة، ويقوم في الوقت ذاته برعاية ابنه (بن) ذي الأربع سنوات خلال النهار في أثناء خروج زوجته (كيم) للعمل.', 'daddy-day-care-2003', 'https://m.media-amazon.com/images/M/MV5BNTZiYjEzY2UtMzA2OC00NjM1LWFlMjItMzg4MTAwOTU2YzYxXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 5.6, 'BluRay', 0, 1, 4409, '2019-04-14 14:19:43', '2019-04-14 14:23:11'),
(4406, 'مشاهدة فيلم Dodgeball: A True Underdog Story 2004 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والرياضي Dodgeball: A True Underdog Story 2004 مترجم بجودة BluRay كامل أون لاين. تدور أحداث الفيلم حول وايت جودمان (بين ستيلر) الذي يملك صالة جيمينزيوم ويتوق بشدة لكي يستحوذ على صالة الجيمينزيوم التي يملكها بيتر لافلور والذي لا يرغب في التنازل عنها لجودمان ، لكنه لا يستطيع جمع المال اللازم والذي يقدر بخمسين ألف دولار، لذا يقوم بتشكيل فريق رياضي سعيًا للفوز في مباراة كروية تقام بين فريقه وبين فريق جودمان.', 'dodgeball-a-true-underdog-story-2004', 'https://m.media-amazon.com/images/M/MV5BMTIwMzE2MjM4MV5BMl5BanBnXkFtZTYwNjA1OTY3._V1_SX300.jpg', 6.7, 'BluRay', 0, 1, 4410, '2019-04-14 14:19:44', '2019-04-14 14:23:10'),
(4408, 'مشاهدة فيلم Backstabbing for Beginners 2018 مترجم', 'مشاهدة فيلم الدراما والتاريخي Backstabbing for Beginners 2018 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. (مايكل) شاب يافع مثالي يتولى وظيفة أحلامه في (الأمم المتحدة)، وسرعان ما يجد نفسه في مركز برامج الوقود مقابل الغذاء، ثم يبدأ في لملمة خيوط المجال من باشا (بن كينجسلي)، الدبلوماسي المحنك المغرور.. وبعد مقتل مسئول الأمم المتحدة في (العراق)، يحتاج باشا إلى وجه جديد من أجل تقديم تقرير – حول نجاح برنامج الوقود مقابل الغذاء – لمجلس الأمم المتحدة', 'backstabbing-for-beginners-2018', 'https://m.media-amazon.com/images/M/MV5BZGEyYjlhNTktZDU5NC00OTFkLTk5M2UtNWFlNDM0ZTY2YzZiXkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg', 6.2, 'BluRay', 0, 1, 4412, '2019-04-14 14:19:52', '2019-04-14 14:23:08'),
(4410, 'مشاهدة فيلم A Madea Christmas 2013 مترجم', 'مشاهدة فيلم الكوميديا والدراما A Madea Christmas 2013 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. بروح عيد الميلاد المعهودة يرصد الفيلم حياة الجدة ماديا (تايلر بيري)، ماديا تجد نفسها ملزمة بمساعدة قريبتها إيلين (أنا ماريا هورسفورد) بعد أن تقنعها بمساعدتها في ترتيب زيارة مفاجئة للمدينة من أجل ابنتها لاسي (تيكا سومبتر). تتعقد الأحداث فور وصول الجدة ماديا حيث يوجد هنالك أسرار يتم الكشف عنها تصعق الجميع ،من جانبٍ آخر العلاقات القديمة يتم وضعها تحت المجهر ويتم اختبارها ولكن كل هذا ممزوجٌ بروح عيد الميلاد.', 'a-madea-christmas-2013', 'https://m.media-amazon.com/images/M/MV5BMjIwNjA3OTM4NF5BMl5BanBnXkFtZTgwOTA0MjM2MDE@._V1_SX300.jpg', 4.9, 'BluRay', 0, 1, 4414, '2019-04-14 14:20:03', '2019-04-14 14:23:05'),
(4412, 'مشاهدة فيلم War Story 2014 مترجم', 'مشاهدة فيلم الدراما War Story 2014 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. يحكي هذا الفيلم عن “لي”، سيدة أمريكية يبدو عليها الإرهاق تصل إلى مدينة إيطالية، لكن شجارها مع طاقم العمل بالفندق وتدخينها المتواصل، وعدم اكتراثها برنات الهاتف المتتالية، يكشف حقيقتها المتقلبة التي تتخفى وراء مظهرها، وبين نومها الخفيف المتقطع، تتجول في الشوارع وتلتقط صورا للمتشردين كما لو كانت آلة التصوير التي تحملها سلاح وغصن زيتون، وبينما تكافح من أجل مواجهة شياطينها، تُقرر أن تُساعد شابة في حاجة إليها.', 'war-story-2014', 'https://m.media-amazon.com/images/M/MV5BMjE5MTU2MDcxMl5BMl5BanBnXkFtZTgwNDczMTg5MDE@._V1_SX300.jpg', 3.9, 'BluRay', 0, 1, 4416, '2019-04-14 14:20:38', '2019-04-14 14:23:04'),
(4413, 'مشاهدة فيلم Best of the Best 4: Without Warning 1998 مترجم', 'مشاهدة وتحميل فيلم الاكشن والمغامره Best of the Best 4: Without Warning 1998 مترجم بجودة BluRay كامل أون لاين. قامت مجموعة من العصابات الروسية بسرقة كمية ضخمة من الورق لطباعة العملة الأمريكية ، وهي الآن تغرق السوق بفواتير مجزية. عندما تقرر واحدة من الغوغاء إعطاء …', 'best-of-the-best-4-without-warning-1998', 'uploads/191950645725.jpg', NULL, 'BluRay', 0, 1, 4417, '2019-04-14 14:20:55', '2019-04-14 14:23:02'),
(4415, 'مشاهدة فيلم Star Trek: Insurrection 1998 مترجم', 'مشاهدة فيلم الاكشن والمغامره Star Trek: Insurrection 1998 مترجم بجودة BrRip مشاهدة مباشرة اون لاين. إطار الخيال العلمي يغلب على طابع الفيلم في محاولة للاستيلاء ع كوكب يطلق عليه ماجيك فيتولى الكابتن بيكار مهمة الدفاع عن الكوكب برفقة طاقم سفينته', 'star-trek-insurrection-1998', 'https://m.media-amazon.com/images/M/MV5BNWEzZDI0NjEtY2FkMC00ZjQwLWI2YzgtZDEyMzMwZmRlZDlhXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 6.4, '0', 0, 1, 4419, '2019-04-14 14:21:14', '2019-04-14 14:23:00'),
(4418, 'مشاهدة فيلم Lethal Weapon 4 1998 مترجم', 'مشاهدة وتحميل فيلم الاكشن والجريمة Lethal Weapon 4 1998 بجودة bluray مترجم كامل اون لاين مشاهدة مباشرة يوتيوب تدور أحداث الفيلم حول الضابط مارتن ريجز وصديقه الشرطي روجر اللذان يتوليان التحقيق في جريمة القاتلة الصينية و محاولتها لإخراج شقيقها من السجن', 'lethal-weapon-4-1998', 'https://m.media-amazon.com/images/M/MV5BZTllNWNlZjctMWQwMS00ZDc3LTg5ZjMtNzhmNzhjMmVhYTFlXkEyXkFqcGdeQXVyNTc1NTQxODI@._V1_SX300.jpg', 7.6, 'bluray', 0, 1, 4422, '2019-04-14 14:21:24', '2019-04-14 14:22:58'),
(4419, 'مشاهدة فيلم Time Will Tell 2018 مترجم', 'مشاهدة فيلم Time Will Tell 2018 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر كيم تيمبل المراهقة المتمردة لديها مشاعر غريبة تجعلها تشعر بعدم الامان المواقف الموترة تجعلها تفقد الوعي. ويزداد التوتر منذ اقتراب موعد اطلاق سراح والدها الذي تخافه بشدة من السجن.', 'time-will-tell-2018', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTkzMzA0MzExMl5BMl5BanBnXkFtZTcwNzA3MjAyMQ@@._V1_SX300.jpg', 8, 'WEB-DL', 0, 1, 4423, '2019-04-14 14:21:27', '2019-04-14 14:22:57'),
