(4423, 'مشاهدة فيلم How to Steal a Dog 2014 مترجم', 'مشاهدة وتحميل فيلم الجريمة والدراما How to Steal a Dog 2014 بجودة HDRip مترجم اون لاين وتحميل مباشر. جي سو شابة ليس لديها منزل بسبب والدها المفلس. لتحصل على المال لشراء منزل تخطط لسرقة كلاب الاثرياء لتربح مال المكافأة حين تجدها.', 'how-to-steal-a-dog-2014', 'https://m.media-amazon.com/images/M/MV5BYzE0NGIwYzgtZDVhMS00NDlhLWIxMWEtYWFlZDFkZWRhMGQ4XkEyXkFqcGdeQXVyMzE4MDkyNTA@._V1_SX300.jpg', 7, 'HDRip', 0, 1, 4427, '2019-04-14 14:21:51', '2019-04-14 14:22:54'),
(4425, 'مشاهدة فيلم Jackrabbit 2015 مترجم', 'مشاهدة و تحميل فيلم الدراما والخيال العلمي Jackrabbit 2015 مترجم اون لاين جودة WEB-DL وتحميل مباشر مشاهدة اون لاين مباشرة عندما يترك انتحار صديق ذاكرة كمبيوتر خلفه يتعاون مخترق حواسيب غريب وتقني حواسيب بارع معا ليفكوا شيفرة رسالة التي تركها في حياته.', 'jackrabbit-2015', 'https://m.media-amazon.com/images/M/MV5BNmQ3YTM1NzItMTcwZC00ODA0LWEzZjAtMGY1YTg5Y2NlZDYzXkEyXkFqcGdeQXVyNDMxMjgwOA@@._V1_SX300.jpg', 4.6, 'WEB-DL', 0, 1, 4429, '2019-04-14 14:22:00', '2019-04-14 14:22:51'),
(4427, 'مشاهدة فيلم Stephanie 2017 مترجم', 'مشاهدة و تحميل فيلم الدراما والفانتازيا Stephanie 2017 مترجم اون لاين جودة WEB-DL وتحميل مباشر مشاهدة اون لاين مباشرة تدور احداث قصه فيلم الرعب و الغموض Stephanie 2017 فتاة يتيمة بقوى خارقة يؤويها رجل وامرأة يدعيان انهما والديها.', 'stephanie-2017', 'https://m.media-amazon.com/images/M/MV5BOWExMTg4NmQtZDNlZi00OTBjLWFhYjgtYzI4Zjg2YzU1ODVlXkEyXkFqcGdeQXVyMTg2NjYzOA@@._V1_SX300.jpg', 5.8, 'WEB-DL', 0, 1, 4431, '2019-04-14 14:22:08', '2019-04-14 14:22:49'),
(4429, 'مشاهدة فيلم The Debt Collector 2018 مترجم', 'مشاهدة وتحميل فيلم الاكشن The Debt Collector 2018 مترجم بجودة WEB-DL كامل اون لاين. يذهب فنان الدفاع عن النفس المدربين كلاسيك (أدكنز) للعمل كمجمع للديون للحشد. المهمة تبدو سهلة بما فيه الكفاية ، حتى يسحبه “عميل” واحد إلى وضع أعمق مما يمكن توقعه', 'the-debt-collector-2018', 'https://m.media-amazon.com/images/M/MV5BNDBmYTcyODQtNWRmNy00NmQ0LWE5NTYtZGQwOTNmZmFiYTBjXkEyXkFqcGdeQXVyNzIzMTc2Mw@@._V1_SX300.jpg', 5.7, 'WEB-DL', 0, 1, 4433, '2019-04-14 14:22:16', '2019-04-14 14:22:47'),
(4431, 'مشاهدة فيلم Blockers 2018 مترجم', 'مشاهدة فيلم الكوميديا Blockers 2018 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. تدور احداث قصه فيلم الكوميديا Blockers 2018 ثلاثة آباء يحاولون منع بناتهم من ممارسة الجنس أثناء ليلة حفل التخرج.', 'blockers-2018', 'https://m.media-amazon.com/images/M/MV5BMjE0ODIzNjkzMl5BMl5BanBnXkFtZTgwODQ3MzU4NDM@._V1_SX300.jpg', 6.2, 'BluRay', 0, 1, 4435, '2019-04-14 14:22:29', '2019-04-14 14:22:45'),
(4432, 'فيلم The Sweeney: Paris 2015 مترجم اون لاين', 'مشاهدة وتحميل فيلم الاكشن والدراما The Sweeney: Paris 2015 بجودة BluRay مترجم اون لاين وتحميل مباشر.', 'the-sweeney-paris-2015', 'https://m.media-amazon.com/images/M/MV5BMDQyMzJhYmMtMzIzZS00MDk3LTg3MDUtMGU3Njg5NDQxZWRjXkEyXkFqcGdeQXVyNjQ5ODMxNDQ@._V1_SX300.jpg', 5.7, 'BluRay', 0, 1, 4436, '2019-04-14 14:22:33', '2019-04-14 14:22:44'),
(4433, 'مشاهدة فيلم In the Fade 2017 مترجم', 'مشاهدة وتحميل فيلم الجريمة والدراما In the Fade 2017 بجودة WEB-DL مترجم اون لاين وتحميل مباشر. تنهار حياة (كاتيا) فجأة وبشكل غير متوقع، عندما تنفجر قنبلة وتودي بحياة زوجها (نوري)، وابنها الصغير (روكو)، فيحاول بعدها أصدقاؤها وأفراد عائلتها أن يمدوها بالدعم الذي تحتاجه، وحاولت هي أن تتماسك بطريقة أو بأخرى خلال الجنازة، لكن البحث البطيء والممل عن مرتكبي الحادث، وكشف الأسباب والدوافع خلف هذا القتل، الذي لا معنى له.', 'in-the-fade-2017', 'https://m.media-amazon.com/images/M/MV5BODc2NTkyZjEtMTYxNC00YTJmLTgzZjMtNTVmOTZmNDBhMjQ5XkEyXkFqcGdeQXVyODAzODU1NDQ@._V1_SX300.jpg', 7.1, 'WEB-DL', 0, 1, 4437, '2019-04-14 14:22:38', '2019-04-14 14:22:44'),
(4435, 'مشاهدة فيلم And Then I Go 2017 مترجم', 'مشاهدة فيلم الدراما And Then I Go 2017 مترجم بجودة WEB-DL مشاهدة مباشرة اون لاين. تدور احداث قصه فيلم الدراما And Then I Go 2017 في عالم الاعدادية القاسي يعاني ادوين من القلق والغربة مع صديقه الوحيد فلايك. مساء فهمهما من قبل عائلتيهما ويتعرضان للتنمر كل يوم في المدرسة يستعر غضبهما في صمت حتى تنطلق فكرة الانتقام المرعبة.', 'and-then-i-go-2017', 'https://m.media-amazon.com/images/M/MV5BMjI2ODE3NzMxMV5BMl5BanBnXkFtZTgwMTIyMDYxNTM@._V1_SX300.jpg', 6.2, 'WEB-DL', 0, 1, 4439, '2019-04-14 14:22:44', '2019-04-14 14:23:04'),
(4436, 'مشاهدة فيلم Body of Sin 2018 مترجم', 'مشاهدة وتحميل فيلم المغامره والجريمة Body of Sin 2018 بجودة WEB-DL مترجم اون لاين وتحميل مباشر. تدور احداث قصه فيلم الجريمه و المغامره و الاثاره Body of Sin 2018 سيدتان يغريان للسرقة من الرجال المشردين. لكن عندما تكتشفان ان احد ضحاياهما يخبئ مليون دولار كماس هدف حياتهما اصبح الهرب بحياتهما.', 'body-of-sin-2018', 'https://m.media-amazon.com/images/M/MV5BOWU1ZmIzMzItZTgyYy00YzhmLWI5NjQtODE4ZTA2NWE2MTJkXkEyXkFqcGdeQXVyNDA1NDA2NTk@._V1_SX300.jpg', 4.9, 'WEB-DL', 0, 1, 4440, '2019-04-14 14:23:02', '2019-04-14 14:23:03'),
(4438, 'مشاهدة فيلم I’d Kill for You 2018 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والدراما I’d Kill for You 2018 بجودة WEB-DL مترجم اون لاين وتحميل مباشر. تدور احداث قصه فيلم الكوميديا و الدراما و الموسيقى I’d Kill for You 2018 قصة حب شاب والفتاة المغنية الجميلة الميالة للانتحار يقوده الى بحث عن شقيقه الشرير الضائع. بينما يقترب اكثر من ايجاد الحقيقة يجب ان يقرر بمن يثق وماذا يصدق.', 'id-kill-for-you-2018', 'uploads/1940453158.jpg', NULL, 'WEB-DL', 0, 1, 4442, '2019-04-14 15:13:34', '2019-04-14 15:21:59'),
(4439, 'مشاهدة فيلم Wanderland 2017 مترجم', 'مشاهدة وتحميل فيلم ال Wanderland 2017 مترجم بجودة WEB-DL كامل اون لاين. تدور احداث قصه فيلم المغامرات و الدراما Wanderland 2017 رجل نيويورك اليكس ياخذ رحلة بعيدة عن الموسم الى هامبتون في محاولة للهرب من روتينه في المدينة. بينما يحاول قضاء وقته في الاسترخاء ينتهي به المطاف ضائعا مما يضعه على اتصال مع محليين يغيرون الحياة اثناء ليله من المغامرات.', 'wanderland-2017', 'https://m.media-amazon.com/images/M/MV5BYmY3ZjRhODYtMDZlYi00NmJhLWE4YjQtMDVhMWUyYmU3MDg5XkEyXkFqcGdeQXVyMzMyMzg5MjM@._V1_SX300.jpg', 5.3, 'WEB-DL', 0, 1, 4443, '2019-04-14 15:13:45', '2019-04-14 15:21:58'),
(4440, 'مشاهدة فيلم High-Rise Rescue 2017 مترجم', 'مشاهدة وتحميل فيلم الاكشن والدراما High-Rise Rescue 2017 بجودة WEB-DL مترجم كامل اون لاين مشاهدة مباشرة يوتيوب تدور احداث قصه فيلم الاكشن و الدراما High-Rise Rescue 2017 ام تفعل ما بوسعها لانقاذ عائلتها.', 'high-rise-rescue-2017', 'https://ia.media-imdb.com/images/M/MV5BYzYzZWRiNGQtNmRiMC00YWY4LTk3NWUtZDAzYWYzYTFhYTllXkEyXkFqcGdeQXVyMjQxODI3Ng@@._V1_SX300.jpg', 5.1, 'WEB-DL', 0, 1, 4444, '2019-04-14 15:13:59', '2019-04-14 15:21:57'),
(4441, 'مشاهدة فيلم The Magdalene Sisters 2002 مترجم', 'مشاهدة وتحميل فيلم الدراما The Magdalene Sisters 2002 بجودة BluRay مترجم اون لاين وتحميل مباشر. ثلاث شابات إيرلنديات يكافحن للحفاظ على أرواحهن بينما يتعرضن لمعاملة غير إنسانية ومضايقات بعد أن أصبحن نزيلات في ملجأ تابع للأخوية.', 'the-magdalene-sisters-2002', 'https://m.media-amazon.com/images/M/MV5BMTI2NzU1NTc1NF5BMl5BanBnXkFtZTcwOTQ1MjAwMQ@@._V1_SX300.jpg', 7.8, 'BluRay', 0, 1, 4445, '2019-04-14 15:14:14', '2019-04-14 15:21:56'),
(4442, 'مشاهدة فيلم The Mummy Returns 2001 مترجم', 'مشاهدة فيلم الاكشن والمغامره The Mummy Returns 2001 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. يتم شحن الجثة المحنطة لإمحوتب إلى متحف في لندن، حيث يستيقظ مرة أخرى ويبدأ حملة الغضب والإرهاب', 'the-mummy-returns-2001', 'https://m.media-amazon.com/images/M/MV5BMjE2NzU1NTk2MV5BMl5BanBnXkFtZTgwMjIwMzcxMTE@._V1_SX300.jpg', 6.4, 'BluRay', 0, 1, 4446, '2019-04-14 15:14:31', '2019-04-14 15:21:55'),
(4443, 'مشاهدة فيلم The Pianist 2002 مترجم', 'مشاهدة وتحميل فيلم السيرة الذاتية والدراما The Pianist 2002 مترجم بجودة BluRay كامل اون لاين. فيلم مقتبس عن قصة حياة عازف البيانو البولندي (فالديك سبيلمان) في فترة الحرب العالمية الثانية حينما يجتاح الجيش الألماني بولندا ويحتلها، ويعاني سبيلمان معاناة شديدة هو وأسرته بسبب انتمائه للديانة اليهودية، وتعمد الألمان التنكيل باليهود وكيفية مطاردتهم والتضييق عليهم وتعذيبهم وقتلهم من دون سبب؛ حسب ادعاء الفيلم ذلك.', 'the-pianist-2002', 'https://m.media-amazon.com/images/M/MV5BOWRiZDIxZjktMTA1NC00MDQ2LWEzMjUtMTliZmY3NjQ3ODJiXkEyXkFqcGdeQXVyNjU0OTQ0OTY@._V1_SX300.jpg', 8.5, 'BluRay', 0, 1, 4447, '2019-04-14 15:14:53', '2019-04-14 15:21:54'),
(4444, 'مشاهدة فيلم The Scorpion King 2002 مترجم', 'مشاهدة فيلم The Scorpion King 2002 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر ماثيوس (The Rock) هو آخر محارب أكادي بعد قتل أخاه من قبل الامبراطور ميمون (Steven Brand) الذي سيطر وحكم مناطق شاسعة بقبضة من حديد . وكان ميمون يستمد قوته من الساحرة كاسندرا التي ترى المستقبل وهي رمز الدعم لدى محاربي ميمون .', 'the-scorpion-king-2002', 'https://m.media-amazon.com/images/M/MV5BMjkxNTAwNTQ0M15BMl5BanBnXkFtZTYwMTQwMjM3._V1_SX300.jpg', 5.5, 'BluRay', 0, 1, 4448, '2019-04-14 15:15:05', '2019-04-14 15:21:54'),
(4445, 'مشاهدة فيلم The Count of Monte Cristo 2002 مترجم', 'مشاهدة وتحميل فيلم الاكشن والمغامره The Count of Monte Cristo 2002 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب تدور أحداث الفيلم في فترةٍ مضطربةٍ من تاريخ فرنسا التي تخلصت لتوها من حكم نابليون. يحلم الصديقان إدموند دانتي ورفيق دربه فيرناند مونديجو بأن يعملا في الملاحة على متن إحدى السفن الراسية في مارسيليا…', 'the-count-of-monte-cristo-2002', 'https://m.media-amazon.com/images/M/MV5BMDM0ZWRjZDgtZWI0MS00ZTIzLTg4MWYtZjU5MDEyMDU0ODBjXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 7.8, 'BluRay', 0, 1, 4449, '2019-04-14 15:15:17', '2019-04-14 15:21:53'),
(4446, 'مشاهدة فيلم The Last Castle 2001 مترجم', 'مشاهدة فيلم الاكشن والدراما The Last Castle 2001 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. تدور أحداث الفيلم حول الجنرال “جين” الذي يجرد من رتبته بعد عصيانه الأوامر في إحدى المهام العسكرية، ويزج به داخل سجن عسكري يديره “وينتر” الذي يتبع أساليب قاسية في إدارة سجنه، وبعد فترة يلاحظ جين ذلك الأمر ويعقد على تلقين وينتر عظة عبر استيلاء قيادة السجن منه، ومن هنا يبدأ الصراع بينهما لامتلاك زمام الأمور.', 'the-last-castle-2001', 'https://m.media-amazon.com/images/M/MV5BMzZlMTllYjMtZmQ0NS00ZGJkLTg1ODItODM2MmViYjlmNzcyXkEyXkFqcGdeQXVyNDE5MTU2MDE@._V1_SX300.jpg', 6.9, 'BluRay', 0, 1, 4450, '2019-04-14 15:15:46', '2019-04-14 15:21:53'),
(4447, 'مشاهدة فيلم The Parole Officer 2001 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والجريمة The Parole Officer 2001 بجودة BluRay مترجم اون لاين وتحميل مباشر. (سيمون) ضابط للإفراج المؤقت، لكنه فاشل في عمله، يورطه أحد الضباط الفاسدين بمانشستر في جريمة قتل، ولا يملك سوى دليل واحد لتبرئة نفسه، وهو شريط فيديو كاميرات المراقبة الموجود في قبو أحد البنوك، فيقرر الاستعانة بأربعة من المجرمين السابقين، لمحاولة سرقة البنك رغم أنهم هواة وفاشلين، وتحاول حبيبته (إيما) مساعدته.', 'the-parole-officer-2001', 'https://m.media-amazon.com/images/M/MV5BNGY3NWExYTctNTdlYS00MGU4LWE3OTAtMjA5YjZlYmNmM2E5XkEyXkFqcGdeQXVyMTMxMTY0OTQ@._V1_SX300.jpg', 6.4, 'BluRay', 0, 1, 4451, '2019-04-14 15:16:06', '2019-04-14 15:21:52'),
(4448, 'مشاهدة فيلم The Time Machine 2002 مترجم', 'مشاهدة فيلم The Time Machine 2002 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر يحاول العالم والمخترع أليكساندر هارتغين أن يثبت إمكانية السفر عبر الزمن. ثم يتحول تصميمه إلى اندفاع يائس حين تقع له مأساة شخصية تدفعه لمحاولة تغيير الماضي. وهكذا يبدأ باختبار نظريته بنفسه باستخدام آلة سفر عبر الزمن اخترعها، ليجد نفسه انتقل 800 ألف عام في المستقبل إلى الأرض بعد اندثار الحضارات. حيث انقسمت البشرية لقسمين، الصياد والفريسة.', 'the-time-machine-2002', 'https://m.media-amazon.com/images/M/MV5BMTM4YTViNGMtYTYyOS00MTViLWEyYTgtNGM0OTIwMWRmYzdhL2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 5.9, 'BluRay', 0, 1, 4452, '2019-04-14 15:16:08', '2019-04-14 15:21:52'),
(4449, 'مشاهدة فيلم Thir13en Ghosts 2001 مترجم', 'مشاهدة وتحميل فيلم الرعب Thir13en Ghosts 2001 مترجم بجودة BluRay كامل أون لاين. تدور أحداث الفيلم في قالب من الرعب والغموض. يرث (آرثر) وطفلاه (كاثي وبوبي) ممتلكات العم (سايروس) بعد وفاته. كان سايروس هاويًا لجمع الأشياء الفريدة والغريبة، وقد كتب تركته كاملة لابن أخيه آرثر.', 'thir13en-ghosts-2001', 'uploads/121855785223.jpg', NULL, 'BluRay', 0, 1, 4453, '2019-04-14 15:16:22', '2019-04-14 15:21:51'),
(4450, 'مشاهدة فيلم Undisputed 2002 مترجم', 'مشاهدة وتحميل فيلم الاكشن والجريمة Undisputed 2002 مترجم بجودة BluRay كامل اون لاين. يُصنف جورج شامبرز كأحد أبطال الوزن الثقيل في الملاكمة. تنقلب حياة شامبرز رأسًا على عقب عندما يتم اتهامه بالاغتصاب ويذهب إلى السجن. عندما يصل إلى السجن، يسمع عن مونرو هاتشن بطل السجن في الملاكمة لمدة عشر سنوات.', 'undisputed-2002', 'https://m.media-amazon.com/images/M/MV5BMmE1NjQ0MDAtMTFhMC00OTgxLTg0ODktMGI2YmE2ZTU4YjhjXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 6.2, 'BluRay', 0, 1, 4454, '2019-04-14 15:16:39', '2019-04-14 15:21:50'),
(4451, 'مشاهدة فيلم Roger Dodger 2002 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والدراما Roger Dodger 2002 بجودة BluRay مترجم اون لاين وتحميل مباشر. يتمتع (روجر) بسمعة ممتازة في نيويورك بشأن قدراته الكبيرة في الإيقاع بالنساء الجميلات؛ حيث يتفاخر دومًا بأن رأس ماله الحقيقي هو كلامه المعسول. يعرف بعدها أن رئيسته في العمل (جويس) تريد أن تقطع علاقتها به، وهو الأمر الذي يصيبه بصدمة. وتزداد الأمور تعقيدًا في حياته عندما يأتي إليه (نيك) ابن أخيه المراهق…', 'roger-dodger-2002', 'https://m.media-amazon.com/images/M/MV5BNzk1MDgyODQzMl5BMl5BanBnXkFtZTYwNTI4MjE3._V1_SX300.jpg', 7, 'BluRay', 0, 1, 4455, '2019-04-14 15:16:51', '2019-04-14 15:21:50'),
(4452, 'مشاهدة فيلم Showtime 2002 مترجم', 'مشاهدة فيلم الاكشن والكوميديا Showtime 2002 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. في ولاية لوس أنجلوس، يسعى محقق المباحث الفيدرالية “ميتش بريستون” إلى العمل بمفرده منذ فترة طويلة. في حين أن خفير الدوريات “تراي سيلارز” يسعى دوما إلى دخول عالم الفن دون جدوى بدلاً من العمل كشرطي.', 'showtime-2002', 'https://m.media-amazon.com/images/M/MV5BZTQzNGUyYzEtYzhlOC00YTQzLWJmOGYtOTNlMzE1Yjk4MDkzXkEyXkFqcGdeQXVyNTUyMzE4Mzg@._V1_SX300.jpg', 5.5, 'BluRay', 0, 1, 4456, '2019-04-14 15:17:03', '2019-04-14 15:21:49'),
(4453, 'مشاهدة فيلم Signs 2002 مترجم', 'مشاهدة فيلم الدراما والغموض Signs 2002 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. في مقاطعة ميلووكي بولاية بنسلفانيا، تعيش عائلة في إحدي المزارع، وذات يوم يجدوا دوائر غامضة على المحاصيل في حقولهم، الأمر الذي يثير جنون وسائل اﻹعلام ، وتبدأ رحلة السعي وراء إكتشاف حقيقة تلك الدوائر.', 'signs-2002', 'https://m.media-amazon.com/images/M/MV5BNDUwMDUyMDAyNF5BMl5BanBnXkFtZTYwMDQ3NzM3._V1_SX300.jpg', 6.7, 'BluRay', 0, 1, 4457, '2019-04-14 15:17:15', '2019-04-14 15:21:48'),
(4455, 'مشاهدة فيلم Star Trek: Nemesis 2002 مترجم', 'مشاهدة وتحميل فيلم الاكشن والمغامره Star Trek: Nemesis 2002 بجودة BrRip مترجم كامل اون لاين مشاهدة مباشرة يوتيوب ” ستار تريك : انتقام ” عندما تحول سفينة (الانتربرايز) مسارها الي موطن الروميولان (روميولس) , كي – من المفترض – ان يتفاوضوا علي معاهدة سلام .', 'star-trek-nemesis-2002', 'https://m.media-amazon.com/images/M/MV5BMjAxNjY2NDY3NF5BMl5BanBnXkFtZTcwMjA0MTEzMw@@._V1_SX300.jpg', 6.4, '0', 0, 1, 4459, '2019-04-14 15:17:27', '2019-04-14 15:21:47'),
(4456, 'مشاهدة فيلم The Dreamers 2003 مترجم', 'مشاهدة وتحميل فيلم الدراما والرومانسية The Dreamers 2003 مترجم بجودة BluRay كامل أون لاين. ربيع (باريس) في عام 1968 ، ذروة الحركة الطلابية ، وانتشار الفكر الهيبي ، يحيا الشقيقان (ثيو) ،و(إيزابيل) حياة هادئة في بيتهما الكبير بباريس ، يتعرفان على طالب أمريكي هو (ماتيو) ، وهو طالب محافظ ، هادئ ، ملتزم ، يُسْقِطَانه في هُوة جميع المتع الحسية ، من إدمان المخدرات ، والجنس الجماعي ، مما يجعله يفقد براءته ، فيحاول الخروج من هذا المستنقع .', 'the-dreamers-2003', 'https://m.media-amazon.com/images/M/MV5BMjA4MDU3ODM3OV5BMl5BanBnXkFtZTYwMDE0Njc2._V1_SX300.jpg', 7.2, 'BluRay', 0, 1, 4460, '2019-04-14 15:17:28', '2019-04-14 15:21:47'),
(4458, 'مشاهدة فيلم The Great Raid 2005 مترجم', 'مشاهدة و تحميل فيلم الاكشن والدراما The Great Raid 2005 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة تدور أحداث الفيلم في الفلبين في عام 1945 في نهاية الحرب العالمية الثانية ، حين يقرر الملازم أول دوجلاس ماك أرثر إرسال كتيبة من الجنود الأمريكين إلى الفلبين للانتقام منهم بعدما انتصروا عليهم خلال الحرب اليابانية في كاباناتوان ، بجانب محاولة إنقاذ الأسرى الأمريكان الذين تم أسرهم خلال الحرب…', 'the-great-raid-2005', 'https://m.media-amazon.com/images/M/MV5BMjExMTEzODI3Nl5BMl5BanBnXkFtZTcwNjA1NzAzMQ@@._V1_SX300.jpg', 6.7, 'BluRay', 0, 1, 4462, '2019-04-14 15:17:41', '2019-04-14 15:21:46'),
