(4472, 'مشاهدة فيلم Body of Evidence 1993 مترجم', 'مشاهدة وتحميل فيلم الدراما والاثارة Body of Evidence 1993 مترجم بجودة BluRay كامل أون لاين. العثور على مليونير مات إثر أزمة قلبية مكبل اليدين في السرير والعثور على شريط فيديو له ولعشيقته. بعد تشريح جثته تبين أنه تعاطى الكوكايين كما تم العثور على وصية بإعطاء 8 مليون دولار لعشيقته فتم القبض عليها للاشتباه في أنها قتلته. ينجذب محاميها إلى سحرها ويقع في غرامها لكن عندما تظهر بعض الدلائل أثناء المحاكمة يشعلا أنه يدافع عن قاتلة.', 'body-of-evidence-1993', 'https://m.media-amazon.com/images/M/MV5BOTFhZTM2ZDAtZTc4OS00NzExLWIzODctNGVhNmMyMjBlNDRjXkEyXkFqcGdeQXVyNjQ2MjQ5NzM@._V1_SX300.jpg', 4.4, 'BluRay', 0, 1, 4476, '2019-04-14 15:19:40', '2019-04-14 15:21:34'),
