(4508, 'فيلم Teen Spirit 2011 مترجم اون لاين', 'مشاهدة و تحميل فيلم الكوميديا والدراما Teen Spirit 2011 مترجم اون لاين جودة DVDRip وتحميل مباشر مشاهدة اون لاين مباشرة', 'teen-spirit-2011', 'https://m.media-amazon.com/images/M/MV5BZDFiOWVkNDMtNjExZS00OTk1LWI5ZTQtYWZlMzg1M2M0NThmXkEyXkFqcGdeQXVyNDgyODgxNjE@._V1_SX300.jpg', 5.6, 'DVDRip', 0, 1, 4512, '2019-04-14 15:26:45', '2019-04-14 15:28:31'),
(4509, 'مشاهدة فيلم Die Another Day 2002 مترجم', 'مشاهدة وتحميل فيلم الاكشن والمغامره Die Another Day 2002 بجودة BluRay مترجم اون لاين وتحميل مباشر. يخوض العميل البريطاني السري (جيمس بوند) مغامرته الجديدة، ويتصدى فيها لمخطط (إكراس)؛ وهو نظام ذو مرآة محورية مصنوعة من الماس، والذي سيركز الطاقة الشمسية على مساحة صغيرة،', 'die-another-day-2002', 'https://m.media-amazon.com/images/M/MV5BODNkYmIwYTMtYzdhNy00YWE3LThkYmEtNzA5ZTE5YmVjYzZlXkEyXkFqcGdeQXVyNTIzOTk5ODM@._V1_SX300.jpg', 6.1, 'BluRay', 0, 1, 4513, '2019-04-14 15:26:47', '2019-04-14 15:28:30'),
(4510, 'فيلم A Lover Betrayed 2017 مترجم اون لاين', 'مشاهدة وتحميل فيلم الاثارة A Lover Betrayed 2017 بجودة HDTV مترجم كامل اون لاين مشاهدة مباشرة يوتيوب', 'a-lover-betrayed-2017', 'https://m.media-amazon.com/images/M/MV5BNWExNmM5ZDYtNjZlYi00YTQ2LWI4MDktYTcxNjU5YzU0MGViXkEyXkFqcGdeQXVyNzY4ODc3OTA@._V1_SX300.jpg', 5.7, 'HDTV', 0, 1, 4514, '2019-04-14 15:26:58', '2019-04-14 15:28:29'),
(4511, 'مشاهدة فيلم Jason X 2001 مترجم', 'مشاهدة وتحميل فيلم الاكشن والرعب Jason X 2001 مترجم بجودة BluRay كامل أون لاين. تصبح الأرض في القرن الخامس والعشرين مكانًا غير صالح للحياة، مما يجعل البشر يعيشون في الفضاء، ويتعاملون مع الأرض باعتبارها مكانًا للتجارب والأبحاث العلمية. يسافر فريق من الباحثين إلى الأرض ويجدون جثتين متجمدتين في حالة جيدة، إحداهما لفتاة جميلة والأخرى لرجل غامض يرتدي قناع هوكي.', 'jason-x-2001', 'https://m.media-amazon.com/images/M/MV5BYzc0MDllYjktYzFjZi00OTgwLWJmZWMtODlmMTVlODQyZTgwXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 4.4, 'BluRay', 0, 1, 4515, '2019-04-14 15:27:00', '2019-04-14 15:28:28'),
(4512, 'فيلم Separated at Birth 2018 مترجم اون لاين', 'مشاهدة فيلم Separated at Birth 2018 بجودة HDTV مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر', 'separated-at-birth-2018', 'https://m.media-amazon.com/images/M/MV5BZDQ5NWQxZjYtMzJhNS00M2I5LThiNGMtZGE2ZTAyYTVjMGMzXkEyXkFqcGdeQXVyMTk1NzUwMA@@._V1_SX300.jpg', 5.8, 'HDTV', 0, 1, 4516, '2019-04-14 15:27:10', '2019-04-14 15:28:28'),
(4513, 'مشاهدة فيلم Jay and Silent Bob Strike Back 2001 مترجم', 'مشاهدة فيلم Jay and Silent Bob Strike Back 2001 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر واحد من افضل افلام الكوميديا وتدور أحداثه حول “جاي” و”بوب الصامت” واللذان وصل كتابهما الكوميدي إلى الشهرة حيث تم بيعه إلى “هوليوود” كجزء من فيلم كبير سيجعلهم يخسرون كل أتباعهم.', 'jay-and-silent-bob-strike-back-2001', 'https://m.media-amazon.com/images/M/MV5BY2EyYWEwZmQtZWU0Yy00M2Y3LThiZTktOTQxZDUxY2ZjOTYwXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 6.9, 'BluRay', 0, 1, 4517, '2019-04-14 15:27:11', '2019-04-14 15:28:27'),
(4514, 'مشاهدة فيلم Joy Ride 2001 مترجم', 'مشاهدة فيلم الغموض والاثارة Joy Ride 2001 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. ينطلق الشاب لويس توماس (بول والكر) في رحلة على الطريق من أجل مقابلة حبيبته (فينا ويلكوكس)؛ التي تدرس في الجامعة. في طريقه إلى هناك، يقوم لويس بدفع كفالة أخيه فولر (ستيف زاهن) ويقوم بإخراجه من السجن. يرغب فولر في قضاء وقت ممتع، ويقوم بمرافقة أخيه في طريقه إلى فينا. يشترك فولر ولويس في دعابة ثقيلة، ولكن الأمور تتعقد ويجد الثلاثة أنفسهم مطاردين من سائق مجنون.', 'joy-ride-2001', 'https://m.media-amazon.com/images/M/MV5BMzQ2N2NlNWQtY2Q1Mi00ZTc3LWE5YmMtNGVjMjYxODRjOGZjXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 6.6, 'BluRay', 0, 1, 4518, '2019-04-14 15:27:13', '2019-04-14 15:28:27'),
(4515, 'فيلم Deadly Delusion 2017 مترجم اون لاين', 'مشاهدة فيلم Deadly Delusion 2017 بجودة HDTV مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر', 'deadly-delusion-2017', 'https://m.media-amazon.com/images/M/MV5BNDljNTAyMjYtZTdhOC00MTJjLTg0ZDEtYzk1MGYxMzQ4NDJlXkEyXkFqcGdeQXVyMjI0ODc0NTI@._V1_SX300.jpg', 5.1, 'HDTV', 0, 1, 4519, '2019-04-14 15:27:23', '2019-04-14 15:28:26'),
(4516, 'مشاهدة فيلم Joyeux Noel 2005 مترجم', 'مشاهدة فيلم الدراما والتاريخي Joyeux Noel 2005 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. في الحرب العالمية الأولى عام ١٩١٤ ، تُعلن هُدنة غير رسمية بين الجنود في جبهة الحرب في فترة الكريسمس تجعلهم يتفكرون في طريقة حياة بعضهم.', 'joyeux-noel-2005', 'https://m.media-amazon.com/images/M/MV5BMTQyODczNjU3NF5BMl5BanBnXkFtZTcwNjQ0NDIzMQ@@._V1_SX300.jpg', 7.8, 'BluRay', 0, 1, 4520, '2019-04-14 15:27:27', '2019-04-14 15:28:25'),
(4517, 'فيلم Deadly Inn 2018 مترجم اون لاين', 'مشاهدة وتحميل فيلم الاثارة Deadly Inn 2018 مترجم بجودة HDTV كامل أون لاين.', 'deadly-inn-2018', 'https://m.media-amazon.com/images/M/MV5BYjI4YjcxMTItNGFkMS00OTM4LWE3YjYtMWFhNDI0Y2RhNTAxXkEyXkFqcGdeQXVyNjk2Mjc2OTI@._V1_SX300.jpg', 5.3, 'HDTV', 0, 1, 4521, '2019-04-14 15:27:32', '2019-04-14 15:28:25'),
(4518, 'مشاهدة فيلم Jurassic Park III 2001 مترجم', 'مشاهدة فيلم الاكشن والمغامره Jurassic Park III 2001 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. دكتور آلان جرانت عالم الإحاثة الذي تعافى من حادثة الجزء الأول بحديقة الديناصورات يعلن على الملأ أنه لا يوجد قوة على الأرض من الممكن أن تعيده إلى الجزيرة مرة أخرى. لكن زوجان غريبا الأطوار يطلبان منه فجأة اصطحابهما في رحلة بالطائرة كمرشد سياحي من أجل المتعة.', 'jurassic-park-iii-2001', 'https://m.media-amazon.com/images/M/MV5BZDMyZGJjOGItYjJkZC00MDVlLWE0Y2YtZGIwMDExYWE3MGQ3XkEyXkFqcGdeQXVyNDYyMDk5MTU@._V1_SX300.jpg', 5.9, 'BluRay', 0, 1, 4522, '2019-04-14 15:27:40', '2019-04-14 15:28:24'),
(4519, 'فيلم Home Run 2013 مترجم اون لاين', 'مشاهدة فيلم الدراما والرياضي Home Run 2013 مترجم بجودة BluRay مشاهدة مباشرة اون لاين.', 'home-run-2013', 'https://m.media-amazon.com/images/M/MV5BNDAzODgwNDY0Nl5BMl5BanBnXkFtZTcwNDQ3NjAxOQ@@._V1_SX300.jpg', 6, 'BluRay', 0, 1, 4523, '2019-04-14 15:27:43', '2019-04-14 15:28:24'),
(4520, 'مشاهدة فيلم K-19: The Widowmaker 2002 مترجم', 'مشاهدة وتحميل فيلم الدراما والتاريخي K-19: The Widowmaker 2002 مترجم بجودة BluRay كامل اون لاين. أثناء الحرب الباردة بين روسيا والولايات المتحدة، تبحر غواصة نووية روسية لأول مرة في المحيط الأطلنطي بقيادة الكابتن (أليكسي فوستريكوف)، الذي يكتشف بعد الشروع في الإبحار أن الغواصة لم تكن مجهزة بشكل جيد، وبها عيوب في التصنيع أدت إلى حدوث تسريب لبعض المواد الإشعاعية..', 'k-19-the-widowmaker-2002', 'uploads/141576668304.jpg', NULL, 'BluRay', 0, 1, 4524, '2019-04-14 15:27:50', '2019-04-14 15:28:23'),
(4521, 'مشاهدة فيلم Matchstick Men 2003 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والجريمة Matchstick Men 2003 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب نصاب محتال يدعي روي “نيكولاس كيدج”وشريكه فرانك ، يواصلان النصب على الأشخاص الغافلين بطرق ذكية وفنية جدا ، ومن جهة أخري فإن حياة روي الخاصة فاشلة جدا ، ويفاجأ بأن إبنته تبحث عنه بعيدا عن والدتها القاسية لتجد الحنان والحب والاحتواء عند والدها ، فيجد والدها بأن لديها مشاكل وأفكار كثيرة .', 'matchstick-men-2003', 'https://m.media-amazon.com/images/M/MV5BMjA3NjMyNjIyMF5BMl5BanBnXkFtZTYwOTgzMDI3._V1_SX300.jpg', 7.3, 'BluRay', 0, 1, 4525, '2019-04-14 15:27:52', '2019-04-14 15:28:23'),
(4522, 'فيلم I Give It A Year 2013 مترجم اون لاين', 'مشاهدة فيلم I Give It A Year 2013 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر', 'i-give-it-a-year-2013', 'https://m.media-amazon.com/images/M/MV5BMTg5NDk4MTUwNl5BMl5BanBnXkFtZTcwMDU5MTc4OQ@@._V1_SX300.jpg', 5.7, 'BluRay', 0, 1, 4526, '2019-04-14 15:27:55', '2019-04-14 15:28:22'),
(4523, 'مشاهدة فيلم Mulholland Drive 2001 مترجم', 'مشاهدة فيلم الدراما والغموض Mulholland Drive 2001 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. (بيتي) ممثلة شابة موهوبة تأتي إلى هوليوود مُحملة بالأمال العريضة لكي تصبح نجمة، ونظرًا لإمكاناتها المادية المتواضعة تترك لها عمتها _التي تسافر في رحلة عمل_ شقتها لكي تقطن بها ولكن (بيتي) تتفاجأ بأن الشقة التي كانت تظنها خالية توجد بها امرأة تُدعى (ريتا) تعرضت لحادث ولا تتذكر شيئًا من ماضيها، فتحاول (بيتي) أن تساعد تلك المرأة في التعرف على ماضيها.', 'mulholland-drive-2001', 'https://m.media-amazon.com/images/M/MV5BNWM2MDZmMDgtYjViOS00YzBmLWE4YzctMDMyYTQ2YTc4MmVkXkEyXkFqcGdeQXVyNDk3NzU2MTQ@._V1_SX300.jpg', 8, 'BluRay', 0, 1, 4527, '2019-04-14 15:28:04', '2019-04-14 15:28:21'),
(4524, 'فيلم Kill em All 2012 مترجم اون لاين', 'مشاهدة وتحميل فيلم الاكشن والجريمة Kill em All 2012 مترجم بجودة BluRay كامل اون لاين.', 'kill-em-all-2012', 'https://m.media-amazon.com/images/M/MV5BMTM2OTczNjgyOV5BMl5BanBnXkFtZTcwNjE2NjQ5NQ@@._V1_SX300.jpg', 4.4, 'BluRay', 0, 1, 4528, '2019-04-14 15:28:05', '2019-04-14 15:28:20'),
(4525, 'مشاهدة فيلم Murder by Numbers 2002 مترجم', 'مشاهدة وتحميل فيلم الجريمة والغموض Murder by Numbers 2002 مترجم بجودة BluRay كامل اون لاين. يحلم الطالب الذكي في المدرسة الثانوية (ريتشارد)، مع زميله الذي يقرأ في الطب الشرعي وعلم الأدلة الجنائية (بونابرت)، بمحاولة صنع الجريمة الكاملة من خلال ارتكاب جريمة قتل محكمة، وإظهارها على أن قاتلًا محترفًا متسلسلًا قد ارتكب الجريمة، تتولى المحققة (كيسي) وزميلها (كينيدي) القضية، وتحاول، بما لديها من خبرة كبيرة، الكشف عن غموض الحادث، وكشف القاتل.', 'murder-by-numbers-2002', 'https://m.media-amazon.com/images/M/MV5BMTI4MTcyMTU1OF5BMl5BanBnXkFtZTYwMTE5MDE3._V1_SX300.jpg', 6.2, 'BluRay', 0, 1, 4529, '2019-04-14 15:28:17', '2019-04-14 15:28:19'),
(4526, 'فيلم One Chance 2013 مترجم اون لاين', 'مشاهدة فيلم السيرة الذاتية والكوميديا One Chance 2013 مترجم بجودة BluRay مشاهدة مباشرة اون لاين.', 'one-chance-2013', 'https://m.media-amazon.com/images/M/MV5BMTA5MzQxMzEzOTVeQTJeQWpwZ15BbWU4MDY2NzM5NzIx._V1_SX300.jpg', 6.8, 'BluRay', 0, 1, 4530, '2019-04-14 15:28:18', '2019-04-14 15:28:19');
