(4527, 'مشاهدة فيلم High Crimes 2002 مترجم', 'مشاهدة وتحميل فيلم الجريمة والدراما High Crimes 2002 بجودة WEB-DL مترجم كامل اون لاين مشاهدة مباشرة يوتيوب كلير كوبيك محامية رفيعة المستوي ، تنقلب حياتها رأسا على عقب ، عندما تعلم أن زوجها والذي يدعي توم كوبيك يتم القبض عليه ويتضح بأنه الرقيب رون تشابمان ، الذي يتم محاكمته بإرتكاب جرائم قتل للقرويين اللأتنيين اﻷمريكين حينما كان فى سلاح المشاة. سرعان ما تعلمات كلير نظام القضاء العسكري لتساعد زوجها ، بينما معظم الشهود العيان قد لقوا حتفهم .', 'high-crimes-2002', 'https://m.media-amazon.com/images/M/MV5BMTM3MDkyNDMyMV5BMl5BanBnXkFtZTYwMDI3Nzc3._V1_SX300.jpg', 6.4, 'WEB-DL', 0, 1, 4531, '2019-04-14 15:28:28', '2019-04-14 15:30:37'),
(4528, 'مشاهدة فيلم I Am Sam 2001 مترجم', 'مشاهدة وتحميل فيلم الدراما I Am Sam 2001 مترجم بجودة BluRay كامل اون لاين. يعاني سام من إعاقةٍ ذهنيةٍ، تجعل عقله عقل طفلٍ في السابعة من عمره، سام لديه ابنة صغيرة من سيدةٍ لا يعلم عنها شيئًا، يقوم سام بتربية ابنته بمفرده، وبالرغم من المعاناة الشديدة التي يعيش فيها سام إلا أن ابنته تزيد تلك المعاناة شدة مع بلوغها سن السابعة أيضًا .', 'i-am-sam-2001', 'https://m.media-amazon.com/images/M/MV5BYzEyNzc0NjctZjJiZC00MWI1LWJlOTMtYWZkZDAzNzQ0ZDNkXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 7.6, 'BluRay', 0, 1, 4532, '2019-04-14 15:28:41', '2019-04-14 15:30:37'),
(4529, 'مشاهدة فيلم City of God 2002 مترجم', 'مشاهدة فيلم City of God 2002 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر قصة الفيلم مقتبسة عن قصة حقيقية تحكي عن ضاحية قامت الحكومة البرازيلية ببنائها لتكون مأوى لبعض الفقراء والمتشردين فى الستينات بعيداً عن ريو دي جانيرو، وسميت هذه الضاحية (مدينة الرب) ويحكي كيف تطورت الحياة في هذه المنطقة حتى صارت أكبر البؤر الإجرامية في البرازيل، وهذا أمر طبيعي في مثل هذه المناطق التي يتشابه وجودها في الكثير من مدن العالم، يحكي لنا المصور (روكيت) الحياة في تلك المدينة ملقيا الضوء على حياة رجال العصابات وتطورها، حتى وصولهم إلى هذا المستوى.', 'city-of-god-2002', 'https://m.media-amazon.com/images/M/MV5BMGU5OWEwZDItNmNkMC00NzZmLTk1YTctNzVhZTJjM2NlZTVmXkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg', 8.6, 'BluRay', 0, 1, 4533, '2019-04-14 15:28:50', '2019-04-14 15:30:36'),
(4530, 'مشاهدة فيلم Cube²: Hypercube 2002 مترجم', 'مشاهدة و تحميل فيلم الخيال العلمي والاثارة Cube²: Hypercube 2002 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة تدور أحداث قصة فيلم الاثارة والخيال العلمي حول ثمانية غرباء توقظ من دون ذاكرة وتجد نفسها في غرفة على شكل مكعب المحير حيث قوانين الفيزياء لا تنطبق دائما', 'cube-hypercube-2002', 'https://m.media-amazon.com/images/M/MV5BNWFmNDJhNTMtNmIzNy00MmI4LThlMDktOTdiM2ExMjI2MWE1XkEyXkFqcGdeQXVyNTIzOTk5ODM@._V1_SX300.jpg', 5.6, 'BluRay', 0, 1, 4534, '2019-04-14 15:29:02', '2019-04-14 15:30:36'),
(4531, 'مشاهدة فيلم Daredevil 2003 مترجم', 'مشاهدة وتحميل فيلم الاكشن والجريمة Daredevil 2003 مترجم بجودة BluRay كامل أون لاين. تدور الأحداث حول رجل تم إصابته بالعمى من قبل النفايات السامة، والتي عززت باقي الحواس لديه مما جعلته خارق في فنون الدفاع عن النفس، ليبدأ محاربته ضد الظلم والفساد.', 'daredevil-2003', 'https://m.media-amazon.com/images/M/MV5BODcwOTg2MDE3NF5BMl5BanBnXkFtZTgwNTUyNTY1NjM@._V1_SX300.jpg', 8.7, 'BluRay', 0, 1, 4535, '2019-04-14 15:29:21', '2019-04-14 15:30:35'),
(4532, 'مشاهدة فيلم Friday After Next 2002 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والدراما Friday After Next 2002 بجودة DVDRip مترجم اون لاين وتحميل مباشر. الفيلم تدور أحداثه حول مجموعة من الشباب تتحد لايجاد من سرق منزلهم.', 'friday-after-next-2002', 'https://m.media-amazon.com/images/M/MV5BMTE5NTI3OTYyN15BMl5BanBnXkFtZTYwNjUxNTg2._V1_SX300.jpg', 5.8, 'DVDRip', 0, 1, 4536, '2019-04-14 15:29:22', '2019-04-14 15:30:35'),
(4533, 'مشاهدة فيلم Dont Say a Word 2001 مترجم', 'مشاهدة وتحميل فيلم الدراما والغموض Dont Say a Word 2001 مترجم بجودة BluRay كامل اون لاين. مجموعة من اللصوص تقوم بسرقة جوهرة ثمينة، لكن اثنين من أفراد العصابة يخدعان (باتريك) زعيم العصابة ويهربان بالجوهرة، بعد عشر سنوات من الواقعة يصل باتريك إلى (إليزابيث) والتي هي ابنة أحد أعضاء العصابة اللذان سرقا الجوهرة، ليقوم بإختطافها.', 'dont-say-a-word-2001', 'uploads/241812740055.jpg', NULL, 'BluRay', 0, 1, 4537, '2019-04-14 15:29:28', '2019-04-14 15:30:34'),
(4534, 'مشاهدة فيلم Gangs of New York 2002 مترجم', 'مشاهدة وتحميل فيلم الجريمة والدراما Gangs of New York 2002 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب يحاول أمستردام فالون الانتقام من عصابة الجزار التي قتلت والده واستعادة سيطرته على المنطقة قبل أن يصدر مشروع القانون الذي يجرم وجود تلك العصابات، ويستعد امستردام لذلك بجيش جديد كليا.', 'gangs-of-new-york-2002', 'https://m.media-amazon.com/images/M/MV5BNDg3MmI1ZDYtMDZjYi00ZWRlLTk4NzEtZjY4Y2U0NjE5YmRiXkEyXkFqcGdeQXVyNzAxMjE1NDg@._V1_SX300.jpg', 7.5, 'BluRay', 0, 1, 4538, '2019-04-14 15:29:41', '2019-04-14 15:30:34'),
(4535, 'مشاهدة فيلم Ghosts of Mars 2001 مترجم', 'مشاهدة فيلم Ghosts of Mars 2001 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر قصة انقاذ المستعمرين الإنسان على سطح المريخ بعد أن أصبح يمتلكهم أشباح المريخ الانتقامية.', 'ghosts-of-mars-2001', 'https://m.media-amazon.com/images/M/MV5BMGFlNzNmY2ItYmZjMi00ZjQ1LWJjMmMtODM5MWQ0NzI3NzBhXkEyXkFqcGdeQXVyNjU0OTQ0OTY@._V1_SX300.jpg', 4.9, 'BluRay', 0, 1, 4539, '2019-04-14 15:29:54', '2019-04-14 15:30:33'),
(4536, 'مشاهدة فيلم Harry Potter and the Sorcerers Stone 2001 مترجم', 'مشاهدة وتحميل فيلم المغامره والعائلي Harry Potter and the Sorcerers Stone 2001 مترجم بجودة BluRay كامل اون لاين. تدور أحداث الفلم في إطار خيالي استنادا إلى الرواية التي كتبتها الكاتبة البريطانية (ج . ك . رولينج) (هاري بوتر وحجر البروفسير) ، فتدور الأحداث حول الصغير (هاري بوتر) الذي يحتفل بعيد ميلاده الحادي عشر ، ويكتشف بالصدفة أنه ساحر فينتقل إلى مدرسة (هوجوارتس) ليتعلم هناك أعمال السحر والشعوذة .', 'harry-potter-and-the-sorcerers-stone-2001', 'uploads/271232435024.jpg', NULL, 'BluRay', 0, 1, 4540, '2019-04-14 15:30:04', '2019-04-14 15:30:32'),
(4537, 'مشاهدة فيلم A Knights Tale 2001 مترجم', 'مشاهدة و تحميل فيلم الاكشن والمغامره A Knights Tale 2001 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة بعد وفاة سيده، يسعى الفلاح حامل الدروع ، مدعوم برغبته في الطعام والمجد، لخلق لنفسه هوية جديدة كفارس.', 'a-knights-tale-2001', 'uploads/281967538985.jpg', NULL, 'BluRay', 0, 1, 4541, '2019-04-14 15:30:14', '2019-04-14 15:30:32'),
(4538, 'مشاهدة فيلم A man Apart 2003 مترجم', 'مشاهدة وتحميل فيلم الاكشن والجريمة A man Apart 2003 مترجم بجودة BluRay كامل اون لاين. (شون)، و(ديمتريوس) عميلان متميزان في مكتب مكافحة المخدرات على الحدود بين كاليفورنيا والمكسيك، يوقعان بأحد كبار المهربين، ويدخلانه السجن، لكن يتولى قيادة عمليات التهريب تاجر آخر أكثر شراسة، يتسبب في قتل زوجة (شون) في إحدى العمليات، فيقسم (شون) على ملاحقته حتى الموت انتقاماً لزوجته، ويستعين بالتاجر المحبوس للقبض على المهرب الجديد.', 'a-man-apart-2003', 'https://m.media-amazon.com/images/M/MV5BMTk4NzEwNjk1N15BMl5BanBnXkFtZTYwNTEzNTk5._V1_SX300.jpg', 6.1, 'BluRay', 0, 1, 4542, '2019-04-14 15:30:15', '2019-04-14 15:30:31'),
(4539, 'مشاهدة فيلم About a Boy 2002 مترجم', 'مشاهدة فيلم About a Boy 2002 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر يدور الفيلم حول الطفل ماركوس الذى يبلغ 12 عاما ، ويعيش مع والدتهالتى تعانى من الاكتئاب المزمن وتدعى فيونا .ماركوس حاول فعل كل ما في وسعه لشفاء والدته من الاكتئاب ويجعلها سعيدة، ، وقال انه يدرك ان ما ينظر إليه مختلفاباعتباره مختلفا عن معظم الأطفال،كما أن جزء من التهكم ضده هي حقيقة أنه يغني ويتحدث لنفسه دون أن يدركوا حتى انه فعل ذلك. كما أن ماركوس يساعد رجل ساخر، والشباب غير الناضج الذي يدرس كيفية التصرف مثل كبروا قبل طفل صغير.', 'about-a-boy-2002', 'https://m.media-amazon.com/images/M/MV5BMTQ2Mzg4MDAzNV5BMl5BanBnXkFtZTgwMjcxNTYxMTE@._V1_SX300.jpg', 7.1, 'BluRay', 0, 1, 4543, '2019-04-14 15:30:20', '2019-04-14 15:30:30'),
(4540, 'مشاهدة فيلم Adaptation. 2002 مترجم', 'مشاهدة فيلم Adaptation. 2002 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر يتم تكليف الكاتب تشارلي كوفمان بإعداد سيناريو سينمائي لكتاب لص الأوركيد للكاتبة سوزان أورلين . تواجه تشارلي مشكلةً كبيرةً في كتابة الفيلم لأن الكتاب لا يحتوي على خطٍ درامي واضح، وفي نفس الوقت يعاني تشارلي من أزمة منتصف العمر. تزداد مشاكل تشارلي مع وصول شقيقه التوأم دونالد الذي يحلم هو الآخر باحتراف كتابة السيناريو. لكن عندما يذهب تشارلي لمقابلة مؤلفة الكتاب سوزان، يكتشف وجود علاقة حبٍ تجمعها مع جون لاروش صائد الأوركيد وبطل كتابها، ويكتشف العديد من الأمور غير المتوقعة.', 'adaptation-2002', 'uploads/311278862386.jpg', 0, 'BluRay', 0, 1, 4544, '2019-04-14 15:30:29', '2019-04-14 15:30:29'),
(4541, 'مشاهدة فيلم Analyze That 2002 مترجم', 'مشاهدة فيلم الكوميديا والجريمة Analyze That 2002 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. ينتهي المطاف بزعيم المافيا (بول فيتي) وراء القضبان، بعدما تم سجنه بسبب عملية كانت تقوم بها عصابته. يؤثر الأمر على حالة فيتي النفسية؛ حيث أصبح يبكي كالأطفال، ويصاب بانهيار عصبي شديد.', 'analyze-that-2002', 'https://m.media-amazon.com/images/M/MV5BMTc0OTYwMzQ5OF5BMl5BanBnXkFtZTYwMzQyMDg5._V1_SX300.jpg', 5.9, 'BluRay', 0, 1, 4545, '2019-04-14 15:34:01', '2019-04-14 15:40:35'),
(4542, 'مشاهدة فيلم Bring It on Again 2004 مترجم', 'مشاهدة فيلم الكوميديا والرياضي Bring It on Again 2004 مترجم بجودة WEB-DL مشاهدة مباشرة اون لاين. عندما يأتي الطالبات الجدد إلى فريق التشجيع في الكلية يشكلون فرقتهم الخاصة ويستعدون للهتاف.', 'bring-it-on-again-2004', 'https://m.media-amazon.com/images/M/MV5BMjExODY0NDI3OV5BMl5BanBnXkFtZTcwNDU3ODUyMQ@@._V1_SX300.jpg', 4.5, 'WEB-DL', 0, 1, 4546, '2019-04-14 15:34:13', '2019-04-14 15:40:35'),
(4543, 'مشاهدة فيلم Fat Albert 2004 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والعائلي Fat Albert 2004 بجودة WEB-DL مترجم اون لاين وتحميل مباشر. شخصية شهيرة من عالم الرسوم المتحركة، وهو مصاب بالسمنة المفرطة. يقع عن طريق المصادفة من عالم التلفزيون إلى عالم الواقع بصحبة أصدقائه غريبي الأطوار. يحاول ألبرت مساعدة الفتاة الصغيرة (دوريس) في اكتساب أصدقاء جدد، ويستعين بفريقه في هذه المهمة الشاقة. يكتشفون أن الحياة التي اعتادوها في عالمهم البسيط تختلف تماًما عن عالمنا المادي…', 'fat-albert-2004', 'https://m.media-amazon.com/images/M/MV5BMTg2MzYxMDI2M15BMl5BanBnXkFtZTYwNTAzNTM3._V1_SX300.jpg', 4.3, 'WEB-DL', 0, 1, 4547, '2019-04-14 15:34:14', '2019-04-14 15:40:34'),
(4544, 'مشاهدة فيلم Kings Ransom 2005 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والجريمة Kings Ransom 2005 بجودة WEB-DL مترجم اون لاين وتحميل مباشر. رجل أعمال ثرى و مغرور ، بعد انفصاله عن زوجته ، قررت الزوجة أخذ جميع مستحقاتها منه من ثروته ، كما عزم مالكولم على عدم فقدان ثروته فقرر خطفه زوجته .', 'kings-ransom-2005', 'uploads/31545630042.jpg', NULL, 'WEB-DL', 0, 1, 4548, '2019-04-14 15:34:26', '2019-04-14 15:40:34'),
(4545, 'مشاهدة فيلم May 2002 مترجم', 'مشاهدة فيلم الدراما والرعب May 2002 مترجم بجودة WEB-DL مشاهدة مباشرة اون لاين. نفسي حول امرأة شابة وحيدة عانت من طفولة صعبة، ومحاولاتها اليائسة للتواصل مع الناس حولها', 'may-2002', 'https://m.media-amazon.com/images/M/MV5BZjUwYzdjMjAtN2FjMS00NDNhLWJlNjYtODBkNzllYTFjMjhhXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 6.7, 'WEB-DL', 0, 1, 4549, '2019-04-14 15:34:40', '2019-04-14 15:40:34'),
(4546, 'فيلم Unknown Soldier 2017 مترجم اون لاين', 'مشاهدة وتحميل فيلم الدراما والحرب Unknown Soldier 2017 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب', 'unknown-soldier-2017', 'https://m.media-amazon.com/images/M/MV5BODk1OGFkYWUtMWQ2MS00OWJhLTkwMzUtZDgyN2I4MDBmY2RmXkEyXkFqcGdeQXVyNzAwMTc2MDU@._V1_SX300.jpg', 7.9, 'BluRay', 0, 1, 4550, '2019-04-14 15:34:41', '2019-04-14 15:40:33'),
(4547, 'فيلم Metallica Through The Never 2013 مترجم اون لاين', 'مشاهدة و تحميل فيلم الموسيقى Metallica Through The Never 2013 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين…', 'metallica-through-the-never-2013', 'https://m.media-amazon.com/images/M/MV5BMjQwNjk5MTk4Ml5BMl5BanBnXkFtZTcwNTgwNDA5OQ@@._V1_SX300.jpg', 7.2, 'BluRay', 0, 1, 4551, '2019-04-14 15:34:52', '2019-04-14 15:40:32'),
(4548, 'مشاهدة فيلم The Clique 2008 مترجم', 'مشاهدة فيلم الكوميديا والدراما The Clique 2008 مترجم بجودة WEB-DL مشاهدة مباشرة اون لاين. الطالبة بالمدرسة الإعدادية بنيويورك وتدعى مسي بلوك “إليزابيث ماكلولين”،والتي تتزعم مجموعة مكونة من أربع طالبات راقيات ومتميزات.حيث أطلقت هذه المجموعة على أنفسهن اسم “المجموعة الجميلة”.', 'the-clique-2008', 'https://m.media-amazon.com/images/M/MV5BMTU3MDA5MjQ0Ml5BMl5BanBnXkFtZTgwODA1NzAwNzE@._V1_SX300.jpg', 5.3, 'WEB-DL', 0, 1, 4552, '2019-04-14 15:34:55', '2019-04-14 15:40:31'),
