(4555, 'مشاهدة فيلم Submergence 2017 مترجم', 'مشاهدة وتحميل فيلم الدراما والرومانسية Submergence 2017 مترجم بجودة WEB-DL كامل أون لاين. داخل غرفة معدومة النوافذ على الساحل الشرقي لأفريقيا، (جيمس مور) رجل إنجليزي واقع تحت أسر مقاتلي الجهاد. بينما على بُعد آلاف الأميال في بحر (جرينلاند)، تتحضر (دانييل فليندرس) للغوص بواسطة غواصة في قاع المحيط.. تمر الأحداث وتسحبهما الظروف إلى محفل الكريسماس للعام السابق، حيث تزداد فرصة لقائهما هناك على شاطئ فرنسي شهد على رومانسيتهما وقصة حبهما.', 'submergence-2017', 'https://m.media-amazon.com/images/M/MV5BNjE2NDUyMTY3M15BMl5BanBnXkFtZTgwODU0MDQ5NDM@._V1_SX300.jpg', 5.4, 'WEB-DL', 0, 1, 4559, '2019-04-14 15:35:49', '2019-04-14 15:40:28'),
(4557, 'مشاهدة فيلم Curse of the Mayans 2017 مترجم', 'مشاهدة فيلم Curse of the Mayans 2017 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر عالم الآثار الأمريكي د. “الان جرين” يقود “دانيال نوبل” وفريقها من غواصي الكهوف في مهمة استكشافية في بحث عن سجلات المايا القديمة. بدلا من إيجاد المجد سيجدون الجحيم مخبأ في كهوف “زيبالبا” تحت الماء.', 'curse-of-the-mayans-2017', 'https://m.media-amazon.com/images/M/MV5BNzE0NDE3ODUxM15BMl5BanBnXkFtZTgwOTEwNzkwMTE@._V1_SX300.jpg', 3.3, 'WEB-DL', 0, 1, 4561, '2019-04-14 15:35:56', '2019-04-14 15:40:26'),
