(4567, 'مشاهدة فيلم Shopgirl 2005 مترجم', 'مشاهدة وتحميل فيلم الدراما والرومانسية Shopgirl 2005 مترجم بجودة WEB-DL كامل أون لاين. تجد البائعة (ميرابيل) نفسها وسط مثلث حب معقد؛ بين رجل الأعمال الثري (راي) والشاب الفقير الطائش (جيريمي). تجاهد ميرابيل لتوفير مصاريف دراستها الجامعية، وهربًا من الوحدة تقيم علاقة مع جيريمي، لكنها حين تلتقي براي تقع في غرامه بعد أن يبهرها بشخصيته الساحرة وأناقته وهداياه الثمينة.', 'shopgirl-2005', 'https://m.media-amazon.com/images/M/MV5BMjE2MTM5NjIyOV5BMl5BanBnXkFtZTcwOTg3NDAzMQ@@._V1_SX300.jpg', 6.4, 'WEB-DL', 0, 1, 4571, '2019-04-14 15:37:27', '2019-04-14 15:40:20'),
