(4569, 'مشاهدة فيلم Stuart: A Life Backwards 2007 مترجم', 'مشاهدة وتحميل فيلم الدراما Stuart: A Life Backwards 2007 مترجم بجودة HD كامل أون لاين. ليتقي (ستيوارت شورتر) الرجل المشرد المدمن للخمور، الذي يملك ماضيا عنيفا مع الكاتب ورجل الأعمال الخيرية (الكسندر ماسترز)، تنشأ بينهما علاقة صداقة من نوع غريب.', 'stuart-a-life-backwards-2007', 'https://m.media-amazon.com/images/M/MV5BM2UwNDBlOTEtODExZC00YzA2LWIyYWUtMzY3NDUzMGMyNTAwXkEyXkFqcGdeQXVyNDM5OTY5MzI@._V1_SX300.jpg', 7.9, 'HD', 0, 1, 4573, '2019-04-14 15:37:39', '2019-04-14 15:40:18'),
