(4580, 'مشاهدة فيلم Babe 1995 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والدراما Babe 1995 بجودة BluRay مترجم اون لاين وتحميل مباشر. ينضم الخنزير (بيب) إلى الحشد الهائل من الحيوانات التي تعيش في مزرعة السيد (هوجات)، لكنه لا يزال صغيرًا، ولا يعرف ما الذي يمكن أن يكونه في هذا العالم، وسرعان ما ينجح في تكوين الكثير من الصداقات داخل المزرعة، بل ينجح في أن يكون مسئولًا عن الأغنام، وهي مهمة خاصة بالكلاب فقط، لكنه يؤديها بكفاءة هائلة.', 'babe-1995', 'https://m.media-amazon.com/images/M/MV5BYjg4ZjUzMzMtYzlmYi00YTcwLTlkOWUtYWFmY2RhNjliODQzXkEyXkFqcGdeQXVyNTUyMzE4Mzg@._V1_SX300.jpg', 6.8, 'BluRay', 0, 1, 4584, '2019-04-14 15:38:39', '2019-04-14 15:40:02'),
