(4583, 'مشاهدة فيلم As Above, So Below 2014 مترجم', 'مشاهدة فيلم الرعب والغموض As Above, So Below 2014 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. تدور أحداث الفلم في سراديب الموتى الملتوية التي تقع أسفل شوارع (باريس) ، وتُعد مخبأ لأرواح لا تحصى، وذلك عندما يقوم فريق من المستكشفين بالمخاطرة في متاهات مجهولة من العظام لكشف سر الظلام الذي يقع داخل مدينة الموتى . الفلم عبارة عن رحلة إلى الجنون والرعب، حيث يتغلغل في أعماق النفس البشرية ، ليكشف عن الشياطين التي تعود لتطاردنا جميعًا بشكل شخصي .', 'as-above-so-below-2014', 'https://m.media-amazon.com/images/M/MV5BMTQzNzg0NDI2MF5BMl5BanBnXkFtZTgwMzgxNzY2MTE@._V1_SX300.jpg', 6.2, 'BluRay', 0, 1, 4587, '2019-04-14 15:38:52', '2019-04-14 15:39:58'),
