(4585, 'فيلم Moving Parts 2017 مترجم اون لاين', 'مشاهدة فيلم الاكشن والجريمة Moving Parts 2017 مترجم بجودة HDRip مشاهدة مباشرة اون لاين.', 'moving-parts-2017', 'https://m.media-amazon.com/images/M/MV5BN2FhYmJhMzEtMjJjYS00ZjY1LThjMGYtMzgwOWUxZjEwMDViXkEyXkFqcGdeQXVyNDg3NzEyMzY@._V1_SX300.jpg', 5.4, 'HDRip', 0, 1, 4589, '2019-04-14 15:39:00', '2019-04-14 15:39:57'),
(4586, 'مشاهدة فيلم Team America: World Police 2004 مترجم', 'مشاهدة فيلم الاكشن والكوميديا Team America: World Police 2004 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. منظمة دولية تدعى “البوليس الدولي” وهدفها الحفاظ على سلامة واستقرار العالم. فور علم المنظمة أن الديكتاتور المجنون “كيم جونج إل” يسعى لتدمير العالم تستدعي المنظمة نجم المسرح الممثل “جاري جونستون” لكي يعمل متخفيا ويعرف المزيد من الأسرار عن الإرهابيين. بمساعدة “فريق أمريكا” سيتمكن “جاري” من الكشف عن الخطة السرية لتدمير العالم. فهل سيتمكن “فريق أمريكا ” من الوصول للخطة وابطالها في الوقت المناسب.', 'team-america-world-police-2004', 'https://m.media-amazon.com/images/M/MV5BMTM2Nzc4NjYxMV5BMl5BanBnXkFtZTcwNTM1MTcyMQ@@._V1_SX300.jpg', 7.2, 'BluRay', 0, 1, 4590, '2019-04-14 15:39:03', '2019-04-14 15:39:56'),
