(4588, 'مشاهدة فيلم The Dead 2: India 2013 مترجم', 'مشاهدة وتحميل فيلم الرعب The Dead 2: India 2013 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب في الجزء الثاني من فيلم الرعب The Dead، تنتشر عدوى مرضية عبر كافة أرجاء (الهند) ، في نفس الوقت الذي يعلم فيه أحد المهندسين الأمريكيين ويدعى (نيكولاس بيرتون) أن صديقته التي تحمل طفلهما في أحشائها محصورة بالقرب من إحدى المناطق العشوائية في مدينة (مومباي) ، وعليه أن يشق طريقه بين عشرات الموتى الأحياء من أجل إنقاذ صديقته .', 'the-dead-2-india-2013', 'uploads/25853677355.jpg', NULL, 'BluRay', 0, 1, 4592, '2019-04-14 15:39:14', '2019-04-14 15:39:55'),
(4589, 'مشاهدة فيلم The Philadelphia Story 1940 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والرومانسية The Philadelphia Story 1940 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب تراسى لورد(Katharine Hepburn)سيدة مجتمع ثرية فى فيلاديلفيا تزوجت زواجا متسرعا بإندفاع غريب من ديكستر هيفن(Cary Grant) لتكتشف إفراطه بالشراب وعدم تقديره للمسئولية،وهى التى تسعى للكمال فحدث الطلاق بينهما سريعا.', 'the-philadelphia-story-1940', 'https://m.media-amazon.com/images/M/MV5BYjQ4ZDA4NGMtMTkwYi00NThiLThhZDUtZTEzNTAxOWYyY2E4XkEyXkFqcGdeQXVyMjUxODE0MDY@._V1_SX300.jpg', 8, 'BluRay', 0, 1, 4593, '2019-04-14 15:39:15', '2019-04-14 15:39:55'),
(4590, 'مشاهدة فيلم Jersey Shore Massacre 2014 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والرعب Jersey Shore Massacre 2014 بجودة BluRay مترجم اون لاين وتحميل مباشر. “مذبحة جيرسي شور” فى اطار من الرعب والكوميديا حيث تدور ملخص قصة الفيلم حول مجموعه من الاصدقاء ست فتيات وخمسة البغيضة يصبحوا اهداف سهله للقاتل مختل', 'jersey-shore-massacre-2014', 'https://m.media-amazon.com/images/M/MV5BMTQwODAwODcxN15BMl5BanBnXkFtZTgwMDg1NzI0MjE@._V1_SX300.jpg', 2.9, 'BluRay', 0, 1, 4594, '2019-04-14 15:39:17', '2019-04-14 15:39:55'),
