(4633, 'مشاهدة فيلم False Confessions 2017 مترجم', 'مشاهدة و تحميل فيلم الكوميديا والدراما False Confessions 2017 مترجم اون لاين جودة WEB-DL وتحميل مباشر مشاهدة اون لاين مباشرة ارامينت الارملة الثرية التي توظف دون ان ترغب دورانت ليكون محاسبها. تتراكم الاسرار والاكاذيب بينما دورانت وشريكه ارامينت دوبوا يتلاعب ليس فقط بارامينت بل ايضا بصديقها ومصدر ثقتها مارتون.', 'false-confessions-2017', 'https://m.media-amazon.com/images/M/MV5BOGQzYjg0ZGItNjdhNS00NTJmLTgxOTUtMjEyMTM4Y2VmMTlkXkEyXkFqcGdeQXVyNTExMTg3MDg@._V1_SX300.jpg', 5.2, 'WEB-DL', 0, 1, 4637, '2019-04-14 15:48:13', '2019-04-14 15:49:16'),
(4634, 'مشاهدة فيلم The Soviet Story 2008 مترجم', 'مشاهدة فيلم الوثائقي والتاريخي The Soviet Story 2008 مترجم بجودة 480 مشاهدة مباشرة اون لاين. وثائقي انصح به صادم وممتع قصة السوفييت وجرائم ستالين الذي فاق هتلر وحشية والنازيين الجدد والعنصرية في روسيا و كيف تغاضى الغرب عن جرائم ستالين لانه حليف ضد النازية و يكفي ان تعرف ان ستالين هو سبب مجاعة اوكرانيا سنة 1932 التي راح ضحيتها 3.5 مليون اوكراني', 'the-soviet-story-2008', 'https://m.media-amazon.com/images/M/MV5BMjE3NDQ4MzUzNV5BMl5BanBnXkFtZTcwMzc0MjAwMg@@._V1_SX300.jpg', 8.1, '0', 0, 1, 4638, '2019-04-14 15:48:22', '2019-04-14 15:49:16'),
(4635, 'مشاهدة فيلم Stephen Hawkings Favorite Places 2016 مترجم', 'مشاهدة فيلم Stephen Hawkings Favorite Places 2016 بجودة 720 مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر هل هناك معنى للحياة؟ ما هو سبب وجودنا؟ يحقق هوكينغ فيما يمكن أن تكشفه لنا القوانين الفيزيائية عن البشرية والواقع', 'stephen-hawkings-favorite-places-2016', 'uploads/221096300671.jpg', NULL, '0', 0, 1, 4639, '2019-04-14 15:48:23', '2019-04-14 15:49:16'),
(4637, 'مشاهدة فيلم The Music of Strangers 2015 مترجم', 'مشاهدة وتحميل فيلم الوثائقي والموسيقى The Music of Strangers 2015 مترجم بجودة WEB-DL كامل اون لاين. يناقش عضو فريق Cellist Yo-Yo Ma والفنانين العالميين الآخرين لمشروع The Silk Road Project فلسفتهم حول الموسيقى والثقافة.', 'the-music-of-strangers-2015', 'https://ia.media-imdb.com/images/M/MV5BMjE1MjU5MTczMl5BMl5BanBnXkFtZTgwMDg2NTQxOTE@._V1_SX300.jpg', 7.7, 'WEB-DL', 0, 1, 4641, '2019-04-14 15:48:25', '2019-04-14 15:49:15'),
(4638, 'مشاهدة فيلم The Passenger 1975 مترجم', 'مشاهدة وتحميل فيلم الدراما والاثارة The Passenger 1975 مترجم بجودة BluRay كامل أون لاين. يأخذ مراسل الحرب المحبط ، غير قادر على العثور على الحرب التي طُلب منه تغطية ، الطريق المحفوف بالمخاطر المتمثل في اختطاف ملف التعريف. تاجر تاجر أسلحة ميت.', 'the-passenger-1975', 'https://m.media-amazon.com/images/M/MV5BM2MyODc3OWEtYzRiYS00Yzc5LTliZjMtNTQ1NWFlMDRmZmVlL2ltYWdlXkEyXkFqcGdeQXVyNzM0MDQ1Mw@@._V1_SX300.jpg', 7.6, 'BluRay', 0, 1, 4642, '2019-04-14 15:48:38', '2019-04-14 15:49:15'),
(4639, 'مشاهدة فيلم Very Good Girls 2013 مترجم', 'مشاهدة وتحميل فيلم الدراما والرومانسية Very Good Girls 2013 مترجم بجودة BluRay كامل اون لاين. فتاتان من نيويورك تعقدان اتفاقية على فقد عذريتهما خلال أجازة الصيف الاولى لهما من الدراسة، وعندما تطارحا ذات الشخص – فنان شوارع – الغرام، تتعرض علاقة الصديقتين لاختبار ليس يهيّن.', 'very-good-girls-2013', 'https://m.media-amazon.com/images/M/MV5BMTk5MTA2MzMyN15BMl5BanBnXkFtZTgwODA1NTAyMjE@._V1_SX300.jpg', 6, 'BluRay', 0, 1, 4643, '2019-04-14 15:48:44', '2019-04-14 15:49:14'),
(4640, 'مشاهدة فيلم Wish I Was Here 2014 مترجم', 'مشاهدة فيلم Wish I Was Here 2014 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر تدور أحداث الفيلم حول (أيدان بلوم) البالغ من العمر 35 عامًا، والذي يناضل في مجال التمثيل، بجوار نضاله في علاقته الزوجية وفي علاقته بأبنائه؛ من حيث محاولته الدءوبة أن يمنحهم تعليمًا لائقًا، وما يزال في الوقت نفسه يبحث عن هدف لحياته، وعن صوته الخاص، وخلال كل هذا، يبدأ أيدان في اكتشاف الكثير من الأشياء التي لم يكن يعرفها عن نفسه.', 'wish-i-was-here-2014', 'https://m.media-amazon.com/images/M/MV5BMjI1MTM5NTY2Nl5BMl5BanBnXkFtZTgwODE4OTk4MTE@._V1_SX300.jpg', 6.7, 'BluRay', 0, 1, 4644, '2019-04-14 15:48:54', '2019-04-14 15:49:14'),
(4641, 'مشاهدة فيلم Decoding Annie Parker 2013 مترجم', 'مشاهدة وتحميل فيلم الدراما Decoding Annie Parker 2013 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب يحكي الفيلم قصة واحد من أهم الاكتشافات الطبية في القرن العشرين، حيث (آني باركر) الشابة ذات الكاريزما العالية، والتي ترعرعت وسط حفنة من المآسي، حيث أن والدتها وأختها وقعتا ضحية لمرض سرطان الثدي، ولاحقا اكتشفت أنها مُصابة بالمرض ذاته، تتشابك قصتها تدريجيا مع متخصصة علم الوراثة (ماري كلير كينج)، والتي تكتشف الجين المسئول عن توارث المرض، وتُحدث ثورة في عالم الطب.', 'decoding-annie-parker-2013', 'https://m.media-amazon.com/images/M/MV5BMTQ0MjkzNzQ3OF5BMl5BanBnXkFtZTgwOTAyNzA2MTE@._V1_SX300.jpg', 6.3, 'BluRay', 0, 1, 4645, '2019-04-14 15:48:56', '2019-04-14 15:49:13'),
(4642, 'مشاهدة فيلم Duel 1971 مترجم', 'مشاهدة و تحميل فيلم الاكشن والاثارة Duel 1971 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة (ديفيد) هو رجل أعمال متوسط الثراء، يضطر لقطع طريق صحراوي بسرعة لحضور اجتماع مهم، ويتسبب اجتيازه لسائق شاحنة مختل، في إثارة غضب السائق الذي يتتبعه في كل مكان للانتقام منه بسبب جرح كرامته، يستمر هروب (ديفيد) وتتبع سائق الشاحنة له، لكنه يدرك في النهاية حتمية المواجهة.', 'duel-1971', 'https://m.media-amazon.com/images/M/MV5BNzRkNjE4NjQtZTQ2NC00YTg1LThiZTMtNmRhYmQzODBlMDc2XkEyXkFqcGdeQXVyNjc1NTYyMjg@._V1_SX300.jpg', 7.7, 'BluRay', 0, 1, 4646, '2019-04-14 15:49:09', '2019-04-14 15:49:12'),
(4643, 'مشاهدة فيلم Strangled 2016 مترجم', 'مشاهدة فيلم الجريمة والاثارة Strangled 2016 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. تدور قصة الفيلم المستوحاة من احداث حقيقية وقعت بالفعل في ريف المجر في عام 1960، حيث تقع سلسلة من حوادث القتل الفظيعة، ويتبين أن مريض نفسي هو الذي وراء هذه الجرائم التي يقوم فيها بذبح النساء الشابات..', 'strangled-2016', 'https://m.media-amazon.com/images/M/MV5BN2RmODY5MzctN2ZhMi00YWNiLTg4MzMtMzFkZWFkZGUyMmI0XkEyXkFqcGdeQXVyMTg2NTc4MzA@._V1_SX300.jpg', 7, 'BluRay', 0, 1, 4647, '2019-04-14 15:49:10', '2019-04-14 15:49:12'),
(4644, 'مشاهدة فيلم That Evening Sun 2009 مترجم', 'مشاهدة و تحميل فيلم الدراما That Evening Sun 2009 مترجم اون لاين جودة HDRip وتحميل مباشر مشاهدة اون لاين مباشرة يعود مزارع في ولاية تينيسي إلى منزله ، ويجب عليه مواجهة خيانة العائلة ، وظهور عدو قديم ، وفقدان مزرعته.', 'that-evening-sun-2009', 'https://m.media-amazon.com/images/M/MV5BMjIzNDM3OTIyMV5BMl5BanBnXkFtZTcwNzc4NzA5Mg@@._V1_SX300.jpg', 7.1, 'HDRip', 0, 1, 4648, '2019-04-14 15:49:11', '2019-04-14 15:49:12'),
(4645, 'فيلم Bottle Rocket 1996 مترجم اون لاين', 'مشاهدة وتحميل فيلم الكوميديا والجريمة Bottle Rocket 1996 مترجم بجودة BRrip كامل أون لاين.', 'bottle-rocket-1996', 'https://m.media-amazon.com/images/M/MV5BNDA3NGEwZGYtN2I0Yy00M2E3LWEzNmItNzUwOWUyYmUzYWZmXkEyXkFqcGdeQXVyNTgzMzU5MDI@._V1_SX300.jpg', 7, '0', 0, 1, 4649, '2019-04-14 15:52:50', '2019-04-14 15:59:32'),
(4646, 'فيلم Altered Hours 2016 مترجم اون لاين', 'مشاهدة فيلم Altered Hours 2016 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر', 'altered-hours-2016', 'https://m.media-amazon.com/images/M/MV5BZWZiMTgxM2EtOTgxOC00NTgxLTgyZDUtYzg5NjA1MTZlZGU4XkEyXkFqcGdeQXVyNTg1NjY3MzQ@._V1_SX300.jpg', 4.6, 'WEB-DL', 0, 1, 4650, '2019-04-14 15:53:00', '2019-04-14 15:59:31'),
(4648, 'مشاهدة فيلم The Anomaly 2014 مترجم', 'مشاهدة و تحميل فيلم الاكشن والخيال العلمي The Anomaly 2014 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة معركة للسيطرة على العقل باستخدام أحدث التكنولوجيا الحيوية، حيث يستيقظ الجندي السابق (ريان ريف) في الجزء الخلفي من سيارة تتحرك، وبجواره صبي صغير مأخوذ كسجين، يحرره، ويبدأ العمل على فهم ما يحدث، بينما ينتقل عقله مرارا وتكرارا بين عالمين موازيين، يتحد مع الغامضة (دانا) ليحارب المنظمة التي حاكت المؤامرة ضده، والمعروفة باسم (الانحراف) بقيادة (هاركين لانغام).', 'the-anomaly-2014', 'https://m.media-amazon.com/images/M/MV5BYzQ0MTIyOTEtZGI1Mi00NzgwLWE2NzAtNTU2NmEwZTM3NTVmXkEyXkFqcGdeQXVyMTYxNjkxOQ@@._V1_SX300.jpg', 4.8, 'BluRay', 0, 1, 4652, '2019-04-14 15:53:18', '2019-04-14 15:59:29'),
(4649, 'مشاهدة فيلم The Blob 1988 مترجم', 'مشاهدة و تحميل فيلم الرعب والخيال العلمي The Blob 1988 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة حينما يصطدم نيزك بالأرض في منطقة أربورفيلا بكالفورنيا، أحد المسنين في منطقة الاصطدام يجد مادة جيلاتينية تلتصق بالأيدي ولا تتركها.', 'the-blob-1988', 'https://m.media-amazon.com/images/M/MV5BYWIzYjFmZTAtNWMxZS00MmVhLTkyYmEtZjkzZWQwMzg0N2ZjXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 6.4, 'BluRay', 0, 1, 4653, '2019-04-14 15:53:30', '2019-04-14 15:59:28'),
(4650, 'فيلم A Wrinkle in Time 2018 مترجم اون لاين', 'مشاهدة و تحميل فيلم المغامره والعائلي A Wrinkle in Time 2018 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون…', 'a-wrinkle-in-time-2018', 'https://m.media-amazon.com/images/M/MV5BMjMxNjQ5MTI3MV5BMl5BanBnXkFtZTgwMjQ2MTAyNDM@._V1_SX300.jpg', 4.2, 'BluRay', 0, 1, 4654, '2019-04-14 15:53:31', '2019-04-14 15:59:27'),
(4651, 'مشاهدة فيلم The Christmas Candle 2013 مترجم', 'مشاهدة وتحميل فيلم الدراما والعائلي The Christmas Candle 2013 مترجم بجودة BluRay كامل أون لاين. ويروي الفيلم قصة قرية بريطانية تدعى غلادبري وتعيش تقليدأ حول وجود ملاك يزور القرية كل ربع قرن يلمس خلالها شمعة تجلب الضوء والحظ السعيد لكل من يضيئها في ليلة الميلاد', 'the-christmas-candle-2013', 'https://m.media-amazon.com/images/M/MV5BMTgzNzM2NjE0OV5BMl5BanBnXkFtZTgwMDY5MjI1MDE@._V1_SX300.jpg', 6.2, 'BluRay', 0, 1, 4655, '2019-04-14 15:53:41', '2019-04-14 15:59:27'),
(4652, 'فيلم Dead on Arrival 2017 مترجم اون لاين', 'مشاهدة فيلم الاثارة Dead on Arrival 2017 مترجم بجودة DVDRip مشاهدة مباشرة اون لاين.', 'dead-on-arrival-2017', 'https://m.media-amazon.com/images/M/MV5BZTAyNDEyMDUtYTU2YS00Y2E5LThiODYtNThkMTRmMTI3MjllXkEyXkFqcGdeQXVyMjA0NjgxOTk@._V1_SX300.jpg', 6.6, 'DVDRip', 0, 1, 4656, '2019-04-14 15:53:41', '2019-04-14 15:59:26'),
(4653, 'مشاهدة فيلم The Graduate 1967 مترجم', 'مشاهدة و تحميل فيلم الكوميديا والدراما The Graduate 1967 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة (بنيامين) عاد إلى (لوس أنجلوس) بعد أن حصل على شهادته العليا، ويُستقبَل من والديه استقبال الأبطال، ويسأله الجميع عن خططه المستقبلية، وينصحه الجميع بما ينبغي عليه فعله..', 'the-graduate-1967', 'https://m.media-amazon.com/images/M/MV5BMTQ0ODc4MDk4Nl5BMl5BanBnXkFtZTcwMTEzNzgzNA@@._V1_SX300.jpg', 8, 'BluRay', 0, 1, 4657, '2019-04-14 15:53:53', '2019-04-14 15:59:25'),
(4654, 'فيلم Beware the Lake 2017 مترجم اون لاين', 'مشاهدة و تحميل فيلم الرعب والاثارة Beware the Lake 2017 مترجم اون لاين جودة HDRip وتحميل مباشر مشاهدة اون لاين…', 'beware-the-lake-2017', 'https://m.media-amazon.com/images/M/MV5BNmEyZGY0MmMtZGVjZC00NjFkLTgxYjAtMTI4ZDVlMjQ1N2ZhXkEyXkFqcGdeQXVyMTg0MTI3Mg@@._V1_SX300.jpg', 3.7, 'HDRip', 0, 1, 4658, '2019-04-14 15:53:57', '2019-04-14 15:59:25'),
(4655, 'مشاهدة فيلم The Thirteenth Floor 1999 مترجم', 'مشاهدة فيلم الغموض والخيال العلمي The Thirteenth Floor 1999 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. (هانون) عالم عبقري يكتشف شيئا خطيراً مذهلاً قد يغير موازين العلم، ويستعد لإعلان اكتشافه، ولكن جهة ما تراقبه، وتسعى للعثور على اكتشافه، يصاب بالذعر فيترك شفرة على حاسوبه تقود إلى عالم مواز في الثلاثينيات، يكتشف صديقه العالم (دوجلاس) مقتل زميله (هانون)، ويصل إلى الشفرة، ويحاول حل اللغز في عالم الثلاثينيات الموازي.', 'the-thirteenth-floor-1999', 'https://m.media-amazon.com/images/M/MV5BODYxZTZlZTgtNTM5MC00N2RhLTg3MjUtNGVkMDJjMGY3YzA5L2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 7, 'BluRay', 0, 1, 4659, '2019-04-14 15:54:06', '2019-04-14 15:59:24'),
(4656, 'فيلم Last Passenger 2013 مترجم اون لاين', 'مشاهدة وتحميل فيلم الاكشن والغموض Last Passenger 2013 بجودة BluRay مترجم اون لاين وتحميل مباشر.', 'last-passenger-2013', 'https://m.media-amazon.com/images/M/MV5BODkxNTE2NjczNF5BMl5BanBnXkFtZTgwOTQ2NzA1MTE@._V1_SX300.jpg', 5.7, 'BluRay', 0, 1, 4660, '2019-04-14 15:54:10', '2019-04-14 15:59:24'),
(4657, 'مشاهدة فيلم Life Is Sweet 1990 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والدراما Life Is Sweet 1990 مترجم بجودة BluRay كامل أون لاين. نادلة ، زوج طباخها ، وابنتيهما التوأم يفكران في حياتهم على مدى بضعة أسابيع في ضاحية من الطبقة العاملة شمال لندن.', 'life-is-sweet-1990', 'https://m.media-amazon.com/images/M/MV5BNjM4NTk5OTMtN2EzOS00N2U3LTlhYjgtZjAwMjkyYzQ0ZTg0XkEyXkFqcGdeQXVyMTAwMzUyOTc@._V1_SX300.jpg', 7.5, 'BluRay', 0, 1, 4661, '2019-04-14 15:54:18', '2019-04-14 15:59:23'),
(4658, 'مشاهدة فيلم Mr. Magoriums Wonder Emporium 2007 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والعائلي Mr. Magoriums Wonder Emporium 2007 بجودة BluRay مترجم اون لاين وتحميل مباشر. تعمل “مولي” لدى السيد “ماجوريام” في متجره السحري لألعاب الأطفال، والتي تصبح حقيقية بمجرد إيمان الزبائن بذلك، لكن بعد فترة تستاء مولي من مستقبلها في ذلك المتجرنن، بعد رحيل ماجوريام يفاجئها المحاسب الخاص به بتوريث المتجر إليها، وعندما يحدث ذلك تخشى مولي تلك المسئولية، وتقرر بيعه، إلا أنه يحدث ما لم تكن تتوقعه.', 'mr-magoriums-wonder-emporium-2007', 'uploads/62135357021.jpg', NULL, 'BluRay', 0, 1, 4662, '2019-04-14 15:54:19', '2019-04-14 15:59:22'),
