(4663, 'مشاهدة فيلم People Like Us 2012 مترجم', 'مشاهدة فيلم People Like Us 2012 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر قصة الفيلم درامية مستوحاة من أحداث حقيقية فسام (كريس بان) شاب يتوفى والده فجأة، فيضطر إلى النظر في عقارات والده التي تركها له، كذلك معاودة الاتصال بشقيقته فرانكي (إليزابيث فرانكس) البالغة 30 عاما وتتوطد العلاقة بينهما، ثم يكتشف سام سرا مذهلا يقلب حياته رأسا على عقب؛ فيضطر إلى إعادة التفكير في العديد من الأمور بحياته الخاصة.', 'people-like-us-2012', 'https://m.media-amazon.com/images/M/MV5BMTM3MzUyNzg3NF5BMl5BanBnXkFtZTcwNjk3NDA4Nw@@._V1_SX300.jpg', 7.1, 'BluRay', 0, 1, 4667, '2019-04-14 15:54:46', '2019-04-14 15:59:20'),
(4664, 'مشاهدة فيلم Razorback 1984 مترجم', 'مشاهدة وتحميل فيلم الرعب والاثارة Razorback 1984 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب يحكي عن خنزير بري آكل للحوم البشر يثير الرعب في ضواحي أستراليا المنعزلة، ويمثل نجم التلفزيون المخضرم غريغوري هاريسون دور كارل، الرجل الذي يبحث عن زوجته الصحافية المفقودة، التي اختفت ولم يشاهدها أحد منذ أن بدأت هذه الهجمات.', 'razorback-1984', 'https://m.media-amazon.com/images/M/MV5BYTk3MzVhMjQtMjk0Yi00ZmJmLThjNjMtY2FjYmY4NGU1NmUwXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 6, 'BluRay', 0, 1, 4668, '2019-04-14 15:54:55', '2019-04-14 15:59:20'),
