(4671, 'مشاهدة فيلم Wild Things 1998 مترجم', 'مشاهدة و تحميل فيلم الجريمة والدراما Wild Things 1998 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة (سام لومباردو) يعمل مستشارًا اجتماعيًّا في مدرسة ثانوية ويحيا حياة سعيدة، لكن حياته تنقلب رأسًا على عقب بعد أن تتهمه التلميذة المشاغبة (كيلي فان رايان) باغتصابها، وهى تلميذة جميلة، ووالدتها من أغنى سيدات المنطقة وأكثرهن نفوذًا في المجتمع..', 'wild-things-1998', 'https://m.media-amazon.com/images/M/MV5BODMyYTlkNWYtODAzMC00ZjFiLWE3YjctMGUyMzM1MDk3ZDFlXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 6.5, 'BluRay', 0, 1, 4675, '2019-04-14 15:55:40', '2019-04-14 15:59:16'),
