(4673, 'مشاهدة فيلم Small Time Crooks 2000 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والجريمة Small Time Crooks 2000 بجودة BluRay مترجم اون لاين وتحميل مباشر. يتناول الفيلم قصة “راي” وزوجته “فرينشي” . حيث سجن “راي” من قبل لقيامه بمحاولة فاشلة لسرقة بنك , بينما “فرينشي” , النادلة والتي تحلم بأن تصبح سيدة مجتمع راقية ( ويبدو هذا واضحا من خلال متابعتها المستمر لأفلام عن الأميرة ديانا ).', 'small-time-crooks-2000', 'https://m.media-amazon.com/images/M/MV5BNTA2NTBiMzEtMDA2My00YWNhLWJjMjAtYTUyMzMwNjM0Mjk2XkEyXkFqcGdeQXVyNDk3NzU2MTQ@._V1_SX300.jpg', 6.7, 'BluRay', 0, 1, 4677, '2019-04-14 15:55:53', '2019-04-14 15:59:15'),
