(4782, 'مشاهدة فيلم Shark Killer 2015 مترجم', 'مشاهدة وتحميل فيلم الاكشن والاثارة Shark Killer 2015 مترجم بجودة WEB-DL كامل اون لاين. يحكي الفيلم قصة العصابات حيث أتناء احد عملياتها سقطت قطع الماس و ابتعلتها سمكة القرش و هنا تبدأ القصة لاستراجع القطع التي ابتلعتها اسماك القرش .', 'shark-killer-2015', 'https://m.media-amazon.com/images/M/MV5BOTZjNjdkY2EtYWI3ZC00NzAyLTg4M2EtZjhkMzMwNGUyOGQyXkEyXkFqcGdeQXVyNDE5MTU2MDE@._V1_SX300.jpg', 4.2, 'WEB-DL', 0, 1, 4786, '2019-04-14 17:12:06', '2019-04-14 17:17:01'),
(4783, 'مشاهدة فيلم The Time Capsule 2018 مترجم', 'مشاهدة فيلم The Time Capsule 2018 بجودة HDRip مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر يجتمع اصدقاء من الثانوية لاخراج كبسولة الزمن خاصتهم. حين يفتحونها يتذكرون افضل لحظاتهم في الثانوية. لم يعرفوا ان الكبسولة يمكنها اصلاح القلوب المكسورة والالهام بعلاقات جديدة.', 'the-time-capsule-2018', 'https://m.media-amazon.com/images/M/MV5BNGM3NmM3YzYtYzQwZS00MjYxLWJjNjgtNzYyNWJmNmNkOTEwXkEyXkFqcGdeQXVyODA4MDAxOTM@._V1_SX300.jpg', 5.4, 'HDRip', 0, 1, 4787, '2019-04-14 17:12:19', '2019-04-14 17:17:01'),
(4784, 'مشاهدة فيلم The Ornithologist 2016 مترجم', 'مشاهدة فيلم The Ornithologist 2016 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر فرناندو، عالم الطيور الانفرادي، يبحث عن اللقالق السوداء عندما اجتاحه المنحدراتفي محاولة للحصول على العودة على طريقه.', 'the-ornithologist-2016', 'https://m.media-amazon.com/images/M/MV5BNTY4ODY2OGUtYTc4OC00OTE5LWFhZTMtOGQ4ZmRmNTRiZjFlXkEyXkFqcGdeQXVyMTU2NjUwNTg@._V1_SX300.jpg', 6.3, 'BluRay', 0, 1, 4788, '2019-04-14 17:12:20', '2019-04-14 17:17:00'),
(4785, 'مشاهدة فيلم The Red Thread 2016 مترجم', 'مشاهدة وتحميل فيلم الدراما والرومانسية The Red Thread 2016 مترجم بجودة WEB-DL كامل أون لاين. يتقابل “مانويل” و “أبريل” مجددًا بعد 7 أعوام من أول لقاء مصيري بينهما. وعلى الرغم من أن كليهما متزوج، إلا أن انجذابهما قد نما.', 'the-red-thread-2016', 'https://m.media-amazon.com/images/M/MV5BYTMzNTYzMDItODg4My00YjIzLTkzYTktYjU0ODUyODIwODdmXkEyXkFqcGdeQXVyMTkwMzU0NTk@._V1_SX300.jpg', 5.4, 'WEB-DL', 0, 1, 4789, '2019-04-14 17:12:35', '2019-04-14 17:17:00'),
(4786, 'مشاهدة فيلم The Model 2016 مترجم', 'مشاهدة و تحميل فيلم الدراما The Model 2016 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة تدور أحداث القصة حول عالم الأزياء والشغف الكبير به، حيث يتناول قصة عارضة الأزياء (إيما) وسعيها الحثيث لدخول عالم الموضة الشهير في باريس، تكافح إيما من أجل تحقيق هدفها في الصعود وبلوغ قمة هذا المجال الهام لها، وعلاقتها بمصور الموضة والأزياء (شاين وايت) التي تتطور إلى درجة الخطورة.', 'the-model-2016', 'https://m.media-amazon.com/images/M/MV5BMjE1MzAxMTMxMV5BMl5BanBnXkFtZTgwODczMjE0NzE@._V1_SX300.jpg', 5.8, 'BluRay', 0, 1, 4790, '2019-04-14 17:12:36', '2019-04-14 17:17:00'),
(4787, 'مشاهدة فيلم Beyond the Edge 2018 مترجم', 'مشاهدة وتحميل فيلم الاكشن والمغامره Beyond the Edge 2018 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب في مدينة (موسكو)، يحاول مقامر محترف أن يجمع فريقًا من اﻷشخاص الذين يتمتعون بقدرات خارقة وغير طبيعية في سبيل الفوز بلعبة مقامرة كبرى تنعقد في إحدى الكازينوهات، لكنهم يجدون في طريقهم خصم أقوى بكثير عليهم تجاوزه.', 'beyond-the-edge-2018', 'https://m.media-amazon.com/images/M/MV5BMTFkNzIxMTAtODZjOS00YzIwLWIzMTMtNzRjZTg1Nzk0MzZkXkEyXkFqcGdeQXVyMzY0MTE3NzU@._V1_SX300.jpg', 4.7, 'BluRay', 0, 1, 4791, '2019-04-14 17:12:48', '2019-04-14 17:16:59'),
(4788, 'مشاهدة فيلم Cover Versions 2018 مترجم', 'مشاهدة وتحميل فيلم الغموض Cover Versions 2018 بجودة WEB-DL مترجم اون لاين وتحميل مباشر. اعضاء في فرقة يروون قصة مختلفة عن ليلة من الجنس والمخدرات وجريمة قتل قبل عرضهم الكبير الاول في مهرجان موسيقي شهير.', 'cover-versions-2018', 'https://m.media-amazon.com/images/M/MV5BOGI5Nzc2YjktNGY4Ni00NmI4LWI1MmEtZDQwYzJjNjhkNWM5XkEyXkFqcGdeQXVyMzE5ODc1OA@@._V1_SX300.jpg', 5.5, 'WEB-DL', 0, 1, 4792, '2019-04-14 17:13:00', '2019-04-14 17:16:59'),
(4789, 'مشاهدة فيلم Double Date 2017 مترجم', 'مشاهدة فيلم Double Date 2017 بجودة HDRip مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر البريء الذي يخاف الفتيات وفي مسعى جنوني لاثبات رجولته في الليلة التي تسبق بلوغه ال30. هو وصديقه المتبجح اليكس يظنان انهما ربحا اليانصيب عندما يقابلان قريبتيهما الجميلتين كيتي ولولو اللتان تبدوان مستعدتين لاي شيء في ليلة الاحتفال. لكنهما لم يعرفا ان الفتاتين تريدان ان يخسر جيم ما هو اكثر من عذريته لم تكن المضاحعة صعبة هكذا ابدا.', 'double-date-2017', 'https://m.media-amazon.com/images/M/MV5BNjA5ZGNmMDYtYTBiNi00YTk5LWI2MzUtNjYzZjliZjk5ZjZmXkEyXkFqcGdeQXVyNTI1MDU0MzM@._V1_SX300.jpg', 6.1, 'HDRip', 0, 1, 4793, '2019-04-14 17:13:22', '2019-04-14 17:16:58'),
(4790, 'مشاهدة فيلم Evil Doctor 2018 مترجم', 'مشاهدة و تحميل فيلم الاثارة Evil Doctor 2018 مترجم اون لاين جودة HDTV وتحميل مباشر مشاهدة اون لاين مباشرة مات واوبري سينجبان طفلهما الاول. ذهبا للقاء د. ناتالي بارنز الطبيبة النسائية لكنها ليست كما تبدو. تبدل صور الاشعة وتكذب على اوبري بينما تحاول اغواء مات. فشلت مساعي د. بارنز في الحمل والان حولت انتباهها نحو طفل اوبري.', 'evil-doctor-2018', 'https://m.media-amazon.com/images/M/MV5BZTMxNTc4ZDQtYjlhNS00NGRjLTlkNzgtZDFmNDc5ODA1N2IyXkEyXkFqcGdeQXVyNjU2NzExNTU@._V1_SX300.jpg', 5.6, 'HDTV', 0, 1, 4794, '2019-04-14 17:13:23', '2019-04-14 17:16:58'),
(4791, 'مشاهدة فيلم Honey: Rise Up and Dance 2018 مترجم', 'مشاهدة وتحميل فيلم الدراما والموسيقى Honey: Rise Up and Dance 2018 مترجم بجودة WEB-DL كامل أون لاين. راقصة الشوارع الملهمة سكايلر امام مفترق طرق في حياتها. قررت دخول نفس فريق الرقص كشقيقتها امحترفة سابقا توشا لتتنافس على منحة دراسية لكن عائلتها وصديقها الحميم لا يشجعونها ويشككون في ان موهبتها القليلة كافية لتربح. مع تصميمها على اثبات خطا الجميع تتدرب سكايلر بلا توقف في قاعة اتلانتا للرقص وتلفت نظر تايريل. يساعدها على رفع مهاراتها في الرقص والهيب هوب الى المستوى التالي لتصل الى احلامها.', 'honey-rise-up-and-dance-2018', 'https://m.media-amazon.com/images/M/MV5BMjY2YzUxYmQtMTUyMC00MzdiLTg3NjAtNWU1MDc4Nzg1ZmVkXkEyXkFqcGdeQXVyNTM3MDMyMDQ@._V1_SX300.jpg', 5.2, 'WEB-DL', 0, 1, 4795, '2019-04-14 17:13:36', '2019-04-14 17:16:58'),
(4792, 'مشاهدة فيلم Paterno 2018 مترجم', 'مشاهدة وتحميل فيلم السيرة الذاتية والدراما Paterno 2018 مترجم بجودة WEB-DL كامل اون لاين. تدور أحداث الفيلم حول مدرب كرة القدم الأمريكية (جو باتيرنو)، والذي يعتبر من أساطير المجال التدريبي، والمتهم في قضية أخلاقية.', 'paterno-2018', 'https://m.media-amazon.com/images/M/MV5BNDVhZDQzMWQtOGE4Yy00MDY5LWFmMDktZjk2Mzk3NjY3MmY3XkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg', 6.5, 'WEB-DL', 0, 1, 4796, '2019-04-14 17:13:43', '2019-04-14 17:16:57'),
(4793, 'مشاهدة فيلم Riphagen 2016 مترجم', 'مشاهدة و تحميل فيلم الدراما والحرب Riphagen 2016 مترجم اون لاين جودة WEB-DL وتحميل مباشر مشاهدة اون لاين مباشرة يروي فيلم السيرة الذاتية هذا قصة “أندريس ريفاغن”؛ مجرم هولندي كان يبتزّ اليهود خلال الحرب العالمية الثانية، والمسؤول عن مئات القتلى.', 'riphagen-2016', 'https://m.media-amazon.com/images/M/MV5BNDUxMGE1OGItZTk2OS00NGE4LTllZjItNDk1NGUwYzgwNDU0XkEyXkFqcGdeQXVyMjA5MDA0Mw@@._V1_SX300.jpg', 7.2, 'WEB-DL', 0, 1, 4797, '2019-04-14 17:14:01', '2019-04-14 17:16:57'),
(4794, 'مشاهدة فيلم Risk 2016 مترجم', 'مشاهدة وتحميل فيلم الوثائقي Risk 2016 مترجم بجودة BluRay كامل اون لاين. واحد من افضل الافلام الوثائقية وتدور قصته حول رئيس تحرير موقع “ويكيليكس” الصحفي والمبرمج والناشط الأسترالي “جوليان أسانج” من وجهة نظر مخرجة الأفلام “لورا بويتراس”.', 'risk-2016', 'https://m.media-amazon.com/images/M/MV5BMzIzNzYzMDM0NF5BMl5BanBnXkFtZTgwNzA1OTgwMjI@._V1_SX300.jpg', 6.3, 'BluRay', 0, 1, 4798, '2019-04-14 17:14:24', '2019-04-14 17:16:57'),
(4795, 'مشاهدة فيلم 7 Años 2016 مترجم', 'مشاهدة فيلم الدراما 7 Años 2016 مترجم بجودة WEB-DL مشاهدة مباشرة اون لاين. تُختبر الولاءات ويُكشف القناع عن الأفعال الوحشية عندما يتجادل أربعة شركاء عمل في ليلة عصيبة حول مَن سيدفع ثمن الجريمة التي ارتكبوها.', '7-aos-2016', 'uploads/15955486437.jpg', 5, 'WEB-DL', 0, 1, 4799, '2019-04-14 17:14:41', '2019-04-14 18:01:33'),
(4796, 'مشاهدة فيلم A Bride for Rip Van Winkle 2016 مترجم', 'مشاهدة فيلم الدراما والغموض A Bride for Rip Van Winkle 2016 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. تدور حول سيدة تدعى “نانامي” تقوم باستئجار مجموعة من الممثلين للعب دور أصدقائها وأقاربها في حفل زفافها', 'a-bride-for-rip-van-winkle-2016', 'https://m.media-amazon.com/images/M/MV5BMTI1MDk0YjYtZTZlMy00YWEwLThmNTItMWY5MmJmOTQyNGZmXkEyXkFqcGdeQXVyNjUyODU3MDM@._V1_SX300.jpg', 7.2, 'BluRay', 0, 1, 4800, '2019-04-14 17:15:02', '2019-04-14 17:16:56'),
(4797, 'مشاهدة فيلم As You Are 2016 مترجم', 'مشاهدة وتحميل فيلم الدراما والغموض As You Are 2016 بجودة WEB-DL مترجم اون لاين وتحميل مباشر. في بداية التسعينات كلمة ” كما أنت ” هي تحديد أو إعادة تحديد لعلاقة لثلاثة مراهقين بينما تشق طريقها خلال بناء ذكريات قوية معززة بتحقيق جنائي.', 'as-you-are-2016', 'https://m.media-amazon.com/images/M/MV5BZWFiMjdjODktMWY4YS00MWU0LThiNDUtNDI4ODY0NzhhMGFkXkEyXkFqcGdeQXVyNjU1MjQzMjQ@._V1_SX300.jpg', 6.6, 'WEB-DL', 0, 1, 4801, '2019-04-14 17:15:16', '2019-04-14 17:16:55'),
(4798, 'مشاهدة فيلم Her Love Boils Bathwater 2016 مترجم', 'مشاهدة فيلم Her Love Boils Bathwater 2016 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر تدور أحداث الفيلم عن أُم صارمة لكنها مُراعية لأبعد حد تتلقى صفعة من الحياة توقظها من غفوتها عندما تعلم بأنها مُصابة بالسرطان، وتبقى لها أشهر قليلة لتعيشها. فتتدراك ماتبقى لها من الوقت بإكمال أربعة مهام مهمة والكشف عن سرٍ دفين تُخفيه للجميع.', 'her-love-boils-bathwater-2016', 'https://m.media-amazon.com/images/M/MV5BZmVhMTBmZmItODk1Mi00MjU3LTk0N2UtMjcwOTg1ZDkwYTE0XkEyXkFqcGdeQXVyNDQ3MTIyODQ@._V1_SX300.jpg', 7.6, 'BluRay', 0, 1, 4802, '2019-04-14 17:15:27', '2019-04-14 17:16:55'),
(4799, 'مشاهدة فيلم Knucklebones 2016 مترجم', 'مشاهدة وتحميل فيلم الرعب Knucklebones 2016 مترجم بجودة BluRay كامل اون لاين. فى اطار من الرعب حول مجموعة من طلاب الجمعات تحدث لهم مفاجأت مرعبة وذلك اثناء قيامهم بلعب النرد', 'knucklebones-2016', 'https://m.media-amazon.com/images/M/MV5BNmJjODYxZDYtODMzMC00Yzk5LThlMGEtMWIwNTdlMTg2ODBlXkEyXkFqcGdeQXVyNDY3NTE4MjY@._V1_SX300.jpg', 3.7, 'BluRay', 0, 1, 4803, '2019-04-14 17:15:37', '2019-04-14 17:16:55'),
(4800, 'مشاهدة فيلم Why Blame It on the Child 2016 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والرومانسية Why Blame It on the Child 2016 بجودة WEB-DL مترجم اون لاين وتحميل مباشر. بعد أن أسفرت علاقة ليلة واحدة عن حدوث حمل، تقرر امرأة شابة أن تصبح شريكة الأب المرتقب غير الناضج عاطفيًا.', 'why-blame-it-on-the-child-2016', 'uploads/20638848922.jpg', NULL, 'WEB-DL', 0, 1, 4804, '2019-04-14 17:15:38', '2019-04-14 17:16:53'),
(4801, 'مشاهدة فيلم Dirty Dead Con Men 2018 مترجم', 'مشاهدة فيلم الاكشن والجريمة Dirty Dead Con Men 2018 مترجم بجودة WEB-DL مشاهدة مباشرة اون لاين. حول شرطي ونصاب محترف يتعاونان معا لتنفيذ مداهمة قبل وصول رجال الشرطة لكن تسوء الامور اكثر مما كانا يتوقعان.', 'dirty-dead-con-men-2018', 'https://m.media-amazon.com/images/M/MV5BMWU4MTI1NWEtZDkwNS00YTM0LTgxYzAtODQxY2Q1MDVkZDI2XkEyXkFqcGdeQXVyMTkyMTYyNQ@@._V1_SX300.jpg', 4.5, 'WEB-DL', 0, 1, 4805, '2019-04-14 17:15:42', '2019-04-14 17:16:53'),
(4802, 'مشاهدة فيلم The Preachers Son 2017 مترجم', 'مشاهدة وتحميل فيلم الدراما والغموض The Preachers Son 2017 بجودة WEB-DL مترجم اون لاين وتحميل مباشر. الأسقف ويلسون وزوجته وطفليه عائلة محترمة في مجتمعهم ومع ذلك فإن أطفال ويلسون يكافحون الإغراءات ولديهم ابن دانتي لديه أفكار أخرى غير الاستيلاء على كنيسة آباءه', 'the-preachers-son-2017', 'uploads/221780986589.jpg', NULL, 'WEB-DL', 0, 1, 4806, '2019-04-14 17:15:43', '2019-04-14 17:16:53'),
(4803, 'مشاهدة فيلم 4/20 Massacre 2018 مترجم', 'مشاهدة وتحميل فيلم الاكشن والرعب 4/20 Massacre 2018 مترجم بجودة HDRip كامل اون لاين. مجموعة من خمسة نساء يقومون بالتخييم في الغابات للإحتفال بعيد ميلاد أحدى الصديقات،ولكن عند عبور عشب الماريجوانا، فعليهم الكفاح من أجل النجاة من هذا الجحيم.', '420-massacre-2018', 'https://m.media-amazon.com/images/M/MV5BZDg2NDJkOGYtMjM3My00Mzc2LWJiYjktODFlMzBjNmQwMTEyXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 6.2, 'HDRip', 0, 1, 4807, '2019-04-14 17:15:51', '2019-04-14 17:16:53'),
(4804, 'مشاهدة فيلم Deep Blue Sea 2 2018 مترجم', 'مشاهدة فيلم Deep Blue Sea 2 2018 بجودة HDRip مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر ملياردير عبقري يدعى كارل دورانت يجري تجارب على القروش والتي سرعان ما تتمرد لتحدث الفوضى لمجموعة من العلماء.', 'deep-blue-sea-2-2018', 'https://m.media-amazon.com/images/M/MV5BZWM0NjVkOGYtMjk5Mi00NGVmLWE3NDMtMDQ3ZjdjMDcwYzdlL2ltYWdlXkEyXkFqcGdeQXVyNTAyODkwOQ@@._V1_SX300.jpg', 5.8, 'HDRip', 0, 1, 4808, '2019-04-14 17:16:05', '2019-04-14 17:16:52'),
(4805, 'مشاهدة فيلم Love, Simon 2018 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والدراما Love, Simon 2018 بجودة HDCAM مترجم كامل اون لاين مشاهدة مباشرة يوتيوب كل شخص يستحق قصة الحب الخاصة به. لكن مع (سيمون)، الأمر مُعقد للغاية؛ فلا أحد يعلم أنه شاذ جنسيًا، كما أنه لا يعرف بعد زميله الذي وقع في غرامه من خلال شبكة الانترنت', 'love-simon-2018', 'https://m.media-amazon.com/images/M/MV5BNTMyZDdiMzUtZjcxNS00Mjc3LTljY2UtYjI4YmY5NzJlYjc1XkEyXkFqcGdeQXVyMTA5OTkwNTc@._V1_SX300.jpg', 7.7, 'HDCAM', 0, 1, 4809, '2019-04-14 17:16:06', '2019-04-14 17:16:52'),
(4806, 'مشاهدة فيلم Off the Menu 2018 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والرومانسية Off the Menu 2018 بجودة WEB-DL مترجم كامل اون لاين مشاهدة مباشرة يوتيوب وريث غير محتمل لمطعم وجبات سريعة مكسيكي ينطلق للبحث عن الطاهي الموهوب التالي ويجد نفسه في مدينة صغيرة متربة في نيو مكسيكو حيث يأتي محبو الطعام من كل مكان لياكلوا الطعام اللذيذ الذي تعده طاهية اصلية.', 'off-the-menu-2018', 'https://m.media-amazon.com/images/M/MV5BNGVjZTdkYmYtOTc3Ny00NTlmLWEzYjAtNjdmYWZlNzczNTQ5XkEyXkFqcGdeQXVyNTE1OTQ3NTA@._V1_SX300.jpg', 5.6, 'WEB-DL', 0, 1, 4810, '2019-04-14 17:16:19', '2019-04-14 17:16:52'),
(4807, 'مشاهدة فيلم Part-time Spy 2017 مترجم', 'مشاهدة وتحميل فيلم الاكشن والكوميديا Part-time Spy 2017 مترجم بجودة WEB-DL كامل أون لاين. يانغ يونغ سيل على وظيفة في وكالة الامن القومي. تم توظيفها ككاتبة متعاقدة لتكتب امورا ايجابية عن الوكالة. نا يونغ ان محقق يستخدم لغة سيئة دائما. ينطلقان في عملية تصفية لاستعادة مال سرق من رئيسها بعد خدعة صوتية.', 'part-time-spy-2017', 'https://m.media-amazon.com/images/M/MV5BOTNkODQ0YjctZDMwNC00ZjFkLWI3MjYtYTE5Y2ZlYzQ4MzdhXkEyXkFqcGdeQXVyNjIzNjIxNzc@._V1_SX300.jpg', 5.5, 'WEB-DL', 0, 1, 4811, '2019-04-14 17:16:30', '2019-04-14 17:16:51'),
(4808, 'مشاهدة فيلم Sylvio 2017 مترجم', 'مشاهدة فيلم Sylvio 2017 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر “تنضم غوريلا إلى بلدة صغيرة في برنامج تلفزيوني محلي، حيث تُتابع سلسلة من الحوادث على الهواء من الشهرة والحب إلى الكره”', 'sylvio-2017', 'https://images-na.ssl-images-amazon.com/images/M/MV5BYjBjNzk2ZjctNTViYi00MTc2LWFlMjItODEzNDU2OWQ3MWI0XkEyXkFqcGdeQXVyNTkwMjc3OQ@@._V1_SX300.jpg', 8.4, 'WEB-DL', 0, 1, 4812, '2019-04-14 17:16:32', '2019-04-14 17:16:51'),
(4809, 'مشاهدة فيلم The Strangers: Prey at Night 2018 مترجم', 'مشاهدة وتحميل فيلم الرعب The Strangers: Prey at Night 2018 بجودة HDCAM مترجم كامل اون لاين مشاهدة مباشرة يوتيوب رحلة برية عائلية تأخذ منعطفًا خطيرًا عندما تصل إحدى العائلات إلى حديقة تقع خارج نطاق تغطية المحمول، لكي يجلسوا مع بعض أقاربهم، لكنهم يكتشفوا أن الحديقة الغامضة مهجورة بالكامل، وتحت غطاء الظلام، يقوم ثلاثة مرضى نفسيين ملثمين، بوضع العائلة تحت اختبار الكفاح من أجل البقاء', 'the-strangers-prey-at-night-2018', 'https://m.media-amazon.com/images/M/MV5BMTY1OTIwODgzMV5BMl5BanBnXkFtZTgwMzUyMDgzNDM@._V1_SX300.jpg', 5.2, 'HDCAM', 0, 1, 4813, '2019-04-14 17:16:33', '2019-04-14 17:16:50'),
