(4821, 'مشاهدة فيلم The Madness of King George 1994 مترجم', 'مشاهدة وتحميل فيلم السيرة الذاتية والكوميديا The Madness of King George 1994 مترجم بجودة BluRay كامل اون لاين. فيلم كوميدى يستند إلى حقائق تاريخية حول مرض وجنون الملك (جورج الثالث)، والذى كان يعتقد كذلك أن جنونه هو عرض لاضطرابات فى الدم، حول أفعاله وتصرفاته الهوجاء، وكيف أنه أصبح شخصا غير مرغوب فيه فى عوالم السياسة، وكيف تسبب جنونه فى بعض القرارات الخطأ والحمقاء.', 'the-madness-of-king-george-1994', 'https://m.media-amazon.com/images/M/MV5BMTNiNzk1YjMtODViOC00MjUyLWI3MmMtZjhkMjlkYTM0NjU2XkEyXkFqcGdeQXVyMTMxMTY0OTQ@._V1_SX300.jpg', 7.2, 'BluRay', 0, 1, 4825, '2019-04-14 17:22:48', '2019-04-14 17:27:33'),
