(4824, 'مشاهدة فيلم Incorruptible 2015 مترجم', 'مشاهدة وتحميل فيلم الوثائقي والاكشن Incorruptible 2015 بجودة WEB-DL مترجم كامل اون لاين مشاهدة مباشرة يوتيوب في شوارع السنغال، تنهض حركة شبابية تُناهض نظامًا عازمًا على البقاء في السلطة بالقوة في هذا الوثائقي عن انتخابات الأمة العاصفة عام 2012.', 'incorruptible-2015', 'https://m.media-amazon.com/images/M/MV5BMTA4MjkyMjAxMTBeQTJeQWpwZ15BbWU4MDY1OTczMzcx._V1_SX300.jpg', 5.7, 'WEB-DL', 0, 1, 4828, '2019-04-14 17:23:31', '2019-04-14 17:27:32'),
(4825, 'مشاهدة فيلم LA 92 2017 مترجم', 'مشاهدة فيلم الوثائقي والتاريخي LA 92 2017 مترجم بجودة WEB-DL مشاهدة مباشرة اون لاين. فيلم من توزيع ناشيونال جيوغرافيك، عرض في ٢٨ أبريل ٢٠١٧ في الولايات المتحدة، من إخراج كل من دانيال ليندسي، وتي. جي، ومدته ١١٤ دقيقة ، فبعد خمسة وعشرين عاما من صدور الحكم في محاكمة رودني كينغ وقع عدد من الاحتجاجات والعنف والنهب في لوس أنجليس، ويدرس المخرجون تلك الفترة المضطربة من خلال لقطات نادرة من أرشيف الصور.', 'la-92-2017', 'https://m.media-amazon.com/images/M/MV5BMzUzNDM2NzM2MV5BMl5BanBnXkFtZTgwNTM3NTg4OTE@._V1_SX300.jpg', 8, 'WEB-DL', 0, 1, 4829, '2019-04-14 17:23:45', '2019-04-14 17:27:31'),
