(4829, 'مشاهدة فيلم Murmur of the Heart 1971 مترجم', 'مشاهدة فيلم Murmur of the Heart 1971 بجودة DVDRip مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر في نهاية حرب الهند الصينية الأولى ، يجد فتى مراهق متفتح الذهن نفسه بين الرغبة في اكتشاف الحب والعاطفة المتواصلة والمسيطرة على والدته.', 'murmur-of-the-heart-1971', 'https://m.media-amazon.com/images/M/MV5BYTk4YjhmNGMtOTZkYi00MjNmLThmZGItMGYyNDljNTdhNDA1XkEyXkFqcGdeQXVyNDE5MTU2MDE@._V1_SX300.jpg', 7.8, 'DVDRip', 0, 1, 4833, '2019-04-14 17:24:09', '2019-04-14 17:27:30'),
(4830, 'مشاهدة فيلم Lara Croft: Tomb Raider 2001 مترجم', 'مشاهدة فيلم الاكشن والمغامره Lara Croft: Tomb Raider 2001 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. تقوم لارا كروفت نباشة القبور، بجمع الآثار القديمة من أنقاض المدن والمعابد حول العالم من خلال استغلال قدرتها الفائقة على القتال اليدوي واستخدام اسلحة فضلا عن اتقانها لغات أجنبية عديدة، وتضطر إلى مواجهة جماعة تدعى المتنورين في صراع البحث عن تعويذة تعطي صاحبها القدرة على التحكم بالوقت، ويجب العثور عليها في خلال أسبوع.', 'lara-croft-tomb-raider-2001', 'https://m.media-amazon.com/images/M/MV5BNzMzODVjMWUtYmIxZS00NDlkLTlmNTktNjI5NTdhZjUzYzY1XkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 5.8, 'BluRay', 0, 1, 4834, '2019-04-14 17:24:19', '2019-04-14 17:27:30'),
(4831, 'مشاهدة فيلم Lara Croft Tomb Raider: The Cradle of Life 2003 مترجم', 'مشاهدة وتحميل فيلم الاكشن والمغامره Lara Croft Tomb Raider: The Cradle of Life 2003 بجودة BluRay مترجم اون لاين وتحميل مباشر. تجنيد الاستخبارات البريطانية لعالمة الآثار (لارا كروفت) من أجل حصولها على صندوق “باندورا الأسطوري”؛ الذي يحتوي على الوباء الأخطر على وجه الأرض، قبل أن يحصل عليه العالم الشرير (جوناثان)؛ الذي يتاجر في الفيروسات القاتلة ومصل علاجها على نطاق واسع، وفي المقابل تطلب (لارا) من الاستخبارات الإفراج عن حبيبها من أجل مساعدتها في تلك العملية.', 'lara-croft-tomb-raider-the-cradle-of-life-2003', 'uploads/191877528812.jpg', NULL, 'BluRay', 0, 1, 4835, '2019-04-14 17:24:27', '2019-04-14 17:27:27'),
(4832, 'مشاهدة فيلم The Assassin’s Code 2018 مترجم', 'مشاهدة وتحميل فيلم الاثارة The Assassin’s Code 2018 بجودة HC HDRip مترجم اون لاين وتحميل مباشر. محقق مهمل ابن شرطي فاسد ميت يعمل على حل اول قضية رئيسية له بينما يراقبه القاتل المأجور جيدا.', 'the-assassins-code-2018', 'uploads/201898285943.jpg', NULL, 'HDRip', 0, 1, 4836, '2019-04-14 17:24:37', '2019-04-14 17:27:26'),
