(4836, 'مشاهدة فيلم Spinning Man 2018 مترجم', 'مشاهدة و تحميل فيلم الدراما والغموض Spinning Man 2018 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة أستاذ جامعي ينعم بزواج سعيد، ورغم هذا فهو معروف بعلاقاته المتعددة مع طالباته؛ لذا يصبح المشتبه به الأول عندما يتم العثور على امرأة شابة مقتولة', 'spinning-man-2018', 'https://m.media-amazon.com/images/M/MV5BMTAyODY2MzUxNTFeQTJeQWpwZ15BbWU4MDc0NzM2NzQz._V1_SX300.jpg', 5.6, 'BluRay', 0, 1, 4840, '2019-04-14 17:25:43', '2019-04-14 17:27:23'),
