(4838, 'مشاهدة فيلم A Quiet Place 2018 مترجم', 'مشاهدة وتحميل فيلم الدراما والرعب A Quiet Place 2018 مترجم بجودة HDCAM كامل أون لاين. حول دور الأحداث في مرزعة هادئة تسكنها أسرة صغيرة متحابة. تتعرض هذه الأسرة للترهيب والرعب -مِن قِبَل أشباح وكائنات مخيفة- لبعض الوقت. وعلى هذه اﻷسرة أن تظل طوال الوقت في صمت تام ودون إصدار أدني صوت ﻷن هذه الكائنات تصطاد ضحاياها من خلال اﻷصوات التي يحدثوها أو يصدروها', 'a-quiet-place-2018', 'https://m.media-amazon.com/images/M/MV5BMjI0MDMzNTQ0M15BMl5BanBnXkFtZTgwMTM5NzM3NDM@._V1_SX300.jpg', 7.6, 'HDCAM', 0, 1, 4842, '2019-04-14 17:25:54', '2019-04-14 17:27:19'),
(4839, 'مشاهدة فيلم After Louie 2017 مترجم', 'مشاهدة فيلم الدراما والرومانسية After Louie 2017 مترجم بجودة WEB-DL مشاهدة مباشرة اون لاين. بعد أن يستكشف لؤي تناقضات الحياة المثلية الحديثة والتاريخ من خلال سام ، رجل يائسة لفهم كيف وصل هو ومجتمعه إلى ما هم عليه اليوم.', 'after-louie-2017', 'https://m.media-amazon.com/images/M/MV5BMWQwYzllODItMzBhOC00YzExLTk2MWEtOGQ1MDRhMTc0OTFiXkEyXkFqcGdeQXVyMjYyNzAwOTk@._V1_SX300.jpg', 5.1, 'WEB-DL', 0, 1, 4843, '2019-04-14 17:26:12', '2019-04-14 17:27:17'),
