(4865, 'مشاهدة فيلم Requiem for the American Dream 2015 مترجم', 'مشاهدة فيلم Requiem for the American Dream 2015 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر يشرح المفكّر ذائع الصيت “نعوم تشومسكي” رؤيته حول الكيفية التي آل إليها الجزء الأكبر من ثروة ونفوذ أمريكا في يد قلة معدودة من الأشخاص.', 'requiem-for-the-american-dream-2015', 'https://m.media-amazon.com/images/M/MV5BZDE0ZjNiODgtNDE4MS00MWM1LTgyZWMtZjA1NDAzYTZhMWRjXkEyXkFqcGdeQXVyNDI1Njc3NDA@._V1_SX300.jpg', 8.1, 'BluRay', 0, 1, 4869, '2019-04-14 17:32:06', '2019-04-14 17:39:03'),
(4866, 'فيلم Red Tails 2012 مترجم اون لاين', 'فيلم الاكشن والمغامره Red Tails 2012 مترجم بجودة BluRay مشاهدة اون لاين يوتيوب وتحميل مباشر افلام اون لاين', 'red-tails-2012', 'uploads/161934041091.jpg', NULL, 'BluRay', 0, 1, 4870, '2019-04-14 17:32:14', '2019-04-14 17:39:02'),
(4867, 'مشاهدة فيلم A War 2015 مترجم', 'مشاهدة وتحميل فيلم الجريمة والدراما A War 2015 بجودة BluRay مترجم اون لاين وتحميل مباشر. كلاوس إم بيدرسن يشارك في الحرب الدائرة في أفغانستان مع مجموعة من الرجال تحت إمرته، وخلال إحدى المهام التقليدية، تعلق السرية في إحدى عمليات تبادل إطلاق النار، مما يدفع كلاوس ﻹتخاذ بالغ الصعوبة في نفس الوقت الذي تحاول فيه زوجته في الوطن أن تحافظ على المنزل والأبناء في ظل غياب الأب.', 'a-war-2015', 'https://m.media-amazon.com/images/M/MV5BMjA1ODY3NjQzNV5BMl5BanBnXkFtZTgwNjEzNTUxNzE@._V1_SX300.jpg', 7.1, 'BluRay', 0, 1, 4871, '2019-04-14 17:32:35', '2019-04-14 17:39:01'),
(4869, 'مشاهدة فيلم Last Knights 2015 مترجم', 'مشاهدة وتحميل فيلم الاكشن والمغامره Last Knights 2015 بجودة BluRay مترجم اون لاين وتحميل مباشر. تدور أحداث الفيلم في إطار من الحركة والمغامرة حول المحارب طريح الأرض والذي ينهض من جديد ضد الحاكم الفاسد والمستبد ليأخذ بثأر مُعلمه والذي تم إهانته على يد هذا الحاكم.', 'last-knights-2015', 'uploads/82069265916.jpg', NULL, 'BluRay', 0, 1, 4873, '2019-04-14 17:32:59', '2019-04-14 17:38:59'),
(4870, 'مشاهدة فيلم Made in France 2015 مترجم', 'مشاهدة فيلم Made in France 2015 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر قصة صحفي فرنسي من أصول عربية مسلمة يتسلل إلى خلية إرهابية تخطط للقيام بعمليات متعددة ومتزامنة في عدة أحياء باريسية، إنه تقريباً سيناريو 13 نوفمبر الأخير.', 'made-in-france-2015', 'uploads/972902395.jpg', NULL, 'BluRay', 0, 1, 4874, '2019-04-14 17:33:11', '2019-04-14 17:38:58'),
(4871, 'مشاهدة فيلم Meadowland 2015 مترجم', 'مشاهدة و تحميل فيلم الدراما Meadowland 2015 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة بعد الاختفاء الغامض لابنهما، يحاول كل من الزوجين سارة وفيليب أن يتعاملا مع الأمر كل على طريقته الخاصة، فييحاول فيليب الذي يعمل شرطيًا بمدينة نيويورك أن يوجد شكلًا تقليديًا من التعافي لكنه سرعان ما يفقد بوصلته الأخلاقية، أما سارة فتحاول أن تسلك دروبًا غير متوقعة نحو القبول وينتهي بها الأمر بالوقوع في مواقف صعبة.', 'meadowland-2015', 'uploads/10238731165.jpg', NULL, 'BluRay', 0, 1, 4875, '2019-04-14 17:33:30', '2019-04-14 17:38:57'),
(4872, 'فيلم Purge 2012 مترجم اون لاين', 'فيلم الجريمة والدراما Purge 2012 مترجم بجودة BluRay مشاهدة اون لاين وتحميل مباشر افلام سيما فلاش', 'purge-2012', 'uploads/172084852680.jpg', NULL, 'BluRay', 0, 1, 4876, '2019-04-14 17:33:47', '2019-04-14 17:38:56'),
(4873, 'مشاهدة فيلم Mercenary: Absolution 2015 مترجم', 'مشاهدة وتحميل فيلم الاكشن والمغامره Mercenary: Absolution 2015 مترجم بجودة BluRay كامل أون لاين. يتقرب قاتل مأجور يدعى جون ألكسندر (ستيفن سيجال) من فتاة هاربة من رئيس عصابة يتميز بالقسوة والخطورة. والأدهى من ذلك أنه يمتلك صلات سياسية بالغة القوة والمتانة، كما أنه يدير عمليات اختطاف واسعة النطاق من أجل اﻹتجار بمن اختطفهم. وهو ما يجعل جون في مفترق طرق: بين الرغبة في حماية الفتاة، وبين الحفاظ على ولائه للوكالة الحكومية التي قامت بتوظيفه.', 'mercenary-absolution-2015', 'https://m.media-amazon.com/images/M/MV5BMTY2NjY0NzYzOF5BMl5BanBnXkFtZTgwMDM2MzI4NDE@._V1_SX300.jpg', 4.5, 'BluRay', 0, 1, 4877, '2019-04-14 17:33:47', '2019-04-14 17:38:56'),
(4874, 'مشاهدة فيلم Miss You Already 2015 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والدراما Miss You Already 2015 مترجم بجودة BluRay كامل أون لاين. (ميلي)، و(جيس) صديقتان مقربتان جدًا، تتشاركان كل شيء، من أسرار ولحظات سعيدة، إلى أصدقاء، ومشتركات أخرى غيرهم، الآن أصبحتا بالغتين، (ميلي) تعمل بوظيفة ممتازة، وتعيش في منزل جميل مع زوجها، وولديها الاثنين، أما (جيس) تعمل مخططة للمدينة، وتعيش مع صديقها في مركب على قناة (لندن)، إلى أن تبدأ (جيس) في المكافحة للحصول على الطفل الذي تتوق له منذ مدة كبيرة.. (ميلي) تُصاب بسرطان الثدي.', 'miss-you-already-2015', 'uploads/12581468833.jpg', NULL, 'BluRay', 0, 1, 4878, '2019-04-14 17:33:56', '2019-04-14 17:38:55'),
(4875, 'فيلم At Any Price 2012 مترجم اون لاين', 'فيلم الدراما والرياضي At Any Price 2012 مترجم بجودة BluRay مشاهدة مباشرة اون لاين وتحميل مباشر افلام دراما', 'at-any-price-2012', 'uploads/181562105765.jpg', NULL, 'BluRay', 0, 1, 4879, '2019-04-14 17:33:59', '2019-04-14 17:38:54'),
(4876, 'مشاهدة فيلم Mission: Impossible – Rogue Nation 2015 مترجم', 'مشاهدة و تحميل فيلم الاكشن والمغامره Mission: Impossible – Rogue Nation 2015 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة تدور أحداث هذا الجزء في إطار من الحركة والتشويق والإثارة، حيث يتتبع الفيلم العميل الاستخباراتي (إيثان هانت) وفريقه، وهم يخوضون أصعب مهمة لهم في تاريخهم حتى الآن، وهي القضاء على الـ(مؤسسة)، وهى منظمة دولية قائمة على الاحتيال والنصب، ويتلقى أفرادها تدريبات على أعلى مستوى كالتي يتلقاها (إيثان) وفريقه بالضبط، واعدين بتدمير صندوق النقد الدولي.', 'mission-impossible-rogue-nation-2015', 'https://m.media-amazon.com/images/M/MV5BOTFmNDA3ZjMtN2Y0MC00NDYyLWFlY2UtNTQ4OTQxMmY1NmVjXkEyXkFqcGdeQXVyNTg4NDQ4NDY@._V1_SX300.jpg', 7.4, 'BluRay', 0, 1, 4880, '2019-04-14 17:34:02', '2019-04-14 17:38:53'),
(4877, 'مشاهدة فيلم Mortdecai 2015 مترجم', 'مشاهدة وتحميل فيلم الاكشن والكوميديا Mortdecai 2015 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب تدور أحداث الفيلم في إطار درامي كوميدي حول تشارلي موردخاي (جوني ديب)، والملقب بتاجر التحف، والذي يملك مهارات خاصة في اصطياد اللوحات الفنية المفقودة. تنتشر الشائعات عن فقد لوحة فنية لها علاقة بشفرة حساب بنكي مليء بذهب النازيين. تقوده المغامرة من جيرسي إلى موسكو، حيث يتجسس ويلجأ للعنف حتى يحقق كل ما يرغب.', 'mortdecai-2015', 'uploads/14608992634.jpg', NULL, 'BluRay', 0, 1, 4881, '2019-04-14 17:34:10', '2019-04-14 17:38:52'),
(4878, 'فيلم Robot and Frank 2012 مترجم اون لاين', 'فيلم الكوميديا والجريمة Robot and Frank 2012 مترجم بجودة BluRay مشاهدة اون لاين يوتيوب وتحميل مباشر افلام اون لاين', 'robot-and-frank-2012', 'uploads/191851156873.jpg', NULL, 'BluRay', 0, 1, 4882, '2019-04-14 17:34:10', '2019-04-14 17:38:51'),
(4879, 'مشاهدة فيلم Hostile Border 2015 مترجم', 'مشاهدة وتحميل فيلم الدراما Hostile Border 2015 بجودة BluRay مترجم اون لاين وتحميل مباشر. تدور أحداث القصة حول المهاجرة (كلوديا)، تهاجر كلوديا إلى الولايات المتحدة مستشرقة الحلم الأمريكي، ولكن يعتقلها مكتب التحقيقات الفيدرالي بسبب أوراق غير قانونية، ويتم ترحيلها إلى المكسيك، تنتقل كلوديا للعيش في مزرعة والدها، وتفكر للعودة مجددًا إلى الولايات المتحدة، لتتفق مع أحد المهربين على مساعدتها للهروب إليها، ولكن تخرج الأمور عن السيطرة مع ذلك المهرب.', 'hostile-border-2015', 'uploads/151647115940.jpg', NULL, 'BluRay', 0, 1, 4883, '2019-04-14 17:34:24', '2019-04-14 17:38:49'),
(4880, 'فيلم Best Man Down 2012 مترجم اون لاين', 'فيلم الكوميديا والدراما Best Man Down 2012 مترجم بجودة BluRay مشاهدة مباشرة اون لاين وتحميل مباشر افلام كوميديا', 'best-man-down-2012', 'uploads/201363390619.jpg', NULL, 'BluRay', 0, 1, 4884, '2019-04-14 17:34:25', '2019-04-14 17:38:48'),
(4882, 'مشاهدة فيلم Hyena Road 2015 مترجم', 'مشاهدة وتحميل فيلم الدراما والحرب Hyena Road 2015 مترجم بجودة BluRay كامل اون لاين. وسط جبال أفغانستان، وعقب انتهاء الحرب الضارية بين قوات التحالف، والتنظيمات الإرهابية الأفغانية تتمركز قوات الجيش الأمريكي هناك في محاولة لمحاربة الإرهاب، والقضاء على تلك التنظيمات وعدم عودتها مرة أخرى لساحة الحرب، ساعية لتجنيد أهم قادة هؤلاء الإرهابيون والذي يٌدعى (أسد الصحراء) أملا في مساعدتهم في تلك المهمة.', 'hyena-road-2015', 'uploads/171412220077.jpg', NULL, 'BluRay', 0, 1, 4886, '2019-04-14 17:34:32', '2019-04-14 17:38:46'),
(4883, 'فيلم Battlestar Galactica: Blood and Chrome 2012 مترجم اون لاين', 'فيلم الاكشن والخيال العلمي Battlestar Galactica: Blood and Chrome 2012 مترجم بجودة BluRay مشاهدة اون لاين وتحميل مباشر افلام سيما…', 'battlestar-galactica-blood-and-chrome-2012', 'uploads/211611359975.jpg', NULL, 'BluRay', 0, 1, 4887, '2019-04-14 17:34:35', '2019-04-14 17:38:45'),
(4884, 'فيلم Black Rock 2012 مترجم اون لاين', 'فيلم الرعب والاثارة Black Rock 2012 مترجم بجودة BluRay مشاهدة اون لاين يوتيوب وتحميل مباشر افلام اون لاين', 'black-rock-2012', 'uploads/22966291334.jpg', NULL, 'BluRay', 0, 1, 4888, '2019-04-14 17:34:41', '2019-04-14 17:38:44'),
(4885, 'مشاهدة فيلم I Spit on Your Grave: Vengeance is Mine 2015 مترجم', 'مشاهدة وتحميل فيلم الرعب والاثارة I Spit on Your Grave: Vengeance is Mine 2015 مترجم بجودة BluRay كامل اون لاين. كاتى تحاول النجاح كموديل فتقبل عرضاً باخذ صوراً جديدة لها فيتحول جلسة تصويرها بسرعة إلى عملية إختطاف و إغتصاب و تعذيب فتعيش كابوس صعب الخروج منها لذآ عندما تتمكن من الهرب من خاطفيها و هى مليئة بالكدمات و مصابة بالكسور فى عظامها تقرر الغوض فى الأماكن المظلمة الموجودة فى النفس البشرية ليس فقط لتحافظ على نفسها قيد الحياة و لكن لتنتقم من خاطفيها أيضاً فهل تنجح فى مسعاها ؟', 'i-spit-on-your-grave-vengeance-is-mine-2015', 'uploads/18645949076.jpg', NULL, 'BluRay', 0, 1, 4889, '2019-04-14 17:34:46', '2019-04-14 17:38:40'),
(4886, 'فيلم Bikini Spring Break 2012 مترجم اون لاين', 'فيلم الكوميديا Bikini Spring Break 2012 مترجم بجودة BluRay مشاهدة مباشرة اون لاين وتحميل مباشر افلام كوميديا', 'bikini-spring-break-2012', 'uploads/23763371133.jpg', NULL, 'BluRay', 0, 1, 4890, '2019-04-14 17:34:54', '2019-04-14 17:38:39'),
(4887, 'مشاهدة فيلم Identicals 2015 مترجم', 'مشاهدة فيلم Identicals 2015 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر تدور أحداث القصة حول منظمة إلكترونية تحدد شبكات الإنترنت للأشخاص المتشابهين في طريقة حياتهم وتواصلهم ومحادثاتهم، بهدف تطوير حياتهم للأفضل وتقديم مختلف متطلباتهم بشكل أيسر، ولكن مع تقدم التكنولوجيا دائمًا ما تقع الأخطاء، حيث يدخل (سلايتر) في عالم موازي للحياة الحقيقية وعليه العثور على ذاته مجددًا.', 'identicals-2015', 'uploads/19843006954.jpg', NULL, 'BluRay', 0, 1, 4891, '2019-04-14 17:34:55', '2019-04-14 17:38:22'),
(4888, 'مشاهدة فيلم Infini 2015 مترجم', 'مشاهدة وتحميل فيلم الرعب والخيال العلمي Infini 2015 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب ”البحث والإنقاذ” فريق من النخبة المتنقلين يذهبون لعالم التعدين لانقاذ كارمايكل، الناجي الوحيد من الاندلاع البيولوجي.', 'infini-2015', 'uploads/201237045952.jpg', NULL, 'BluRay', 0, 1, 4892, '2019-04-14 17:35:02', '2019-04-14 17:38:19'),
(4889, 'فيلم Apartment 212 2017 مترجم اون لاين', 'فيلم الرعب Apartment 212 2017 مترجم بجودة WEB-DL مشاهدة اون لاين وتحميل مباشر افلام سيما فلاش', 'apartment-212-2017', 'uploads/241366094681.jpg', NULL, 'WEB-DL', 0, 1, 4893, '2019-04-14 17:35:07', '2019-04-14 17:38:18'),
(4890, 'فيلم The Motive 2017 مترجم اون لاين', 'فيلم الكوميديا والدراما The Motive 2017 مترجم بجودة BRrip مشاهدة مباشرة اون لاين وتحميل مباشر افلام كوميديا', 'the-motive-2017', 'uploads/25586996991.jpg', NULL, '0', 0, 1, 4894, '2019-04-14 17:35:18', '2019-04-14 17:38:17'),
(4891, 'مشاهدة فيلم Ip Man 3 2015 مترجم', 'مشاهدة فيلم Ip Man 3 2015 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر تدور أحداث القصة حول محاولة إحدى العصابات السيطرة على المدينة الموجودة بها والقيام بأعمال ملتوية من أجل تحقيق هذا الهدف، مما يدفع السيد (يب) المعروف بقدراته الكبيرة في فنون القتال إلى التورط في الأمر والدفاع عن المدينة.', 'ip-man-3-2015', 'uploads/2143561754.jpg', NULL, 'BluRay', 0, 1, 4895, '2019-04-14 17:35:21', '2019-04-14 17:38:16'),
(4892, 'فيلم Josie 2017 مترجم اون لاين', 'فيلم الدراما والاثارة Josie 2017 مترجم بجودة WEB-DL مشاهدة مباشرة اون لاين وتحميل مباشر افلام دراما', 'josie-2017', 'uploads/261781786889.jpg', NULL, 'WEB-DL', 0, 1, 4896, '2019-04-14 17:35:32', '2019-04-14 17:38:15'),
(4893, 'مشاهدة فيلم June 2015 مترجم', 'مشاهدة وتحميل فيلم الرعب والخيال العلمي June 2015 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب تدور أحداث فيلم حول فتاة قادمة من بين الغضب لإكتشاف ذاتها والتغلب على الشياطين الداخلية الخاصة بها للحصول على الحب فى عالم فوضوي .', 'june-2015', 'uploads/222059427264.jpg', NULL, 'BluRay', 0, 1, 4897, '2019-04-14 17:35:33', '2019-04-14 17:38:14'),
(4894, 'مشاهدة فيلم Karbala 2015 مترجم', 'مشاهدة وتحميل فيلم الدراما والحرب Karbala 2015 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب تدور في عام 2004، عملية تحرير العراق من المقاومة الاسلامية العراقية الموالية للزعيم الشيعي مقتدى الصدر، شن تمردا. يتم قطع كربلاء قاعة المدينة قبالة، وترك في داخلها 40 شخص من البولنديين و 40 جنديا بلغاريا مع إمدادات الغذاء والذخيرة إلى 24H المعركة.', 'karbala-2015', 'uploads/231900946823.jpg', NULL, 'BluRay', 0, 1, 4898, '2019-04-14 17:35:43', '2019-04-14 17:38:13'),
