(4898, 'مشاهدة فيلم Kidnapping Mr. Heineken 2015 مترجم', 'مشاهدة فيلم الاكشن والسيرة الذاتية Kidnapping Mr. Heineken 2015 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. فيلم مبني على القصة الحقيقية التي حدثت في (هولندا) في بداية الثمانينيات باختطاف رجل الأعمال وأيقونة صناعة الجعة الهولندي (فريدي هاينيكن)، يسرد الفيلم في إطار من التشويق عمليات التخطيط والتنفيذ للاختطاف والفوضى التي حدثت بعد العملية، والتي نتج عنها دفع أكبر مبلغ فدية في التاريح مقابل شخص واحد، وهو 35 مليون جيلدر هولندي (ما يقرب من 16 مليون يورو تقريبًا).', 'kidnapping-mr-heineken-2015', 'uploads/24905707417.jpg', NULL, 'BluRay', 0, 1, 4902, '2019-04-14 17:36:18', '2019-04-14 17:37:49'),
