(4909, 'مشاهدة فيلم Dark Summer 2015 مترجم', 'مشاهدة فيلم Dark Summer 2015 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر تدور أحداث الفيلم حول فتى يبلغ من العمر سبعة عشر عامًا، وحكمت عليه السلطات بأن يظل محتجزًا في منزله طيلة فترة الصيف، بينما تنشغل والدته عنه بالعمل في الخارج، وخلال هذه الفترة يقع حادث رهيب يخلف أثرا غير محمود في كافة جنبات المنزل.', 'dark-summer-2015', 'uploads/301476582272.jpg', NULL, 'BluRay', 0, 1, 4913, '2019-04-14 17:37:17', '2019-04-14 17:37:37'),
