(4933, 'مشاهدة فيلم Psychokinesis 2018 مترجم', 'مشاهدة وتحميل فيلم الاكشن والمغامره Psychokinesis 2018 بجودة HDRIP مترجم كامل اون لاين مشاهدة مباشرة يوتيوب “بعد أن تركها والدها وهي صغيرة، أتى إليها لإنقاذها من مسؤليين كبار بالبلد، يريدون هدم المتجر الذي تمتلكه، لينشأوا مشاريع آخرى بدلًا منه،سرعان ما يكتشف والدها قوى عظمة بداخله تستطيع تحريك الأشياء عن بُعد”.', 'psychokinesis-2018', 'https://m.media-amazon.com/images/M/MV5BNDQxZjlhZDQtNzEzMS00NGQ5LWEwMzMtZTM0NWI2NmViZWRmXkEyXkFqcGdeQXVyNjQ3ODkxMjE@._V1_SX300.jpg', 5.9, 'HDRIP', 0, 1, 4937, '2019-04-14 17:44:46', '2019-04-14 17:48:37'),
(4934, 'مشاهدة فيلم Anti-Social 2015 مترجم', 'مشاهدة فيلم Anti-Social 2015 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر وسط لندن، فوضي و سطو يستهدف محلات المجوهرات من قبل مجموعة من اللصوص المحترفين و العصابات .', 'anti-social-2015', 'uploads/181449757720.jpg', NULL, 'BluRay', 0, 1, 4938, '2019-04-14 17:44:47', '2019-04-14 17:48:35'),
(4935, 'مشاهدة فيلم Avengers Grimm 2015 مترجم', 'مشاهدة و تحميل فيلم الاكشن والمغامره Avengers Grimm 2015 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة عندما يدمر رامبيلستيلتسكين والمرآة السحرية ويهربوا إلى العالم الحديث، ورابونزيل-امتص الأميرات الأربعة “كان يا ما كان” -سندريلا والجمال النائم، سنو وايت، وذلك من خلال البوابة الإلكترونية. المدربين تدريبا جيدا وهبوا قوى سحرية، يجب على أربع نساء محاربة رامبيلستيلتسكين وجيشه من الثرالس قبل أن يستعبد الجميع على الأرض.', 'avengers-grimm-2015', 'uploads/192065638170.jpg', NULL, 'BluRay', 0, 1, 4939, '2019-04-14 17:44:48', '2019-04-14 17:48:33'),
(4936, 'مشاهدة فيلم Beasts Of No Nation 2015 مترجم', 'مشاهدة و تحميل فيلم الدراما والحرب Beasts Of No Nation 2015 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة تدور أحداث الفيلم حول (أيجو) الطفل العسكري الذي ينفصل عن أهله من أجل أن يحارب في حرب أهلية في إحدى الدول الأفريقية، ليجد هناك القائد (أدريس ألبا) الذي يأخذه ويبدأ في تعليمه قواعد الحرب والقتال.', 'beasts-of-no-nation-2015', 'uploads/201343609722.jpg', NULL, 'BluRay', 0, 1, 4940, '2019-04-14 17:44:59', '2019-04-14 17:48:32'),
(4937, 'مشاهدة فيلم Beyond the Mask 2015 مترجم', 'مشاهدة وتحميل فيلم الاكشن والدراما Beyond the Mask 2015 بجودة BluRay مترجم اون لاين وتحميل مباشر. يسعى قاتل شركة الهند الشرقية البريطانية للتجارة لتخليص ماضيه من خلال إحباط مؤامرة ضد الأمل في أمة فتية من أجل الحرية.', 'beyond-the-mask-2015', 'uploads/21103836409.jpg', NULL, 'BluRay', 0, 1, 4941, '2019-04-14 17:45:17', '2019-04-14 17:48:31'),
(4938, 'مشاهدة فيلم Bound to Vengeance 2015 مترجم', 'مشاهدة و تحميل فيلم الرعب والاثارة Bound to Vengeance 2015 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة فتاة شابة، مقية بالسلاسل في الطابق السفلي من قبل رجل مريض، يهرب وتتحول .', 'bound-to-vengeance-2015', 'uploads/221903371534.jpg', NULL, 'BluRay', 0, 1, 4942, '2019-04-14 17:45:35', '2019-04-14 17:48:30'),
(4939, 'مشاهدة فيلم Bridgend 2015 مترجم', 'مشاهدة و تحميل فيلم الدراما Bridgend 2015 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة تصل (سارة) مع والدها إلى قرية صغيرة في مقاطعة بريدجيند داخل ولاية (ويلز) الإنجليزية، وهي قرية تسيطر عليها آفة انتحار الشباب.. تقع سارة في حب (جيمي)، أحد مراهقي القرية، بينما يحاول (ديف) – ضابط الشرطة الجديد في القرية ….', 'bridgend-2015', 'https://m.media-amazon.com/images/M/MV5BOGM5NGE4NjktZGViOS00NDNlLTkxZmUtMzM0MjI1MDE2ZTkxXkEyXkFqcGdeQXVyNTM3MDMyMDQ@._V1_SX300.jpg', 5.5, 'BluRay', 0, 1, 4943, '2019-04-14 17:45:51', '2019-04-14 17:48:29'),
(4940, 'مشاهدة فيلم Broken Horses 2015 مترجم', 'مشاهدة فيلم الاكشن والجريمة Broken Horses 2015 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. على مقربة من الحدود الفاصلة بين (الولايات المتحدة الأمريكية) ، و(المكسيك) ، حيث تعيش هذه المنطقة حربًا طاحنة بين العصابات التي تستوطنها ، يختبر الفلم في قصته العديد من المشاعر والخبرات عن الروابط الأسرية ، وأواصر الأخوة ، عن القوانين التي تحكم الولاء لمن ننتمي إليهم ، وعن عبثية وعدم جدوى الحلول التي تأتي بالعنف .', 'broken-horses-2015', 'https://m.media-amazon.com/images/M/MV5BMTEyODkzODExMzReQTJeQWpwZ15BbWU4MDU0NjM2NzQx._V1_SX300.jpg', 5.7, 'BluRay', 0, 1, 4944, '2019-04-14 17:46:04', '2019-04-14 17:48:29'),
(4941, 'مشاهدة فيلم Careful What You Wish For 2015 مترجم', 'مشاهدة فيلم Careful What You Wish For 2015 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر يحكي قصة رجل دخل في علاقة غرامية مع زوجة مصرفي استثماري. قريبا، وهي سياسة الموت المشبوهة والتأمين على الحياة كبيرة توريط له في فضيحة.', 'careful-what-you-wish-for-2015', 'uploads/251398431027.jpg', NULL, 'BluRay', 0, 1, 4945, '2019-04-14 17:46:10', '2019-04-14 17:48:28'),
(4942, 'مشاهدة فيلم Chain of Command 2015 مترجم', 'مشاهدة و تحميل فيلم الاكشن والاثارة Chain of Command 2015 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة رجل يعثر على شقيقه مقتولا بعد عودته من العمل ليبدا بالحث عن الجناة ومعرفة الحقيقة لكنه يتفاجا بان المؤامرة ممتدة داخل الحكومة الامريكية.', 'chain-of-command-2015', 'uploads/26164501571.jpg', NULL, 'BluRay', 0, 1, 4946, '2019-04-14 17:46:59', '2019-04-14 17:48:27'),
(4943, 'مشاهدة فيلم Chi-Raq 2015 مترجم', 'مشاهدة فيلم Chi-Raq 2015 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر مقتل طفل أمريكي برصاصة طائشة وتداعيات تلك الحادثة على المجتمع الأمريكي وخاصة الجنوب الأمريكي حول العنف المتصاعد بجوانبه المختلفة وتجارة الجنس والعنف في الولايات المتحدة والعالم بشكل عام، فتنشأ حركة نسائية مناهضة للعنف المنتشر في الولايات المتحدة بكافة أشكاله.', 'chi-raq-2015', 'uploads/271170951960.jpg', NULL, 'BluRay', 0, 1, 4947, '2019-04-14 17:47:09', '2019-04-14 17:48:26'),
(4944, 'مشاهدة فيلم American Justice 2015 مترجم', 'مشاهدة و تحميل فيلم ال American Justice 2015 مترجم اون لاين جودة BluRay وتحميل مباشر مشاهدة اون لاين مباشرة جاك شرطي من شرطة لوس انجليس، الذي اوقف عن العمل من قوات الشرطة بسبب الإجراءات المتهورة، جاك يسافر إلى تكساس …', 'american-justice-2015', 'uploads/281748827229.jpg', NULL, 'BluRay', 0, 1, 4948, '2019-04-14 17:47:22', '2019-04-14 17:48:24'),
(4945, 'مشاهدة فيلم American Poltergeist 2015 مترجم', 'مشاهدة وتحميل فيلم الرعب American Poltergeist 2015 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب مجموعة من الأصدقاء يذهبوا إلى بيت لقضاء العطلات مع الماضي المشؤوم في خالريف بجانب النهر بولاية ماساتشوستس. صاحبة المنزل المشبوه…', 'american-poltergeist-2015', 'https://m.media-amazon.com/images/M/MV5BMTgzNzA0MDMzNV5BMl5BanBnXkFtZTgwNDI0MDM1NTE@._V1_SX300.jpg', 2.2, 'BluRay', 0, 1, 4949, '2019-04-14 17:47:38', '2019-04-14 17:48:23'),
(4946, 'مشاهدة فيلم Amnesiac 2015 مترجم', 'مشاهدة وتحميل فيلم الدراما والرعب Amnesiac 2015 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب الفيلم يحكي قصة رجل يستيقظ على سرير في المستشفى بعد حادث سير ليكتشف انه فقد الذاكرة ويبدا بالشك في زوجته وكونها زوجته الحقيقية ام لا ويعتقد ان الكثير من الاكاذيب والخدع تقال له حيث سرعان ما يجد نفسه سجين الاوهام.', 'amnesiac-2015', 'uploads/30212460308.jpg', NULL, 'BluRay', 0, 1, 4950, '2019-04-14 17:47:55', '2019-04-14 17:48:22'),
(4947, 'مشاهدة فيلم The Sweeney: Paris 2015 مترجم', 'مشاهدة وتحميل فيلم الاكشن والدراما The Sweeney: Paris 2015 مترجم بجودة BluRay كامل أون لاين. تصدى الشرطة الفرنسية لمجموعة من المجرمين الخارجين على القانون ومحاولة إفساد مخططهم والقبض عليهم .', 'the-sweeney-paris-2015', 'https://m.media-amazon.com/images/M/MV5BMDQyMzJhYmMtMzIzZS00MDk3LTg3MDUtMGU3Njg5NDQxZWRjXkEyXkFqcGdeQXVyNjQ5ODMxNDQ@._V1_SX300.jpg', 5.7, 'BluRay', 0, 1, 4951, '2019-04-14 17:48:22', '2019-04-14 17:48:22'),
(4948, 'مشاهدة فيلم Rambo 2008 مترجم', 'مشاهدة وتحميل فيلم الاكشن والاثارة Rambo 2008 مترجم بجودة BluRay كامل اون لاين. جون رامبو يعيش في تايلند في قرية نائية بالقرب من الحدود البورمية؛ حيث يكسب لقمة عيشه من التقاط الثعابين، وبيعها، ونقل الناس بواسطة قاربه عبر نهر سالويين، في الوقت نفسه، تدور حرب أهلية في بورما؛ حيث طغى الظلم وانتشر في المنطقة: أنواع القتل المريع، والاغتصاب، وخطف الأطفال. ويأتي فريق مغامر يحاول إنقاذ تلك المنطقة؛ حيث يطلبون من رامبو إيصالهم لتلك المنطقة، إلا أنه سرعان ما ينكشف أمر فريق الإنقاذ، فيصبح لزاما على رامبو إنقاذهم.', 'rambo-2008', 'https://m.media-amazon.com/images/M/MV5BMTI5Mjg1MzM4NF5BMl5BanBnXkFtZTcwNTAyNzUzMw@@._V1_SX300.jpg', 7, 'BluRay', 0, 1, 4952, '2019-04-14 17:52:06', '2019-04-14 17:59:25'),
(4949, 'مشاهدة فيلم Sunny 2008 مترجم', 'مشاهدة وتحميل فيلم الموسيقى والرومانسية Sunny 2008 مترجم بجودة BluRay كامل أون لاين. أملًا في رؤية زوجها الذي غادر إلى حرب فيتنام دون إعلامها بالأمر، تنضمّ زوجة شابة إلى فرقة غنائية متجولة كمطربة رئيسية.', 'sunny-2008', 'https://m.media-amazon.com/images/M/MV5BMTk2MTgxMjgxNl5BMl5BanBnXkFtZTgwOTU2MTAzMjE@._V1_SX300.jpg', 7.8, 'BluRay', 0, 1, 4953, '2019-04-14 17:52:20', '2019-04-14 17:59:25'),
(4950, 'مشاهدة فيلم The Curious Case of Benjamin Button 2008 مترجم', 'مشاهدة وتحميل فيلم الدراما والفانتازيا The Curious Case of Benjamin Button 2008 مترجم بجودة BluRay كامل أون لاين. في نهاية الحرب العالمية الأولى عام 1918 ، يولد بنجامين بوتون وتكون ظروف ولادته غير طبيعيةٍ بالمرة، حيث يولد عجوزًا ثم يبدأ يصغر تدريجيًا حتى يصبح طفلًا، حياته تمر عكس بقية البشر ، وأثناء حياته تصادفه العديد من الأشياء، فبعد أن يولد عجوزًا يصبح رجلًا يلجأ إلى البحر ويصبح بحارًا ، فيلتقي بفتاةٍ جميلةٍ (ديزي) ويقع في حبها ويعيش معها أجمل أيامه.', 'the-curious-case-of-benjamin-button-2008', 'uploads/21629566148.jpg', NULL, 'BluRay', 0, 1, 4954, '2019-04-14 17:52:31', '2019-04-14 17:59:24'),
(4951, 'مشاهدة فيلم The Dark Knight 2008 مترجم', 'مشاهدة فيلم The Dark Knight 2008 بجودة BluRay مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر يبدا باتمان فى محاربة العدو الجديد الجوكر الذى يسعى لنشر الذعر والشر فى جوثام واثبات ان العيش بدون قواعد افضل مما يؤدى لصراع بين الاثنين يشترك فية المفتش جوردن والمدعى العام هارفى دينت وصديقة بروس وين راشيل .', 'the-dark-knight-2008', 'uploads/3990507482.jpg', NULL, 'BluRay', 0, 1, 4955, '2019-04-14 17:52:36', '2019-04-14 17:59:22'),
(4952, 'مشاهدة فيلم 4Got10 2015 مترجم', 'مشاهدة وتحميل فيلم الاكشن والاثارة 4Got10 2015 مترجم بجودة BluRay كامل اون لاين. برايان برانز (جوني ميسنر عنما يستيقظ في الصحراء جريحا وفاقد للذاكرة ومحاط بثماني جثث ويجد سيارة فيها اربع ملايين دولار وسيارة أخرى محملة بالكوكايين ويصبح محاصر ليس فقط بالمخدرات وسوء السمعة وكذلك داني بيريز (داني تريجو ) الذي يريد المال الذي معه وكذلك روكر (دولف لوندغرين) ولكن محاط بالفاسدين مثل شريف اولسون(مايكل باري) الذي يفعل كل شيء للحصول على المال ويحوال برايان ان يتذكر ليستطيع معرفة المعركة التي وجد نفسه فيها', '4got10-2015', 'uploads/41569436950.jpg', NULL, 'BluRay', 0, 1, 4956, '2019-04-14 17:53:00', '2019-04-14 17:59:21'),
(4953, 'مشاهدة فيلم 6 Years 2015 مترجم', 'مشاهدة وتحميل فيلم الدراما والرومانسية 6 Years 2015 مترجم بجودة BluRay كامل أون لاين. تدور أحداث الفيلم في إطار من الرومانسية حول زوج من الشباب، اللذين تربطهما علاقة رومانسية مثالية، يبدأان في اقتحام عالم جديد لكشف فرص غير متوقعة، والتي تجرهم إلى طريق متقلب ومليء بالعنف، والذي يهدد مستقبلهما الهادئ الذي دائما ما تخيلاه.', '6-years-2015', 'uploads/51609384599.jpg', NULL, 'BluRay', 0, 1, 4957, '2019-04-14 17:53:01', '2019-04-14 17:59:20'),
(4955, 'مشاهدة فيلم 90 Minutes in Heaven 2015 مترجم', 'مشاهدة فيلم الدراما 90 Minutes in Heaven 2015 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. رجل متورط في حادث سيارة مروع حصل فيه حالة وفاة ، إلا أنه عاد إلى الحياة بعد ساعة ونصف ، مدعياً أن …', '90-minutes-in-heaven-2015', 'uploads/71332856443.jpg', NULL, 'BluRay', 0, 1, 4959, '2019-04-14 17:53:24', '2019-04-14 17:59:14'),
(4956, 'مشاهدة فيلم American Hero 2015 مترجم', 'مشاهدة وتحميل فيلم الاكشن والكوميديا American Hero 2015 مترجم بجودة BluRay كامل أون لاين. ميلفين (ستيفن دروف) بطل خارق، ولكن المشكلة ليست في ذلك، بل في كونه يوجه كامل طاقته نحو الجريمة والمخدرات والعلاقات النسائية، لكنه مع الوقت يلاحظ أن السبيل الوحيد أمامه لكي يستطيع رؤية ابنه المنفصل عنه بأن يبتعد عن أية أنشطة إجرامية ويحقق ما هو مرجو منه، أي أن يكون مكافحًا للجريمة.', 'american-hero-2015', 'uploads/8534434057.jpg', NULL, 'BluRay', 0, 1, 4960, '2019-04-14 17:53:41', '2019-04-14 17:59:13'),
(4957, 'مشاهدة فيلم Ong-bak 2 2008 مترجم', 'مشاهدة فيلم الاكشن Ong-bak 2 2008 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. في عام 1431، تنتصر جيوش مملكة (أوتاثيان) على جيوش مملكة (سوخوتاي) التايلاندية، وتمتد جيوشهم شرقا، يموت في هذه الحرب غدراً الملك (سيها) وزوجته؛ نتيجة غدر من أحد قواده (راجاسينا)، لكن ينجو ابنهما الوحيد (تين) بمساعدة أحد جنود (سيها) المخلصين، يعيشان في الغابات، ويتربي على الفنون القتالية، والمعنى الحقيقي لها، والانتقام ممن خان والده.', 'ong-bak-2-2008', 'uploads/9560723779.jpg', NULL, 'BluRay', 0, 1, 4961, '2019-04-14 17:53:48', '2019-04-14 17:59:12'),
(4958, 'مشاهدة فيلم The Elevator: Three Minutes Can Change Your Life 2013 مترجم', 'مشاهدة وتحميل فيلم الدراما والاثارة The Elevator: Three Minutes Can Change Your Life 2013 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب فيلم نفسي مثيرة للقلق، يشرك الجمهور فيه لدرجة أن يتم اكتشاف ذلك على حين غرة، وبالتالي تغيير وجهة نظر اثنين من فناني الأداء الرئيسيين.', 'the-elevator-three-minutes-can-change-your-life-2013', 'uploads/101473879616.jpg', NULL, 'BluRay', 0, 1, 4962, '2019-04-14 17:53:49', '2019-04-14 17:59:11'),
(4959, 'مشاهدة فيلم The Human Race 2013 مترجم', 'مشاهدة وتحميل فيلم الاكشن والرعب The Human Race 2013 مترجم بجودة BluRay كامل اون لاين. فيرونيكا تجد فجأة نفسها في سباق الماراثون المرعبة. القواعد بسيطة: إذا كنت ملفوف، تموت. إذا كنت في خطوة قبالة الطريق، تموت…', 'the-human-race-2013', 'https://m.media-amazon.com/images/M/MV5BMTQwNzM1NTYzNF5BMl5BanBnXkFtZTgwMjI0MTk2MTE@._V1_SX300.jpg', 5.3, 'BluRay', 0, 1, 4963, '2019-04-14 17:54:03', '2019-04-14 17:59:10'),
(4960, 'مشاهدة فيلم Food, Inc. 2008 مترجم', 'مشاهدة وتحميل فيلم الوثائقي Food, Inc. 2008 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب يتحدث الفيلم عن الشركات الكبرى المسيطرة على سوق الطعام في الولايات المتحدة ويظهر الفساد المتغلغل والطعام الفاسد وطريقة الذبح السيئة واضطهاد الحيوانات وكيفية السيطرة على السوف وجني الارباح الباهظة، حتى أنه دخل أحد المصانع بكاميرا مخفية.', 'food-inc-2008', 'https://m.media-amazon.com/images/M/MV5BZGNhYTA1ODMtY2M5Yy00MTYwLWFlZmEtNDM4M2I4ZTI2ZmVmXkEyXkFqcGdeQXVyNTA4NzY1MzY@._V1_SX300.jpg', 7.8, 'BluRay', 0, 1, 4964, '2019-04-14 17:54:11', '2019-04-14 17:59:10'),
(4961, 'مشاهدة فيلم Birdshot 2016 مترجم', 'مشاهدة وتحميل فيلم الدراما والغموض Birdshot 2016 مترجم بجودة WEBRip كامل اون لاين. “فيلم لغزى يروي قصة فتاة (فلبينية) تعيش فى حدود غابة مع والدها. عن طريق الخطأ يُقتل نسر مُهدد بالانقراضبينما تبدأ الشرطة المحلية عملية مطاردة لتعقب صياد الطيور، فإن تحقيقهم يقودهم إلى اكتشاف أكثر فظاعة.”.', 'birdshot-2016', 'https://m.media-amazon.com/images/M/MV5BZjljNTVmMzItN2EzOS00YWNkLWEwNDUtZDMzOWU2M2IyMmFmXkEyXkFqcGdeQXVyNTI5NjIyMw@@._V1_SX300.jpg', 6.6, '0', 0, 1, 4965, '2019-04-14 17:54:33', '2019-04-14 17:59:10'),
(4962, 'مشاهدة فيلم Birdland 2018 مترجم', 'مشاهدة وتحميل فيلم الجريمة والغموض Birdland 2018 بجودة WEB-DL مترجم اون لاين وتحميل مباشر. شرطية سابقة تخفي كاميرات مراقبة في منزلها لمشاهدة خيانة زوجها لها، لتصبح نظرة حياتها الخاصة.', 'birdland-2018', 'https://m.media-amazon.com/images/M/MV5BYmU0NTcyNGEtMzlmMS00ZDg2LWI2NTgtNWU4YzRhODM4MzAzXkEyXkFqcGdeQXVyODEwMjMyNTU@._V1_SX300.jpg', 3.5, 'WEB-DL', 0, 1, 4966, '2019-04-14 17:54:47', '2019-04-14 17:59:10'),
(4963, 'مشاهدة فيلم Suck Me Shakespeer 3 2017 مترجم', 'مشاهدة وتحميل فيلم الكوميديا Suck Me Shakespeer 3 2017 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب لص البنك قد أصبح معلماً بهذا الجزء، وهو الآن يخوض مغامرة مضحكة مع بعض الطلاب الفاشلون.', 'suck-me-shakespeer-3-2017', 'https://m.media-amazon.com/images/M/MV5BMTkxMzc1MjMxM15BMl5BanBnXkFtZTgwNzQxNzI5MDE@._V1_SX300.jpg', 7, 'BluRay', 0, 1, 4967, '2019-04-14 17:54:59', '2019-04-14 17:59:09'),
(4964, 'مشاهدة فيلم Sleepwalking in Suburbia 2017 مترجم', 'مشاهدة وتحميل فيلم الدراما Sleepwalking in Suburbia 2017 بجودة WEB-DL مترجم اون لاين وتحميل مباشر. ميشيل ميلير مصابة بمرض السير اثناء النوم المزمن، هي وزوجها دان يحاولون إنجاب طفلهم الأول ، في ليلة ما تسير اثناء نومها إلى غرفة نوم جارها لوك ويليامز بينما تكون زوجته نانسي خارج البلدة، هم يمارسون الحب ،هي لاتدري ان هذا قد حصل لكنه يقع في حبها ويقرر أنه يريد ترك زوجته من أجلها.', 'sleepwalking-in-suburbia-2017', 'https://m.media-amazon.com/images/M/MV5BZDkwY2EwYTUtODE1NS00MGEyLWJjNzItMGRlOTU4NjViYmFjXkEyXkFqcGdeQXVyNTM3MDMyMDQ@._V1_SX300.jpg', 5.2, 'WEB-DL', 0, 1, 4968, '2019-04-14 17:55:01', '2019-04-14 17:59:09'),
(4965, 'مشاهدة فيلم The Barbarians 1987 مترجم', 'مشاهدة وتحميل فيلم الفانتازيا والمغامره The Barbarians 1987 مترجم بجودة bluray كامل أون لاين. اثنين من الهمجيين التوأمين تسعى الانتقام من أمير الحرب الذين ذبحوا قبيلتهم وأسرهم عندما كانوا أطفالا صغيرين.', 'the-barbarians-1987', 'https://m.media-amazon.com/images/M/MV5BMGE0YTQwNDAtNTUxZC00ZjYxLWFjOTItNmIyZGQ5ZGI3NGIwXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', 4.9, 'bluray', 0, 1, 4969, '2019-04-14 17:55:25', '2019-04-14 17:59:09'),
(4966, 'مشاهدة فيلم First Match 2018 مترجم', 'مشاهدة وتحميل فيلم الدراما First Match 2018 بجودة WEB-DL مترجم كامل اون لاين مشاهدة مباشرة يوتيوب تتوقّف فتاة مراهقة من حي بروكسفيل في بروكلين بعد سنوات من الرعاية في الحضانة ، وهي أن الانضمام إلى فريق المصارعة الأولاد هو السبيل الوحيد للعودة إلى والدها المنفصل', 'first-match-2018', 'https://m.media-amazon.com/images/M/MV5BMjI2MDMxOTQzMF5BMl5BanBnXkFtZTgwNzIxNzk5NDM@._V1_SX300.jpg', 6.3, 'WEB-DL', 0, 1, 4970, '2019-04-14 17:55:39', '2019-04-14 17:59:08'),
(4967, 'مشاهدة فيلم Gone Are the Days 2018 مترجم', 'مشاهدة و تحميل فيلم الغربي Gone Are the Days 2018 مترجم اون لاين جودة BRrip وتحميل مباشر مشاهدة اون لاين مباشرة لقد ولت أيام قصة خارج عن القانون سيئ السمعة ، تايلون فلين. كان فلين مسنّاً ومريّضاً وغير قادر على التوفيق بين الرجل الذي كان قد أصبح عليه ، فهو عازم على الخروج من هذه الحياة في حريق من المجد', 'gone-are-the-days-2018', 'https://m.media-amazon.com/images/M/MV5BZTU5MDc0NTAtZjRiNS00NTgxLTgzOWMtYjg5ZWNmM2Y4Mzc4XkEyXkFqcGdeQXVyOTg4MDYyNw@@._V1_SX300.jpg', 5.2, '0', 0, 1, 4971, '2019-04-14 17:55:41', '2019-04-14 17:59:08'),
(4968, 'مشاهدة فيلم Ready Player One 2018 مترجم', 'مشاهدة وتحميل فيلم الاكشن والمغامره Ready Player One 2018 مترجم بجودة BluRay كامل اون لاين. اللاعب الأول يستعد” في المستقبل القريب، يحاول الشاب المنبوذ (وايد واتس) الهروب من رعبه اليومي عن طريق التحاقه بلعبة إلكترونية تُدعى (الواحة). وعندما يموت مؤسس اللعبة البليونير، تُعرَض ثروته على اللاعبين كجائزة لمن يصل إلى نقطة معينة باللعبة.. وبعد خمس سنوات من التحاقه باللعبة، يجد واتس نفسه مُحاصرًا بديون خصومه من الشركة؛ في الواقع وداخل اللعبة على حد سواء.', 'ready-player-one-2018', 'https://m.media-amazon.com/images/M/MV5BY2JiYTNmZTctYTQ1OC00YjU4LWEwMjYtZjkwY2Y5MDI0OTU3XkEyXkFqcGdeQXVyNTI4MzE4MDU@._V1_SX300.jpg', 7.5, 'BluRay', 0, 1, 4972, '2019-04-14 17:56:14', '2019-04-14 17:59:08'),
(4969, 'مشاهدة فيلم The Titan 2018 مترجم', 'مشاهدة وتحميل فيلم الخيال العلمي The Titan 2018 بجودة BluRay مترجم اون لاين وتحميل مباشر. “العملاق” ريك جانسين (سام ورثينجتون) طيار جوي بارع، يتم اختياره لتجربة عسكرية تهدف إلى تخليق كائن حي قادر على التكيف مع ظروف بيئة قمر كوكب (زحل) المعروف بإسم (TITAN).. تنجح التجربة ويتحول ريك إلى كائن فائق القدرات، لكن للتجربة آثار جانبية تهدد حياة ريك وزوجته وعائلته وربما الإنسانية بأسرها.', 'the-titan-2018', 'https://m.media-amazon.com/images/M/MV5BMjE4NDc5MDU2NV5BMl5BanBnXkFtZTgwNDI1ODEyNTM@._V1_SX300.jpg', 4.8, 'BluRay', 0, 1, 4973, '2019-04-14 17:56:31', '2019-04-14 17:59:07'),
(4970, 'مشاهدة فيلم Like Me 2017 مترجم', 'مشاهدة فيلم Like Me 2017 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر “امرأة شابة تبدأ ببعض الجرائم الغريبة، وتبثها على وسائل التواصل الاجتماعي، يشك البعض أنها مريضة نفسية او تعشق الظهور والأهتمام والشهرة”', 'like-me-2017', 'https://m.media-amazon.com/images/M/MV5BODY0NTM1NjM3M15BMl5BanBnXkFtZTgwNDQyMTM2MTI@._V1_SX300.jpg', 5.4, 'WEB-DL', 0, 1, 4974, '2019-04-14 17:56:32', '2019-04-14 17:59:07'),
(4971, 'مشاهدة فيلم The Espadrillo Fortune 2017 مترجم', 'مشاهدة فيلم The Espadrillo Fortune 2017 بجودة WEB-DL مترجم كامل مشاهدة مباشرة اون لاين و تحميل مباشر خارج عن القانون لديه ماض غامض يجب أن يتغلب على صائد كنوز غامض لاستعادة حطام سفينة إسبانية تقول الشائعات أنها غرقت في إحدى الخلجان على الساحل الجنوبي لساردينيا.', 'the-espadrillo-fortune-2017', 'https://images-na.ssl-images-amazon.com/images/M/MV5BOTQ2NjAwYTUtYWRlZS00ZTEwLTk2MjAtMDg3MjMwNTg0YmRlXkEyXkFqcGdeQXVyMjY1NDA3MjE@._V1_SX300.jpg', 9.2, 'WEB-DL', 1, 1, 4975, '2019-04-14 17:56:51', '2019-04-14 18:17:42'),
(4972, 'مشاهدة فيلم Birthmarked 2018 مترجم', 'مشاهدة وتحميل فيلم الكوميديا Birthmarked 2018 بجودة WEB-DL مترجم اون لاين وتحميل مباشر. عالمان يربيان 3 أطفال بشكل معاكس لميولهما الجينية لاثبات ان القوة القصوى تاتي من التربية وليس الطبيعة.', 'birthmarked-2018', 'https://m.media-amazon.com/images/M/MV5BMTY3NzE5NzU2Nl5BMl5BanBnXkFtZTgwMTIzMzc4NDM@._V1_SX300.jpg', 5.7, 'WEB-DL', 0, 1, 4976, '2019-04-14 17:57:04', '2019-04-14 17:59:07'),
(4973, 'مشاهدة فيلم Status Update 2018 مترجم', 'مشاهدة فيلم الكوميديا والفانتازيا Status Update 2018 مترجم بجودة BluRay مشاهدة مباشرة اون لاين. مراهق غادر منزله بعد طلاق والديه ولا يستطيع الاستقرار في مدينته الجديدة يتعثر في تطبيق سحري يحول ما يكتبه في وسائل التواصل الى حقيقة.', 'status-update-2018', 'https://m.media-amazon.com/images/M/MV5BM2NmOTExNzQtOTZhYi00MzZjLWE5M2EtYTllNDM2OWMzZWVkXkEyXkFqcGdeQXVyMjg1ODA0ODA@._V1_SX300.jpg', 5.9, 'BluRay', 0, 1, 4977, '2019-04-14 17:57:45', '2019-04-14 17:59:06'),
(4974, 'مشاهدة فيلم A Walk in the Clouds 1995 مترجم', 'مشاهدة وتحميل فيلم الدراما والرومانسية A Walk in the Clouds 1995 مترجم بجودة BluRay كامل اون لاين. أثناء عودة بول إلى مدينته بعد قضاء فترة تجنيده بالجيش ؛يقابل امرأةً تٌدعى فيكتوريا يتعرف عليها ،ويكتشف أنها حامل دون أن تتزوج؛ وأنها عائدة لبلدتها للمشاركة في موسم جمع العنب، وتخبره بخوفها من غضب والدها لحملها وتوقعها بأنه سيقتلها، فيعرض عليها بول أن يدعي زواجها أمام والدها حتى ينقذها من الموت الحتمي، إلا أنه يقع بالفعل في حبها ويقرر الارتباط بها.', 'a-walk-in-the-clouds-1995', 'uploads/261748685601.jpg', NULL, 'BluRay', 0, 1, 4978, '2019-04-14 17:57:50', '2019-04-14 17:59:02'),
(4975, 'مشاهدة فيلم The Ashram 2018 مترجم', 'مشاهدة وتحميل فيلم الفانتازيا والاثارة The Ashram 2018 مترجم بجودة WEB-DL كامل أون لاين. بعد تلقي رسالة مشفرة ، يسافر المتشائم الأمريكي جيمي إلى جبال الهيمالايا الهندية لالتقاط أثر صديقته المفقودة. هناك ، يكتشف المجتمع السري الذي يقوده غورو بصلاحيات غريبة قد تشارك أو لا تشارك في اختفائها', 'the-ashram-2018', 'https://m.media-amazon.com/images/M/MV5BZmIxYzhhMmMtNWJlNi00N2IyLWJmMzMtYjg4ZDEwMGU1ODNhXkEyXkFqcGdeQXVyNDAzNDY2Mw@@._V1_SX300.jpg', 5.2, 'WEB-DL', 0, 1, 4979, '2019-04-14 17:58:01', '2019-04-14 17:59:01'),
(4976, 'مشاهدة فيلم Peeples 2013 مترجم', 'مشاهدة وتحميل فيلم الكوميديا والرومانسية Peeples 2013 مترجم بجودة BluRay كامل اون لاين. الشرر يتطاير، وتنفجر المفاجأت، عندما يأتي واد وكر إلى حفل لم الشمل السنوي للعائلة الذي يقام في هامبتونز، وهذا لطلب يد ابنتهم الغالية للزواج.', 'peeples-2013', 'https://m.media-amazon.com/images/M/MV5BMTQwODU0MDM4Ml5BMl5BanBnXkFtZTcwMTA5MDkzOQ@@._V1_SX300.jpg', 5.3, 'BluRay', 0, 1, 4980, '2019-04-14 17:58:13', '2019-04-14 17:59:01');
