(4977, 'مشاهدة فيلم Return to Nims Island 2013 مترجم', 'مشاهدة وتحميل فيلم المغامره والعائلي Return to Nims Island 2013 مترجم بجودة BluRay كامل أون لاين. يعود الأبطال إلى جزيرة نيم مرة أخرى ليشهدوا على الكيفية التي سارت بها الأمور مع نيم ووالدها، وذات يوم يتلقى الجميع رسالة فحواها أن هناك مجموعة من الأشخاص النافذين سيقومون بشراء الجزيرة من أجل استغلالها في بناء منتجع، وهو ما يدفع نيم لفعل أي شيء في سبيل الدفاع عن وطنها.', 'return-to-nims-island-2013', 'uploads/291747559680.jpg', NULL, 'BluRay', 0, 1, 4981, '2019-04-14 17:58:25', '2019-04-14 17:59:00'),
(4978, 'مشاهدة فيلم Cody the Robosapien 2013 مترجم', 'مشاهدة وتحميل فيلم المغامره والدراما Cody the Robosapien 2013 بجودة BluRay مترجم كامل اون لاين مشاهدة مباشرة يوتيوب بعد أن يعكف أحد العلماء على ابتكار روبوت ذكي من أجل استخدامه لأغراض إنسانية، يكتشف أن الشركة التي يعمل لديها تنوي أن تستغل الروبوت لأغراض عسكرية، فيقوم العالم بسرقة الروبوت من مقر الشركة، والذي ينتهي به الأمر مكسورًا وضائعًا، حتى يقوم طفل بالغ من العمر أحد عشر عامًا بإصلاحه، ويتعاون الفتى مع العالم من أجل إنقاذ آبائهم المحتجزين في مقر الشركة.', 'cody-the-robosapien-2013', 'https://m.media-amazon.com/images/M/MV5BZjJmMmM5OTEtOGI3OC00Mzk0LThlZmQtOTkwMDNhZTU4OTMzXkEyXkFqcGdeQXVyNjg4NzIzMzg@._V1_SX300.jpg', 4.8, 'BluRay', 0, 1, 4982, '2019-04-14 17:58:38', '2019-04-14 17:59:00'),
(4979, 'مشاهدة فيلم Scenic Route 2013 مترجم', 'مشاهدة وتحميل فيلم الدراما والاثارة Scenic Route 2013 بجودة BluRay مترجم اون لاين وتحميل مباشر. يدور الفيلم حول تصاعد حدة التوتر بين صديقي العمر (ميتشل) و(كارتر)، بعد تعطل شاحنتهما في طريق صحراوي معزول، فيبدأ كلًا منهما في الهجوم على قراراتهم الحياتية.', 'scenic-route-2013', 'uploads/31748094909.jpg', NULL, 'BluRay', 0, 1, 4983, '2019-04-14 17:58:55', '2019-04-14 17:58:59'),
